INSERT INTO `ps_product_lang` VALUES (11510,1,1,'Uchwyt zagłówkowy Baseus Backseat Urządzenia o przekątnej od 4.7 do 12.9 Materiał najwyższej jakości Uchwyt zagłówkowy Backseat od marki Baseus wykonany z wysokiej jakości materiałów, został zaprojektowany z myślą o samochodowych wycieczkach rodzinnych. Składany uchwyt zajmuje mało miejsca, a dzięki wykorzystanym rozwiązaniom uchwyt wpasuje się w większość samochodów łapiąc w swoje ramiona większość dostępnych urządzeń na rynku. *Zestaw nie zawiera tabletu Silikonowe wykończenie Silikonowe warstwy znajdujące się w wewnętrznej części uchwytu zmniejszają ryzyko wypadnięcia urządzenia podczas jazdy na wyboistych drogach, a także niwelują możliwość porysowania się czy uszkodzenia boków i plecków urządzenia. Niezwykle uniwersalny W uchwyt Baseus Backseat włożysz urządzenia których przekątna mieści się w przedziale od 4.7(np. iPhone 87) do 12.9(np. iPad Pro 12.9), co czyni z niego niezwykle uniwersalny uchwyt. Ramiona chwytające za zagłówek rozkładają sie od 140mm do 180mm, dzięki czemu uchwyt da się zamontować w większych i mniejszych samochodach. Ruchoma głowica Ruchoma głowica, na której umieszczony zostaje uchwyt pozawala na swobodny obrót uchwytu o 360 stopni, co sprawia, że położenie swojego urządzenia możesz dostosować do swoich potrzeb co zwiększa komfort w trakcie użytkowania z uchwytu.','','uchwyt-zaglowkowy-baseus-backseat-suhz-01-czarne','','','','Uchwyt zagłówkowy Baseus Backseat SUHZ-01, czarne','','','',''),(14136,1,1,'Spigen Band Modern FitApple Watch 11 (46 mm)Apple Watch 10 (46 mm)Apple Watch Ultra 3 2 1 (49 mm)Apple Watch 9 8 7 (45 mm)Apple Watch SE 3 SE 2022 SE 6 5 4 (44 mm)Apple Watch 3 2 1 (42 mm)Materiał wysokiej jakościOryginalny pasek marki Spigen z serii Band Modern Fit o eleganckim, klasycznym i ponadczasowym wyglądzie. Zastosowanie wysokiej jakościstali nierdzewnej, zapewnia lekkość i trwałość bransolety.Kolor producenta: BlackDługość paska: 18,1 3,2 cmSzerokość paska: 2,2 cmPonadczasowy designSpigen Band Modern Fit to wyjątkowy pasek dla Twojego smartwatcha Apple, który został zaprojektowany i wykonany w klasycznej, ponadczasowej stylistyce.Smukła budowa o metalicznym i eleganckim wyglądzie, przeznaczona dla osób preferujących bardziej biznesowy niż sportowy styl.Smukła i dobrze dopasowanaBransoleta charakteryzuje się gładką i lekką strukturą o wysokiej odporności, a jej solidne zapięcie jest cienkie i nie dodaje zbędnej objętości.Możliwość regulacji rozmiaruDzięki załączonym do zestawu akcesoriom z łatwością dostosujesz rozmiar paska do obwodu swojego nadgarstka, tak jak w klasycznej bransolecie z teleskopami.','','pasek-spigen-band-modern-fit-do-apple-watch-49-46-45-44-mm-czarny','','','','Pasek Spigen Band Modern Fit do Apple Watch 49/46/45/44 mm, czarny','','','',''),(16820,1,1,'Uchwyt iOttie Auto Sense Wireless Charging Dash Mount Uniwersalny (Dla urządzeń o szerokości do 92 mm) Stworzony z myślą o wygodzie Producent iOttie - najchętniej wybierany przez klientów, powraca z nową serią uchwytów i nowymi rozwiązaniami, które zaskoczą niejednego. Renomowana jakość zapewnia satysfakcję, a funkcjonalność sprawi, że każda podróż będzie bez wątpienia przyjemniejsza. Teraz z ładowaniem indukcyjnym, możesz naładować swój telefon w trakcie podróży. Bezpieczne rozwiązanie Auto Sense Uchwyt montowany jest na desce rozdzielczej lub przedniej szybie. W pełni bezpieczny dzięki funkcji Auto Sense: po umieszczeniu telefonu pomiędzy ramoniami uchwytu, ten wykrywa go dzięki czujnikowi odległości i zaciska się, blokując przy tym urządzenie i zapobiegając jego wypadnięciu. Takie rozwiązanie zapewnia nie tylko bezpieczeństwo ale również wygodę użytkowania. Po umieszczeniu telefonu w uchwycie, wbudowana ładowarka automatycznie rozpoczyna ładowanie bezprzewodowe dobierając najwyższą bezpieczną moc. Szybkie ładowanie indukcyjne Uchwyt iOttie wyposażony jest w wysokiej jakości szybką ładowarkę indukcyjną umożliwiającą ładowanie telefonów Apple mocą 7.5W oraz telefonów z systemem Android mocą 10W. Certyfikat Qi świadczy o niezawodności i bezpieczeństwu ładowarki. Dowolna regulacja Zastosowanie przegubu kulowego pozwala na regulację uchwytu i ustawienie go pod optymalnym kątem. Aby wyjąć telefon z uchwytu należy szybkim ruchem kliknąć dwa przyciski znajdujące się na bokach uchwytu. Kompletny zestaw Zestaw nie składa się wyłącznie z uchwytu i wbudowanej ładowarki bezprzewodowej. Do zestawu dołączona jest również ładowarka samochodowa oraz kabel USB-A do MicroUSB, podkładka na deskę rozdzielczą oraz naklejka na telefonetui ułatwiająca wykrycie urządzeńpokrowców o czarnym bądź matowym wykończeniu. Sprawdź jak korzysta się z uchwytu w praktyce:','','uchwyt-samochodowy-qi-iottie-auto-sense-wireless-charging-dash-mount-do-92-mm-czarny','','','','Uchwyt Samochodowy Qi iOttie Auto Sense Wireless Charging Dash Mount (do 92 mm), czarny','','','',''),(16831,1,1,'Uchwyt iOttie Auto Sense Wireless Charging Vent CD Slot Mount Uniwersalny (Dla urządzeń o szerokości do 92 mm) Stworzony z myślą o wygodzie Producent iOttie - najchętniej wybierany przez klientów, powraca z nową serią uchwytów i nowymi rozwiązaniami, które zaskoczą niejednego. Renomowana jakość zapewnia satysfakcję, a funkcjonalność sprawi, że każda podróż będzie bez wątpienia przyjemniejsza. Teraz z ładowaniem indukcyjnym, możesz naładować swój telefon w trakcie podróży. Bezpieczne rozwiązanie Auto Sense Uchwyt montowany jest w kratce nawiewu lub w miejscu na płyty CD. W pełni bezpieczny dzięki funkcji Auto Sense: po umieszczeniu telefonu pomiędzy ramoniami uchwytu, ten wykrywa go dzięki czujnikowi odległości i zaciska się, blokując przy tym urządzenie i zapobiegając jego wypadnięciu. Takie rozwiązanie zapewnia nie tylko bezpieczeństwo ale również wygodę użytkowania. Po umieszczeniu telefonu w uchwycie, wbudowana ładowarka automatycznie rozpoczyna ładowanie bezprzewodowe dobierając najwyższą bezpieczną moc. Szybkie ładowanie indukcyjne Uchwyt iOttie wyposażony jest w wysokiej jakości szybką ładowarkę indukcyjną umożliwiającą ładowanie telefonów Apple mocą 7.5W oraz telefonów z systemem Android mocą 10W. Certyfikat Qi świadczy o niezawodności i bezpieczeństwu ładowarki. Dowolna regulacja Zastosowanie przegubu kulowego pozwala na regulację uchwytu i ustawienie go pod optymalnym kątem. Aby wyjąć telefon z uchwytu należy szybkim ruchem kliknąć dwa przyciski znajdujące się na bokach uchwytu. Kompletny zestaw Zestaw nie składa się wyłącznie z uchwytu i wbudowanej ładowarki bezprzewodowej. Do zestawu dołączona jest również ładowarka samochodowa oraz kabel USB-A do MicroUSB oraz naklejka na telefonetui ułatwiająca wykrycie urządzeńpokrowców o czarnym bądź matowym wykończeniu.','','uchwyt-samochodowy-qi-iottie-auto-sense-wireless-charging-vent-cd-slot-mount-do-92-mm-czarny','','','','Uchwyt Samochodowy Qi iOttie Auto Sense Wireless Charging Vent & CD Slot Mount (do 92 mm), czarny','','','',''),(17531,1,1,'Belkin BoostCharge Braided USB-A to USB-C Cable USB-A do USB-C Krótki kabel do Android Auto Wzmocniony oplotem nylonowym kabel ładujący i synchronizujący dane marki Belkin z serii BoostCharge. Przeznaczony dla urządzeń z portem USB-C. Można go używać zarówno do ładowania z ładowarką sieciową, samochodową jak i jako kabel połączeniowy z komputerem, czy stacjami dokującymi. Długość kabla: 15cm Kolor producenta: Black Przesyłanie danych oraz ładowanie Wykonany z wysokiej jakości materiałów kabel Belkin BoostCharge może być używany do ładowania urządzeń jak i do synchronizacji danych. Przeznaczony dla urządzeń z portem USB-C. Kabel posiada niewielkie rozmiary oraz długość 15cm. Jest dość giętki dzięki czemu możesz zawsze mieć go przy sobie. Wystarczy, że podłączysz go do źródła zasilania, by naładować swoje urządzenia czy to w domu, w biurze czy w podróży. Wzmocniony nylonowym oplotem Nylonowy oplot wzmacnia żywotność kabla, przedłużając jego czas użytkowania minimalizując wystąpienie uszkodzeń. Kabel posiada formowany odciążnik naprężeń na obu końcówkach, co zapewnia większą elastyczność przy ewentualnym ruchu kabla i minimalizuje ryzyko pęknięcia lub uszkodzenia, zwiększając jego ogólną trwałość w tym szczególnie narażonym na uszkodzenia miejscu. Pomyślnie przetestowany podczas 10000-krotnego zginania pod kątem 60 stopni. Bezpieczeństwo użytkowania Certyfikat USB-IF zapewnia zgodność z technologią Hi-Speed USB. Oznacza to, że kabel został certyfikowany przez USB-IF w celu spełnienia wszelkich wymaganych standardów elektrycznych, mechanicznych i środowiskowych.','','kabel-belkin-boost-charge-braided-do-android-auto-usb-a-do-usb-c-15cm-czarny','','','','Kabel Belkin Boost Charge Braided do Android Auto USB-A do USB-C 15cm, czarny','','','',''),(17825,1,1,'Etui Spigen Urban FitiPad Pro 11 4 gen. 2022 (A2759, A2435, A2761, A2762)iPad Pro 11 3 gen. 2021 (A2377, A2459, A2301, A2460)iPad Pro 11 2 gen. 2020 (A2228, A2068, A2230, A2231)iPad Pro 11 1 gen. 2018 (A1980, A2013, A1934, A1979) Wysoka jakość wykonania Eleganckie etui marki Spigen z serii Urban Fit, wykonane z połączenia mocnego i sztywnego poliwęglanu z tkaninowym wykończeniem. Wnętrze klapki posiada wyściółkę z delikatnej mikrofibry, która dodatkowo chroni ekran dotykowy przed zarysowaniami. Kolor producenta: Black *Szkło nie powinno nachodzić na etui, gdyż grozi to jego podważeniem **Wymiary etui do doboru szkła hartowanego (szer. dług. przek.): 17,68 x 24,56 x 29,26 cm Poliwęglanowa ochrona Solidne i wytrzymałe tworzywo poliwęglanowe skutecznie chroni przed zabrudzeniami i zarysowaniami, mogącymi powstać w wyniku codziennego użytkowania. Front i tył pokrowca wykończony został eleganckim splotem tkaniny o drobnym wzorze, dodając stylowego wyglądu. Dobrze dopasowane Wycięcia dla wszystkich portów oraz osłony przycisków zapewniają pełen dostęp do interfejsów. Futerał jest lekki i cienki, stanowi dobrą ochronę przed zabrudzeniami oraz zarysowaniami. Posiada funkcję automatycznego wybudzania i usypiania urządzenia. Ustawienie poziome Niezależnie od tego czy czytasz, piszesz lub oglądasz swój ulubiony film - dzięki regulowanej podpórce możesz to robić jeszcze lepiej i wygodniej. Slot na rysik Futerał dodatkowo posiada specjalnie zaprojektowane wycięcie na rysik Apple. Kompatybilność wsteczna Pokrowiec pasuje także na wcześniejszą wersję iPada Pro 11 z 2018 roku, jedynie wycięcie na aparat będzie lekko większe.','','etui-do-ipad-pro-11-2022-2021-2020-2018-spigen-urban-fit-czarne','','','','Etui do iPad Pro 11 2022/2021/2020/2018, Spigen Urban Fit, czarne','','','',''),(17977,1,1,'Etui Spigen Urban FitiPad Pro 11 4 gen. 2022 (A2759, A2435, A2761, A2762)iPad Pro 11 3 gen. 2021 (A2377, A2459, A2301, A2460)iPad Pro 11 2 gen. 2020 (A2228, A2068, A2230, A2231)iPad Pro 11 1 gen. 2018 (A1980, A2013, A1934, A1979) Wysoka jakość wykonania Eleganckie etui marki Spigen z serii Urban Fit, wykonane z połączenia mocnego i sztywnego poliwęglanu z tkaninowym wykończeniem. Wnętrze klapki posiada wyściółkę z delikatnej mikrofibry, która dodatkowo chroni ekran dotykowy przed zarysowaniami. Kolor producenta: Rose Gold *Szkło nie powinno nachodzić na etui, gdyż grozi to jego podważeniem **Wymiary etui do doboru szkła hartowanego (szer. dług. przek.): 17,65 x 24,53 x 29,21 cm Poliwęglanowa ochrona Solidne i wytrzymałe tworzywo poliwęglanowe skutecznie chroni przed zabrudzeniami i zarysowaniami, mogącymi powstać w wyniku codziennego użytkowania. Front i tył pokrowca wykończony został eleganckim splotem tkaniny o drobnym wzorze, dodając stylowego wyglądu. Dobrze dopasowane Wycięcia dla wszystkich portów oraz osłony przycisków zapewniają pełen dostęp do interfejsów. Futerał jest lekki i cienki, stanowi dobrą ochronę przed zabrudzeniami oraz zarysowaniami. Posiada funkcję automatycznego wybudzania i usypiania urządzenia. Ustawienie poziome Niezależnie od tego czy czytasz, piszesz lub oglądasz swój ulubiony film - dzięki regulowanej podpórce możesz to robić jeszcze lepiej i wygodniej. Slot na rysik Futerał dodatkowo posiada specjalnie zaprojektowane wycięcie na rysik Apple. Kompatybilność wsteczna Pokrowiec pasuje także na wcześniejszą wersję iPada Pro 11 z 2018 roku, jedynie wycięcie na aparat będzie lekko większe.','','etui-do-ipad-pro-11-2022-2021-2020-2018-spigen-urban-fit-rozowe','','','','Etui do iPad Pro 11 2022/2021/2020/2018, Spigen Urban Fit, różowe','','','',''),(18636,1,1,'Etui Spigen Rugged Armor Pro iPad Pro 11 4 gen. 2022 (A2759, A2435, A2761, A2762)iPad Pro 11 3 gen. 2021 (A2377, A2459, A2301, A2460)iPad Pro 11 2 gen. 2020 (A2228, A2068, A2230, A2231)iPad Pro 11 1 gen. 2018 (A1980, A2013, A1934, A1979) Materiał najwyższej jakości Wzmocnione etui od marki Spigen z serii Rugged Armor Pro, wykonane z połączenia wysokiej jakości miękkiego termoplastycznego poliuretanu oraz trwałego poliwęglanu. Hybrydowy pokrowiec z klapką, zapewniający solidną ochronę oraz dobry chwyt, z wygodnym uchwytem na rysik. Kolor producenta: Black Etui kompatybilne ze szkłami o wymiarach nie przekraczających (dług.szer.przek.): 17,57 x 24,47 x 29,16 cm Hybrydowe etui z klapką Nowoczesne etui Rugged Armor Pro z klapką z magnetycznym zamykaniem, zachowujące smukły profil urządzenia. Zapewnia doskonałą ochronę przed zarysowaniami oraz skuteczną amortyzację wstrząsów, dzięki wewnętrznej strukturze sieci pajęczej. Doskonale dopasowane Dobrze leży w dłoni, a lekko wystające krawędzie chronią kamerę i ekran przed zarysowaniami na płaskich powierzchniach. Wnętrze klapki zostało wykończone delikatną mikrofibrą, która stanowi dodatkowe zabezpieczenie dla ekranu. Precyzyjne wycięcia Zapewniają swobodny dostęp do wszystkich interfejsów urządzenia. Niezwykle funkcjonalne i wygodne w użytkowaniu. Posiada responsywne zintegrowane przyciski i wygodne wycięcia na porty. Wzmocniona konstrukcja Zapewnia dodatkową ochronę przy minimalnych gabarytach oraz wadze podczas upadków, dzięki technologii Air Cushion - poduszek powietrznych umiejscowionych w narożnikach. Funkcjonalna klapka umożliwia wybudzanie i usypianie urządzenia podczas jej otwierania i zamykania. Nowoczesny design Spigen Rugged Armor Pro został wykończony karbonowymi akcentami u góry i u dołu plecków pokrowca nadając nowoczesnego stylu. Dodatkowo posiada specjalnie zaprojektowany uchwyt na rysik, zachowujący jego funkcjonalność.','','etui-do-ipad-pro-11-2022-2021-2020-2018-spigen-rugged-armor-pro-czarne','','','','Etui do iPad Pro 11 2022/2021/2020/2018, Spigen Rugged Armor Pro, czarne','','','',''),(18839,1,1,'Uchwyt iOttie Easy One Touch 5 Dash Windshield Mount Uniwersalny dla urządzeń o szerokości 50-90mm Wykonanie najwyższej jakości Kolejna generacja rewelacyjnego uchwytu samochodowego marki iOttie przeznaczonego dla większości smartfonów, który łączy w sobie wszechstronność i wygodę użytkowania. Uchwyt wykonany z wysokiej jakości materiałów - zaprojektowany i stworzony do montażu zarówno na szybie jak i desce rozdzielczej. Kolor producenta: Black Lekki i komfortowy w użyciu Jest niezwykle lekki i kompaktowy, zapewnia doskonały chwyt oraz bezpieczeństwo urządzenia. Uchwyt wyposażony został w opatentowany system Easy One Touch, pozwalający na mocowanie i zwolnienie blokady jednym, prostym ruchem ręki. Posiada duży i wygodny przycisk zwalniający blokadę, automatycznie zamykającą ramiona uchwytu na urządzeniu, natomiast ściśnięcie dwóch pomniejszych ramion pomocniczych poniżej zwalnia telefon z zacisków uchwytu. Poznaj zalety uchwytu iOttie Uchwyty marki iOttie to jedne z najlepiej sprzedających się uchwytów na rynku, spełniające oczekiwania wielu osób. Obejrzyj poniższy film i przekonaj się, dlaczego! Nowości wersji Touch 5 iOttie w wersji 5 oprócz odświeżonej i ulepszonej budowy oferuje dodatkowe półtora cala zasięgu przy zachowaniu kompaktowych rozmiarów. Teleskopowe ramię rozciąga się w przedziale 5-8 cali, oferując kierowcom bardziej spersonalizowane dostosowywanie jego ustawień do jazdy. Przycisk Easy One Touch jest teraz jeszcze większy i równie wygodny, a jednocześnie jest zgrabnie wkomponowany w całość uchwytu, doskonale wpasowując się w jego ogólny design. Zupełną nowością jest magnetyczny organizer do kabli, ułatwiający podłączanie zasilania do smartfona. Magnetyczny organizer do kabli Dzięki nowemu magnetycznemu organizerowi na przewód do ładowania smartfona w szybki i prosty sposób zabezpieczysz swój kabel od ładowarki samochodowej czy PowerBanka, by w bezpieczny sposób zasilić energią Twoje urządzenie podczas jazdy w każdej koniecznej chwili. Koniec z szukaniem końcówki kabla i ryzykiem dekoncentrowania się podczas jazdy! Wystarczy umieścić swój kabel w dołączonym pasku, który następnie magnetycznie przypina się do spodniej części plecków uchwytu. Dla większości smartfonów Uchwyt zachowuje szeroką kompatybilność dzięki sporemu rozstawowi ramion, co pozwala na zamontowanie urządzeń o szerokości od 5cm do 9cm. Wysuwane ramię Wysięgnik teleskopowy z funkcją obrotu Pivot umożliwia regulację pod szerokim katem aż 225. Daje to różne warianty ustawień, dzięki czemu zapewnia możliwość optymalnego rozstawienia w każdym samochodzie, niezależnie czy mocowanie będzie na szybie czy desce rozdzielczej. Kompaktowe ułożenie posiada dość niski profil, dzięki czemu nie wpływa na widoczność w trakcie jazdy i nie zasłania pola widzenia. Ergonomiczny projekt Dzięki ergonomicznemu projektowi wszystkie regulatory rozmieszczone są tak, aby zapewnić jak najlepszy i swobodny dostęp dla ręki. Posiada regulowaną stopkę pozwalającą na dopasowanie uchwytu do większości smartfonów i ich akcesoriów. Dołączona do zestawu specjalna podkładka Dashboard Pad zapewnia bezpieczne i mocniejsze przyleganie do nierównych powierzchni, takich jak deska rozdzielcza samochodu. Przeznaczona jest do jednorazowego użytku, dlatego przed jej założeniem należy upewnić się co do ostatecznego miejsca montażu. Po jej przyklejeniu należy odczekać ok. 30 minut zanim zamocujemy na niej uchwyt. Montaż na szybie lub desce rozdzielczej Uchwyt pozwala na różne opcje montażu i ustawień, dzięki czemu nada się do każdego samochodu. Bez problemu zamontujesz go zarówno na szybie jak i desce rozdzielczej.','','uchwyt-samochodowy-iottie-easy-one-touch-5-dash-50-90mm','','','','Uchwyt samochodowy iOttie Easy One Touch 5 Dash (50-90mm)','','','',''),(18848,1,1,'Uchwyt iOttie Easy One Touch 5 Air Vent Mount Uniwersalny dla urządzeń o szerokości 50-90mm Wykonanie najwyższej jakości Kolejna generacja rewelacyjnego uchwytu samochodowego marki iOttie przeznaczonego dla większości smartfonów, który łączy w sobie wszechstronność i wygodę użytkowania. Uchwyt wykonany z wysokiej jakości materiałów - zaprojektowany i stworzony do montażu w kratce nawiewu. Kolor producenta: Black Lekki i komfortowy w użyciu Jest niezwykle lekki i kompaktowy, zapewnia doskonały chwyt oraz bezpieczeństwo urządzenia. Uchwyt wyposażony został w opatentowany system Easy One Touch, pozwalający na mocowanie i zwolnienie blokady jednym, prostym ruchem ręki. Posiada duży i wygodny przycisk zwalniający blokadę, automatycznie zamykającą ramiona uchwytu na urządzeniu, natomiast ściśnięcie dwóch pomniejszych ramion pomocniczych poniżej zwalnia telefon z zacisków uchwytu. Poznaj zalety uchwytu iOttie Uchwyty marki iOttie to jedne z najlepiej sprzedających się uchwytów na rynku, spełniające oczekiwania wielu osób. Obejrzyj poniższy film i przekonaj się, dlaczego! Nowości wersji Touch 5 iOttie w wersji 5 oprócz odświeżonej i ulepszonej budowy rozbudowało Air Vent o dolną regulowaną stopkę, której nie było w poprzednich wersjach, co dodaje większej stabilności bez nadmiernego rozbudowywania projektu budowy uchwytu. Przycisk Easy One Touch jest teraz jeszcze większy i równie wygodny, a jednocześnie jest zgrabnie wkomponowany w całość uchwytu, doskonale wpasowując się w jego ogólny design. Zupełną nowością jest magnetyczny organizer do kabli, ułatwiający podłączanie zasilania do smartfona. Magnetyczny organizer do kabli Dzięki nowemu magnetycznemu organizerowi na przewód do ładowania smartfona w szybki i prosty sposób zabezpieczysz swój kabel od ładowarki samochodowej czy PowerBanka, by w bezpieczny sposób zasilić energią Twoje urządzenie podczas jazdy w każdej koniecznej chwili. Koniec z szukaniem końcówki kabla i ryzykiem dekoncentrowania się podczas jazdy! Wystarczy umieścić swój kabel w dołączonym pasku, który następnie magnetycznie przypina się do spodniej części plecków uchwytu. Dla większości smartfonów Uchwyt zachowuje szeroką kompatybilność dzięki sporemu rozstawowi ramion, co pozwala na zamontowanie urządzeń o szerokości od 5cm do 9cm. Dostosowanie kąta widzenia Ruchoma głowica pozwala na swobodny obrót 360, dzięki czemu łatwo i wygodnie dostosujesz ułożenie swojego urządzenia w dogodnej pozycji. Montaż w kratce nawiewu pozwala zachować niski profil, dzięki czemu nie wpływa na widoczność w trakcie jazdy i nie zasłania pola widzenia. Ergonomiczny projekt Dzięki ergonomicznemu projektowi wszystkie regulatory rozmieszczone są tak, aby zapewnić jak najlepszy i swobodny dostęp dla ręki. Posiada regulowaną stopkę pozwalającą na dopasowanie uchwytu do większości smartfonów i ich akcesoriów. Pokrętło blokady zacisku pozwala na bezpieczne i stabilne zamocowanie uchwytu w kratce nawiewu. Montaż w kratce nawiewu Uchwyt pozwala na montaż w dowolnej kratce nawiewu. To wygodny sposób mocowania uchwytu, o minimalnym wyglądzie i niskim profilu. Doskonale uzupełni funkcjonalność każdego wnętrza samochodowego.','','uchwyt-samochodowy-iottie-easy-one-touch-5-air-vent-50-90mm','','','','Uchwyt samochodowy iOttie Easy One Touch 5 Air Vent (50-90mm)','','','',''),(18855,1,1,'Uchwyt iOttie Easy One Touch 5 CD Slot Mount Uniwersalny dla urządzeń o szerokości 50-90mm Wykonanie najwyższej jakości Kolejna generacja rewelacyjnego uchwytu samochodowego marki iOttie przeznaczonego dla większości smartfonów, który łączy w sobie wszechstronność i wygodę użytkowania. Uchwyt wykonany z wysokiej jakości materiałów - zaprojektowany i stworzony do montażu w slocie odtwarzacza płyt CD. Kolor producenta: Black Lekki i komfortowy w użyciu Jest niezwykle lekki i kompakt