ld-pro-laptop-stand-szara','','','','Podstawka Maxximus Fold Pro Laptop Stand, szara','','','',''),(40127,1,1,'Uchwyt samochodowy z ładowarką indukcyjną Baseus Wisdom 15W Urządzenia funkcją ładowania bezprzewodowego, telefony 4,7 - 7,5 Ładowarka i uchwyt w jednym Uchwyt samochodowy marki Baseus Wisdom, został stworzony z myślą o wymagających kierowcach. Dysponuje precyzyjnym mechanizmem, który automatycznie dopasowuje się do rozmiarów telefonu 4,7 - 7,5. Uchwyt pełni też rolę inteligentnej ładowarki indukcyjnej. Dzięki nowoczesnemu chipowi, dobiera ona moc ładowania urządzenia. Uchwyt z ładowarką Qi jest prosty w obsłudze i wykonany z solidnych materiałów. Bez trudu zamontujesz go w kratce nawiewu swojego samochodu przez co zwiększysz bezpieczeństwo w trakcie jazdy. Kolor producenta: Black (czarny) Inteligentna ładowarka Uchwyt Baseus posiada funkcję ładowarki bezprzewodowej. Wystarczy podłączyć ją do źródła zasilania przy pomocy kabla USB USB-C. Dzięki wydajnej cewce indukcyjnej i nowoczesnym podzespołom elektronicznym, automatycznie dobierze ona parametry prądu do potrzeb ładowanego telefonu. Posiada też funkcję szybkiego ładowania oraz moc ładowania z przedziału 5W 7,5W 10W 15W. Wygoda i bezpieczeństwo Uchwyt został skonstruowany w taki sposób aby pasować do większości samochodowych kratek nawiewu. System zacisku sprawia, że szczęki stabilnie utrzymują osadzony w nich telefon. Masz więc pewność, że nie wypadnie on przypadkowo, nawet podczas jazdy po nierównej nawierzchni, a dzięki funkcji obrotu i pochylenia możesz ułożyć telefon w wygodnej dla Ciebie pozycji. Specyfikacja Marka: BaseusModel: Wisdom CGZX000001Materiał: ABSPrąd wejściowy: 5V2A, 9V2A, 12V1,67AMoc wyjściowa: 5W 7,5W 10W 15WGniazdo ładowania: USB-CKompatybilność: telefony 4,7 - 7,5Kabel w zestawie: takRodzaj kabla: USB - USB-CDługość kabla: 1 mWaga: 160 g','','ladowarka-indukcyjna-i-uchwyt-baseus-wisdom-czarna','','','','Ładowarka indukcyjna i uchwyt Baseus Wisdom, czarna','','','',''),(40601,1,1,'Etui UAG Plyo Apple MacBook Pro 14 2025 (A3434) M5Apple MacBook Pro 14 2024 (A3112, A3401, A3185) M4 M4 Pro M4 MaxApple MacBook Pro 14 2023 (A2918, A2992) M3 M3 Pro M3 MaxApple MacBook Pro 14 2023 (A2779) M2 Pro M2 MaxApple MacBook Pro 14 2021 (A2442) M1 Pro M1 Max Ochrona w pszczelarskim stylu Oryginalna, jednoczęściowa obudowa od marki Urban Armor Gear z serii Plyo to wykonana z połączenia poliwęglanu i TPU ochrona w prawdziwym stylu. Obroni Twojego MacBooka przed codziennymi przeciwnościami losu, takimi jak straszne ostre klucze i zminimalizuje przykre skutki działania grawitacji. UWAGA: W etui do modelu Apple MacBook Pro 14 2023 Apple M3 wycięcie na porty jest większe niż w pozostałych modelach. Nie wpływa to na funkcjonalność etui. Kolor producenta: Ice (przezroczyste z czarną ramką) Królowa etui Niczym yin i yang, obudowa Plyo balansuje między subtelnym, a pancernym designem. Półprzezroczyste plecki przywodzące na myśl plaster miodu nie zasłaniają ikonicznego jabłuszka, a w połączeniu ze wzmocnionymi narożnikami tworzą mocną skorupę dla Twojego MacBooka. Mimo to etui jest tak lekkie, że prawdopodobnie zapomnisz o tym, że je w ogóle założyłeś na laptopa. Instalacja na klik-klik Założenie obudowy UAG Plyo na MacBooka jest równie proste, co założenie koszuli. Wystarczy włożyć urządzenie do jednoczęściowej konstrukcji i zatrzasnąć. Pokrowiec mocno przylega do laptopa, natomiast o swobodny przepływ powietrza, a nie tropiki w środku etui, dbają otwory wentylacyjne. Zawias łączący dwie strony pokrowca jest elastyczny, dzięki czemu otwieranie i zamykanie odbędzie się bez żadnych trzasków i innych świdrujących dźwięków.','','etui-pancerne-urban-armor-gear-plyo-do-macbook-pro-14-2021-2025-przezroczyste-z-czarna-ramka','','','','Etui pancerne Urban Armor Gear Plyo do MacBook Pro 14\" 2021-2025, przezroczyste z czarną ramką','','','',''),(40602,1,1,'Etui UAG Plyo Apple MacBook Pro 16 2024 (A3403, A3186) M4 Pro M4 MaxApple MacBook Pro 16 2023 (A2991) M3 Pro M3 MaxApple MacBo