acy ze wszystkimi urządzeniami z wyświetlaczem dotykowym. Służy jako przedłużenie palca. Wykonany jest z wysokiej jakości stopu aluminium. Cechuje go doskonała precyzja co do piksela i dokładność oraz zerowe opóźnienie reakcji. Kolor producenta: Grey (szary) *Uwaga: Rysik ten nie posiada funkcji odrzucania dłoni i nie jest kompatybilny z urządzeniami Apple iPad. Magnetyczne mocowanie Rysik wyposażony jest w magnes, za pomocą którego przymocujesz go do tabletu czy laptopabez obawy przed zagubieniem rysika. Nie zsuwa się z boku urządzenia, a dzięki temu wygodnie i szybko możesz z niego skorzystać. Komfort użytkowania Aby aktywować rysik, wystarczy stuknąć górną część rysika. Graphite Uni jest wykonany z wytrzymałego stopu aluminium i jest doskonale wyważony, co zapewnia wygodną kontrolę nad rysikiem i pracą. Pisanie i rysowanie jest absolutnie intuicyjne oraz doskonale symuluje pracę na klasycznym papierze. Bez parowania Rysik działa automatycznie i nie trzeba parować go z urządzeniem poprzez Bluetooth. Naładowana bateria wystarcza nawet do 12h pracy, a ładowanie odbywa się sprawnie przez wejście USB-C w górnej części rysika. Świetnie wygląda Rysik ma opływowe kształty i świetnie leży w dłoni. Waży niewiele, dzięki czemu nawet długotrwałe pisanie nie sprawia trudności i nie męczy ręki. Aluminium z matowym wykończeniem i minimalistycznymi dodatkami świetnie komponuje się z każdym urządzeniem. W zestawie oprócz rysika Fixed znajdują się także 2 wymienne końcówki oraz kabel USB-C do ładowania.','','rysik-fixed-graphite-uni-stylus-szary','','','','Rysik Fixed Graphite Uni Stylus, szary','','','',''),(40767,1,1,'Uchwyt zagłówkowy Stretchable Headrest Car Uniwersalny dla urządzeń o szerokości od 140 mm do 250 mmDla zagłówków o szerokości od 105 do 140mm Praktyczny uchwyt Uchwyt zagłówkowy na tablet telefon od firmy Tech Protect. Z pewnością umili każdą podróż pasażerom siedzącym z tyłu, dzieci będą zachwycone. Dzięki dwóm regulowanym częściom ramienia oraz przegubowi obrotowemu 360 można łatwo dostosować ustawienie wedle potrzeby. Rodzaj trzymania urządzenia: chwyt zaciskowy dla urządzeń między 140 a 250 mm Mocowanie uchwytu: na zagłówek fotela samochodowego o rozstawie wewnętrznym od 105 do 140 mm Kolor producenta: Black (czarny) Stabilna konstrukcja Lekka a zarazem bardzo stabilna konstrukcja to połączenie odpornego PC oraz miękkiego silikonowego wykończenia. Klipy mocujące pozwolą na stabilne i silne trzymanie urządzenia o wymiarach od 140 mm do 250 mm. Obrotowa głowica Ruchome ramię oraz obracana o 360 stopni głowica w prosty sposób pozwolą na dopasowanie najlepszego ustawienia. Wycięcia na port ładowania Tech Protect Stretchable Headrest został wyposażony w wycięcia umożliwiające podłączenie urządzenia znajdującego się w uchwycie do zasilania. Dzięki temu nie musisz się martwić o rozładowanie urządzenia w trakcie seansu.','','uchwyt-samochodowy-zaglowkowy-tech-protect-stretchable-headrest-czarny','','','','Uchwyt samochodowy zagłówkowy Tech Protect Stretchable Headrest, czarny','','','',''),(40786,1,1,'Transmiter ładowarka samochodowa Hyper Car FM 3mk Uniwersalny, dla każdego samochodu z radiem FMBluetooth 5.0 Pendrive z USB-A karty 1TF Jazda w rytmie muzyki Transmiter Hyper Car FM od marki 3mk umili każdą podróż samochodem, zapewni dodatkowe bezpieczeństwo, byś nie musiał sięgać po telefon w czasie jazdy i gwarantuje komfort obsługi, aby nie rozpraszać Cię gdy kierujesz. Dodatkowo pełni funkcję ładowarki samochodowej, dzięki której możesz udostępniać muzykę z telefonu bez obawy przed rozładowaną baterią. Zakres częstotliwości FM: 87,5 - 99,8 MHz Kolor producenta: Black Pełnia komfortu Nie musisz martwić się o niekorzystny wpływ tego urządzenia na jakość jazdy, ponieważ dla Twojego bezpieczeństwa producent zadbał o intuicyjną obsługę jedną ręką, zestaw głośnomówiący oraz dobrze widoczny wyświetlacz, który jednocześnie nie rozprasza osoby kierującej pojazdem. Dla nocnych podróżników Urządzenie wyposażone jest w funkcję LED Light - podświetlenie, które ułatwia parowanie telefonu z transmiterem w ciemności. Bezpieczeństwo i komfort jazdy w nocy są najważniejsze. Halo, to ja... Nie narażaj siebie na otrzymanie mandatu za rozmowę z telefonem w ręce, a także na niebezpieczeństwo, które niesie ze sobą nietrzymanie obu rąk na kierownicy. Zamiast tego zamontuj transmiter Hyper Car FM, sparuj z telefonem za pomocą Bluetooth i ruszaj w drogę z ulubioną muzyką i komfortem. Ładowanie na żądanie Urządzenie naładuje także Twój telefon i inny sprzęt za pomocą portów USB-A z szybkim ładowaniem Posiada wejście na kartę 1FT i funkcję woltomierza, która informuje o napięciu elektrycznym w samochodzie. Specyfikacja: Napięcie wyjściowe USB-A 1: 5V2.4A Napięcie wyjściowe USB-A 2: 5V3A 9V2A 12V1.5A Moc: max 30 Zakres częstotliwości FM: 87,5 - 99,8 MHz Zakres mocy: USB-A 1: 20W MAX USB A 2 QC3.0: 18W MAX USB-A 1 USB-A 2: 12W 18W MAX','','transmiter-ladowarka-samochodowa-hyper-car-fm-3mk-czarny','','','','Transmiter + ładowarka samochodowa Hyper Car FM 3mk, czarny','','','',''),(41491,1,1,'Rysik Tech-Protect Digital Stylus Pen 2 Apple iPad Pro 12,9 6 gen. 2022 (A2436, A2764, A2437, A2766)Apple iPad Pro 12,9 5 gen. 2021 (A2378, A2461, A2379, A2462)Apple iPad Pro 12,9 4 gen. 2020 (A2229, A2069, A2232, A2233)Apple iPad Pro 12,9 3 gen. 2018 (A1876, A1983, A1895, A2014)Apple iPad Pro 11 4 gen. 2022 (A2759, A2435, A2761, A2762)Apple iPad Pro 11 3 gen. 2021 (A2377, A2459, A2301, A2460)Apple iPad Pro 11 2 gen. 2020 (A2228, A2068, A2230, A2231)Apple iPad Pro 11 1 gen. 2018 (A1980, A2013, A1934, A1979)Apple iPad Air 10,9 5 gen. 2022 (A2588, A2589, A2591)Apple iPad Air 10,9 4 gen. 2020 (A2316, A2324, A2325, A2072)Apple iPad Mini 8.3 6 gen. 2021 (A2567, A2568, A2569) Rysuj precyzyjnie i pisz wygodnie Rysik od marki Tech-Protect to zaawansowane narzędzie graficzne, które idealnie sprawdza się w wykonywaniu precyzyjnych grafik i rysunków na iPadzie. Zapomnij o zmęczonej rysowaniem ręce, ponieważ urządzenie posiada ergonomiczny kształt i wagę piórkową wśród rysików. Wyposażony jest w magnetyczne mocowanie oraz funkcję indukcyjnego uzupełniania energii, która pozwala naładować stylus bezprzewodowo. Grubość linii możesz kontrolować poprzez zmianę kąta trzymania rysika. Kolor producenta: White (biały) *Rysik ładuje się magnetycznie po przyczepieniu go do iPada. Nie jest kompatybilny z iPadami Pro, Air i Mini z 2024 roku i nowszymi. Zobacz jak rysuje Obejrzyj filmik i zobacz na co go stać! Magnetyczna energia Rysik wyposażony jest w magnes, za pomocą którego stanie się nieodłącznym elementem wyposażenia Twojego iPada - nie ma mowy o przypadkowym zagubieniu rysika! Przyłączając rysik do magnetycznego złącza w iPadzie, naładujesz go także bezprzewodowo, a wszystko za sprawą funkcji indukcyjnego uzupełniania energii. Łączymy się w pary Digital Stylus Pen 2 połączysz z iPadem za pomocą Bluetooth. Dzięki temu masz też kontrolę nad stanem baterii Twojego rysika, przez co wiesz jak rozplanować swoją pracę i ładowanie urządzenia. W zestawie znajdziesz parę wymiennych końcówek rysika. Dioda kontrolna Obsługa rysika jest banalnie prosta. Wbudowana dioda LED informuje o statusie urządzenia. Kiedy świeci się na niebiesko, rysik jest włączony i gotowy do pracy. Kolor czerwony ostrzega o niskim poziomie naładowania baterii i podczas ładowania. W momencie kiedy rysik jest naładowany, dioda zmienia kolor na zielony. Wtedy użytkownik rysika wpada w stan maksymalnej kreatywności i weny, przez co tworzy niesamowite grafiki i oryginalne rysunki. Grubość linii możesz kontrolować poprzez zmianę kąta trzymania rysika. Energooszczędność Rysik włącza się poprzez przytrzymanie górnej części przez 3 sekundy, po których zaświeci się lampka kontrolna. Urządzenie wyłącza się automatycznie po 5 minutach braku reakcji w celu oszczędzania energii. Maksymalny czas pracy rysika na jednym ładowaniu to aż 9h. Natomiast do pełna ładuje się w 2h. Specyfikacja: - Wymiary: 166mm x 9mm- Czas ładowania: 2h- Bateria: 120 mAh- Ciągły czas pracy: 9h','','rysik-tech-protect-digital-stylus-pen-2-dla-ipad-pro-air-mini-2018-2022-bialy','','','','Rysik Tech Protect Digital Stylus Pen 2 dla iPad Pro / Air / Mini 2018-2022, biały','','','',''),(41726,1,1,'Ładowarka sieciowa Baseus Super Si USB-C 25W Uniwersalna USB-C Kompaktowa ładowarka Ładowarka sieciowa Baseus Super Si o kompaktowym rozmiarze wyposażona w port USB-C pozwoli szybko i optymalnie naładować Twoje urządzenie. Ładowarka doskonale nada się do ładowania urządzeń, takich jak smartfony, tablety, konsole do gier, aparaty, słuchawki z akumulatorem, itp. Kolor producenta: White Szybkie i bezpieczne ładowanie - Super Si Szereg certyfikatów bezpieczeństwa oraz inteligentny układ zarządzania chroniący przed przegrzaniem, przeładowaniem czy przepięciami zachowują bezpieczeństwo Twojego urządzenia podczas ładowania. Po podłączeniu urządzenia do ładowarki inteligentny chip automatycznie wykryje wspierane przez nie parametry i dostosuje optymalną ilość prądu. Baseus Super Si oznacza, że ładowarka wykonana została w taki sposób, aby zmniejszyć wydzielaną ilość ciepła, dzięki czemu komponenty potrzebne do uzyskania jej parametrów można było zestawić i umieścić w znacznie mniejszej obudowie. Takie rozwiązanie zaowocowało niewielką i podręczną ładowarką, która zawsze możesz mieć przy sobie. Ładowanie do 25W max Ładowarka posiada port USB-C szybkiego ładowania, a jej maksymalne obciążenie mocy wynosi do 25W. Parametry wyjściowe: USB-C: 5V3A, 9V2.78A, 12V2.1A Moc wejściowa: 100-240V, 5060Hz, 0.7A Kompaktowa i stylowa Elegancka, stylowa i minimalistyczna ładowarka o kompaktowych rozmiarach pozwala bez problemu schować ją w plecaku czy torebce, dzięki czemu będzie Ci przydatna wszędzie tam, gdzie będziesz potrzebować uzupełnić baterię w swoim urządzeniu.','','ladowarka-sieciowa-usb-c-25w-baseus-super-si-quick-charger-biala','','','','Ładowarka sieciowa USB-C 25W, Baseus Super Si Quick Charger, biała','','','',''),(41741,1,1,'Powerbank 20000mAh Baseus Super Energy Ma