owerbank. Pojemność: 20000mAh3.7V74Wh Znamionowa pojemność: 13000mAh Wejście: 5V2A, 9V2A(Max) Wyjście USB1: 5V3A,9V3A,12V2.5A(Max) Wyjście USB2: 5V2.4A(Max) Napięcie rozruchowe: 12V Prąd rozruchowy: 1000A Prąd szczytowy: 2000A Całkowita moc wyjściowa: 42W(Max) Maksymalna energia Powerbank Super Enegry Max ładuje się za pomocą ładowarki sieciowej (nie ma jej w zestawie), poprzez port USB-C. Ten sam port jest również portem wyjściowym, tak samo jak i dwa dodatkowe porty USB-A, dzięki którym możemy zasilić urządzenia takie jak smartfon czy tablet. Urządzenie obsługuje szybkie ładowanie o mocy 15W, a dzięki inteligentnemu układowi sterowania, dostosowuje napięcie do określonego sprzętu. Wygrywa w ekstremalnych warunkach Tak mocarną obudowę ciężko będzie złamać lub uszkodzić. Wbudowane ogniwo polimerowe, które jest odporne na ekstremalne temperatury umożliwia działanie urządzenia w temperaturze od -20C do 60C. Powerbank przeszedł szereg testów bezpieczeństwa i zdobył certyfikaty, m.in. FCC, CE i ROHS. Spełnia standardy lotnicze, a chipset dopasowuje natężenie prądu do urządzenia, chroniąc je przed: przeładowaniem, wyładowaniem, przepięciami, przegrzaniem, prądem przetężeniowym, krótkimi spięciami, polem elektromagnetycznym.','','powerbank-20000mah-baseus-super-energy-max-car-z-funkcja-rozruchu-silnika-i-latarka-kable-rozruchowe-usb-a-usb-c-czarny','','','','Powerbank 20000mAh Baseus Super Energy Max Car z funkcją rozruchu silnika i latarką + kable rozruchowe, USB-A, USB-C, czarny','','','',''),(41756,1,1,'Powerbank 10000mAh Baseus Super Energy Car Jump Pojazdy benzynowe 12V o pojemności do 4LPojazdy 12V z silnikiem Diesla o pojemności do 2,5L Powerbank i rozrusznik w jednym Z Powerbankiem Super Energy Max marki Baseus możesz być spokojny w awaryjnych sytuacjach. Urządzenie nie tylko pozwoli uruchomić Twój pojazd, ale i naładuje smartfona czy tablet, zupełnie jak zwykły powerbank. A w sytuacjach ekstremalnych, kiedy Twoje auto odmówi posłuszeństwa na drodze w ciemnym lesi