a z popularnymi urządzeniami od Apple, obsługującymi standard ładowania bezprzewodowego Qi, w tym serii iPhone z MagSafe. W opakowaniu dołączono ładowarkę sieciową z kablem 1,2m. To elegancki projekt o smukłych rozmiarach, zachowujący minimalistyczny i stylowy wygląd. Kolor producenta: White Obejrzyj recenzję produktu Odwiedź nasz profil na YouTube i zobacz jak ładowarka sprawdza się w praktyce. Bezpieczna i wydajna Ładowarka zapewnia bezpieczeństwo ładowanych urządzeń oraz komfort użytkowania, wystarczy położyć urządzenie w wyznaczonym miejscu aby rozpocząć ładowanie. Pozwala na jednoczesne ładowanie 3 następujących urządzeń Apple: smartfona z serii iPhone - zgodnego z technologią ładowania Qi oraz MagSafe słuchawek z serii AirPods smartwatcha z serii Apple Watch (do 33 szybsze ładowanie zegarków Apple wyposażonych w Fast Charging) Belkin zapewnia gwarancję bezpieczeństwa podłączonego sprzętu o wartości do 2,000. Jeśli Twój sprzęt zostanie uszkodzony z winy tego produktu podczas prawidłowego podłączenia i użytkowania, Belkin naprawi lub wymieni urządzenie na nowe. Kompatybilna z MagSafe Ładowarka Belkin jest kompatybilna ze smartfonami iPhone zgodnymi z MagSafe, dzięki czemu zachowuje ich pełną funkcjonalność i swobodę użytkowania. Pozwala to zapewnić optymalne ładowanie poprzez właściwe przyleganie w odpowiednim miejscu względem cewki Qi. Ekskluzywny design Wykonana z wysokiej jakości materiałów tworzy elegancką całość i jest przyjemna w dotyku. Małe rozmiary i smukła budowa doskonale komponują się w każdym wnętrzu. Całość wykonana została w dość kompaktowym i przemyślanym rozmiarze. Apple Fast Charge i certyfikat MFi Ładowarka jest dobrze zoptymalizowana, pozwala na wydajne ładowanie urządzeń i wykorzystanie w pełni możliwości ładowarki dostosowując odpowiednio moc ładowania. Wyposażona w technologię ładowania Apple Fast Charge dla iPhone. Ładowarka posiada certyfikat MFi, co daje gwarancję kompatybilności z urządzeniami Apple. W zestawie dołączono ładowarkę siec