zegub kulowy - elastyczne i optymalne kąty widzenia. Porządne szczypce - mocne trzymanie i łatwa instalacja. Wsparcie MagSafe - solidne magnesy i wygodne ładowanie. Wskaźnik LED - sygnalizacja świetlna podczas ładowania.','','uchwyt-samochodowy-magnetyczny-z-ladowaniem-qi-fixed-magclick-75w-15w-do-iphone-z-magsafe-czarny','','','','Uchwyt samochodowy magnetyczny z ładowaniem Qi Fixed MagClick 7,5W/ 15W do iPhone z MagSafe, czarny','','','',''),(44808,1,1,'Uchwyt 3mk Drive and Charge Uniwersalny Jedź i ładuj Nie możesz pozwolić sobie na rozładowany telefon w trasie, dlatego producent 3mk przychodzi z propozycją funkcjonalnego uchwytu z funkcją ładowania indukcyjnego. Drive and Charge to gadżet, który spełni oczekiwania każdego kierowcy i posiadacza smartfona z ładowaniem bezprzewodowym. W zestawie znajduje się kabel USB-A USB-C. Kolor producenta: Black (czarny) Dla każdego coś dobrego Uchwyt jest uniwersalny i pasuje do każdego modelu telefonu. Mocne ramiona sprawiają, że smartfon jest zawsze bezpieczny. Dodatkowo miejsce docelowe uchwytu wybierasz sam! Może być to deska rozdzielcza, szyba, a dzięki klipsowi możesz zamontować uchwyt także w kratce nawiewu. Uchwyt wyposażony jest w ruchomą głowicę, która pozwala na ustawienie smartfona w wygodnej dla Ciebie pozycji. Komu w drogę, temu uchwyt z ładowaniem indukcyjnym! Drive and Charge zapewnia stałe doprowadzanie energii do smartfona o mocy do 15W, dzięki czemu możesz śmiało włączyć nawigację i nie martwić się o deficyt energii czy zbędne kable od ładowarki, które wiją się wokół kierownicy samochodu jak węże. A co ważniejsze, panel ładujący posiada system chłodzenia, dzięki któremu telefon nie nagrzewa się, bateria jest zawsze pełna, a Ty gotowy do drogi. Nic, tylko jechać... To moje miejsce! Ten elegancki kompan podróży nie narzeka na swoje miejsce w samochodzie. Przyssawka wielokrotnego użytku pozwala na częstą zmianę położenia uchwytu, a materiał, z którego jest zrobiona nie traci właściwości przylegających.','','uchwyt-samochodowy-z-ladowaniem-indukcyjnym-3mk-drive-and-charge-15w-czarny','','','','Uchwyt samochodowy z ładowaniem indukcyjnym 3mk Drive and Charge 15W, czarny','','','',''),(44897,1,1,'Tech-Protect L02S Wireless Selfie Stick Tripod Bluetooth Dla smartfonów z Bluetooth Dla każdego wielbiciela fotografii Składany selfie stick Tripod marki Tech-Protect z serii L02S Wireless to przemyślany kijek do robienia zdjęć, który może być także statywem wraz ze zdalnym bezprzewodowym pilotem Bluetooth. Uchwyt jest wykonany z bardzo dobrych materiałów, co zapewnia gwarancję wytrzymałości. Po sparowaniu urządzeń za pomocą funkcji Bluetooth wystarczy nacisnąć guzik na rączce, powiedzieć ,,cheese i zrobić zdjęcie. W opakowaniu: 1 x Selfie Stick Tech-Protect L02S Kolor producenta: Black (czarny) Połączenie za pomocą Bluetooth Wysuń kij do selfie, aby zrobić ładniejsze zdjęcia lub nagrywaj fajniejsze filmy. Statyw jest kompatybilny z większością telefonów dostępnych na rynku, posiadającymi łączność Bluetooth oraz system operacyjny iOS lub Android. Dla każdego Jest to gadżet, który sprawi, że Twoje zdjęcia zawsze dobrze wyjdą. Dzięki lekkiej i kompaktowej konstrukcji możesz go zabrać ze sobą, gdzie chcesz. Od teraz masz możliwość przechowywania go w torebce, w kieszeni lub plecaku. Długość po złożeniu: 15.2 cm Długość selfie sticka: 72 cm Waga: 125 g Zasilanie pilota: bateryjne Zasięg pracy pilota: 10m Funkcja statywu Rodzaj trzymania telefonu: zaciskowe Pełna wygoda Szybko i łatwo rozłóż kijek na statywie, aby robić wspólne zdjęcia, filmować siebie lub prowadzić wideo rozmowy bez użycia rąk. Włóż telefon do wysuwanego uchwytu, przyjmij pozę modela lub ustaw się, jak chcesz. Uśmiechnij się szeroko i naciśnij spust migawki pilota. Samodzielna obsługa to teraz nic trudnego. Dołączony pilot umożliwia zdalne wykonywanie zdjęć za pomocą połączenia z telefonem przez Bluetooth.','','uchwyt-kijek-statyw-tech-protect-l02s-wireless-selfie-stick-tripod-bluetooth-czarny','','','','Uchwyt, kijek, statyw Tech-Protect L02S Wireless Selfie Stick Tripod Bluetooth, czarny','','','',''),(45687,1,1,'Belkin BoostCharge Pro Dual Wall Charger, PD 3.0, PPS, GaN, 45W Uniwersalna 2x USB-C Wygodna i elegancka Oryginalna, kompaktowa ładowarka sieciowa marki Belkin z serii BoostCharge Pro z tranzystorami wykonanymi z azotku galu (GaN) o mniejszym generowaniu ciepła niż standardowe krzemowe komponenty. Można używać jej z wszelkimi urządzeniami posiadającymi kabel ze złączem USB typu C. Ładowarka posiada elegancki i nowoczesny design. Dwa porty USB-C Power Delivery 3.0 zostały wyposażone w technologię, która wykrywa możliwie maksymalne natężenie prądu dla danego urządzenia, co znacznie skraca czas ładowania względem standardowych ładowarek, a inteligentne rozdzielanie mocy zapewni ładowanym urządzeniom możliwie odpowiednią ilość energii z każdego portu. Kolor producenta: White Szybsze ładowanie 45W Naładuje Twój smartfon, tablet, laptop, czy inne urządzenie z optymalną, możliwie najszybsza prędkością. Nowoczesna konstrukcja zapewnia łatwe i wygodne użytkowanie. Wyjścia: USB-C PD 3.0 25W45W: do 25W max podczas obciążenia obu portów lub 45W max podczas obciążenia tylko tego portu(5V3A15W, 9V3A27W, 12V3A36W, 15V3A45W, 20V2,25A45W) USB-C PD 3.0 20W45W: do 20W max podczas obciążenia obu portów lub 45W max podczas obciążenia tylko tego portu(5V3A15W, 9V3A27W, 12V3A36W, 15V3A45W, 20V2,25A45W) Ponadto ładowarka wyposażona została w technologię dynamicznego ładowania PPS, która wykrywa podłączone urządzenie i negocjuje odpowiednią ilość energii wymaganą do wydajnego ładowania. Parametry PPS: 3,3-16V2,8A 45W max Funkcja inteligentnego rozdzielania mocy ładowania pomiędzy oba porty zapewnia optymalny przesył mocy w przypadku ładowania dwóch urządzeń jednocześnie. *Do wykorzystania potencjału ładowarki wymagane jest posiadanie kabla z Power Delivery 3.0 o przepustowości mocy do 45W. Nowoczesny design z technologią GaN Zastosowanie tranzystorów z azotku galu (GaN - gallium nitride) zamiast tradycyjnego krzemu zaowocowało jeszcze mniejszym wytwarzaniem ciepła, co pozwoliło na bliższe usytuowanie wewnętrznych komponentów względem siebie, a tym samym zachowanie kompaktowej budowy ładowarki. Dzięki takiemu rozwiązaniu otrzymujesz znacznie mniejszą ładowarkę z dużą mocą, która wymagałaby standardowo większej obudowy. Nowoczesny design ładowarki prezentuje się smukło i stylowo. Doskonale sprawdzi się w ciasnym szeregu gniazdek na listwach zasilających, a ponadto równie łatwo zmieścisz ją w torebce czy plecaku, by mieć ją zawsze pod ręką będąc poza domem. Gwarancja bezpieczeństwa Ładowarki firmy Belkin są tak skonstruowane, aby zapewnić najlepsze zabezpieczenie urządzenia podczas ładowania. Inteligentny układ mierzy napięcie i automatycznie dostosowuje odpowiednio maksymalną moc ładowania. Belkin zapewnia gwarancję bezpieczeństwa podłączonego sprzętu o wartości do 2,000 Euro. Jeśli sprzęt zostanie uszkodzony przez ładunek elektryczny podczas prawidłowego podłączenia do ładowarki, Belkin naprawi lub wymieni urządzenie na nowe.','','ladowarka-sieciowa-gan-2x-usb-c-30-pd-pps-45w-belkin-boost-pro-wall-dual-biala','','','','Ładowarka sieciowa GaN 2x USB-C 3.0 PD, PPS, 45W, Belkin Boost Pro Wall Dual, biała','','','',''),(46188,1,1,'Etui Supcase Unicorn Beetle Pro Apple MacBook Pro 16 2024 (A3403, A3186) M4 Pro M4 MaxApple MacBook Pro 16 2023 (A2991) M3 Pro M3 MaxApple MacBook Pro 16 2023 (A2780) M2 Pro M2 MaxApple MacBook Pro 16 2021 (A2485) M1 Pro M1 Max Mocna konstrukcja z podstawką Pancerne, dwuczęściowe etui od marki Supcase z serii Unicorn Beetle Pro z wbudowaną rozkładaną podstawką, umożliwiającą ustawienie laptopa pod jednym z 3 dostępnych kątów nachylenia. Wysoka jakość wykonania - połączenie termopoliuretanu i poliwęglanu. Pełna ochrona - zabezpieczenie przodu i tyłu urządzenia przed zarysowaniami i uszkodzeniami w codziennym użytkowaniu. Łatwa instalacja zatrzaskowa. Elegancki i smukły design. Rozkładana podstawka. Kolor producenta: Black (przezroczy