-C, DC 5V2.4A, 9V2A Wyjście iOS: 5W 7.5W Wyjście z systemu Android OS: 5W 7.5W 10W 15W Złącze USB-C Waga: 160g Wymiary uchwytu: 82,5x55x130mm','','uchwyt-samochodowy-magnetyczny-z-ladowaniem-qi-fixed-magclick-xl-75w-15w-do-iphone-z-magsafe-czarny','','','','Uchwyt samochodowy magnetyczny z ładowaniem Qi Fixed MagClick XL 7,5W/ 15W do iPhone z MagSafe, czarny','','','',''),(47100,1,1,'Etui Spigen Metal Fit Pro Apple Watch 9 8 7 (45 mm)Apple Watch SE 2022 SE 6 5 4 (44 mm) Eleganckie etui z paskiem Oryginalne etui z paskiem marki Spigen z serii Metal Fit Pro zapewniające doskonałą ochronę przed zarysowaniami i uderzeniami w codziennym użytkowaniu. Etui na kopertę zegarka wykonano z połączenia zewnętrznej warstwy z lekkiego aluminium wyłożonego wewnątrz osłonką z termopoliuretanu, a całość dopełnia stalowy pasek z wygodnym, magnetycznym zapięciem. To świetny zestaw o spójnie zaprojektowanej budowie, który doskonale będzie prezentował się na nadgarstku. Dla obwodu nadgarstka: 140 mm - 215 mm Kolor producenta: Graphite (grafitowy z czarnymi akcentami) Dystyngowana prezencja Pokrowiec z paskiem wykonano w eleganckiej stylistyce, odznaczającej się ponadczasowym wyglądem, który zadowoli gust wszystkich tych, którzy preferują bardziej biznesowy i klasyczny design od sportowego fasonu. Taka wizytowa i taktowna forma zestawu doskonale sprawdzi się z każdym ubiorem. Ochronny cover na kopertę zegarka Etui zestawu wykonane zostało z połączenia lekkiego aluminium oraz wewnętrznej osłonki z amortyzującego TPU. Taka budowa świetnie zabezpieczy kopertę Twojego smartwatcha zapewniając mu wysoką odporność na wstrząsy i otarcia. Wystarczy włożyć urządzenie do ramki i gotowe. Stalowy pasek Pasek wykonano z mocnej stali o drobnym splocie oczek i stylowej strukturze, który świetnie dopełnia całościowy design zestawu. Na końcach posiada klasyczny rodzaj montażowy dopasowany do pokrowca, czyli sprężynowe bolce wchodzące w zagłębienia w obudowie. Magnetyczne zapięcie Brak dziurek w połączeniu 