anie Rapid Charge o mocy 15W Zasilanie: wejście USB-C Mocna poliwęglanowa konstrukcja z ABS Zawartość pudełka: uchwyt Fixed, samoprzylepny adapter do montażu na desce rozdzielczej, kabel do zasilania USB-C, instrukcja obsługi (brak ładowarki*) *Producent zaleca ładowarkę samochodową ze wsparciem PD o mocy min. 18W. Kolor producenta: Black (czarny) Szybkie ładowanie bezprzewodowe - 15W Uchwyt zapewnia wygodne ładowanie podczas jazdy. Obsługuje zarówno standard Qi, jak i Qualcomm Quick Charge 3.0 i bez problemu poradzi sobie nawet z najnowocześniejszymi smartfonami. Wystarczy włożyć telefon, a ładowanie bezprzewodowe rozpocznie się natychmiast. Cewka ładująca wewnątrz uchwytu może ładować o mocy do 15W. Wejście: 5V 2A, 9V 2A, 12V 2A (maks.) Wyjście: DC 5V1A, 9V 1.1A Moc: 5W 7.5W 10W 15W Automatyczny system Producent zadbał o maksymalną wygodę podczas mocowania smartfona, dzięki specjalnym szczypcom z automatyczną blokadą dla obsługi jedną ręką. Wystarczy umieścić telefon na podstawie uchwytu, a szczypce automatycznie bezpiecznie zabezpieczą włożony telefon, ładowanie bezprzewodowe rozpocznie się natychmiast. Aby otworzyć uchwyt, wystarczy użyć przycisku dotykowego na górze. Dzięki wewnętrznemu kondensatorowi uchwyt może zmagazynować wystarczającą ilość energii nawet po odłączeniu go od zasilania, aby można było wygodnie wyjąć telefon. Mocowanie na przedniej szybie i desce rozdzielczej Uchwyt jest bardzo funkcjonalny, można go zamontować na szybie, jak i na szybie rozdzielczej. Niewielka budowa idealnie wpasuje się we wnętrze Twojego samochodu. Waga: 160 g Wymiary uchwytu: 100 x 67 x 130 mm Bezpieczny widok Przegub kulowy pozwala ustawić szybko i łatwo najlepszy kąt widzenia. Obracaj smartfon, jak chcesz. Dzięki uchwytowi FIXED Matic XL każda wycieczka samochodem będzie wygodniejsza i bezpieczniejsza niż kiedyś. Pełna ochrona Fixed Matic zapewnia pełne bezpieczeństwo użytkowania, posiada ochronę przeciwprzepięciową i ochronę przed przegrzaniem. Wyposażony we wskaźnik ś