uchwyt Baseus JoyRide Pro sprawi, że Twój pasażer poczuje się komfortowo i zrelaksowany.','','uchwyt-samochodowy-zaglowkowy-baseus-joyride-pro-czarny','','','','Uchwyt samochodowy zagłówkowy Baseus JoyRide Pro, czarny','','','',''),(49588,1,1,'Ładowarka sieciowa OnePlus SuperVOOC Charger Adapter 80W USB-A Mała ładowarka, wielkie możliwości! Odkryj oryginalną ładowarkę sieciową marki OnePlus z technologią SuperVOOC. Teraz ładowanie Twojego urządzenia stanie się jeszcze łatwiejsze i szybsze niż kiedykolwiek wcześniej! Nie tylko Twój smartfon, ale także iPad, tablet, słuchawki z akumulatorem czy konsola do gier - wszystko to możesz naładować za pomocą jednego, wygodnego portu USB-A. Uwaga! Ładowarka sprzedawana jest bez kabla. Kolor producenta: White (biały) Bezpieczeństwo ładowania Wybierając ładowarkę sieciową marki OnePlus wykonaną z materiału odpornego na temperaturę klasy UL95-V0, masz pewność, że otrzymujesz produkt łączący w sobie solidną konstrukcję i najwyższą jakość wykonania. Zastosowane materiały gwarantują nie tylko długą żywotność produktu, ale także bezpieczeństwo podczas ładowania Twojego smartfona. Ładowarka jest kompatybilna z produktami OnePlus, jak i z innymi urządzeniami wymagającymi takiej mocy. Dlatego też, jeśli cenisz sobie jakość i niezawodność, ładowarka sieciowa OnePlus SuperVOOC jest idealnym wyborem dla Ciebie! Ładowanie do 80W max Ładowarka posiada port USB-A szybkiego ładowania, a jej maksymalne obciążenie mocy wynosi do 80W. Parametry wyjściowe: USB-A: 5V2A 5-11V7,3A Moc wejściowa: 100-240V, 5060Hz, 2A Naładuj swój telefon w mgnieniu oka! Nowa technologia ładowania SuperVOOC Super Flash zapewnia ładowanie z maksymalną mocą 80W, dzięki czemu naładuje telefon OnePlus 10 Pro 5G do 100 w 32 minut. W przypadku telefonów nieobsługujących szybkiego ładowania, zasilanie odbywać się będzie z maksymalną możliwą dla nich prędkością.','','ladowarka-sieciowa-usb-a-80w-oneplus-supervooc-charger-adapter-biala','','','','Ładowarka sieciowa USB-A 80W, OnePlus SuperVOOC Charger Adapter, biała','','','',''),(49596,1,1,'Uchwyt iOttie Velox Magnetic Flush Mount MagSafe Dla serii Apple iPhone z MagSafe Etui z wbudowanym pierścieniem magnetycznym z funkcją MagSafe Ultrakompaktowy i niezwykle lekki Magnetyczny uchwyt samochodowy iOttie Velox Magnetic Flush Mount przeznaczony dla iPhoneów i etui kompatybilnych z technologią MagSafe. Uwaga! Uchwyt kompatybilny tylko z telefonami z serii iPhone 12, iPhone 13 i iPhone 14. Mocny chwyt magnetyczny - trzyma stabilnie urządzenie Smukły i elegancki profil Aluminiowa konstrukcja z wysokiej jakości silikonem W zestawie: uchwyt, instrukcja obsługi Kolor producenta: Black (czarny) Siła przyciągania magnetycznego Dzięki specjalnej konstrukcji z magnetycznym mocowaniem uchwyt umożliwia łatwe i bezpieczne przymocowanie Twojego iPhonea z technologią MagSafe oraz pokrowców i futerałów MagSafe. Dzięki temu nie musisz się martwić, że Twój telefon wypadnie nawet na najbardziej nierównych drogach. Instalacja w kratce wentylacyjnej Podstawka samoprzylepna uchwytu Velox to bardzo wygodne rozwiązanie, ponieważ nie wymaga ona dodatkowych narzędzi ani specjalnych umiejętności do zamocowania uchwytu w samochodzie. Samoprzylepna powierzchnia zapewnia mocne i solidne przymocowanie uchwytu do miejsca w samochodzie, gdzie użytkownik chce umieścić uchwyt. Znajdź idealny kąt widzenia! Dzięki trwałemu i mocnemu przegubowi kulowemu możesz łatwo obracać uchwyt z trybu poziomego na pionowy i szybko dostosować go do swoich potrzeb. Nawiguj lub prowadź rozmowy telefoniczne zawsze z optymalnym kątem widzenia!','','uchwyt-samochodowy-magnetyczny-iottie-velox-flush-mount-do-iphone-z-magsafe-czarny','','','','Uchwyt samochodowy magnetyczny iOttie Velox Flush Mount do iPhone z MagSafe, czarny','','','',''),(49934,1,1,'Etui 3mk Silicone CaseApple iPhone 14 Silikonowa przyjemność dla smartfonaSilicone Case od polskiego producenta 3mk to propozycja dla osób ceniących wygodę, minimalizm i optymalną ochronę swojego urządzenia.Miękki silikon, z którego wykonano etui jest gładki, delikatny i przyjemny w dotyku, a dzięki wysokiemu współczynnikowi tarcia nie ma mowy o przypadkowym wyślizgnięciu się smartfona z ręki. Dzięki testom Absorber200, możesz być pewny, że ten pokrowiec zapewni rewelacyjną ochronę twojego telefonu. Wersja kolorystyczna: Black (czarny)Etui kompatybilne ze szkłami o wymiarach nieprzekraczających (dług.szer.przek.): 14,47 x 6,94 x 15,17 cmProducent zmienił szatę graficzną pudełka, więc może się różnić od tego na zdjęciach. Zmiana dotyczy samego opakowania. Perfekcyjne dopasowanieEtui jest idealnie dopasowane do twojego telefonu, dzięki czemu nie dostanie się do niego np. piasek, który mógłby porysować twoje urządzenie.Futerał jest w pełni hipoalergiczny i delikatny dla skóry. Silikonowy materiał, z którego wykonano Silicone Case posiada właściwości hydrofobowe dzięki innowacyjnej technologii wytwarzania odpycha cząsteczki wody i innych płynów, dzięki czemu wystarczy jeden ruch ręką i etui znów jest czyste. Jak pancerz ochronnyDla dodatkowej ochrony, przy projektowaniu Silicone Casea producent postawił na podniesione i wystające krawędzie, które chronią ekran i wyspę aparatu na płaskich powierzchniach. Dodatkowo cover spełnia standard odporności Absorber200 (26 upadków z wysokości 200 cm na betonowy podkład zero zniszczeń smartfona). Bezpieczny dla zdrowiaEtui posiada atest PZH, oraz jest zgodny z dyrektywą RoHS.','','etui-3mk-silicone-case-do-iphone-14-czarne','','','','Etui 3mk Silicone Case do iPhone 14, czarne','','','',''),(50117,1,1,'Bizon Case Tab Clear Matt Apple iPad 9. gen. 2021 (A2602, A2603, A2604, A2605) Apple iPad 8. gen. 2020 (A2270, A2428, A2429, A2430)Apple iPad 7. gen. 2019 (A2197, A2200, A2198) Zapobiegnij serii niefortunnych zdarzeń Once you go matt, you never go back. Etui od producenta Bizon z serii Tab Clear Matt ochroni Twój tablet przed zabrudzeniami, zarysowaniami i drobnymi upadkami i przyjmie na klatę (plecy) codzienne przeciwności losu, takie jak kropelki kawy bombardujące tył tabletu, MMA z kluczami w plecaku czy pospieszne odłożenie urządzenia AKURAT na krawędź blatu. Kolor producenta: BlackLogo występuje w różnych wariantach kolorystycznych i może odbiegać od przedstawionego na zdjęciach. Etui kompatybilne ze szkłami* o wymiarach nieprzekraczających (dług.szer.przek.): 24,82 x 17,24 x 29,34 cm * Przy doborze ochrony ekranu zwróć uwagę, aby szkło było mniejsze niż wymiary wewnętrzne pokrowca. Przedmiotem sprzedaży jest samo etui, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Matowe etui wyreżyserowane przez Bizona Boisz się, że po założeniu etui, tablet zacznie sam klikać, a kiedy Ty będziesz chciał zwiększyć głośność, to strzeli na Ciebie focha i zamiast tego się wyłączy? Tak jest tylko na filmach. A Bizon Tab Clear Matt, oprócz hybrydowej konstrukcji z TPU na ramce, twardego akrylu na pleckach oraz poliuretanu wykończonego matem od zewnątrz, cechuje się utrzymaną płynnością działania przycisków! Wzmocnione narożniki załagodzą nieco Twój szok i impet uderzenia, a ukryta w środku pokrowca mikrofibra dodatkowo otuli i zabezpieczy urządzenie. Odpowiedź: rysik Co to: zawsze potrzebny, a nigdy go nie ma? Znający zasadę nagłego znikania, Tab Clear Matt może przechować to jakże cenne narzędzie pracy w dedykowanym slocie wewnątrz obudowy! Proszę wstać, Tab Clear Matt idzie Może i nie nadaje się jako papier origami, ale odpowiednio złożony pokrowiec zamieni się w podstawkę, dzięki której wygodnie przeczytasz artykuł, zagrasz w grę czy obejrzysz odcinek serialu. Tablet nie człowiek, skąd ma wiedzieć, kiedy się położyć i wstać? Dzięki funkcji automatycznego wybudzania i usypiania*! Uniesienie klapki aktywuje urządzenie, a zamknięcie - powie mu dobranoc. *Kompatybilna z wybranymi modelami tabletów.','','etui-bizon-case-tab-clear-matt-do-ipad-9-8-7-102-2021-2020-2019-czarne','','','','Etui Bizon Case Tab Clear Matt do iPad 9/8/7 10.2 2021/2020/2019, czarne','',