e oświetlenie! 10-calowa lampa pierścieniowa Apexel z regulowaną głowicą statywu to idealne narzędzie dla osób zajmujących się fotografią lub livestreamingiem. Dzięki możliwości obrotu o 360 światło pierścienia może być łatwo dostosowane do potrzeb użytkownika. Regulowana jasność i uchwyt na telefon Lampa posiada trzy tryby oświetlenia (biały, ciepły żółty i ciepły żółty biały), z każdym z nich związanych jest 10 poziomów jasności. Lampa zawiera 120 żarówek, co oznacza, że zapewnia lepsze oświetlenie niż wiele innych lamp pierścieniowych. Klips na telefon jest kompatybilny z większością smartfonów, a jego giętka konstrukcja umożliwia zainstalowanie telefonu w poziomie lub w pionie. Zasilanie przez USB Lampa dzięki temu, że posiada wtyczkę USB może być zasilana przez wiele urządzeń, takich jak ładowarka sieciowa, komputer czy laptop. Z łatwością można więc korzystać z niej w dowolnym momencie i miejscu. W skład zestawu wchodzą: lampa pierścieniowa, mini statyw, uchwyt na telefon, instrukcja obsługi.','','lampa-pierscieniowa-ring-apexel-led-light-foldable-floor-stand-apl-fl10jj14-statyw','','','','Lampa pierścieniowa Ring Apexel LED Light Foldable Floor Stand APL-FL10JJ14 + statyw','','','',''),(51909,1,1,'Obiektyw na aparat Apexel 18X Telephoto Lens with Tripod APL-T18ZJ Uniwersalny smartfony z obiektywem o szerokości max 15 mm Tak daleko i tak blisko Czy kiedykolwiek miałeś ochotę zrobić świetne zdjęcia w plenerze, ale nie chciałeś nosić ciężkiego sprzętu? Profesjonalny obiektyw od Apexel to idealna propozycja dla Ciebie. Teleskop przybliży twoje oko do obiektów aż 18 razy. W zestawie znajduje się uchwyt na telefon, statyw, obiektyw, adapter do użycia jako luneta, pokrowiec, ściereczka z microfibry Szerokość telefonu: 5,5 - 8,8cm 2,17 - 3,46 cala Rozmiar statywu: długość po złożeniu 16,5 cm, minimalna długość 14,5 cm, maksymalna długość 20 cm Rozmiar soczewki aparatu: max szerokość 15 mm Maksymalna odległość środka obiektywu od krawędzi telefonu: 3 cm Kolor producenta: Black (czarny) Tylko bez podglądania Wykonany z wysokiej jakości materiałów obiektyw skutecznie rozwiązuje problemy z wyraźnymi środkowymi częściami i rozmytymi krawędziami, które często pojawiają się podczas robienia zdjęć za pomocą zewnętrznego obiektywu do telefonu komórkowego. Dzięki 18 krotnemu zoomowi pozwala uzyskać bardzo wyraźne zdjęcia z dalekich odległości. Podręczny teleskop Każdy pasjonat fotografii wie, jak ważne jest to, aby mieć pod ręką wyjątkowe narzędzia, które pomogą uwiecznić niezapomniane chwile. Właśnie z tego powodu Apexel przychodzi z profesjonalnym obiektywem, który jest łatwy w użyciu i idealny do zabrania w podróż. Teleskop został precyzyjnie wykonany i mieści się bez problemu w torbie lub plecaku, dlatego możesz go zabrać ze sobą wszędzie, gdziekolwiek się wybierasz. Statyw Tripod W zestawie znajduje się funkcjonalny statyw. Idealny, kompaktowy gadżet, który zabierzesz na kemping, festiwal czy górską wędrówkę, by podziwiać przyrodę. Luneta i obiektyw w jednym! Ten obiektyw ma zastosowanie nie tylko w fotografii. Możesz go także użyć jako lunety, dzięki dołączonej w zestawie specjalnej końcówce do wizjera. To niezwykle praktyczna funkcja, która pozwala Ci na bieżąco obserwować otaczający Cię świat.','','obiektyw-teleskopowy-mobilny-teleobiektyw-apexel-do-smartfona-18x-statyw','','','','Obiektyw teleskopowy / mobilny teleobiektyw Apexel do smartfona 18X + statyw','','','',''),(51954,1,1,'Obiektywy na aparat Apexel 12w1 Telephoto Smartphone Lens Kit APL-22XDG9 Uniwersalne smartfony i tablety z obiektywem do 13 mm średnicy Twórz mistrzowskie ujęcia w każdej sytuacji! Czy kiedykolwiek marzyłeś o robieniu świetnych zdjęć, ale nie chciałeś nosić ze sobą ciężkiego sprzętu fotograficznego? Apexel 12w1 Lens Kits oferuje zestaw profesjonalnych obiektywów, które są idealnym rozwiązaniem dla Ciebie. W zestawie znajduje się 6 obiektywów, 4 filtry, teleskop, etui z karabińczykiem, ściereczka i klips, za którego pomocą przymocujesz nakładkę do obiektywu swojego smartfona. Pamiętaj, że jakość zdjęć zależy od możliwości technicznych aparatu w Twoim urządzeniu i może różnić się od fotografii w ofercie. Kolor producenta: Black (czarny) Zalecamy zapoznanie się z instrukcją w języku polskim: KLIKNIJ TUTAJ Uśmiech! Chwyć klips, wybierz soczewkę z efektem, przyczep ją do klipsa i pstyk, pstyk... Nic prostszego! Niezapomniane efekty wizualne i świetna zabawa gwarantowane! Eksperymentuj i odkrywaj! Niech Twoje zdjęcia staną się dziełami sztuki - wykorzystaj obiektywy, aby odkryć nowe możliwości i uwiecznić najpiękniejsze chwile! Luneta z obiektywem 22x Telephoto - doskonała do fotografowania z daleka, oferuje 22-krotne przybliżenie kadru Obiektyw Ultra Wide 0.63x - idealny dla szerokokątnych ujęć, zapewnia znacznie szersze pole widzenia Obiektyw 15x Macro - dedykowany makrofotografii, umożliwia fotografowanie i filmowanie z bliska (2-5 cm) przy 15-krotnym powiększeniu Obiektyw Fisheye - tworzy efekt rybiego oka, poszerzając obraz do 198 stopni Obiektyw Kaleidoscope 3 i 6 - wprowadza efekt nakładania obrazu Zdobądź efekt wow! Odkryj pełen potencjał swojej fotografii dzięki różnorodnym filtrom, które mogą zwiększyć jakość i kreatywność Twoich zdjęć! Filtr polaryzacyjny CPL - eliminuje odblaski i odbicia z powierzchni metalicznych i szklanych. Dodatkowo zwiększa nasycenie kolorów, co pomaga uzyskać bardziej intensywne i nasycone zdjęcia Filtr Flow - nadaje ruch elementom statycznym zdjęcia. Działa poprzez tworzenie efektu rozmycia, który sugeruje, że obiekty poruszają się dynamicznie. Filtr Radial - powoduje rozmycie tła i wyróżnienie konkretnego obiektu na pierwszym planie. Filtr Star 4x - tworzy efekt czteroramiennej gwiazdy z punktów światła. Gwiazdkowe światło pojawia się wzdłuż ostrych krawędzi źródła światła, dodając blasku i piękna.','','uniwersalne-obiektywy-soczewki-teleskop-apexel-22x-z-klipsem-12w1-na-aparat-smartfona-tabletu','','','','Uniwersalne obiektywy / soczewki / teleskop Apexel 22X z klipsem 12w1 na aparat smartfona / tabletu','','','',''),(52000,1,1,'Obiektywy na aparat Apexel 7w1 Excellent Filter Kit APL-52UV-7G Uniwersalne smartfony i tablety z obiektywem do 15 mm Efekty, które zapierają dech Odkryj profesjonalny zestaw filtrów 7w1 o średnicy 52 mm od Apexel z serii Excellent Filter Kit do smartfonów. Idealny do filmowania i fotografowania. To doskonała propozycja dla profesjonalistów i amatorów, którzy chcą uzyskać niesamowite efekty i ciekawsze zdjęcia. Dzięki różnym filtrom możesz eksperymentować i tworzyć unikalne ujęcia. W zestawie znajduje się 7 filtrów, etui, instrukcja obsługi, ściereczka i klips, za którego pomocą przymocujesz nakładkę do obiektywu swojego smartfona. UWAGA: Do fotografowania małych rzeczy należy użyć obiektywu makro, w odległości około 3-6 cm. Pamiętaj, że jakość zdjęć zależy od możliwości technicznych aparatu w Twoim urządzeniu i może różnić się od fotografii w ofercie. Kolor producenta: Black (czarny) Zalecamy zapoznanie się z instrukcją w języku polskim: KLIJNIJ TUTAJ Uśmiech! Chwyć klips, wybierz soczewkę z efektem, przyczep ją do klipsa i pstyk, pstyk... Nic prostszego! Niezapomniane efekty wizualne i świetna zabawa gwarantowane! Twój sekret do doskonałych zdjęć Zdobądź wyjątkowe efekty i niepowtarzalny styl dzięki różnorodnym filtrom, które podkreślą jakość i kreatywność Twoich zdjęć! Filtr polaryzacyjny kołowy - eliminuje odblaski, odbicia z powierzchni metalicznych i szklanych, zwiększa nasycenie kolorów Filtr Star 6x - gwiazdkowy efekt, idealny do fotografii biżuterii i nocnych ujęć Pełny szary ND32 - redukuje światło, zapobiega prześwietleniom i zwiększa głębię ostrości Niebieski połówkowy - nadaje piękne niebieskie niebo, eliminuje prześwietlenia Żółty połówkowy - podkreśla barwy żółte, idealny do fotografii krajobrazowej Pomarańczowy połówkowy - tworzy efekt ciemnopomarańczowego nieba, eksponuje chmury Czerwony połówkowy - daje ciekawe efekty kolorystyczne, idealny do fotografii krajobrazowej i zachodów słońca Wytrzymałość Składają się z zaawansowanych soczewek wykonanych ze szkła optycznego, pokrytymi powłokami antyrefleksyjnymi oraz warstwami jonowymi. Korpusy filtrów zostały wykonane z lekkiego stopu metalu, który charakteryzuje się wyjątkową trwałością i odpornością na uszkodzenia mechaniczne.','','uniwersalne-obiektywy-soczewki-gradientowe-52-mm-z-filtrem-apexel-7w1-z-klipsem-na-aparat-smartfona-tabletu','','','','Uniwersalne obiektywy / soczewki gradientowe 52 mm z filtrem Apexel 7w1 z klipsem na aparat smartfona / tabletu','','','',''),(52037,1,1,'Baseus T-Typed S-09A Uniwersalna (Bluetooth 4.2 2x USB-A microSD) Wysoka jakość wykonania Wyjątkowo szybka ładowarka samochodowa z wbudowanym Transmiterem FM Bluetooth. Transmiter służy do przesyłania dźwięków z urządzeń mobilnych wyposażonych w bluetooth, pendriveów oraz kart pamięci z muzyką na głośniki samochodowe z wykorzystaniem wbudowanego radia - przy pomocy fal radiowych. Dzięki transmiterowi nawet stare radio samochodowe może działać jak nowoczesny odtwarzacz muzyki lub służyć jako zestaw głośnomówiący. Kolor producenta: Black (czarna) Obejrzyj recenzję produktu Odwiedź nasz profil na YouTube i zobacz jak urządzenie sprawdza się w praktyce. Szybkie ładowanie Urządzenie zostało wyposażone w dwa porty USB-A, z czego jeden z nich posiada funkcję czytania plików muzycznych z dysków zewnętrznych lub pendrive. Wejście: DC 12V-24V Wyjście: USB-A 1: 5V 2.4A USB-A 2: 5V 1A Parametry: Częstotliwość transmisji: 87,5-108,0 MHz Odległość transmisji FM: 5 m Odległość Bluetooth: 10 M Wersja bluetooth: 4.2 Mikrofon HD Wejście dla kart pamięci microSD Kompatybilność: uniwersalny (AndroidiOs) zapalniczki 12-24V Format audio: MP3 WAV FLAC APE WMA Kompatybilny z protokołem BT: A2DP, AVRCP, HSP, HFP Wyświetlacz LED Wbudowany wyświetlacz pozwala na monitorowanie stanu naładowania urządzenia oraz konfigurację częstotliwości. Urządzenie posiada również przyciski odbierania, przewijania do następnegopoprzedniego utworu. W zestawie: Ładowarka samochodowa Instrukcja obsługi po angielsku Bezpieczeństwo Transmiter posiada wbudowany woltomierz, który informuje Cię o aktualnym stanie samochodu. Zanim Twój samochód zostanie uruchomiony, napięcie między 12.8V-12.2V jest normalne. Po uruchomieniu samochodu prawidłowe napięcie wynosi między 14,8V-13,4V. Gdy natomiast napięcie spadnie poniżej 12V oznacza to, że powinieneś sprawdzić swój samochód. Co więcej produkt przeszedł szereg testów bezpieczeństwa i zdobył liczne certyfikaty.','','ladowarka-samochodowa-transmiter-fm-baseus-t-typed-2x-usb-a-microsd-34a-s-09a','','','','Ładowarka samochodowa + Transmiter FM Baseus T-Typed 2x USB-A, MicroSD 3,4A  S-09A','','','',''),(52038,1,1,'Obiektywy na aparat Apexel 18X Telephone Smartphone Lens Kit APL-T18XBJZ5 Uniwersalne smartfony z obiektywem do 13 mm średnicy Wyraźne ujęcia z odległości! Apexel Multifunction Smartphone Lens Kit to zestaw umożliwiający wyraźne fotografowanie oraz nagrywanie wideo różnych scen, takich jak dzika przyroda, zaćmienia, krajobrazy, pejzaże miejskie, imprezy sportowe i koncerty. Dzięki obiektywowi monokularnemu o 18-krotnym zoomie można przekształcić go w potężny teleskop, zapewniający szczegółowe ujęcia z odległych obiektów. To niezastąpione narzędzie dla miłośników przyrody i podróżników, którzy pragną uchwycić wyjątkowe momenty w sposób profesjonalny. W zestawie znajduje się teleobiektyw 18x, obiektyw typu rybie oko 198 stopni, obiektyw szerokokątny 0,63x, obiektyw makro 15x, zdalna migawka, instrukcja obsługi, ściereczka do czyszczenia, statyw i klips, za którego pomocą przymocujesz nakładkę do obiektywu swojego smartfona. Pamiętaj, że jakość zdjęć zależy od możliwości technicznych aparatu w Twoim urządzeniu i może różnić się od fotografii w ofercie. Kolor producenta: Black (czarny) Zalecamy zapoznanie się z instrukcją w języku polskim: KLIKNIJ TUTAJ Selfie bez ograniczeń! Zdalna migawka to idealne rozwiązanie do robienia selfie oraz ujęć ze statywu. Ten praktyczny gadżet umożliwia wykonywanie zdjęć z odległości bez konieczności korzystania z aplikacji. Dzięki funkcji Bluetooth pilot automatycznie łączy się z Twoim urządzeniem, zapewniając wygodne i bezproblemowe sparowanie. Odkryj nowe perspektywy! Niech Twoje zdjęcia staną się dziełami sztuki - wykorzystaj obiektywy, aby odkryć nowe możliwości i uwiecznić najpiękniejsze chwile! Teleobiektyw 18x - umożliwia przybliżenie odległych obiektów, idealny do fotografii sportowej, przyrodniczej i podróżniczej Obiektyw Fisheye - tworzy efekt rybiego oka, poszerzając obraz do 198 stopni Obiektyw szerokokątny 0,63x - szerszy kąt widzenia, idealny do krajobrazów, architektury i grupowych zdjęć Obiektyw makro 15x - umożliwia uwiecznienie najdrobniejszych detali z bliskiej odległości. Idealny do fotografii makro, takiej jak kwiaty, owady i detale produktów Uśmiech! Chwyć klips, wybierz soczewkę z efektem, przyczep ją do klipsa i pstyk, pstyk... Nic prostszego! Teraz możesz cieszyć się niezapomnianymi efektami wizualnymi i świetną zabawą!','','uniwersalne-obiektywy-soczewki-teleskop-apexel-18x-na-aparat-smartfona-ze-statywem-makro-15x','','','','Uniwersalne obiektywy / soczewki / teleskop Apexel 18X na aparat smartfona ze statywem, makro 15X','','','',''),(52043,1,1,'Selfie stick Apexel APL-D6 z pilotem Bluetooth Dla urządzeń o szerokości od 6 cm do 10 cm Zdobądź doskonałe ujęcia! Odkryj niezapomniane chwile i utrwal je na zawsze, dzięki niezwykłemu Apexel APL-D6. Ten gadżet pełni aż trzy funkcje - to nie tylko zwykły selfie stick, ale również gimbal oraz mały statyw, które zostały połączone w jedno urządzenie. Dzięki temu magicznemu trio każde spotkanie ze znajomymi, wycieczka czy rodzinne spotkanie staje się jeszcze bardziej wyjątkowe. Do zestawu dołączony został kabel USB oraz pilot. Długość statywu po rozłożeniu: 50 cm (teleskop rączka). Kolor producenta: Black (czarny) Poznaj moc fotografii! Gotowy na przygody? Naładuj Apexel i ruszaj w drogę! Dzięki baterii, która zapewnia aż 2 godziny działania, nie przegapisz żadnej chwili podczas podróży, spotkań czy wydarzeń rodzinnych. Niezależnie od tego, czy jesteś w trakcie odkrywania nowych miejsc, świętujesz specjalne okazje czy spędzasz czas z bliskimi APL-D6 jest Twoim towarzyszem, gotowym uchwycić każde niezapomniane wspomnienie. Precyzyjne ustawienie kąta Dostosuj kąt nachylenia idealnie do swoich potrzeb. Dzięki regulacji w zakresie 220 stopni możesz łatwo ustawić urządzenie w optymalnym kącie. Niezależnie od tego, czy chcesz zarejestrować pejzaż poziomo czy skierować kamerę w pionie, obrotowa głowica o 360 stopni pozwala na swobodne dostosowanie urządzenia. Bezprzewodowy pilot do fotografii Bezprzewodowy pilocik w zestawie to wygodne narzędzie do robienia zdjęć. Możesz go używać w trybie zdalnym lub bezpośrednio w uchwycie statywu. Dioda LED na pilocie informuje o jego działaniu. Kompatybilny z systemami iOS i Android, oferuje szeroki zakres zastosowań.','','selfie-stick-statyw-gimbal-apexel-apl-d6-na-telefon-z-pilotem-bluetooth-czarny','','','','Selfie stick / statyw / gimbal Apexel APL-D6 na telefon z pilotem Bluetooth, czarny','','','',''),(52083,1,1,'Kabel HDMI (żeński) - HDMI (męski) Ugreen adapter, 19 pin, 4k 60Hz, 1.4v, 10 Gbps HDMI (typ żeński) - HDMI (typ męski) Kabel dla doskonałej jakości obrazu Ugreen HDMI-HDMI to świetny sposób na przedłużenie przewodu HDMI bez utraty jakości przesyłanego obrazu. Zapewnia doskonałą jakość 4K 60Hz. Pozłacane wtyczki przewodu gwarantują bezpieczną i stabilną transmisję obrazu. Dane przesyłane przez kabel posiadają prędkość do 10 Gbps. *Żeby zapewnić obraz 4Kx2K 60Hz, całkowita długość przedłużacza i podłączonego do niego kabla nie powinna przekraczać 3 m.*Żeby zapewnić obraz 4Kx2K 30Hz, całkowita długość przedłużacza i podłączonego do niego kabla nie powinna przekraczać 5 m. Długość przewodu: 3 m Kolor producenta: Black (czarny) Solidne wykonanie dla bezpiecznej transmisji Ugreen HDMI-HDMI to wyjątkowo solidny przewód, wykonany z ocynkowanej miedzi i pozłacanych wtyczek. Zapewnia to bezpieczną i stabilną transmisję obrazu bez żadnych zakłóceń. Niezależnie od tego, czy potrzebujesz przewodu do konsoli, laptopa czy projektora z wejściem HDMI, przewód Ugreen na pewno Cię nie zawiedzie. Specyfikacja Ugreen HDMI-HDMI to przewód, który spełni wymagania nawet najbardziej wymagających użytkowników. Jego specyfikacja obejmuje standardy 4K 60Hz, Ethernet, HEC, ARC, audio, 32 kanały. Długość przewodu wynosi aż 3 m, czyli tyle ile powinien mieć wygodny i funkcjonalny adapter, który daje Ci szeroki wachlarz możliwości. Standard HDMI: 1.4vObsługiwane rozdzielczości: 4K x 2K 60Hz, 3840x2160, 2560x1600, 2560x1440, 1920x1200, 1080pFunkcje: Ethernet Channel, Audio Return Channel (ARC), 3DPrzepustowość: 10,2 GbpsRdzeń: 30 AWG','','kabel-przejsciowka-hdmi-zenski-hdmi-meski-ugreen-adapter-19-pin-4k-60hz-14v-10-gbps-2-m-czarny','','','','Kabel przejściówka HDMI (żeński) - HDMI (męski) Ugreen adapter, 19 pin, 4k 60Hz, 1.4v, 10 Gbps, 2 m, czarny','','','',''),(52086,1,1,'Dwukierunkowy kabel Ugreen przewód HDMI - DVI 24 1 pin FHD 60Hz HDMI DVI Oglądaj filmy w najlepszej jakości! Czy też czujesz frustrację, gdy oglądasz filmy na swoim telewizorze lub monitorze, a obraz jest rozmazany, a dźwięk szumi? Rozwiązaniem jest kabel HDMIDVI Ugreen! Dzięki niemu będziesz mógł cieszyć się bardzo dobrą jakością obrazu FHD, 60Hz i dźwięku, a wszystko to bez żadnych zakłóceń czy zniekształceń. Doskonale nadaje się do podłączenia telewizora, odtwarzacza DVD, Blue-Ray czy projektora. Długość przewodu: 1,5m Kolor producenta: Black (czarny) Technologia OFC - doskonała jakość sygnału na duże odległości W kablu Ugreen zastosowano technologię OFC, co oznacza, że rdzeń przewodu został wykonany z miedzi beztlenowej. To przekłada się na lepszy transfer danych nawet na większe odległości. Co więcej, sygnał wideo i audio przesyłany jest bez kompresji, co gwarantuje zachowanie najwyższej jakości obrazu i dźwięku. Pozłacana wtyczka - trwałość i niezawodność Pozłacane wtyczki w kablu Ugreen to gwarancja trwałości i niezawodności. Dzięki temu unikniesz problemów z przerywaniami sygnału lub niską jakością obrazu i dźwięku. Pozłacana wtyczka jest odporna na korozję, co zapewnia długą żywotność kabla. Idealny do podłączenia urządzeń wyświetlających obraz - i nie tylko! Przewód Ugreen doskonale nadaje się do podłączenia różnych urządzeń wyświetlających obraz, takich jak telewizory, monitory czy projektory. Jednak to nie wszystko - może być też wykorzystany do przesyłania sygnału audio z komputera lub laptopa do głośników lub zestawu kina domowego. Długość przewodu pozwala na swobodne ustawienie urządzeń w dowolnym miejscu. Specyfikacja: Marka: Ugreen Długość przewodu: 1,5m Rdzeń przewodu: cynkowana miedź Pozłacanie wtyczki Przekrój: 30AWG Materiał: PVC Rozdzielczość: FHD 60Hz max Ekranowany folią i oplotem','','dwukierunkowy-kabel-hdmi-dvi-ugreen-24-1-pin-fhd-60hz-15m-czarny','','','','Dwukierunkowy kabel HDMI - DVI Ugreen 24 + 1 pin FHD 60Hz, 1,5m, czarny','','','',''),(52223,1,1,'Ładowarka samochodowa BMW M Edition port USB-C USB-A Precyzyjnie zaprojektowana Ładowarka BMW M Edition to wyjątkowe akcesorium, gwarantujące szybkie i bezpieczne ładowanie dwóch urządzeń jednocześnie. Ta kompaktowa i praktyczna ładowarka została starannie zaprojektowana, mając na uwadze wygodę użytkowania oraz trwałość. Wtyczka ładowarki została precyzyjnie wykonana, aby wytrzymać przypadkowe upadki i wstrząsy. Jej kompaktowe rozmiary sprawiają, że bezproblemowo można przechowywać ją w samochodzie, nie zajmując dużo miejsca. Kolor producenta: Black (czarna) Dostosowany do każdego urządzenia BMW M Edition została wyposażona w dwa porty do ładowania, dzięki którym można ładować urządzenia zarówno za pomocą standardowego USB-A, obsługującego szybkie ładowanie QuickCharge 3.0, jak i portu USB-C z technologią PowerDelivery. Dzięki temu możesz korzystać z różnych kabli i ładować każde swoje urządzenie o różnych wymaganiach ładowania. Specyfikacja: USB1-A: 3.6-6.5V3A, 6.5-9V2A, 9-12V1.5A USB2-C (PD): 5V3A, 9V2A, 12V1.5A Napięcie wejściowe: 12V-24V Moc wyjściowa USB1 USB2: 36W M Power Ładowarka BMW z serii M Edition to niezawodne i wszechstronne urządzenie, które pozwoli Ci bezproblemowo ładować Twoje urządzenia mobilne podczas podróży samochodem. Dzięki swojej wysokiej wydajności, elastycznym opcjom ładowania oraz solidnej konstrukcji, ta ładowarka spełni Twoje oczekiwania pod względem szybkości, efektywności i niezawodności.','','ladowarka-samochodowa-bmw-m-edition-usb-c-usb-a-pd-qc30-czarna','','','','Ładowarka samochodowa BMW M Edition USB-C, USB-A, PD, QC3.0, czarna','','','',''),(52439,1,1,'Uchwyt Tech-Protect magnetic MagSafe Dashboard Car Mount Z ładowaniem indukcyjnym Wszystko w zasięgu ręki Elegancka i stylowa ładowarka samochodowa Tech-Protect to doskonałe rozwiązanie dla osób ceniących wygodę i bezpieczeństwo podczas jazdy. Dzięki magnetycznemu mocowaniu i funkcji bezprzewodowego ładowania, korzystanie z tego produktu jest niezwykle proste i wygodne. Uchwyt montowany do kratki nawiewu został specjalnie zaprojektowany z myślą o urządzeniach i akcesoriach z funkcją MagSafe. Mocne magnesy zapewniają stabilne i bezpieczne trzymanie urządzenia. Szybkie ładowanie o mocy 15W to kolejny atut tej ładowarki, umożliwiający szybkie doładowanie energii nawet podczas krótkiej podróży samochodem. Kolor producenta: Black (czarny) W zestawie znajduje się kabel USB-C do USB-C o długości 100 cm. 360 możliwości Obracana głowica o 360 stopni zapewnia pełen zakres obrotu urządzenia, umożliwiając użytkownikowi swobodne ustawienie telefonu pod dowolnym kątem. Dzięki temu użytkownik zyskuje większą kontrolę nad swoim smartfonem i może dostosować jego pozycję do własnych preferencji. Zapomnij o problemach Prosty i szybki montaż jest możliwy dzięki dobrze wykonanemu uchwytowi do kratki wentylacyjnej. Dzięki nim bez problemu zainstalujesz V4 w dowolnym miejscu na kratce nawiewu. Dodatkowo V4 wyposażony jest w oświetlenie wokół uchwytu, co zapewnia wygodę korzystania z telefonu nawet w ciemniejszych warunkach.','','uchwyt-na-telefon-z-ladowaniem-indukcyjnym-tech-protect-mm15w-v4-magnetic-magsafe-czarne','','','','Uchwyt na telefon z ładowaniem indukcyjnym Tech-Protect MM15W-V4 magnetic MagSafe, czarne','','','',''),(52441,1,1,'Spigen Kuel QS24 CD Slot Car Mount UniwersalnyMontaż do slotu CD o wysokości szczeliny między 4-10mm Magnetyczny uchwyt samochodowy Uniwersalny uchwyt samochodowy marki Spigen z serii Kuel, który pozwala na montaż w slocie płyt CD o wysokości wejścia między 4 a 10 mm. Kompatybilny z wszelkimi smartfonami, dzięki magnetycznemu mocowaniu za pomocą dołączonych blaszek, ktore można nakleić na telefonie lub jego pokrowcu, co jest zdecydowanie lepszą opcją w przypadku smartfonów wyposażonych w bezprzewodowe ładowanie. *Przedmiotem sprzedaży jest uchwyt z blaszkami i osłonkami, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Black Magnesy neodymowe 4 silne magnesy neodymowe oferują wyjątkową stabilność oraz solidną przyczepność urządzenia podczas jazdy. Dzięki temu zamontujesz jak i zdejmiesz swój smartfon z uchwytu jednym, prostym ruchem. Dla większości smartfonów Szeroka kompatybilność czyni ten uchwyt niezwykle uniwersalnym - dzięki magnetycznemu mocowaniu z zestawem blaszek kazdy telefon będzie współpracował z tym uchwytem. Wystarczy nakleić blaszkę na etui lub telefon i gotowe. Należy pamiętać, że: w przypadku smartfonów ładowanych bezprzewodowo zaleca się naklejenie blaszki na pokrowiec telefonu, nie na sam telefon w przypadku naklejania blaszki na telefon zaleca się naklejenie jej na dołączoną do zestawu folię ochronną o dopasowanym kształcie do blaszki, która ochroni plecki telefonu od warstwy klejącej 3M i ułatwia ewentualny demontaż blaszki w opakowaniu załączono do wyboru 2 blaszki o różnych kształtach z zestawem folii zabezpieczających: prostokątnym oraz okrągłym Montaż w slocie płyt CD o szczelinie 4-10mm Uchwyt przeznaczony jest do montażu w slocie odtwarzacza płyt CD o wysokości szczeliny między 4 a 10 mm. Ten rodzaj instalacji zajmuje bardzo niewielką przestrzeń, nie wpływa na widoczność w trakcie jazdy i nie blokuje nawiewów. Uchwyt jest łatwy w obsłudze i dobrze komponuje się z wnętrzem samochodu. Klasyczny czarny kolor doskonale pasuje do każdego pojazdu, a charakterystyczne akcenty o karbonowym wzorze dodają stylowego wyglądu. Uchwyt posiada przycisk blokady, który należy przytrzymać wciśnięty podczas wkładania uchwytu do slotu CD, a następnie go puścić, by uaktywnić blokadę i gotowe. Odpowiedni kąt widzenia Nowoczesna budowa zapewnia najwyższy komfort użytkowania i umożliwia swobodne dopasowanie ułożenia uchwytu do indywidulanych potrzeb. Ruchoma głowica 360 - pozwala na swobodny obrót i dobór orientacji urządzenia. Wygodna podróż Uchwyt dzięki swej minimalistycznej lecz funkcjonalnej budowie świetnie sprawdzi się w każdej podróży, czyniąc ją bardziej wygodną i przyjemną. Jego prosta obsługa z pewnością pozwoli Ci dostosować ułożenie smartfona odpowiednio do własnych potrzeb. Zawartość opakowania W pudełku znajdziesz: Uchwyt Spigen Kuel QS24 1x blaszka prostokątna 1x blaszka okrągła 1x folia zabezpieczająca prostokątna 1x folia zabezpieczająca okrągła Instrukcja obsługi','','uchwyt-samochodowy-spigen-kuel-qs24-magnetyczny-do-slotu-cd-czarny','','','','Uchwyt samochodowy Spigen Kuel QS24 magnetyczny do slotu CD, czarny','','','',''),(52445,1,1,'Tech-Protect L03S Wireless Selfie Stick Tripod Bluetooth Dla smartfonów z Bluetooth Dla perfekcyjnych ujęć Tech-Protect L03S to innowacyjny selfie stick, który spełni oczekiwania nawet najbardziej wymagających fotografów i vlogerów. Jego niezwykła kombinacja wytrzymałości, stabilności i wszechstronności zapewnia niezawodne ujęcia w każdej sytuacji. Teraz możesz zabrać go ze sobą wszędzie, wystarczy jedno przekręcenie, a już możesz zaczynać swoją sesję selfie. Ale to nie wszystko! Tech-Protect L03S to także przenośny statyw, który daje Ci pełną swobodę kreatywności. Maksymalna szerokość ramion uchwytu: 86mm Kolor producenta: Black (czarny) Regulowana wysokość Dzięki teleskopowej konstrukcji, wysokość selfie sticka Tech-Protect L03S możesz swobodnie dostosować do swoich potrzeb - nawet do imponujących 148 cm! Po złożeniu jest niewielki i poręczny, zajmując zaledwie 30 cm. Niezależnie od tego, czy preferujesz pozycję pionową czy poziomą, ruchoma głowica o kącie 180 umożliwia precyzyjne ustawienie smartfona. Dodatkowo, obrotowy uchwyt o pełnym zakresie 360 trzyma telefon pewnie i mocno, zapewniając Ci możliwość robienia zdjęć pod dowolnym kątem. A ergonomiczny design sprawia, że selfie stick L03S idealnie leży w Twojej dłoni. Coś dla vlogerów Dzięki pilotowi Bluetooth, który jest częścią tego zestawu, możesz zdalnie sterować swoim smartfonem z odległości do 12 metrów. Nie musisz się martwić o zamieszanie z przewodami czy trudnością w uchwyceniu idealnego kadru. Teraz możesz zająć idealną pozycję, ustawić się w odpowiedniej odległości i wykorzystać pilot Bluetooth do zdalnego robienia zdjęć. Dodatkowo pilot Bluetooth pozwala na zdalne uruchamianie i zatrzymywanie nagrywania wideo, co czyni go idealnym narzędziem dla vlogerów. Teraz możesz skupić się na swoim wystąpieniu lub aktywności, a jednocześnie mieć pełną kontrolę nad rejestrowanym materiałem. Uchwyt posiada wbudowane miejsce na pilot Bluetooth. Niezawodny partner na każdą okazję Tech-Protect L03S wyróżnia się nie tylko swoją wytrzymałością, ale także lekkością dzięki aluminiowej konstrukcji. Łapy uchwytu i nóżki są wyposażone w antypoślizgowe silikonowe podkładki, które gwarantują pewne trzymanie na każdej powierzchni. Teraz możesz robić zdjęcia bez obaw, niezależnie od tego, gdzie się znajdujesz. ZESTAW ZAWIERA: Selfie Stick Tech-Protect L03S Pilot Bluetooth* - Praktyczne sterowanie z odległości do 12 metrów. Torba transportowa *Pilot zasilany jest na baterię CR2032 (jedna znajduje się w zestawie).','','uchwyt-kijek-statyw-tech-protect-l03s-wireless-selfie-stick-tripod-bluetooth-czarny','','','','Uchwyt, kijek, statyw Tech-Protect L03S Wireless Selfie Stick Tripod Bluetooth, czarny','','','',''),(52513,1,1,'Kabel HDMI 4k 60Hz Ugreen Smart Digital Life, 4k 60Hz, 3 m HDMI - HDMI Masz ochotę na dobry film? Nic tak nie podbije Twoich wrażeń podczas wieczornego seansu filmowego jak najlepsza jakość obrazu i dźwięku. W tym celu powinieneś zainwestować w wysokiej jakości kabel HDMI. Jednym z najlepszych rozwiązań jest przewód od Ugreen. To właśnie dzięki niemu filmy, czy gry, będą wyglądać jak prawdziwe dzieła sztuki, a dźwięk będzie tak czysty, że usłyszysz nawet najdrobniejsze detale. Przewód Ugreen HDMI - HDMI 2.0 to świetny sposób na podłączenie komputera, konsoli lub innego urządzenia do telewizora, projektora lub monitora. Zapewnia doskonałą jakość obrazu 4K 60Hz. Długość przewodu: 3 m Kolor producenta: Black (czarny) Delektuj się jakością obrazu Jasne i żywe kolory oraz wyjątkowo czysty dźwięk to tylko niektóre z zalet przewodu Ugreen. Wersja HDMI 2.0 i rozdzielczość 4K 60Hz daje gwarancję tego, że każdy detal zostanie odwzorowany w sposób perfekcyjny. Przewód został zaprojektowany tak, aby doskonale pasował do różnych urządzeń - od telewizora, przez odtwarzacz DVD i Blue-Ray, aż po projektor. Nylonowa trwałość na wieki Przewód Ugreen to doskonały wybór dla osób, które cenią sobie najlepsze osiągi. Został wykonany z najlepszej jakości beztlenowej miedzi OFC, co gwarantuje bezstratny przesył sygnału nawet na duże odległości. Dzięki niemu możesz cieszyć się bezkompresyjnym przesyłaniem dźwięku i obrazu w najwyższej jakości. Długość przewodu pozwoli Ci na swobodne korzystanie z urządzeń nawet z większej odległości. Materiał: aluminum nylon Wersja HDMI: 2.0 Rozdzielczość: 4K 60Hz Rozdzielczość maksymalna: 4K UHD (3840 x 2160 px) Rodzaj złącza: HDMI-A (męski)','','kabel-nylonowy-ugreen-przewod-hdmi-hdmi-4k-60hz-3-m-czarny','','','','Kabel nylonowy Ugreen przewód HDMI - HDMI, 4k / 60Hz, 3 m, czarny','','','',''),(52658,1,1,'Kabel 