wnikowi wygodne ustawianie odpowiedniej częstotliwości, dzięki której dźwięk z urządzeń mobilnych i kart pamięci jest przesyłany na głośniki samochodowe za pośrednictwem wbudowanego radia. Po drugie, wyświetlacz LED służy do monitorowania aktualnego stanu naładowania akumulatora. Bezpieczeństwo Transmiter posiada wbudowany woltomierz, który informuje Cię o aktualnym stanie samochodu. Zanim Twój samochód zostanie uruchomiony, napięcie między 12.8V-12.2V jest normalne. Po uruchomieniu samochodu prawidłowe napięcie wynosi między 14,8V-13,4V. Gdy natomiast napięcie spadnie poniżej 12V oznacza to, że powinieneś sprawdzić swój samochód. Co więcej produkt przeszedł szereg testów bezpieczeństwa i zdobył liczne certyfikaty.','','ladowarka-samochodowa-transmiter-bluetooth-fm-baseus-s-13-2x-usb-a-usb-c-czarny','','','','Ładowarka samochodowa + Transmiter bluetooth FM Baseus S-13 2x USB-A, USB-C, czarny','','','',''),(53814,1,1,'Baseus BSBA-02 (Overseas Edition) Dla urządzeń audio z portem Mini Jack bluetooth Wielofunkcyjny transmiter audio Transmiter marki Baseus umożliwia połączenie telefonu, na przykład z radiem samochodowym, poprzez połączenie Bluetooth AUX. Dzięki wbudowanej technologii Bluetooth 5.0 i złączu AUX mini jack 3,5 mm, urządzenie umożliwia bezprzewodową transformację urządzeń przewodowych na bezprzewodowe. Transmiter wyposażony jest w panel do obsługi rozmów oraz regulacji głośności, co umożliwia wygodne prowadzenie rozmów podczas podróży. Kolor producenta: Black Rozmawiaj jak chcesz Baesus Overseas Edition posiada wbudowany mikrofon, który sprawia, że służy zarówno jako transmiter, jak i zestaw głośnomówiący, zapewniając pełną funkcjonalność i wygodę użytkowania. Szerokie zastosowanie Wznieś na wyższy poziom swoje głośniki samochodowe, zmieniając je w bezprzewodowy odtwarzacz muzyki. Wystarczy podłączyć adapter Baseus do wejścia Audio AUX w Twoim pojeździe. Następnie sparuj np. swój tablet lub smartfon z transmiterem za pomocą Bluetooth, by cieszyć się przesyłaną muzyką i wygodnym jej sterowaniem z zachowaniem stabilnego połączenia dźwięku nawet do 10m odległości. W podobny sposób możesz wykorzystać swoje domowe lub biurowe głośniki. To tylko niektóre przykłady jej wykorzystania. Najnowszy układ elektroniczny zapewniają wysoką jakość przesyłu dźwięku. Wbudowany akumulator Transmiter marki Baseus działa przez około 10 godzin na jednym naładowaniu, co zapewnia długotrwałe użytkowanie bez konieczności częstego ładowania. Dzięki temu możesz cieszyć się bezprzewodowym połączeniem między swoim telefonem a radiem samochodowym przez cały dzień bez obaw o wyczerpanie baterii.','','transmiter-bluetooth-aux-35mm-baseus-bsba-02-overseas-edition-czarny','','','','Transmiter Bluetooth AUX 3.5mm Baseus BSBA-02 (Overseas Edition), czarny','','','',''),(54298,1,1,'Kieszeń na dysk Ugreen obudowa dysku twardego Na dysk M.2 B-Key SATA 3.0 5Gbps Twoje Dane, Twoja Moc Odkryj niezawodność kieszeni Ugreen CM400, która zabezpieczy Twój dysk M.2 B-Key SATA 3.0 5Gbps w eleganckim szarym wydaniu. Możesz bez obaw przechowywać do 2 TB danych, ciesząc się prostą instalacją i wysoką wydajnością transferu. Kolor producenta: Grey (szary) Rozmiar dopasowany do Twoich potrzeb Kieszeń Ugreen jest gotowa obsłużyć dyski o różnych rozmiarach: 2230, 2242, 2260 oraz 2280. To elastyczność, która pozwoli Ci przechowywać zarówno zdjęcia, jak i filmy, bez obaw o brak miejsca. Szybki Transfer, Stabilność, Wygoda Za sprawą inteligentnego chipu ASM2362, kieszeń wspiera dyski B-Key NGFF SATA, zapewniając prędkość transferu danych do 5Gbps. W zestawie znajdziesz kabel USB Typ C, który gwarantuje nie tylko szybkość, ale także stabilność transmisji. Prosta instalacja bez narzędzi Odkryj, jak prosta może być instalacja. Dzięki kieszeni Ugreen nie potrzebujesz żadnych narzędzi. Włóż swój dysk SSD M.2, zabezpiecz go klipsem, zamknij kieszeń, i gotowe! Teraz możesz cieszyć się bezproblemowym przechowywaniem danych. Kieszeń Ugreen to nie tylko funkcjonalność, ale także styl. Wykonana z solidnego aluminium, przyjemnie leży w dłoni i skutecznie odprowadza ciepło. Dioda LED wbudowana w obudowę daje znać, kiedy dysk pracuje. Dzięki tej kieszeni, ochrona i wydajność Twojego dysku idą w parze z elegancją i komfortem. Port: USB 3.2 Gen 1 (SuperSpeed USB 5 Gbps) (USB 3.0, USB 3.1 Gen 1)Interfejs dysku: SSD M.2, B-Key, NGFF SATARozmiar dysku: 2230, 2242, 2260, 2280Prędkość przesyłania danych: do 5GbpsPojemność: do 2TBW zestawie: kabel USB USB Typ C o długości 0,5 mMateriał: aluminiumWymiary: 119 x 37 x 12 mm','','kieszen-na-dysk-ugreen-obudowa-dysku-twardego-m2-b-key-sata-30-5gbps-kabel-usb-typ-c-szara','','','','Kieszeń na dysk Ugreen / obudowa dysku twardego M.2 B-Key SATA 3.0 5Gbps + kabel USB Typ C, szara','','','',''),(54305,1,1,'Spigen DuraPro Armor Band Apple Watch 11 (46 mm)Apple Watch 10 (46 mm)Apple Watch Ultra 3 2 1 (49 mm)Apple Watch 9 8 7 (45 mm)Apple Watch SE 3 SE 2022 SE 6 5 4 (44 mm)Apple Watch 3 2 1 (42 mm) Hybrydowy pasek do smartwatcha Oryginalny pasek marki Spigen z serii DuraPro Armor o wyróżniającym się wyglądzie, wykonany z wytrzymałego TPU oraz nylonu, posiadający metalowe złączki oraz klamrę ze stopu cynku. Trn mocny pasek o solidnej i charakterystycznej budowie zadba o wygodę noszenia smartwatcha, a do tego odważny design doda śmiałego i wyrazistego stylu urozmaicając prezencję zegarka. *Przedmiotem sprzedaży jest sam pasek, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Black - czarny (dominujący kolor paska: czarny, złączki i klamra w kolorystyce tytanowej dopasowanej do koperty Apple Watch Ultra oraz pomarańczowy akcent złączki) Dla obwodu nadgarstka między: 14 - 21,5 cm Długość paska: 24,13 cm Szerokość paska: 2,5 cm Zdecydowany i wyróżniający się design Spigen DuraPro Armor to kontrastowy pasek dla Twojego smartwatcha. Jego wyrazisty charakter zdecydowanie wyróżnia się spośród tradycyjnych bransolet, oferując przy tym ponadprzeciętny wygląd jak i ogromną wygodę w jego użytkowaniu. Design metalowych złączek ze stylowymi akcentami dodatkowo ozdabia końcówki paska, co świetnie komponuje się z obudową zegarka, urozmaicając jego wygląd. Zapinanie na klasyczne dziurki Zapinanie na klasyczną klamrę typu sprzączka z zakresem dziurek oferuje łatwą regulację długości, pozwalając dostosować go do obwodu nadgarstka w zakresie od 140 mm do 215 mm. Sprzączkę wykonano z mocnego stopu cynku co czyni ją wysoce wytrzymałą na warunki codziennego użytkowania. Wygoda i funkcjonalność na co dzień Pasek jest niezwykle wygodny i funkcjonalny i nie przeszkadza w codziennych aktywnościach. Wykorzystane do jego produkcji materiały charakteryzują się lekkością i wysoką trwałością. Solidne i giętkie TPU wykończone zostało wytrzymałym splotem z nylonu, który dodaje drobnego, stylowego wzorku dla oka, a także większej trwałości samemu paskowi. Łatwy montaż Pasek bardzo łatwo się zakłada jak i zdejmuje, nie potrzeba do tego żadnych dodatkowych narzędzi. Wystarczy umieścić końcówki w odpowiednie miejsca koperty smartwatcha i gotowe.','','pasek-spigen-durapro-armor-band-do-apple-watch-49-46-45-44-mm-czarno-bezowy','','','','Pasek Spigen DuraPro Armor Band do Apple Watch 49/46/45/44 mm, czarno-beżowy','','','',''),(54528,1,1,'Ugreen ścienny podstawka do ładowania telefonu Dla smartfonów Niezawodność i ochrona w jednym! Podstawka ścienna Ugreen to stabilne akcesorium ułatwiający proces ładowania. Dzięki antypoślizgowym, silikonowym elementom, chroni Twój telefon, zapobiegając przypadkowemu upadkowi i uszkodzeniom. Wykonana z Aluminium gwarantuje wytrzymałość i długotrwałe użytkowanie. Rozmiary podstawki: 12 x 7 cm Kolor producenta: White (biały) Ładuj bezpiecznie! Ten estetyczny uchwyt ścienny został stworzony po to, byś mógł cieszyć się szybkim i wygodnym dostępem do swojego smartfona w dowolnym momencie. Czy to w sypialni, kuchni, przedpokoju czy łazience, uchwyt umożliwia swobodne korzystanie z urządzenia podczas gotowania, chwil relaksu czy codziennej higieny. Teraz możesz swobodnie przeglądać ulubione programy czy komunikować się, nie trzymając telefonu w dłoniach.Ten uchwyt to nie tylko estetyka, to także wsparcie podczas ładowania urządzenia. Gdy gniazdko elektryczne jest nieco dalej, uchwyt umożliwia bezproblemowe ładowanie poprzez krótki kabel. Dodatkowo, miękkie silikonowe wkładki chronią telefon przed otarciami i zarysowaniami, zachowując jego nieskazitelny wygląd. Organizer na codzień Nie tylko smartfon może znaleźć swoje miejsce na tym uchwycie. Jego funkcjonalność sięga dalej staje się on praktycznym organizatorem, na którym zawiesisz torebkę, klucze, słuchawki czy kabel ładowarki. Dzięki dodatkowej przegródce, możesz również przechowywać listy lub inne drobne przedmioty. Łatwy montaż Uchwyt na telefon jest też bardzo prosty w montażu dzięki specjalnej taśmie samoprzylepnej. Nie musisz wiercić otworów i dziurawić ścian. Do zamocowania wystarczy zdjęcie ochronnego papieru i dociśnięcie elementu do powierzchni.','','uchwyt-scienny-do-telefonu-podstawka-do-ladowania-ugreen-30394-na-telefon-tablet-bialy','','','','Uchwyt ścienny do telefonu, podstawka do ładowania,  Ugreen 30394 na telefon / tablet, biały','','','',''),(54573,1,1,'Zewnętrzna karta sieciowa micro USB 100Mbps do Chromecast micro USB USB-A RJ45 Stabilność po Kablu dla Twojego Chromecasta Przedstawiamy Ci praktyczny i innowacyjny sposób na wyeliminowanie irytujących przerw w połączeniu z Chromecastem. Zewnętrzna karta sieciowa Micro USB 100Mbps to niezawodne narzędzie, które pozwoli Ci cieszyć się płynnym streamowaniem i rozgrywką online bez zbędnych komplikacji. Kolor producenta: Black (czarny) Stabilne Połączenie, zero kompromisów Czy frustruje Cię nagłe zerwanie połączenia w trakcie oglądania ulubionego filmu lub emocjonującej rozgrywki? Zewnętrzna karta sieciowa jest odpowiedzią na te problemy. Dzięki możliwości połączenia Chromecasta przewodowo z internetem, możesz zapomnieć o utracie sygnału w najmniej odpowiednich momentach.Nie ma znaczenia, czy masz wolne łącze czy superszybki internet - ta karta sieciowa automatycznie dostosowuje się do prędkości Twojego łącza, zapewniając optymalny transfer danych. Bez względu na to, czy oglądasz wideo w jakości 4K czy też przeglądasz strony internetowe, możesz być pewien, że doświadczysz płynności bez długich opóźnień. Pełna kontrola Nie musisz być technicznym ekspertem, aby cieszyć się korzyściami tego gadżetu. Zasada działania plugplay sprawia, że nie potrzebujesz żadnych dodatkowych programów czy skomplikowanych konfiguracji. Wystarczy wpiąć adapter do portu micro USB i cieszyć się bezproblemowym połączeniem.Adapter sieciowy Ugreen ma kompaktowe wymiary, co czyni go idealnym do noszenia w podróży czy do użytku w domu. Wykonany z trwałych materiałów, jest praktycznie niezniszczalny, co zapewnia długotrwałe i niezawodne użytkowanie. Specyfikacja:Standadrd USB: 2.0 480MbpsZewnętrzna karta sieciowa: 10100MbpsZasilanie: 5V1A 5V2ADługość przewodu: 1 mWymiary: 61,5 mm x 26 mm x 18 mm','','zewnetrzna-karta-sieciowa-ugreen-micro-usb-100mbps-do-chromecast-1m-czarna','','','','Zewnętrzna karta sieciowa Ugreen micro USB 100Mbps do Chromecast, 1m, czarna','','','',''),(54714,1,1,'Baseus T Shaped S-16 Overseas Edition Uniwersalna (Bluetooth 5.0 2x USB-A) Wysoka jakość wykonania Wyjątkowo szybka ładowarka samochodowa z wbudowanym Transmiterem FM Bluetooth. Transmiter służy do przesyłania dźwięków z urządzeń mobilnych wyposażonych w bluetooth, pendriveów oraz kart pamięci z muzyką na głośniki samochodowe z wykorzystaniem wbudowanego radia - przy pomocy fal radiowych. Tym razem Baseus poszedł o krok dalej i rozdzielił funkcję transmitera i ładowarki, dzięki czemu bazę możemy zamontować w dowolnym miejscu (dzięki dołączonej taśmie dwustronnej). Urządzenie zostało wykonane z wysokiej jakości PC. Kabel typu sprężynka w oplocie z TPE. Kolor producenta: Black (czarna) Szybkie ładowanie Urządzenie zostało wyposażone w dwa porty USB-A, układ sterujący został stworzony w sposób, by odczytywać wszystkie telefony i tablety, bezpiecznie dopasowując prąd i ładując je bez uszkodzenia. Wejście: DC 12V-24V Wyjście: USB-A-1:5V2.1A USB-A 2: 5V1A Porty USB: 5V3,1A (łącznie) Parametry: Częstotliwość transmisji: 87,5-108 MHz Odległość transmisji FM: 5 m Odległość Bluetooth: 10 M Wersja bluetooth: 5.0 Mikrofon HD Kompatybilność: uniwersalny (AndroidiOs) zapalniczki 12-24V Format audio: MP3 WAV FLAC APE WMA Wyświetlacz LED Wbudowany wyświetlacz pozwala na monitorowanie stanu naładowania urządzenia oraz konfigurację częstotliwości. Dzięki podświetleniu ładowarka będzie widoczna po zmroku, tak by łatwo można było ją znaleźć. Urządzenie została wyposażone w panel sterujący głośnością, częstotliwością FM oraz odbieraniem i rozłączaniem połączeń. Nadajnik FM Bluetooth zapewni Ci funkcję głośnomówiącą oraz bezpieczniejszą jazdę - wystarczy jedno kliknięcie, aby odebrać połączenie. Co więcej, wbudowany mikrofon HD zapewni wyraźną rozmowę, dzięki technologii eliminacji echa oraz tłumienia szumów. Jedno kliknięcie wystarczy, by odebrać połączenie. Bezpieczeństwo Transmiter posiada wbudowany woltomierz, który informuje Cię o aktualnym stanie samochodu. Napięcie między 12.8v-12.2v - normalne przed uruchomieniem samochodu Napięcie między 14,8v-13,4v - normalne podczas uruchomienia samochodu Napięcie między poniżej 12v - powinieneś sprawdzić swój samochód Co więcej produkt przeszedł szereg testów bezpieczeństwa i zdobył liczne certyfikaty. Jak dostosować częstotliwość? Znajdź częstotliwość FM na której nie słychać szumów. Włóż transmiter do zapalniczki samochodowej. Ustaw częstotliwość nadajnika na tę samą częstotliwość FM co w radiu samochodowym. (w tym celu przytrzymaj przez 2 sekundy zieloną słuchawkę po czym strzałkami lewo-prawo dopasuj częstotliwość) Po połączeniu radio będzie ciche bez żadnych szumów. (Zmień częstotliwość jeśli cokolwiek słyszysz). Podłącz dysk z muzyką lub sparuj nadajnik Bluetooth FM z urządzeniem cyfrowym, aby cieszyć się odtwarzaniem muzyki lub rozmową bez użycia rąk. Dla posiadacz radia z wejściem AUX możliwe jest podłączenie transmitera poprzez dołączony do zestawu kabel. Dzięki temu możemy pominąć powyższe punkty 3 i 4 i cieszyć się czystszym dźwiękiem w głośnikach samochodowych. *Unikaj częstotliwości zbliżonej do lokalnej stacji radiowej ponieważ może ona znacznie pogarszać jakość transmisji sygnału.','','ladowarka-samochodowa-transmiter-fm-baseus-s-16-overseas-edition-2x-usb-a-czarna','','','','Ładowarka samochodowa + Transmiter FM Baseus S-16 Overseas edition 2x USB-A, czarna','','','',''),(54721,1,1,'Uchwyt Baseus UltraControl Lite Series z przyssawką Dla telefonów o przekątnej od 5.4 do 7.2 Jednoręki bandyta Ten kompaktowy uchwyt na telefon montowany na deskę rozdzielczą to idealne rozwiązanie dla osób, które chcą bezpiecznie korzystać z nawigacji w samochodzie. Dzięki długiemu ramieniu i przegubowi kulowemu możesz idealnie dopasować uchwyt do swoich potrzeb, zapewniając sobie maksymalną widoczność drogi. Szczęki uchwytu pracują w zakresie od 5.4 do 7.2, dzięki czemu pomieści on niemal każdy smartfon dostępny na rynku. Kolor producenta: Black (czarny) Minimalistyczny design Uchwyt Baseus UltraControl Lite Series to idealny wybór dla osób, które szukają stylowego i funkcjonalnego akcesorium do swojego samochodu. Uchwyt charakteryzuje się minimalistyczną, lecz niecodzienną budową, która idealnie pasuje do nowoczesnych wnętrz. Dzięki kompaktowym wymiarom można go łatwo przenosić w każdej torebce czy plecaku. Dodatkowo uchwyt posiada wycięcie na kabel, który umożliwia podłączenie ładowarki nawet w trakcie jazdy. Łatwa instalacja Uchwyt na telefon z bezpieczną i stabilną przyssawką to łatwe w instalacji akcesorium, które zapewni Ci bezpieczeństwo i komfort podczas jazdy. Żelowa przyssawka doskonale przylega do kokpitu, zapewniając stabilne mocowanie uchwytu. Dzięki temu telefon nie będzie się przesuwał ani przewracał, nawet podczas gwałtownych manewrów. Elementy uchwytu zostały wykonane z bezpiecznego w użyciu silikonu, który nie uszkodzi obudowy telefonu. Uchwyt jak i przyssawka są wielokrotnego użytku, dlatego wystarczy przemyć przyssawkę pod bieżącą wodą i gotowe! Możesz przymocować uchwyt w innym miejscu lub w nowym samochodzie.','','uchwyt-samochodowy-na-telefon-baseus-ultracontrol-lite-series-na-kokpit-czarny','','','','Uchwyt samochodowy na telefon Baseus UltraControl Lite Series na kokpit, czarny','','','',''),(54756,1,1,'Wielofunkcyjny HUB Ugreen 7w1 Urządzenia z wejściem USB-A Jeden do wszystkiego! Hub cenionej marki Ugreen to produkt najwyższej jakości, który umożliwia efektywne ładowanie aż siedmiu urządzeń jednocześnie, korzystając z jednego gniazdka sieciowego. Jego kompaktowy design pozwala na łatwe zabranie go w podróż, a wykonanie z wysokiej jakości stopu aluminium gwarantuje trwałość przy zachowaniu niskiej wagi. Dzięki zastosowanej technologii Power Delivery, możesz błyskawicznie naładować swoje urządzenia! Kolor producenta: Grey (szary) Zawsze z Tobą To kompaktowe urządzenie o niewielkich rozmiarach, które bez trudu zmieścisz w torbie na laptopa, sprawiając, że jest idealne do zabrania w podróż. Jego praktyczny design umożliwia wygodne korzystanie z wielu urządzeń jednocześnie, a także znacząco oszczędza miejsce. Dzięki niemu możesz cieszyć się pełną funkcjonalnością i komfortem, niezależnie od miejsca, w którym się znajdujesz. Wszystko w jednym miejscu Doświadcz niezwykłej szybkości ładowania dzięki rozdzielaczowi z siedmioma portami USB 3.0 typu A, z pełną zgodnością z technologią Power Delivery. Teraz możesz jednocześnie naładować aż siedem urządzeń i to w ekspresowym tempie. To idealne rozwiązanie dla osób potrzebujących efektywnego i szybkiego ładowania wielu gadżetów jednocześnie. Specyfikacja Marka: Ugreen Rodzaj: HUB Porty: 1x USB-C (tylko transmisja danych), 7x USB-A z standardem Power Delivery 3.0 Prędkość transferu USB: do 5 Gbs Materiał wykonania: Aluminium Prąd wejściowy: 12V2A W zestawie: HUB Ugreen, kabel USB-A - USB-C, ładowarka sieciowa 12V2A','','wielofunkcyjny-adapter-hub-ugreen-7w1-usb-c-7x-usb-a-30-pd-dc-12v-szary','','','','Wielofunkcyjny adapter HUB Ugreen  7w1 USB-C, 7x USB-A 3.0 PD DC 12V, szary','','','',''),(55098,1,1,'Etui Supcase Unicorn Beetle Case Apple MacBook Air 15,3 M4 2025 (A3241)Apple MacBook Air 15,3 M3 2024 (A3114)Apple MacBook Air 15,3 M2 2023 (A2941) Mocna dwuczęściowa konstrukcja Wzmocnione, dwuczęściowe etui od marki Supcase z serii Unicorn Beetle doskonale zabezpieczy twojego laptopa. Wysoka jakość wykonania - połączenie termopoliuretanu i poliwęglanu. Pełna ochrona - zabezpieczenie przodu i tyłu urządzenia przed zarysowaniami i uszkodzeniami w codziennym użytkowaniu. Łatwa instalacja zatrzaskowa. Elegancki i smukły design. *Przedmiotem sprzedaży jest samo etui, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Black (czarno-przezroczysty) Pancerne i wytrzymałe Spełnia wojskowy standard odporności Mil-Grade co oznacza, że urządzenie w etui zostało poddane testowi spadania z określonej wysokości, zapewniając ekstremalną ochronę przed wstrząsami. Ranty z TPU amortyzujące wstrząsy Mocna obudowa z PC o wysokiej odporności na zarysowania Smukła budowa Case zapewnia skuteczną ochronę przy minimalnych gabarytach oraz wadze, dzięki czemu jest dosyć lekkie i nie dodaje nadto zbędnej objętości urządzeniu. Pokrowiec dzięki gumowym nóżkom pewnie leży na płaskich powierzchniach. Precyzyjne wycięcia Etui zapewnia swobodny dostęp do wszystkich interfejsów. Duże wycięcia, aby swobodnie zmieścić w porcie wtyczkę większości ładowarek dostępnych na rynku. Funkcjonalne i wygodne w użytkowaniu. Kompleksowa ochrona Etui zapewnia wysoką ochronę przed uszkodzeniami i zarysowaniami. Gładkie i przyjemne w dotyku doskonale komponuje się z urządzeniem. Otwory wentylacyjne i gumowe nóżki chronią urządzenie przed przegrzaniem. Skuteczna ochrona, dzięki czemu możesz zabrać swoje urządzenie w każdą podróż. Transparentne wst