cny chwyt magnetyczny - trzyma stabilnie urządzenie Silikonowe widełki dla bezpiecznego montażu w kratce wentylacyjnej Wbudowany przewód USB-C Kolor producenta: Czarny Uchwyt kompatybilny z serią iPhone 12 i nowszymi ilub z etui kompatybilnymi z technologią MagSafe. Szybkie i łatwe dostarczanie energii Możesz szybko i wygodnie korzystać z ładowarki bez zbędnych kabli. 7,5W mocy wystarcza, aby Twój smartfon był w pełni zasilany podczas podróży. Instalacja w kratce nawiewu Łatwo zainstaluj Velox Mini, przesuwając widełki na blaszkę nawiewu w twoim pojeździe, gdzie silikonowe uchwyty zapobiegają jego zsunięciu się. Super mocny zawias pozwala dostosować uchwyt do optymalnej i bezpiecznej pozycji widzenia podczas jazdy. Szereg otworów wentylacyjnych umieszczonych wokół uchwytu pomaga w rozpraszaniu ciepła i utrzymaniu przepływu powietrza. Regulowany kąt widzenia Trwały i mocny przegub kulowy obraca uchwyt Velox Mini z trybu poziomego do pionowego. Szybko i prosto znajdź najwygodniejszy kąt widzenia.','','uchwyt-samochodowy-magnetyczny-iottie-velox-mini-magsafe-do-iphone-na-kratke-czarny','','','','Uchwyt samochodowy magnetyczny iOttie Velox Mini MagSafe do iPhone na kratkę, czarny','','','',''),(56966,1,1,'Uchwyt iOttie Velox Pro MagSafe Magnetic Wireless CryoFlow Cooling Dash Windshield Car Mount Dla serii Apple iPhone z MagSafe Funkcjonalność i wygoda - uchwyt i ładowarka Magnetyczny uchwyt samochodowy iOttie Velox Pro Magnetic Wireless z bezprzewodowym szybkim ładowaniem przeznaczony dla iPhoneów i etui kompatybilnych z technologią MagSafe. Umieść urządzenie na uchwycie i gotowe, dopasuje się na swoim miejscu, w idealnej linii. Możesz go zamontować na desce rozdzielczej lub przedniej szybie. W uchwycie wykorzystywana jest zaawansowana technologia chłodzenia CryoFlow, zapewniając doskonałe doświadczenia z ładowania. Szybkie bezprzewodowe ładowanie do 7,5W Mocny chwyt magnetyczny - trzyma stabilnie urządzenie W zestawie: uchwyt, ładowarka samochodowa, kabel USB-C, instrukcja Kolor producenta: Midnight Blue (ciemno-niebieski) Ładuj wydajnie i komfortowo Uchwyt posiada system chłodzenia CryoFlow, który skutecznie usuwa ciepło z Twojego iPhonea, co zwiększa prędkość ładowania i ogranicza problem z przegrzewaniem się sprzętu. W skład systemu CryoFlow wchodzi półprzewodnikowy układ CryoChip, radiator aluminiowy oraz wentylator z 9 łopatkami z poliwęglanu, wyposażony w 20 wlotów powietrza, co pozwala na maksymalną cyrkulację powietrza. System CryoFlow automatycznie włącza się po podłączeniu telefonu. Dzięki temu każdy iPhone z serii MagSafe może ładować się z optymalną wydajnością. Szybkie i łatwe dostarczanie energii Możesz szybko i wygodnie korzystać z ładowarki bez zbędnych kabli. 7,5W mocy wystarcza, aby Twój smartfon był w pełni zasilany podczas podróży. Instalacja na szybie lub desce rozdzielczej Uchwyt iOttie wyposażony jest w super mocny zawias umożliwiający łatwą regulację uchwytudo optymalnego kąta widzenia. Zintegrowane teleskopowe ramię umożliwia dostosowanie pozycji telefonu do własnych preferencji, nie zasłaniając jednocześnie widoku na drogę. Pierścień oraz zatrzask pozwalają na płynne dostosowanie teleskopowego ramienia, a odłączalny kabel USB-C może być schludnie schowany, gdy nie jest używany. Zamontujesz go szybko i sprawnie na desce rozdzielczej lub przedniej szybie. Prosta regulacja Usprawniona konstrukcja eliminuje nieporęczne pokrętła i sprawia, że regulacja ramienia teleskopowego jest dziecinnie prosta.','','uchwyt-samochodowy-iottie-velox-pro-magsafe-magnetic-na-kokpit-lub-szybe-ciemno-niebieski','','','','Uchwyt samochodowy iOttie Velox Pro MagSafe Magnetic na kokpit lub szybę, ciemno-niebieski','','','',''),(57135,1,1,'Hub Adapter Tech-Protect V6-HUB 4in1 Laptopy z USB-C 1x Port USB 3.0 1x Port USB-C PD 1x Port HDMI 1x Port Mini-Jack 3,5mm Rozszerzaj swoje możliwości! Dodaj funkcjonalności swojemu urządzeniu! Hub Tech-Protect posiada dodatkowe porty, które do jednego gniazda USB-C dodadzą kilka innych. 1x Port USB 3.0 (5.0 Gbps 640MBs) 1x Port USB-C PD 100W (tylko do ładowania) 1x Port HDMI 1x złącze mini-jack 3,5mm (do 48KHz) Długość adaptera: 6 cm Kolor producenta: Grey (szary) * Gniazdo USB-C służy jedynie jako by-pass do ładowania urządzenia pod które HUB jest podpięty (laptop, smartfon). Nie obsługuje ono transmisji danych. ** Przesyłanie sygnału wideo poprzez HDMI możliwe jest tylko przy spełnieniu odpowiedniego standardu przez producenta urządzenia. Zapoznaj się z instrukcją, czy port USB-C w urządzeniu, wspiera nadawanie sygnału wideo. Podłącz, przenieś, działaj! Adapter V6 4w1 jest prawdziwym centrum łączności, które pozwala na rozszerzenie możliwości podłączenia twojego laptopa. Wyposażony w port HDMI obsługujący rozdzielczość 4K przy 30Hz, zapewnia doskonałą jakość obrazu, co sprawia, że oglądanie filmów, prezentacji czy granie w gry staje się jeszcze bardziej realistyczne. Port USB-A 3.0 zapewnia niesamowitą prędkość transmisji danych wynoszącą 5Gbps (640MBs), dzięki czemu przenoszenie dużych plików, takich jak filmy czy zdjęcia, między urządzeniami staje się szybkie i efektywne. Ponadto znajduje się tu również port USB-C z obsługą technologii Power Delivery (PD) o mocy aż 100W. To oznacza, że możesz jednocześnie ładować swój laptop oraz podłączyć inne urządzenia, takie jak smartfony, tablety, dyski zewnętrzne i inne peryferia. To idealne rozwiązanie dla osób ceniących wygodę i efektywność. Komfort i efektywność Co wyróżnia V6-HUB, to także dodatkowy, odpinany uchwyt, który pełni funkcję przejściówki. Doskonale współpracuje z tabletami iPad Pro iPad Air 45, co czyni go wszechstronnym narzędziem dla wielu użytkowników. Niezawodny hub na lata Adapter V6-HUB to połączenie solidnej konstrukcji i najnowszych technologii. Wykonany z wysokiej jakości materiałów, takich jak wytrzymałe ABS i lekkie aluminium, gwarantuje trwałość, odporność na uszkodzenia i stylowy wygląd. Bez względu na to, czy korzystasz z niego w domu, biurze czy w podróży, możesz mieć pewność, że b