56)Apple iPad 10,9 10 gen. 2022 (A2696, A2757, A2777) niekompatybilne z mocowaniem magnetycznym:Apple iPad Air 10,5 3 gen. 2019 (A2152, A2123, A2153, A2154)Apple iPad Mini 7,9 5 gen. 2019 (A2133, A2124, A2126, A2125)Apple iPad 10,2 9 gen. 2021 (A2602, A2604, A2603, A2605)Apple iPad 10,2 8 gen. 2020 (A2270, A2428, A2429, A2430)Apple iPad 10,2 7 gen. 2019 (A2197, A2200, A2198)Apple iPad 9,7 6 gen. 2018 (A1893, A1954) Jeszcze płynniej i przyjemniej Frima Baseus stworzyła rysik do jeszcze przyjemniejszej i niezwykle gładkiej obsługi iPada. Możesz pisać, rysować, czy szkicować bez żadnych zmiennych zakłócających, rysik popłynie idealnie po ekranie zostawiając doskonale równy ślad po sobie. Kontrola poziomu baterii - Dioda LED określająca poziom naładowania Materiał: ABS PC Bateria: 130mAh W zestawie: 1x rysik, 1x końcówka rysika (aktywna), 1x kabel USB-A - USB-C Wymiary rysika: 165 x 9 mm Waga: 14,4 g *Mocowanie magnetyczne jest kompatybilne tylko z iPadem posiadającym tę funkcję- iPadem Pro, iPadem Air 54, iPadem 10 gen. i iPadem mini 6. Kolor producenta: White (biały) Korzystaj, jak Ci wygodnie Cała konstrukcja jest trwała i solidna, wykonana z połączenia stopu aluminium i miedzianej końcówki. Urządzenie wspiera funkcję Palm rejection, czyli ignorowanie dłoni - zapobiega przypadkowemu rysowaniu lub interakcji palców lub dłoni z ekranem podczas korzystania z rysika. Dzięki temu użytkownik może swobodnie oprzeć dłoń na ekranie, aby uzyskać stabilne oparcie podczas pisania lub rysowania, bez obawy o przypadkowe interakcje. Długa praca na baterii W pełni naładowany rysik pozwala nawet na 10 godzin ciągłej pracy. Bateria o pojemności 130mAh w stanie czuwania wytrzymuje 12 miesięcy. Ładowanie odbywa się za pośrednictwem portu USB typu C. Czas użytkowania: 10 godzin ciągłego użytkowania przy pełnym naładowaniu Czas czuwania: 12 miesięcy z w pełni naładowany Magnetyczne mocowanie Kształt i niska waga sprawiają, że korzystanie z rysika jest wygodne i przyjemne. Za sprawą magnetycznej obudowy zawsze jest pod ręką, a ryzyko, że się zgubi spada niemal do zera. Zaraz po wyjęciu z opakowania jest gotowy do użytku bez konieczności instalowania aplikacji. Mocowanie magnetyczne jest kompatybilne tylko z iPadem Pro, iPadem Air 54, iPadem 10 gen. i iPadem mini 6. *Nie obsługuje ładowania bezprzewodowego. Łatwe łączenie Rysik możesz połączyć za pomocą Bluetooth. Wystarczy przytrzymać przycisk włączający i jest gotowy do pracy. Diody LED pokazują stan naładowania baterii: niebieska dioda LED: naładowany i działa, migająca niebieskia dioda LED: niski poziom naładowania, czerwona dioda LED: ładowanie, czerwona dioda LED gaśnie: rysik naładowany.','','rysik-baseus-smooth-writing-2-ze-wskaznikiem-led-do-ipad-ipad-pro-ipad-air-mini-bialy','','','','Rysik Baseus Smooth Writing 2 ze wskaźnikiem LED do iPad / iPad Pro / iPad Air / Mini, biały','','','',''),(58298,1,1,'Alkomat Baseus SafeJourney Pro Series Uniwersalny Precyzyjny alkomat - Twój osobisty anioł stróż Szalony wieczór, długa noc, a rano co? Jesteś zawodowym kierowcą, maszynistą lub po prostu spędzasz wiele godzin w podróży? Niezależnie od Twojej sytuacji, Baseus SafeJourney Pro to kompaktowy alkomat z dokładnością do 0.03, który staje się Twoim niezawodnym wsparciem przed podróżą. Niezastąpiony w sytuacjach, gdy masz wątpliwości co do swojego stanu trzeźwości. Z ciekawością się zastanawiasz, czy jedno piwo na wczorajszej imprezie może wpłynąć na Twoje zdolności za kierownicą? Ten elektroniczny alkomat rozwiąże Twoje dylematy! Kolor producenta: Grey (szary) W zestawie: alkomat bezustnikowy Baseus kabel zasilający pokrowiec Zielone światło - bezpieczeństwo w zasięgu ręki Ten mały i poręczny, cyfrowy alkomat od Baseus zmieścisz w każdej kieszeni, torebce, plecaku lub schowku auta. Dzięki wyświetlaczowi LED i dokładności pomiaru do 0.03, zawsze będziesz wiedział, czy jesteś gotowy do drogi. Zielona lub czerwona ikona poinformuje Cię, czy masz zielone światło na prowadzenie. Komendy głosowe i alerty dźwiękowe czynią korzystanie z alkomatu prostym i przyjemnym. Teraz już nigdy nie będziesz musiał się zastanawiać! Wydajna bateria Bateria o pojemności 470mAh pozwoli Ci na aż 8 godzin testowania, a tryb wielu użytkowników ułatwia podzielenie się urządzeniem. By wykonać pomiar, alkomat musi znajdować się w odległości ok 6cm od ust. PROTIP: Jeśli chcesz, możesz skorzystać z alkomatu z użyciem własnego ustnika (nie ma w zestawie), lecz nie jest to konieczne do prawidłowych odczytów. Specyfikacja: Materiał: stop aluminium Wymiary: 152x152x30mm Pojemność baterii: 470mAh Zasilanie (wejście): 5V 0.47A Moc wyjściowa: 2.35W Sposób użycia - krok po kroku 1. Rozpocznij od włączenia alkomatu. Przekręć dolną część alkomatu zgodnie z ruchem wskazówek zegara i odczekaj 10 sekund. 2. W zależności od Twoich preferencji, wybierz odpowiedni tryb pomiaru indywidualny lub wieloosobowy.Do pomiaru należy ustawić górną część alkomatu minimum 6cm od ust. 3. Przed rozpoczęciem pomiaru upewnij się, że spełniasz następujące warunki: Nie spożyłeś alkoholu przez co najmniej 20 minut przed pomiarem. Upewnij się, że nie zakrywasz wylotów powietrza urządzenia. 4. Pomiar. Dmuchaj równomiernie i bez przerw przez około 3 sekundy. Alkomat wykona pomiar i poda wynik na wyświetlaczu LED. 5. Odczyt wyniku. Wynik zostanie wyświetlony z dokładnością do dwóch miejsc po przecinku. 6. Po użyciu, upewnij się, że alkomat jest czysty. Nie używaj środków chemicznych lub silnie korodujących do czyszczenia urządzenia. Po zakończeniu pomiarów, wyłącz alkomat, aby zachować energię baterii. UWAGA! Pomiar może być przekłamany jeśli urządzenie ma niski procent naładowania! Pamiętaj, że wyniki pomiarów są jedynie wskazówką i nie stanowią podstawy do podejmowania decyzji o prowadzeniu pojazdu. Zawsze przestrzegaj obowiązujących przepisów i nie prowadź pojazdu, jeśli jesteś pod wpływem alkoholu. Alkomat Baseus SafeJourney Pro służy wyłącznie jako narzędzie do osobistej kontroli i bezpieczeństwa. Instrukcja zmiany języka: Aby zmienić ustawienia języka i standard pomiaru, należy włączyć alkomat oraz przytrzymać przycisk znajdujący się po lewej stronie. Gdy na wyświetlaczu zacznie migać ostatnia dolna linia, należy przejść do ostatniej opcji - język angielski i standard pomiaru europejski. Następnie należy nacisnąć szybko dwa razy lewy przycisk. Po ponownym włączeniu urządzenia, ustawienia zostaną zapisane.','','alkomat-baseus-safejourney-pro-series-470mah-szary','','','','Alkomat Baseus SafeJourney Pro Series 470mAh, szary','','','',''),(58436,1,1,'Baseus S-06 Car Uniwersalna (Bluetooth 4.2 2x USB-A) Ładuj i słuchaj! Wyjątkowo szybka ładowarka samochodowa z wbudowanym Transmiterem FM Bluetooth. Transmiter służy do przesyłania dźwięków z urządzeń mobilnych wyposażonych w bluetooth i pendriveów z muzyką na głośniki samochodowe z wykorzystaniem wbudowanego radia - przy pomocy fal radiowych. Dzięki transmiterowi nawet stare radio samochodowe może działać jak nowoczesny odtwarzacz muzyki lub służyć jako zestaw głośnomówiący. Kolor producenta: Black (czarny) Obejrzyj recenzję produktu Odwiedź nasz profil na YouTube i zobacz jak urządzenie sprawdza się w praktyce. Pełna swoboda wyboru! Urządzenie zostało wyposażone w dwa porty USB-A, z czego jeden z nich posiada funkcję czytania plików muzycznych z dysków zewnętrznych lub pendrive. Wejście: DC 12V-24V Wyjście: USB-A 1: 3.8A USB-A 2: 3.8A Parametry: Częstotliwość transmisji: 87,5-108,0 MHz Odległość transmisji FM: 5 m Odległość Bluetooth: 10 M Wersja bluetooth: 4.2 Mikrofon Kompatybilność: uniwersalny (AndroidiOs) zapalniczki 12-24V Format audio: MP3 WAV FLAC APE WMA Kompatybilny z protokołem BT: A2DP, AVRCP, HSP, HFP Jeden przycisk, wiele funkcji! Wielofunkcyjny przycisk umożliwia intuicyjną obsługę, pozwalając na odbieranie, kończenie lub odrzucanie połączeń, regulowanie głośności, zatrzymywanie i wznawianie odtwarzania muzyki oraz wiele innych. Urządzenie zapamiętuje ustawienia, co sprawia, że podróżowanie staje się jeszcze bardziej komfortowe, a wbudowany wyświetlacz dostarcza niezbędnych informacji o pracy transmitera. W zestawie: Ładowarka samochodowa Instrukcja obsługi po angielsku Bezpieczeństwo Zaawansowane możliwości podłączania dodatkowych urządzeń sprawiają, że ten transmiter to prawdziwy lider w swojej kategorii. Gniazdo zapalniczki ułatwia podłączenie różnorodnych akcesoriów, a dwa porty USB pozwalają na jednoczesne podłączenie pendrivea o pojemności nawet 32 GB. Ponadto, unikalna funkcja Bluetooth umożliwia jednoczesne połączenie z dwoma urządzeniami, zapewniając elastyczność w korzystaniu z różnych źródeł dźwięku.','','ladowarka-samochodowa-transmiter-fm-baseus-s-06-car-bluetooth-mp3-player','','','','Ładowarka samochodowa + Transmiter FM Baseus S-06 Car Bluetooth MP3 Player','','','',''),(58446,1,1,'HUB Ugreen rozdzielacz USB - 3x USB 3.2 Gen 1, HDMI 4K 30Hz, USB-C dla urządzeń z portem USB-C Rozszerz swoje możliwości! HUB marki Ugreen zapewnia Ci szeroki wybór portów, które możesz wykorzystać w swoim codziennym użytkowaniu. Znajdziesz tutaj 3x USB 3.2 gen. 1, 1 x HDMI 2.0, 1 x USB-C PD 100W. Dzięki złączu USB 3.2 gen. 1 osiągniesz prędkość transferu danych do 5 Gbs. To oznacza, że przesyłanie plików czy kopiowanie danych będzie szybkie i efektywne. Nie musisz już czekać na długie procesy, teraz wszystko będzie odbywało się błyskawicznie. Kolor producenta: Grey (szary) Uwaga! Przed użyciem sprawdź czy port USB Typ C w Twoim laptopie obsługuje standard DP Alt Mode - jest on niezbędny do korzystania z portu HDMI w HUB-ie. Aluminiowa konstrukcja Został wykonany z trwałego aluminium. Nie tylko prezentuje się elegancko, ale również jest odporny na uszkodzenia mechaniczne. Możesz być pewien, że ten gadżet posłuży Ci przez długi czas, niezależnie od intensywności użytkowania. Pomimo swojej funkcjonalności jest kompaktowy i poręczny. Nie zajmuje dużo miejsca na biurku i jest łatwy do przenoszenia. Możesz go zabrać ze sobą w podróż lub używać w różnych miejscach, gdziekolwiek jesteś. Kompatybilność Jest kompatybilny z różnymi urządzeniami. Niezależnie od tego, czy używasz laptopa, komputera stacjonarnego, tabletu czy smartfona, ten gadżet pozwoli Ci rozszerzyć możliwości Twojego urządzenia. Niezależnie od tego, czy potrzebujesz dodatkowych portów USB, czy portu HDMI, ten HUB ma wszystko, czego potrzebujesz. Teraz możesz bez przeszkód korzystać z dodatkowych portów i rozwijać swoje projekty, przechowywać dane, oglądać filmy w wysokiej rozdzielczości 4K 30Hz i wiele więcej. To niezawodne i praktyczne rozwiązanie dla każdego, kto potrzebuje większej liczby portów i wygody w codziennej pracy lub rozrywce. Specyfikacja Marka: UgreenRodzaj: HUBStandard złącza USB: 3.2 gen. 1Wtyczka: USB typu CPorty: 3x USB 3.2 gen. 1, 1x HDMI 2.0, 1x USB-C PD 100WPrędkość transferu: do 5 GbsMaksymalna rozdzielczość: 4K30Hz Materiał wykonania: Aluminium','','hub-5w1-ugreen-3x-usb-32-gen-1-usb-c-hdmi-4k-30hz-z-portem-zasilania-usb-c-szary','','','','HUB 5w1 Ugreen 3x USB 3.2 Gen 1, USB-C, HDMI 4K 30Hz, z portem zasilania USB-C, szary','','','',''),(58545,1,1,'Torba Guess Quilted Bag Laptopy do 15 Klasyczne wzornictwo i precyzyjne wykonanie Wyjątkowa seria toreb Quilted Bag marki Guess zaprojektowana ze smakiem i stylem. Rozmiar uniwersalny, pasuje do większości laptopów. Zaprojektowana z nadzwyczajną starannością o szczegóły, wykonana z wysokiej jakości miękkiego materiału. Podszewka wewnętrzna - zapewnia ochronę przed zarysowaniami urządzenia. Torba jest pokryta przyjemną i miłą w dotyku pikowaną, wzorowaną sztuczną skórązlogo Guess. Produkt wyprodukowany na licencji marki Guess. Wymiary zewnętrzne całkowite torby: 30 x 39 x 6 cm Kolor producenta: Black (czarny) Ochrona w pełnym wymiarze Pokrowiec zapewnia doskonałą ochronę podczas codziennego użytkowania dodając modnego wyglądu Twojemu laptopowi. Niezwykle funkcjonalny i wygodny w użytkowaniu. Zapewnia ochronę całego urządzenia przed drobnymi uderzeniami oraz zarysowaniami. Poręczna i wygodna Torbę można nosić na różne sposoby: nylonowy pasek na pleckach dzięki któremu można ją przymocować do rączki walizki podróżnej. odpinany i regulowany pasek na ramię z metalicznymi zapięciami dla wolnych rąk i wygodnego noszenia na ramieniu. dwie małe rączki dla poręcznego chwytu. Dodatkowe kieszenie Wykonana z myślą o wygodnym funkcjonowaniu zawiera dużą kieszeń, zamykaną na suwak. Subtelne wzornictwo i gustowny wygląd to zalety produktów firmy Guess.','','torba-na-laptopa-guess-quilted-bag-laptopy-do-15-czarna','','','','Torba na laptopa Guess Quilted Bag Laptopy do 15\'\', czarna','','','',''),(58553,1,1,'Etui Spigen Ultra Hybrid Apple Watch 9 8 7 (41 mm) Etui z osłoną ekranu na kopertę smartwatcha Popularne etui marki Spigen z serii Ultra Hybrid to chętnie wybierany wariant przez wielu użytkowników. Cover wykonany został z połączenia termoplastycznego poliuretanu oraz wytrzymałego poliwęglanu, których hybryda doskonale sprawdza się w codziennym użytkowaniu. Ta stylowa i transparentna obudowa skutecznie zabezpiecza kopertę Twojego smartwatcha, a do tego nie zakrywa jego oryginalnego wyglądu. Smukły i lekki design świetnie współgra z konstrukcją zegarka. Dzięki wbudowanej osłonie ekranu pokrowiec zapewnia ochronę 360, chroniąc także wyświetlacz smartwatcha. *Przedmiotem sprzedaży jest samo etui, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Crystal Clear (przezroczysty) Transparentna ochrona Spigen Ultra Hybrid to świetne zabezpieczenie dla Twojego smart-zegarka. Zaprojektowany i wykonany w nowoczesnej lecz minimalistycznej stylistyce o smukłej, lekkiej i transparentnej budowie zapewnia elegancki styl i wygląd, eksponując jednocześnie oryginalny wygląd smartwatcha. Dobrze dopasowane Etui zapewnia swobodny dostęp do wszystkich funkcji smartwatcha. Jest niezwykle funkcjonalne i wygodne w użytkowaniu. Posiada wszelkie konieczne wycięcia, zachowując możliwość swobodnego korzystania z urządzenia. Nie blokuje czujników pomiaru, więc Twoje zdrowie jest cały czas pod kontrolą. Ranty ochronne Lekko podniesione krawędzie ponad powierzchnię wyświetlacza zapewniają dodatkową ochronę przed przypadkowymi zarysowaniami od płaskich powierzchni, np. od ściany czy blatu biurka.','','etui-z-oslona-ekranu-spigen-ultra-hybrid-do-apple-watch-9-8-7-41-mm-przezroczyste','','','','Etui z osłoną ekranu Spigen Ultra Hybrid do Apple Watch 9 / 8 / 7 41 mm, przezroczyste','','','',''),(58568,1,1,'Kabel HDMI Ugreen HD140, 8K 60Hz, 1,5 m HDMI - HDMI Masz ochotę na dobry film? Nic tak nie podbije Twoich wrażeń podczas wieczornego seansu filmowego jak najlepsza jakość obrazu i dźwięku. W tym celu powinieneś zainwestować w wysokiej jakości kabel HDMI. Jednym z najlepszych rozwiązań jest przewód od Ugreen. To właśnie dzięki niemu filmy, czy gry, będą wyglądać jak prawdziwe dzieła sztuki, a dźwięk będzie tak czysty, że usłyszysz nawet najdrobniejsze detale. Przewód Ugreen HDMI - HDMI 2.1 to świetny sposób na podłączenie komputera, konsoli lub innego urządzenia do telewizora, projektora lub monitora. Zapewnia doskonałą jakość obrazu 8K 60Hz. Długość przewodu: 1,5 m Kolor producenta: Grey (szary) Delektuj się jakością obrazu Jasne i żywe kolory oraz wyjątkowo czysty dźwięk to tylko niektóre z zalet przewodu Ugreen. Wersja HDMI 2.1 i rozdzielczość 8K 60Hz daje gwarancję tego, że każdy detal zostanie odwzorowany w sposób perfekcyjny. Oglądaj obrazy w jakości 7680x4320 8K. Intensywne kolory, wyraźne detale dzięki niewiarygodnemu HDR. Przewód został zaprojektowany tak, aby doskonale pasował do różnych urządzeń - od telewizora, przez odtwarzacz DVD i Blue-Ray, aż po projektor. Nylonowa trwałość na wieki Przewód Ugreen to doskonały wybór dla osób, które cenią sobie najlepsze osiągi. Został wykonany z wysokiej jakości miedzi, co gwarantuje bezstratny przesył sygnału nawet na duże odległości. Dzięki niemu możesz cieszyć się bezkompresyjnym przesyłaniem dźwięku i obrazu w najwyższej jakości. Długość przewodu pozwoli Ci na swobodne korzystanie z urządzeń nawet z większej odległości. Materiał: aluminum nylon Wersja HDMI: 2.1 Rozdzielczość: 8K 60Hz Rozdzielczość maksymalna: 8K UHD (7680x4320 px) Rodzaj złącza: HDMI-A (męski)','','kabel-nylonowy-ugreen-hd140-przewod-hdmi-21-8k-60hz-15-m-czarny','','','','Kabel nylonowy Ugreen HD140 przewód HDMI 2.1, 8K / 60Hz, 1.5 m, czarny','','','',''),(58912,1,1,'Etui UAG Urban Armor Gear Plyo Apple MacBook Air 15,3 M4 2025 (A3241)Apple MacBook Air 15,3 M3 2024 (A3114)Apple MacBook Air 15,3 M2 2023 (A2941) Ochrona w pszczelarskim stylu Oryginalna, jednoczęściowa obudowa od marki Urban Armor Gear z serii Plyo to wykonana z połączenia poliwęglanu i TPU ochrona w prawdziwym stylu. Obroni Twojego MacBooka przed codziennymi przeciwnościami losu, takimi jak straszne ostre klucze i zminimalizuje przykre skutki działania grawitacji. Kolor producenta: Ice-Black (przezroczyste z czarną ramką) Przedmiotem sprzedaży jest samo etui, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Królowa etui Niczym yin i yang, obudowa Plyo balansuje między subtelnym, a pancernym designem. Półprzezroczyste plecki przywodzące na myśl plaster miodu nie zasłaniają ikonicznego jabłuszka, a w połączeniu ze wzmocnionymi narożnikami tworzą mocną skorupę dla Twojego MacBooka. Mimo to etui jest tak lekkie, że prawdopodobnie zapomnisz o tym, że je w ogóle założyłeś na laptopa. Instalacja na klik-klik Założenie obudowy UAG Plyo na MacBooka jest równie proste, co założenie koszuli. Wystarczy włożyć urządzenie do jednoczęściowej konstrukcji i zatrzasnąć. Pokrowiec mocno przylega do laptopa, natomiast o swobodny przepływ powietrza, a nie tropiki w środku etui, dbają otwory wentylacyjne. Zawias łączący dwie strony pokrowca jest elastyczny, dzięki czemu otwieranie i zamykanie odbędzie się bez żadnych trzasków i innych świdrujących dźwięków.','','etui-pancerne-urban-armor-gear-plyo-do-macbook-air-153-m4-m3-m2-przezroczyste-z-czarna-ramka','','','','Etui pancerne Urban Armor Gear Plyo do MacBook Air 15.3\" M4 / M3 / M2, przezroczyste z czarną ramką','','','',''),(59110,1,1,'Rysik Baseus Smooth Writing 2 Stylus Plug-Type Apple iPad Pro 12,9 6 gen. 2022 (A2436, A2764, A2437, A2766)Apple iPad Pro 12,9 5 gen. 2021 (A2378, A2461, A2379, A2462)Apple iPad Pro 12,9 4 gen. 2020 (A2229, A2069, A2232, A2233)Apple iPad Pro 12,9 3 gen. 2018 (A1876, A1983, A1895, A2014)Apple iPad Pro 11 4 gen. 2022 (A2759, A2435, A2761, A2762)Apple iPad Pro 11 3 gen. 2021 (A2377, A2459, A2301, A2460)Apple iPad Pro 11 2 gen. 2020 (A2228, A2068, A2230, A2231)Apple iPad Pro 11 1 gen. 2018 (A1980, A2013, A1934, A1979)Apple iPad Air 10,9 5 gen. 2022 (A2588, A2589, A2591)Apple iPad Air 10,9 4 gen. 2020 (A2316, A2324, A2325, A2072)Apple iPad 11 (A16) 11 gen. 2025 (A3354, A3355, A3356)Apple iPad 10,9 10 gen. 2022 (A2696, A2757, A2777)Apple iPad Mini 8.3 6 gen. 2021 (A2567, A2568, A2569)niekompatybilne z mocowaniem magnetycznym:Apple iPad Air 10,5 3 gen. 2019 (A2152, A2123, A2153, A2154)Apple iPad Mini 7,9 5 gen. 2019 (A2133, A2124, A2126, A2125)Apple iPad 10,2 9 gen. 2021 (A2602, A2604, A2603, A2605)Apple iPad 10,2 8 gen. 2020 (A2270, A2428, A2429, A2430)Apple iPad 10,2 7 gen. 2019 (A2197, A2200, A2198)Apple iPad 9,7 6 gen. 2018 (A1893, A1954) Jeszcze płynniej i przyjemniej Frima Baseus stworzyła rysik do jeszcze przyjemniejszej i niezwykle gładkiej obsługi iPada. Możesz pisać, rysować, czy szkicować bez żadnych zmiennych zakłócających, rysik popłynie idealnie po ekranie zostawiając doskonale równy ślad po sobie. Kontrola poziomu baterii - 3 diody LED określające poziom naładowania Materiał: stop aluminium plastik POM Bateria: 130mAh W zestawie: 1x rysik, 1x końcówka aktywna, 1x kabel USB-A Lightning Wymiary rysika: 165,5 x 9,6 mm Waga: 17,62 g *Mocowanie magnetyczne jest kompatybilne tylko z iPadem posiadającym tę funkcję - iPadem Pro, iPadem Air 54, iPadem 10 gen. i iPadem mini 6. Kolor producenta: White (biały) Korzystaj, jak Ci wygodnie Cała konstrukcja jest trwała i solidna, wykonana z połączenia stopu aluminium i plastiku POM. Używaj rysika wygodnie w każdej pozycji, pionowo lub pod kątem 60 czy 45. Pisz, rysuj, maluj nawet drobne detale z wysoką precyzją i starannością, bez zmęczenia ręki. Odkręć końcówkę zgodnie z ruchem przeciwnym do ruchu wskazówek zegara. Nałóż i zakręć nową końcówkę. Korzystaj nadal ze swojego rysika. Łatwa kontrola - wystarczy zmienić kąt nachylenia, aby zmienić grubość linii. Długa praca na baterii W pełni naładowany rysik pozwala na 11 godzin ciągłej pracy. Bateria o pojemności 130mAh w stanie czuwania wytrzymuje 12 miesięcy. Ładowanie odbywa się za pośrednictwem portu typu Lightning. Wbudowany port pozwoli na szybkie i bezproblemowe ładowanie, a kabel dołączony do zestawu tylko ułatwi sprawę. Tryb oszczędzania energii aktywuje się po 5 minutach bezczynności dla maksymalnej żywotności baterii. Czas użytkowania: 11 godzin ciągłego użytkowania przy pełnym naładowaniu Czas czuwania: 12 miesięcy z w pełni naładowany Czas ładowania: ok. 1 godz. Magnetyczne mocowanie Kształt i niska waga sprawiają, że korzystanie z rysika jest wygodne i przyjemne. Za sprawą magnetycznej obudowy zawsze jest pod ręką, a ryzyko, że się zgubi spada niemal do zera. Zaraz po wyjęciu z opakowania jest gotowy do użytku bez konieczności instalowania aplikacji. *Nie obsługuje ładowania bezprzewodowego. Łatwe łączenie Rysik możesz połączyć za pomocą Bluetooth, przez aplikację lub za pomocą samego przycisku. Wystarczy przytrzymać przycisk włączający i jest gotowy do pracy. Diody LED pokazują stan naładowania baterii: trzy niebieskie światła LED: 100-70, dwa niebieskie światła LED: 70-30, jedno niebieskie światło LED: poniżej 30, jedno migające niebieskie światło LED: poniżej 5.','','rysik-baseus-smooth-writing-2-dla-ipad-ipad-pro-ipad-air-mini-kabel-usb-a-lightning-bialy','','','','Rysik Baseus Smooth Writing 2 dla iPad / iPad Pro / iPad Air / Mini + kabel USB-A - Lightning, biały','','','',''),(59132,1,1,'Rysik Baseus Smooth Writing 2 Stylu