ciągłej pracy. Bateria o pojemności 125mAh w stanie czuwania wytrzymuje 12 miesięcy. Ładowanie odbywa się za pośrednictwem portu USB typu C oraz dzięki ładowaniu bezprzewodowemu. Czas użytkowania: 10 godzin ciągłego użytkowania przy pełnym naładowaniu Czas czuwania: 12 miesięcy z w pełni naładowany Czas ładowania: przewodowo: 19 minut bezprzewodowo: 3 godziny Magnetyczne mocowanie Kształt i niska waga sprawiają, że korzystanie z rysika jest wygodne i przyjemne. Za sprawą magnetycznej obudowy zawsze jest pod ręką, a ryzyko, że się zgubi spada niemal do zera. Zaraz po wyjęciu z opakowania jest gotowy do użytku bez konieczności instalowania aplikacji. Mocowanie magnetyczne jest kompatybilne tylko z iPadem Pro, iPadem Air 54, iPadem 10 gen. i iPadem mini 6. Łatwe łączenie Rysik możesz połączyć za pomocą Bluetooth. Wystarczy przytrzymać przycisk włączający i jest gotowy do pracy. Diody LED pokazują stan naładowania baterii: dioda LED określa poziom naładowania: niebieska: 100-70, zielona: 70-30, czerwona: poniżej 30, pulsująca czerwona: potrzeba naładowania.','','rysik-baseus-smooth-writing-2-overseas-z-ladowaniem-przewodowym-i-indukcyjnym-do-ipad-ipad-pro-ipad-air-mini-bialy','','','','Rysik Baseus Smooth Writing 2 Overseas z ładowaniem przewodowym i indukcyjnym do iPad / iPad Pro / iPad Air / Mini, biały','','','',''),(59583,1,1,'Ugreen Adjustable Portable Stand Multi-Angle LP115 30485 Dla smartfonów tabletów Niezawodność i ochrona w jednym! Podstawka Ugreen Adjustable Portable Multi-Angle to stabilne akcesorium dzięki antypoślizgowym, silikonowym elementom. Chroni Twój telefon, zapobiegając przypadkowemu upadkowi i uszkodzeniom. Wykonana z przyjaznego dla środowiska tworzywa ABS gwarantuje wytrzymałość i długotrwałe użytkowanie. Rozmiary podstawki: 120 x 107 mm Kolor producenta: Black (czarny) Oglądaj i graj! Stojak to przydatne akcesorium, które umożliwia granie w ulubione gry mobilne. Jest także przydatny do czytania, prowadzenia wideokonferencji i innych czynności, gdy chcemy swobodnie używać telefonu, trzymając go na uchwycie. To niezastąpione narzędzie, które poprawia komfort i wygodę korzystania z urządzenia mobilnego. Swobodne dopasowanie kąta Podstawka pod telefon z regulacją nachylenia w zakresie od 0 do 100 umożliwia wygodne oglądanie filmów, seriali i innych treści na telefonie. Dzięki jej elastycznym możliwościom dostosowania możesz wybrać spośród 10 różnych kątów oglądania, aby znaleźć idealną pozycję dla siebie. Dla podróżników Niewielkie, składane akcesorium do telefonu o lekkiej wadze to idealny towarzysz podróży. Możesz zabrać je ze sobą wszędzie, gdzie tylko chcesz, ponieważ bez problemu zmieści się w torbie lub plecaku. Dzięki swojej kompaktowej konstrukcji nie zajmie wiele miejsca i będzie zawsze pod ręką, gdy będziesz potrzebować. Szeroka kompatybilność Dzięki uniwersalnej konstrukcji możesz bez obaw używać jej z różnymi smartfonami i tabletami. Niezależnie od tego, czy posiadasz iPhone, Samsung Galaxy, Huawei czy inne urządzenie, podstawka zapewni stabilne podparcie.','','uchwyt-podstawka-stojak-biurkowy-ugreen-lp115-na-telefon-tablet-czarny','','','','Uchwyt, podstawka, stojak biurkowy Ugreen LP115 na telefon / tablet, czarny','','','',''),(59909,1,1,'Maska Travel Blue Ultimate Sleep Mask Uniwersalna Zanurz się w głębokim śnie! Odkryj pełen relaksu sen, dzięki Travel Blue Ultimate Sleep Mask. Maska do spania wyróżnia się doskonałą zdolnością blokowania wszelkich źródeł światła, umożliwiając Ci osiągnięcie głębokiego i niezakłóconego snu. Jej ergonomiczny design został starannie zaprojektowany, aby idealnie przylegać do oczu i nosa, bez zbędnego ucisku czy dyskomfortu. Podaruj sobie luksusowy sen i pozwól, aby każda chwila była dla Ciebie wyjątkowa. Kolor producenta: Blue (niebieski) Ważne! Producent zaleca pranie ręczne maski. Wymiary (wys. x szer.): 8,5 x 25 cm Dostosuj ją do siebie! Odkryj wyjątkową elastyczność dopasowania, jaką oferuje Ultimate Sleep Mask, umożliwiając łatwe regulowanie paska według Twoich preferencji. Niezależnie od kształtu głowy czy indywidualnych potrzeb, maska dostosuje się do Ciebie. Luksus delikatności! Została precyzyjnie wykonana z pianki poliuretanowej i miękkiej tkaniny poliestrowej, zapewniając nie tylko doskonałą ochronę, ale także delikatność dla skóry twarzy i oczu. Jej konstrukcja sprawia, że noszenie jej jest niezwykle wygodne, pozwalając na długotrwałe korzystanie. Zapewni Ci spokój i relaks, gdziekolwiek się znajdziesz, pomagając w pełnym odprężeniu i regeneracji.','','maska-na-oczy-bezuciskowa-travel-blue-ultimate-sleep-mask-niebieska','','','','Maska na oczy bezuciskowa Travel Blue Ultimate Sleep Mask, niebieska','','','',''),(59958,1,1,'Zatyczki do uszu samolotowe Travel Blue Flight Earplugs Uniwersalne Cisza w każdym locie! Zatyczki douszne Flight Earplugs od Travel Blue to rozwiązanie, stworzone z myślą o maksymalnym komforcie podczas podróży. Ich unikalny design został precyzyjnie zaprojektowany, aby skutecznie redukować hałas i ciśnienie w uszach, zapewniając jednocześnie swobodny przepływ dźwięków otoczenia. Dzięki temu możesz cieszyć się spokojem i ciszą podczas lotu, bez utraty zdolności do słyszenia ważnych ogłoszeń czy rozmów. Kolor producenta: Blue (biało-niebieski) Rozmiar zatyczek do uszu: 1,2 x 2 cm Uwaga! Wyłącznie do użytku zewnętrznego Nie nadaje się dla dzieci poniżej 12 lat Trzymać z dala od niemowląt Jeśli masz infekcję ucha lub inne problemy z uszami, przed użyciem zatyczek do uszu powinieneś skonsultować się z lekarzem. Silikonowy komfort! Dzięki zastosowaniu silikonu produkt nie tylko zapewnia doskonały komfort, ale także ułatwia utrzymanie go w czystości. Procedura czyszczenia jest niezwykle prosta, co sprawia, że użytkowanie produktu jest wyjątkowo wygodne. Umyj produkt ciepłą wodą z dodatkiem mydła lub z 70 alkoholu. Pamiętaj o dokładnym osuszeniu po czyszczeniu. Po zakończonym procesie czyszczenia przechowuj zatyczki douszne w dostarczonym plastikowym pudełku, zapewniając im bezpieczne i higieniczne miejsce. Włóż, obróć, ciesz się ciszą! Aby właściwie założyć zatyczki do uszu, postępuj zgodnie z instrukcją: Włóż zatyczkę do kanału słuchowego, lekko ją obracając. Nie używaj siły pozwól zatyczce delikatnie osiąść w uchu. Upewnij się, że zatyczka jest właściwie umiejscowiona. Jeśli odczuwasz dyskomfort lub ból, wyjmij zatyczki i spróbuj ponownie, dbając o delikatność podczas wprowadzania jej do ucha. Sprawdź, czy głośny hałas w tle jest blokowany, a jednocześnie upewnij się, że głos osób jest nadal słyszalny. Odpowiednie umieszczenie zatyczek pozwoli Ci cieszyć się spokojem bez utraty kontaktu z otoczeniem. Jeżeli zauważysz, że głos jest niesłyszalny, oznacza to, że zatyczka została włożona nieprawidłowo. Skoryguj jej pozycję, ponownie umieszczając ją zgodnie z instrukcją.','','zatyczki-do-uszu-samolotowe-travel-blue-flight-earplugs-bialo-niebieskie','','','','Zatyczki do uszu samolotowe Travel Blue Flight Earplugs, biało-niebieskie','','','',''),(59974,1,1,'Spigen S570W Wondersnap MagFit Selfie Stick Tripod Dla smartfonów z Bluetooth, z obsługą MagSafe But first... let me take a selfie Spigen S570W to nie tylko praktyczne narzędzie dla miłośników fotografii, ale również elegancki dodatek dla posiadaczy iPhoneów z technologią MagSafe i nie tylko. Ten innowacyjny selfie stick nie tylko wyróżnia się unikalnym designem, ale także solidną konstrukcją, zaprojektowaną z myślą o zapewnieniu niezawodnej funkcjonalności. Dzięki kompaktowej budowie możesz zabrać go ze sobą gdzie tylko chcesz i rozpocząć nagrywanie wspomnień lub wykonać sesję słodkich fotek ze znajomymi. Kompatybilny z urządzeniami iOS i Android. Wymiar złożonego: 25 cm Wymiar maksymalny rozłożonego: 67 cm Kolor producenta: Black (czarny) Kompaktowe wymiary Wymiar złożonego selfie sticka wynosi jedynie 25 cm, co sprawia, że bezproblemowo mieści się w każdej torbie czy plecaku, a nawet kieszeni spodni, będąc zawsze gotowym do użycia. Teleskopowa rurka umożliwia rozłożenie do maksymalnej długości 67 cm, co pozwala na uchwycenie szerokiego kąta i uzyskanie unikalnych ujęć. Jego niewielka waga - zaledwie 163g - sprawia, że Spigen S570W jest nie tylko lekki, ale także przenośny, co czyni go idealnym towarzyszem podróży. Dzięki tym zrównoważonym wymiarom, selfie stick ten staje się niezastąpionym narzędziem dla każdego, kto ceni wygodę, funkcjonalność i mobilność podczas tworzenia zdjęć i filmów. Bezprzewodowa wygoda Dzięki wbudowanemu modułowi Bluetooth, Spigen S570W umożliwia bezprzewodowe połączenie ze smartfonem, co eliminuje uciążliwe korzystanie z kabli i zapewnia wygodną obsługę. Ponadto zastosowany w tym kijku uchwyt MagSafe zapewnia szybkie, mocne i bezpieczne mocowanie urządzenia. Dzięki temu możesz korzystać z tego selfie sticka w połączeniu z każdym urządzeniem iOSAndroid, jeśli tylko obsługuje funkcję MagSafe. W przypadku urządzeń Android konieczne będzie zastosowanie odpowiedniego etui z pierścieniem MagSafe - sprzedawane osobno Niech ręka odpocznie... Gdy Twoja ręka zaczyna odczuwać zmęczenie po długim trzymaniu selfie sticka, z łatwością możesz przekształcić go w wygodny statyw. Wyjątkowa funkcja tripoda - statywu z trzema nogami, gwarantuje stabilność podczas fotografowania czy nagrywania filmów. W połączeniu z pilotem Bluetooth sprawia, że Spigen S570W nie tylko gwarantuje stabilność podczas tworzenia dynamicznych selfie, ale również staje się praktycznym narzędziem do produkcji profesjonalnych treści, eliminując potrzebę manualnego trzymania urządzenia. Jego ogromną zaletą jest fakt, że działa w maksymalnej odległości 10 metrów od selfie sticka. Pilot możesz magnetycznie przymocować do uchwytu lub wyjąć go i używać bezprzewodowo. Ładowany jest poprzez port USB-C, a jego bateria wytrzymuje do 50.000 zdjęć lub maksymalnie 6 miesięcy w trybie czuwania. Co w zestawie piszczy? Zestaw Spigen S570W składa się z: Spigen S570W Wondersnap MagFit Selfie Stick Tripod Bezprzewodowy pilot Bluetooth kabel USB-A - USB-C o długości 30 cm Instrukcja obsługi','','uchwyt-kijek-statyw-spigen-s570w-magsafe-bluetooth-selfie-stick-tripod-czarny','','','','Uchwyt, kijek, statyw Spigen S570W MagSafe Bluetooth Selfie Stick Tripod, czarny','','','',''),(60055,1,1,'Wielofunkcyjny klips do mocowania akcesoriów Apexel APL-F001 Uniwersalne Twój pomocnik w mobilnej fotografii Apexel F001 to doskonały dodatek do fotografii mobilnej, który umożliwia połączenie obiektywu lub teleskopu z Twoim smartfonem do fotografowania. Nie musisz się martwić, że klips zakryje lub uszkodzi ekran smartfona. Dzięki grubszym podkładkom silikonowym po obu stronach, zaciskuje, ale nie uszkadza ekranu Twojego smartfona. Dodatkowo, wyprofilowany design silikonowy skutecznie zapobiega przypadkowemu naciskaniu przycisków na telefonie. Wyposażony jest w gwint 14 oraz mocowanie cold shoe (zimna stopka) na dodatkowe akcesoria, dodając praktyczne funkcje do Twoich działań fotograficznych. Apexel APL-F001 to wielofunkcyjny klips o wysokiej kompatybilności. Świetnie współpracuje z takimi modelami jak iPhone 15 15 Pro 15 Pro Max, iPhone 14 14 Pro 14 Pro Max, Samsung Galaxy, Google Pixel, Huawei, OnePlus itp. Idealnie współpracuje z obiektywami Apexel, jak obiektyw makro 100mm, obiektyw 30X, 20-40X, 28X, obiektyw telefoto 60X, itp. Wymiary produktu: 86 x 60.5 x 26 mm Maksymalna szerokość mocowania smartfona: 66 - 95 mm *Przedmiotem sprzedaży jest sam klips, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Black (czarny) Stabilność na pierwszym miejscu Apexel F001 został wyposażony w uniwersalny gwint 14 cala, umożliwiający łatwe zamocowanie na tripodzie lub innym statywie, co znacząco podnosi stabilność podczas fotografowania. Ten innowacyjny adapter obiektywu do telefonu jest specjalnie zaprojektowany dla obiektywów lub filtrów z gwintem 17 mm, co umożliwia pasjonatom fotografii komórkowej uzyskiwanie doskonalszych wrażeń fotograficznych. Gwint ten powinien być skierowany w stronę głównego obiektywu urządzenia. Dodatkowo w klipsie umiejscowiona jest podkładka silikonowa, która sprawia, że twój smartfon jest bezpieczny i nie uszkodzi się od zacisku klipsa. Możliwość mocowania wielu akcesoriów Dzięki temu wielofunkcyjnemu klipsowi Apexel APL-F001 możesz podłączyć wiele akcesoriów, które umożliwią ci wykonywanie mobilnej fotografii na najwyższym poziomie. Pozwala on na mocowanie obiektywów, statywów, mikrofonów, oświetlenia i wielu innych akcesoriów. To wszystko dzięki portom cold shoe znajdującym się w po lewej i prawej stronie klipsa. Uniwersalność i doskonałe dopasowanie W zestawie znajdziesz podkładki EVA o grubościach 2mm, 3mm i 4mm. Możesz ich użyć w przypadku, gdy obiektyw aparatu telefonu jest umiejscowiony za wysoko lub wystaje zbyt mocno. Wystarczy, że przykleisz je w wewnętrznej stronie klipsa, aby wypełnić lukę na plecach telefonu i zrównać ją z kamerą. To sprawia, że Apexel APL-F001 jest niesamowicie uniwersalny i może współpracować z większością smartfonów dostępnych na rynku.','','uniwersalny-wielofunkcyjny-klips-na-smartfona-apexel-apl-f001','','','','Uniwersalny, wielofunkcyjny klips na smartfona Apexel APL-F001','','','',''),(60091,1,1,'Uchwyt zagłówkowy Fixed Passenger Max Uniwersalny dla iPadów między 7 - 13 tabletów z szerokością 14-25,5 cm zagłówków o szerokości 4,5-16 cm Twój towarzysz w drodze! Passenger Max od Fixed to uchwyt na tablet, idealny dla podróżujących. Bezpieczny montaż na zagłówku za pomocą sprężynowych zacisków zapewnia stabilność i eliminuje ryzyko wypadnięcia. Jest w pełni regulowany, oferując wygodę i komfort korzystania z tabletu podczas podróży samochodem. Szybki i prosty montaż sprawia, że jest to niezawodny towarzysz podróży dla tych, którzy cenią sobie bezpieczeństwo i wygodę. Wymiary (rozłożone): 20,5 x 19,5 x 7,5 cm Wymiary (złożone): 20,5 x 11 x 7,5 cm Waga: 298 g Kolor producenta: Space Gray (szary) Przedmiotem sprzedaży jest sam uchwyt, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu funkcjonalności produktu 360 regulacji! Chcesz uzyskać idealny kąt widzenia? Uchwyt pozwala na swobodne regulowanie pozycji tabletu za pomocą przegubu obrotowego. Aby dostosować odległość, użyj wysuwanego ramienia, które można regulować aż do długości 6,5 cm. Gotowy na wszystko! Passenger Max to solidna konstrukcja z połączenia aluminium, wytrzymałego tworzywa sztucznego oraz precyzyjnie obrobionych przegubów. Dzięki temu uchwyt utrzymuje stabilność i bezpieczeństwo tabletu nawet podczas trudnych warunków jazdy, absorbując wszelkie wstrząsy. Swoboda w podróży! Precyzyjne wycięcia w korpusie uchwytu to klucz do łatwego dostępu do portów ładowania, co sprawia, że korzystanie z urządzenia w trakcie podróży staje się niezwykle wygodne. Dodatkowo silikonowe wyściółki spełniają funkcję ochronną, skutecznie chroniąc tablet przed potencjalnymi uszkodzeniami. Oszczędzaj przestrzeń! Kiedy uchwyt nie jest w używany, boczne uchwyty można z łatwością złożyć, co pozwala zaoszczędzić dodatkową przestrzeń. Ta praktyczna funkcja sprawia, że uchwyt staje się jeszcze bardziej kompaktowy i łatwy do przechowywania. Podróżuj sprytnie, oszczędzaj miejsce i korzystaj z uchwytu tylko wtedy, gdy tego potrzebujesz!','','uchwyt-do-samochodu-na-tablet-na-zaglowek-fixed-passenger-max-szary','','','','Uchwyt do samochodu na tablet / na zagłówek Fixed Passenger Max, szary','','','',''),(60136,1,1,'Spigen Rugged Ultra Band Apple Watch 11 (46 mm)Apple Watch 10 (46 mm)Apple Watch Ultra 3 2 1 (49 mm)Apple Watch 9 8 7 (45 mm)Apple Watch SE 3 SE 2022 SE 6 5 4 (44 mm)Apple Watch 3 2 1 (42 mm) Sportowa elegancja Oryginalny pasek marki Spigen z serii Rugged Ultra Band o sportowym zacięciu, wykonany z wysokiej jakości materiałów, które są zarówno elastyczne jak i wytrzymałe. Głównym materiałem jest termopoliuretan, który jest zdobiony na wzór włókna węglowego, nadając paskowi sportowego charakteru. Dodatkowo, pasek posiada metalowe elementy, które zwiększają jego trwałość i bezpieczeństwo. Łączy w sobie styl, wygodę oraz funkcjonalność sprawiając, że jest zaprojektowany właśnie z myślą o Tobie i jest idealnym wyborem. *Przedmiotem sprzedaży jest sam pasek, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Matte Black (czarny z pomarańczową wstawką) Długość paska: 24,66 cm Szerokość paska: 2,5 cm Solidna konstrukcja Spigen Rugged Ultra Band wyróżnia się swoim designem, który jest nie tylko funkcjonalny, ale także elegancki. Został zaprojektowany i wykonany w pancernej stylistyce typu Rugged z akcentami o karbonowym wzorze, która świetnie sprawdzi się w codziennym użytkowaniu. Pasek ma szerszą i solidniejszą budowę, która doskonale pasuje do różnych stylizacji i okazji. Posiada również unikalne pomarańczowe akcenty, które idealnie współgrają z designem zegarka. Podkreśla styl twojego urządzenia Spigen Rugged Ultra Band to świetny dodatek dla Twojego smartwatcha. Pasek ten zaprojektowany i wykonany został w nowoczesnej stylistyce o dopracowanych detalach i wycięciach. Smukła budowa o matowym wykończeniu zapewnia elegancki styl i wygląd. Wygodny i funkcjonalny Spigen Rugged Ultra Band ma również technologię inteligentnego zapięcia, która sprawia, że noszenie zegarka przez cały dzień jest niezwykle komfortowe i bezpieczne. Pasek ma możliwość regulacji według indywidualnych potrzeb, dzięki czemu idealnie dopasowuje się do nadgarstka. Pasuje do większości nadgarstków o wielkości od 140 mm do 215 mm. Łatwy montaż Pasek bardzo łatwo się zakłada jak i zdejmuje, nie potrzeba do tego żadnych dodatkowych narzędzi. Wystarczy umieścić końcówki w odpowiednie miejsca koperty smartwatcha i gotowe.','','pasek-spigen-rugged-ultra-band-do-apple-watch-49-46-45-44-mm-czarny','','','','Pasek Spigen Rugged Ultra Band do Apple Watch 49/46/45/44 mm, czarny','','','',''),(60324,1,1,'Bizon Accessories Ring Turtle Uniwersalne Trzymaj się! Gdyby telefony umiały latać, co mogłoby je utrzymać na stałe w twoim zasięgu? Uchwyt na palec od producenta Bizon z serii Access