ogii Power Delivery 3.0 PPS z maksymalną mocą 25W. Wyjście (maksymalne przy normalnym ładowaniu): 5V 3A Napięcie i natężenie wyjściowe (przy szybkim ładowaniu): PDO : 9 V PPS : 3.3-5.9 V lub 3.3-11.0 V PDO : PDO : 2.77 A(9 V) PPS : 3.0 A(3.3-5.9 V) lub 2.25 A(3.3-11.0 V) Wejście: 100-240V Nowoczesny design Nowoczesny design ładowarki prezentuje się smukło i stylowo, a kompaktowe rozmiary dobrze sprawdzą się w podróży. Uniwersalność zapewni energię większości urządzeń w Twoim domu. Wymiary ładowarki : 38 x 22 x 66.94 mm Waga: 51.6 g','','ladowarka-sieciowa-usb-c-25w-samsung-ep-t2510nw-biala','','','','Ładowarka sieciowa USB-C 25W, Samsung EP-T2510NW, biała','','','',''),(60657,1,1,'Spigen DuraPro Flex Ultra Band Apple Watch 11 (46 mm)Apple Watch 10 (46 mm)Apple Watch Ultra 3 2 1 (49 mm)Apple Watch 9 8 7 (45 mm)Apple Watch SE 3 SE 2022 SE 6 5 4 (44 mm)Apple Watch 3 2 1 (42 mm) Pasek wzmocniony nylonem Oryginalny, lekko elastyczny pasek marki Spigen z serii DuraPro Flex Ultra o stylowym wyglądzie, wykonany z mocnej tkaniny wzmocnionej nylonem oraz klamrze z stopu cynku. Pasek łączy w sobie zarówno świetny wygląd, solidną wytrzymałość, jak i wygodę w codziennym użytkowaniu. Kolor producenta: Black (czarny z pomarańczowym akcentem) Długość paska: 20,62 cm Szerokość paska: 2,6 cm Przedmiotem sprzedaży jest sam pasek, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Design na co dzień Spigen DuraPro Flex Ultra to stylowy, tkaninowy pasek dla Twojego smartwatcha Apple. Został zaprojektowany i wykonany w minimalistycznej stylistyce, która świetnie sprawdzi się w codziennym użytkowaniu. Zapinanie na rzepy Zapinanie na rzepy jest niezwykle łatwe i szybkie, a do tego pozwala na dowolne dostosowanie długości paska do obwodu nadgarstka. To świetne rozwiązanie dla osób, które często napotykają dylemat wyboru między sąsiadującą zbyt ciasną i zbyt luźna dziurką w tradycyjnych klamrach. Dodatkowo dzięki takiemu rozwiązaniu końcówka doskonale przylega do powierzchni paska, dając pełną swobodę jego użytkowania. Smukły i dobrze dopasowany Pasek charakteryzuje się lekkością i wysoką trwałością dzięki mocnym splotom nylonu, a swobodna regulacja długości pozwoli Ci dostosować go do obwodu nadgarstka. Wygodny i funkcjonalny Jest niezwykle wygodny i funkcjonalny, nie dodaje zbędnej objętości na nadgarstku, dzięki czemu nie przeszkadza w codziennych aktywnościach. Łatwy montaż Pasek bardzo łatwo się zakłada jak i zdejmuje, nie potrzeba do tego żadnych dodatkowych narzędzi. Wystarczy umieścić końcówki w odpowiednie miejsca i gotowe.','','pasek-spigen-durapro-flex-ultra-band-do-apple-watch-49-46-45-44-mm-czarny','','','','Pasek Spigen DuraPro Flex Ultra Band do Apple Watch 49/46/45/44 mm, czarny','','','',''),(60686,1,1,'Stojak Spigen Rugged Armor Stand do Apple Watch Ultra 21, Apple Watch Series 98765SE 2022SE 20204321 Stand do ładowarki Apple Watch Elegancka stacja dokująca marki Spigen o półsztywnym wykonaniu z termopoliuretanu. Całość charakteryzuje się przyjemną w dotyku matową powłoką o antypoślizgowych właściwościach. Karbonowe wstawki dodają tej podstawce nowoczesnego stylu. Posiada dolną krawędź, która utrzymuje zegarek na boku, zapewniając stabilność, która zapobiega kołysaniu się zegarka na boki. To wygodny stojak z wycięciami dedykowanymi dla ładowarek od Apple Watch każdej generacji. Umieszczając w nim swój moduł ładujący, przekształcisz go w wygodną stację ładującą w pozycji Night Stand. Kompatybilna z oficjalnym modułem ładowania od Apple Watch. *Przedmiotem sprzedaży jest sam stojak bez ładowarki, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Black Stacja dokująca - stojak Wygodny stojak, który pozwala na wygodne ładowanie smartwatchy od Apple z serii Ultra i starszych. Dzięki jego półelastycznej budowie w prosty sposób umieścisz swój oryginalny moduł ładowania bezprzewodowego w dedykowanym wycięciu, co pozwoli Ci stworzyć na swoim biurku lub stoliku stylową stację ładującą w wygodnej pozycji stand. Odpowiednie wycięcia Posiada odpowiednie wycięcia na doprowadzenie Twojego oryginalnego kabla z modułem ładowania smartwatcha od Apple. Dzięki temu stojakowi z łatwością uporządkujesz kable, umożliwiając jednocześnie swobodny dostęp do ekranu i łatwy wgląd w wyświetlane na nim powiadomienia lub godzinę. Smukła i gładka budowa To nowoczesna stacja dokująca, charakteryzująca się smukłym profilem. Jej gładka powierzchnia o matowym wykończeniu minimalizuje pozostawianie odcisków palców i świetnie się prezentuje w każdym pomieszczeniu. Stabilne mocowanie Nanotac Podstawa stojaka wyłożona jest pianką Nanotac, która doskonale przywiera do płaskich powierzchni, pozwalając na swobodną obsługę uchwytu. Jej wysoka przyczepność zapobiega przemieszczaniu się konstrukcji po bracie podczas użytkowania, a im gładsza powierzchnia, tym lepsze przywieranie podstawy do podłoża. Pianka Nanotac jest zaprojektowana w taki sposób, aby zapewniała jak najlepszą stabilność i przyczepność nakładki bez jakichkolwiek lepkich pozostałości na użytych powierzchniach.','','stacja-dokujaca-podstawka-spigen-rugged-armor-stand-do-ladowarki-apple-watch-czarna','','','','Stacja dokująca, podstawka Spigen Rugged Armor Stand do ładowarki Apple Watch, czarna','','','',''),(61018,1,1,'Rysik Spigen Universal Stylus Pen Uniwersalny Precyzja i komfort Odkryj nowy wymiar obsługi swoich ulubionych urządzeń z innowacyjnym rysikiem 2w1 Spigen Universal Stylus Pen. To świetne rozwiązanie dla każdego, kto potrzebuje płynnej obsługi ekranu dotykowego, a przy tym ceni sobie precyzję, wygodę i stylowe rozwiązania. Cienka końcówka tego stylusa jest idealna do precyzyjnych zadań. Z drugiej strony, grubsza część rysika została stworzona z myślą o prostocie i wygodzie codziennych zadań. To idealny partner do przeglądania stron internetowych, notowania czy obsługi aplikacji, gwarantując niesamowity komfort użytkowania. *Przedmiotem sprzedaży jest sam rysik,