ylus Pen, czarny','','','',''),(61101,1,1,'Kabel kątowy 90 Unitek, PD QC 3.0, 100W 0,5 m USB-C do USB-C Zero plątanin, zero problemów! Kabel w oplocie nylonowym marki Unitek umożliwia szybkie ładowanie wszystkich urządzeń ze złączem USB-C, a także przesyłanie danych na poziomie do 480Mbs. Dzięki konstrukcji eliminuje frustrujące zaczepianie się o inne urządzenia. Nie ma już problemu z przypadkowym zahaczeniem o myszkę po podłączeniu do laptopa czy niepotrzebnymi plątaninami podczas zwijania. Uwaga! Kabel jest kompatybilny z Android Auto! Długość kabla: 0,5 m Kolor producenta: Grey (czarny z szarymi końcówkami) Przedmiotem sprzedaży jest sam kabel, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. 100W mocy z Unitek! Zgodny ze standardem Quick Charge i Power Delivery 3.0 obsługuje ładowanie z mocą do 100W. W końcówkach przewodu zastosowano chipy E-marker pełniące kluczową rolę w obszarze technologii Power Delivery. Dzięki technologii Power Delivery możesz cieszyć się szybkim i efektywnym ładowaniem swoich urządzeń, wykorzystując do tego celu jedynie gniazdo USB-C 480Mbs transferu danych! Kabel nie tylko ułatwi ładowanie Twoich urządzeń, ale także umożliwi szybką synchronizację danych przy prędkości transferu sięgającej 480Mbs. Wykorzystaj go do przenoszenia zdjęć i filmów z telefonu czy tabletu, tworząc kopie zapasowe swoich najważniejszych wspomnień. Gotów na wszystko! Przewód z jedną wygiętą wtyczką L został zaprojektowany z myślą o intensywnym użytkowaniu. Cała konstrukcja kabla została wzmocniona, dzięki czemu przewody są teraz bardziej odporne na wszelkiego rodzaju uszkodzenia. To nie tylko zabezpiecza przed przypadkowymi złamaniami, ale także sprawia, że świetnie sprawdza się nawet w najtrudniejszych warunkach. Android Auto Za pomocą kabla możesz teraz bezproblemowo przesyłać obrazy z telefonu na ekran komputera pokładowego w swoim samochodzie. Ta funkcja jest dostępna dzięki zgodności z aplikacją Android Auto, która o