kietnikiem zapewnia precyzyjne, perfekcyjne dopasowanie, które sprawi, że schowek od Spigen stanie się integralną częścią Twojej Tesli. Elegancja i trwałość Zaawansowany design wykonany z wytrzymałego poliwęglanu gwarantuje nie tylko trwałość, ale także subtelny wygląd, który doskonale współgra z wnętrzem Twojej Tesli. Ten schowek to więcej niż tylko praktyczne rozwiązanie - to prawdziwa perła w dziedzinie organizacji przestrzeni. Wykorzystaj potencjał Zamień niewykorzystaną przestrzeń podłokietnika na ukrytą kryjówkę dla swoich skarbów. Z tym ukrytym schowkiem do podłokietnika firmy Spigen, każda podróż staje się jeszcze bardziej komfortowa i elegancka. Nie bój się wykorzystać nawet najmniejszego kawałka przestrzeni.','','organizer-samochodowy-spigen-console-organizer-hidden-storage-box-do-tesla-model-3-2022-23-y-2022-24-czarny','','','','Organizer samochodowy Spigen Console Organizer Hidden Storage Box do Tesla Model 3 (2022-23) / Y (2022-24), czarny','','','',''),(61528,1,1,'Spigen S560W Wondersnap Selfie Stick Tripod Uniwersalny But first... let me take a selfie Spigen S560W to nie tylko praktyczne narzędzie dla miłośników fotografii, ale również elegancki dodatek dla posiadaczy smartfonów i nie tylko. Ten innowacyjny selfie stick nie tylko wyróżnia się unikalnym designem, ale także solidną konstrukcją, zaprojektowaną z myślą o zapewnieniu niezawodnej funkcjonalności. Dzięki kompaktowej budowie możesz zabrać go ze sobą gdzie tylko chcesz i rozpocząć nagrywanie wspomnień lub wykonać sesję słodkich fotek ze znajomymi. Kompatybilny z smartfonami z iOS i Android oraz z popularnymi kamerkami sportowymi czy aparatami. Wymiar złożonego: 30,48 cm Wymiar maksymalny rozłożonego: 161 cm Obsługiwane maksymalne obciążenie: 1kg Kolor producenta: Black (czarny) Kompaktowe wymiary Wymiar złożonego selfie sticka wynosi jedynie 30,48 cm, co sprawia, że bezproblemowo mieści się w każdej torbie czy plecaku, a nawet kieszeni spodni, będąc zawsze gotowym do użycia. Teleskopowa rurka umożliwia rozłożenie do maksymalnej długości 161 cm, co pozwala na uchwycenie szerokiego kąta i uzyskanie unikalnych ujęć. Jego waga 373g - sprawia, że Spigen S560W jest nie tylko lekki, ale także przenośny, co czyni go idealnym towarzyszem podróży. Dzięki tym zrównoważonym wymiarom, selfie stick ten staje się niezastąpionym narzędziem dla każdego, kto ceni wygodę, funkcjonalność i mobilność podczas tworzenia zdjęć i filmów. Bezprzewodowa wygoda Dzięki wbudowanemu modułowi Bluetooth 5.0, Spigen S560W umożliwia bezprzewodowe połączenie ze smartfonem, co eliminuje uciążliwe korzystanie z kabli i zapewnia wygodną obsługę. Niech ręka odpocznie... Gdy Twoja ręka zaczyna odczuwać zmęczenie po długim trzymaniu selfie sticka, z łatwością możesz przekształcić go w wygodny statyw. Wyjątkowa funkcja tripoda - statywu z trzema nogami, gwarantuje stabilność podczas fotografowania czy nagrywania filmów. W połączeniu z pilotem Bluetooth sprawia, że Spigen S560W nie tylko gwarantuje stabilność podczas tworzenia dynamicznych selfie, ale również staje się praktycznym narzędziem do produkcji profesjonalnych treści, eliminując potrzebę manualnego trzymania urządzenia. Jego ogromną zaletą jest fakt, że działa w maksymalnej odległości 10 metrów od selfie sticka. Pilot możesz przymocować do uchwytu lub wyjąć go i używać bezprzewodowo. Wyposażony jest w baterię CR1632 i wytrzymuje do 50.000 zdjęć lub maksymalnie 6 miesięcy w trybie czuwania. Dostosuj dla idealnego kadru Dynamiczna głowica (190) umożliwia elastyczne dostosowanie smartfona zarówno w pionie, jak i poziomie. Innowacyjny uchwyt 360 pewnie trzyma telefon, zapewniając stabilność podczas fotografowania z różnych kątów. Ergonomiczny design sprawia, że kijek doskonale leży w dłoni, gwarantując wygodę podczas użytkowania. Co w zestawie piszczy? Zestaw Spigen S560W składa się z: Spigen S560W Wondersnap Selfie Stick Tripod Bezprzewodowy pilot Bluetooth Adapter do uniwersalnego montażu kamerek, aparatów Instrukcja obsługi','','uchwyt-kijek-statyw-spigen-s560w-bluetooth-selfie-stick-tripod-czarny','','','','Uchwyt, kijek, statyw Spigen S560W Bluetooth Selfie Stick Tripod, czarny','','','',''),(61622,1,1,'Tech-Protect L06S MagSafe Wireless Selfie Stick Tripod Dla smartfonów z Bluetooth, z obsługą MagSafe Dla perfekcyjnych ujęć Tech-Protect L06S to innowacyjny selfie stick, który spełni oczekiwania nawet najbardziej wymagających fotografów i vlogerów. Jego niezwykła kombinacja wytrzymałości, stabilności i wszechstronności zapewnia niezawodne ujęcia w każdej sytuacji. Teraz możesz zabrać go ze sobą wszędzie, wystarczy jedno przekręcenie, a już możesz zaczynać swoją sesję selfie. Ale to nie wszystko! Tech-Protect L06S to także przenośny statyw, który daje Ci pełną swobodę kreatywności. Kompatybilny z urządzeniami iOS i Android. Waga: 190g Wymiar rozłożonego (maksymalny): 82 cm Kolor producenta: Black (czarny) Regulowana wysokość Selfie Stick posiada teleskopową rurkę, która pozwala na imponujące wydłużenie kijka, co znacząco rozszerza Twoje możliwości fotografowania. Szeroki kąt czy grupa znajomych - teraz wszystko jest w zasięgu Twojej ręki. A kiedy zależy Ci na dodatkowej stabilności, trzy nogi selfie sticka włączają się do gry, gwarantując stabilność podczas tworzenia zdjęć i filmów. To właściwie tripod, który staje się nieodłącznym narzędziem dla profesjonalistów tworzących treści multimedialne. Po złożeniu jest niewielki i poręczny, zajmując zaledwie 24 cm. Niezależnie od tego, czy tworzysz zdjęcia czy filmy, głowica selfie sticka, obracająca się o 360 stopni stawia Cię w pełnej kontroli nad kątem nagrywania. To narzędzie, które stwarza przestrzeń dla Twojej kreatywności, pozwalając na dostosowanie każdego ujęcia do własnych potrzeb. Bezprzewodowa wygoda Dzięki zintegrowanemu modułowi Bluetooth, zestawienie bezprzewodowego połączenia między pilotem a Twoim smartfonem to teraz dziecinnie prosta sprawa. To oznacza, że możesz pozostawić w zapomnieniu plątaninę kabli. Obsługa jest intuicyjna i komfortowa, co stanowi jedną z kluczowych zalet tego urządzenia. Niezawodny partner na każdą okazję Dzięki wytrzymałym materiałom użytym do produkcji Tech-Protect L06S, ten selfie stick nie tylko gwarantuje niezawodność, ale także przetrwa długie sezony użytkowania. Twoje zmartwienia o trwałość możesz odłożyć na bok, ponieważ to narzędzie jest zaprojektowane z myślą o wieloletnim użytkowaniu. Solidność uchwytu to gwarancja stabilności podczas wykonywania zdjęć i nagrań wideo. A dzięki obsłudze systemu MagSafe, twój iPhone będzie bezpiecznie zamocowany, eliminując wszelkie obawy związane z potencjalnym przypadkowym upadkiem. Teraz możesz robić zdjęcia bez obaw, niezależnie od tego, gdzie się znajdujesz.','','uchwyt-kijek-statyw-tech-protect-l06s-magsafe-wireless-selfie-stick-tripod-bluetooth-czarny','','','','Uchwyt, kijek, statyw Tech-Protect L06S MagSafe Wireless Selfie Stick Tripod Bluetooth, czarny','','','',''),(61644,1,1,'Ugreen metalowa, aluminiowa składana podstawka Dla smartfonów tabletów do 7,2 Aluminiowa elegancja! Odkryj rozwiązanie, które łączy w sobie wygodę, elegancję i funkcjonalność - przenośną podstawkę do ładowania marki Ugreen. Wykonana z aluminium, metalowa podstawka zapewnia nie tylko stabilne wsparcie dla Twojego telefonu komórkowego lub mini tabletu, ale także doskonały porządek w kablach, które są sprawnie wyprowadzane przez tylny otwór podstawki. Rozmiary podstawki: 10 x 7,6 x 12 cm Kolor producenta: Grey (szary) Przedmiotem sprzedaży jest sama podstawka, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu funkcjonalności produktu. Swoboda podczas ładowania! Dzięki tej podstawce możesz swobodnie obsługiwać swoje urządzenie, nawet gdy jest podłączone do ładowarki. Teraz nie musisz przerywać oglądania ulubionego serialu czy teledysku - możesz swobodnie odtwarzać pliki audio i dostosować kąt nachylenia podstawki, aby uzyskać doskonałą jakość obrazu i dźwięku. Podróżuj lekko! Przenośna podstawa nie tylko zachwyca stylem i funkcjonalnością, ale także zapewnia wyjątkową lekkość dzięki aluminiowym komponentom. Jej składana konstrukcja w trzech stopniach sprawia, że jest niezwykle łatwa do przechowywania i przenoszenia. Bez względu na to, czy podróżujesz z mniejszym bagażem podręcznym, plecakiem czy torbą z łatwością się w niej zmieści, gwarantując Ci komfort w podróży. Dla różnych urządzeń! Uniwersalna konstrukcja doskonale sprawdza się z różnymi smartfonami i tabletami o rozmiarze do 7,2 cali. Niezależnie od tego, czy używasz iPhonea, Samsunga Galaxy, Huawei czy innego urządzenia, możesz być pewien stabilnego podparcia. Teraz możesz swobodnie korzystać z urządzenia, nie martwiąc się o jego bezpieczeństwo czy wygodę użytkowania. Zapewnij bezpieczeństwo i stabilność! Wewnątrz uchwytu znajdują się specjalne wkładki wykonane z miękkiego silikonu, które skutecznie chronią obudowę urządzenia przed ewentualnymi uszkodzeniami mechanicznymi podczas procesu ładowania. Dodatkowo dzięki właściwościom antypoślizgowym, zapewniają one stabilną pozycję urządzenia, eliminując ryzyko przypadkowego przesunięcia się czy upadku. Regulowane ramiona boczne wykonane z teflonu pozwalają precyzyjnie dopasować uchwyt do różnych rozmiarów urządzeń.','','uchwyt-podstawka-stojak-biurkowy-ugreen-na-telefon-tablet-szary','','','','Uchwyt, podstawka, stojak biurkowy Ugreen na telefon / tablet, szary','','','',''),(61717,1,1,'HUB Ugreen CM219 70336 - 4x USB 3.0 Gen 1 dla urządzeń z portem USB-C Rozszerz swoje możliwości! Poszerz swoje horyzonty z nowoczesnym rozdzielaczem USB Typ C od Ugreen! Ten elegancki HUB, wyposażony w wtyczkę USB Typ C oraz cztery złącza USB 3.2 Gen 1, otwiera przed Tobą zupełnie nowe perspektywy. Niezależnie od tego, czy jesteś użytkownikiem laptopa czy smartfona z portem USB Typ C, ten rewelacyjny gadżet zapewni Ci ekspresową prędkość, ładowanie sprzętu oraz możliwość podłączenia pendriveów, dysków zewnętrznych czy nawet projektora! Idealny dla tych, którzy mają wszystkie porty w komputerze zajęte. Kolor 