','etui-alwaysmart-tpu-colorful-case-do-xiaomi-14-pomaranczowe','','','','Etui AlwaySmart TPU Colorful Case do Xiaomi 14, pomarańczowe','','','',''),(61758,1,1,'Produkt oficjalnie licencjonowany przez PlayStation Kontroler Pad Backbone One PlayStation dla urządzeń z wejściem USB-C z Androidem oraz iPhone z wejściem USB-C Ergonomia spotyka innowację Zanurz się w niezrównane doznania z Backbone One kontrolerem PlayStation do telefonu, który jest mistrzowskim dziełem ergonomii i innowacji. Zapomnij o ograniczeniach tradycyjnych kontrolerów Backbone One został zaprojektowany z myślą o twoim komforcie i zadowoleniu z gry. Jego starannie wyprofilowana forma idealnie leży w dłoniach, oferując ultra szerokie analogowe spusty, które zaspokoją nawet najbardziej wymagających graczy. Dzięki klikalnym drążkom, wyjątkowo czułemu D-pad oraz przyciskom funkcyjnym, każda akcja staje się intuicyjna i precyzyjna. Kompaktowa budowa kontrolera gwarantuje, że będziesz mógł zabrać swoją ulubioną rozrywkę wszędzie ze sobą. Przedmiotem sprzedaży jest sam pad, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: White (biały) Niezakłócona rozrywka Backbone One wyposażono w gniazdo słuchawkowe, co pozwala na całkowite zanurzenie się w świat gier, bez zewnętrznych rozpraszaczy. Podłącz swój ulubiony zestaw słuchawkowy i ciesz się krystalicznie czystym dźwiękiem, który przeniesie Cię prosto do centrum akcji. Kontroler z gniazdem słuchawkowym to gwarancja, że żaden detal dźwiękowy nie umknie Twojej uwadze. Zawsze gotowy do akcji Kontroler redefiniuje pojęcie mobilnej rozgrywki, eliminując potrzebę posiadania baterii. Dzięki inteligentnemu wykorzystaniu portu USB-C, kontroler nie tylko łączy się z Twoim telefonem, ale również pozwala na pasywne ładowanie podczas gry. To rozwiązanie zapewnia nieprzerwane sesje rozgrywki, bez konieczności martwienia się o poziom naładowania. Dodatkowo, pad oferuje funkcję nagrywania rozgrywki i robienia zrzutów ekranu, co umożliwia łatwe dzielenie się Twoimi osiągnięciami z przyjaciółmi. Ciesz się grą bez przerywania na ładowanie, aktualizacje czy konfigurację po prostu graj. Specyfikacja warta uwagi! Kontroler jest kompatybilny z większością telefonów wyposażonych w złącze USB-C, w tym z urządzeniami marki Apple, Samsung, Google i wielu innych. Jego składana konstrukcja nie tylko ułatwia transport, ale również dostosowuje się do różnych rozmiarów telefonów. Dzięki wymiarom i wadze idealnie wyważonym pod kątem mobilności, kontroler jest prawdziwym towarzyszem każdego gracza. Z Backbone One, Twoja podróż do świata mobilnych gier nabiera zupełnie nowego wymiaru. Niezależnie od tego, czy jesteś zapalonym graczem, czy dopiero rozpoczynasz swoją przygodę, ten kontroler otwiera przed Tobą drzwi do nieograniczonych możliwości rozrywki. Przygotuj się na przełom w mobilnym gamingu. Pracuje z iPhone i Android posiadające wejście USB-C Posiada certyfikat Made for iPhone, Works with android','','kontroler-do-mobilnego-grania-backbone-one-playstation-edition-usb-c-bialy','','','','Kontroler do mobilnego grania Backbone One PlayStation Edition, USB-C, biały','','','',''),(61810,1,1,'Uchwyt na tablettelefon 3MK Single Headrest Holder Uniwersalny na zagłówek samochodowy Wygoda i wysoka jakość Uchwyt na zagłówek samochodowy do telefonu lub tabletu marki 3mk z serii Single Headrest Holder wykonany jest z wysokiej jakości tworzyw sztucznych. Single Headrest Holder to praktyczne rozwiązanie w podróży, ale także gwarancja komfortu. Pozwala on łatwo i bezpiecznie umieścić urządzenie w zasięgu wzroku, umożliwiając korzystanie z niego w trakcie jazdy. Zaciski od wewnątrz pokryte są silikonowymi wkładkami dzięki czemu nie musisz się martwić o zarysowanie telefonu. Kolor producenta: Grafitowy Przypnij do zagłówka! Dzięki tej innowacyjnej konstrukcji możesz teraz bezpiecznie utrzymywać swój telefon lub tablet, ciesząc się pełną funkcjonalnością urządzenia. Wygodne zamocowanie na zagłówku samochodu sprawia, że podróż staje się jeszcze przyjemniejsza, bez względu na cel czy długość trasy. Single Headrest Holder - Twój niezawodny towarzysz podróży Ramiona zapewniają stabilny chwyt oraz bezpieczeństwo urządzenia nawet podczas jazdy w trudnych warunkach drogowych. Montaż uchwytu jest niezwykle prosty i intuicyjny. Zaprojektowany, aby być kompatybilny z zagłówkami o szerokości od 105 do 150 mm. Kompatybilny z urządzeniami od 4,7 do 12,9 cala. Pełna regulacja Ruchome ramię to idealne rozwiązanie, dostosowując się od 0 do 170 mm, aby sprostać wszystkim Twoim potrzebom. Czy masz ochotę obejrzeć film, pracować nad prezentacją, czy może Twoje dziecko chce zanurzyć się w ulubionej grze? To ruchome ramię umożliwi Ci precyzyjne ustawienie urządzenia dokładnie w taki sposób, jak tego potrzebujesz. Holder zapewnia regulowaną szerokość, aby sprostać różnym wymiarom urządzeń. Z łatwością dostosuj go do swojego smartfona lub tabletu, ponieważ szerokość regulacji wynosi od 118 do 250 mm. Ta elastyczność pozwala Ci swobodnie korzystać z urządzenia, niezależnie od jego rozmiaru, gwarantując pełen komfort użytkowania.','','uchwyt-holder-na-telefon-lub-tablet-na-zaglowek-3mk-single-headrest-holder-grafitowy','','','','Uchwyt / Holder na telefon lub tablet na zagłówek 3MK Single Headrest Holder, grafitowy','','','',''),(61834,1,1,'Belkin Connect USB-C 11-in-1 Pro Dock USB-C do USB-A USB-C Ethernet HDMI VGA SD MicroSD 3.5mm audio combo InOutuniwersalna dla laptopów z USB-C (Thunderbolt 43) MacBook Windows Chromebook XPS i wiele innych Podłącz dodatkowe urządzenia i monitory do laptopa Oryginalna stacja wieloportowa marki Belkin przeznaczona dla laptopów ze złączem USB-C z obsługą video. Jej główną zaletą jest design, kwalifikujący ją także jako podstawkę pod laptop, dzięki czemu jest to rewelacyjne rozwiązanie dla osób, mających na biurku niewiele miejsca na dodatkowe akcesoria. Hub umożliwia podpięcie do stanowiska roboczego aż do 3 monitorów w zależności od specyfikacji samego laptopa. Do tego dostępność i różnorodność portów oferuje wygodę podłączenia dowolnego urządzenia na USB, Internetu, słuchawek z mikrofonem, kart SD czy MicroSD. Zapewnia przepustowość do 10Gbs między podłączonymi urządzeniami peryferyjnymi a laptopem. Dodatkowym atutem tej stacji jest wyposażenie jej w port USB-C PD 3.0 pozwalający na dostarczanie mocy w przelocie max do 100W - minus 15W na zasilenie samej stacji. Dodatkowymi zaletami stacji są m. in. wykorzystanie technologii SM768 - Silicon Motion dla umożliwienia obsługi wielu monitorów, a także slot bezpieczeństwa Kensington security lock, który pozwala zabezpieczyć huba na jego stanowisku. To świetne rozwiązanie do przesyłania video do monitorów, projektorów, czy też do zapewnienia sprawnego połączenia z siecią internetową. Dzięki niemu bez problemu zwiększysz komfort i wygodę swojej pracy, w łatwy sposób powiększając stanowisko robocze o dodatkowe komponenty. Do prawidłowego działania musisz posiadać ładowarkę o mocy minimum 65W (brak w zestawie), aby zapewnić do 50W ładowania przelotowego podczas korzystania z pozostałych funkcji stacji dokującej. Stacja pobiera 15W z podpiętej ładowarki na potrzeby własnego funkcjonowania. Oznacza to, że przy ładowarce 100W maksymalna moc ładowania laptopa wyniesie 85W. Rzeczywista wydajność może się różnić w zależności od specyfikacji i wymagań danego laptopa, do którego stacja zostanie podłączona. W opakowaniu: stacja Belkin INC014 z wbudowanym kablem USB-C o długości ok. 35 cm instrukcja dokumentacja Kolor producenta: Silver (srebrny szary czarny) Hub i podstawka do laptopa w jednym Design huba świetnie sprawdzi się w każdych okolicznościach, ale z pewnością przypadnie do gustu tym, którzy mają ograniczone miejsce na swoim biurku. A to dlatego, że stacja służy także jako podstawka pod laptopa, co sprawia, że nie zabiera dodatkowego miejsca w Twojej przestrzeni. Wszystkie porty znajdują się na jej tylnej części, dzięki czemu cały czas są dostępne mimo postawienia na niej komputera. Duży wybór portów Multimedialna stacja Belkin INC014 pozwala na podłączenie większej ilości sprzętu użytkowego, jak również z powodzeniem nada się do udostępniania ekranu laptopa innym osobom. Przydatna w domu, w biurze, czy na spotkaniach prezentacyjnych, itp. Przejściówka może obsługiwać trzy wyświetlacze jednocześnie. Można ją podłączyć do wielu laptopów Mac, Windows czy Chromebook, wyposażonych w złącze USB-C (lub Thunderbolt 43). Dostępne porty: Kensington security lock SD 4.0 - czytnik kart MicroSD 3.0 - czytnik kart USB-A 3.2 - 10Gbs (0,9A) USB-A 3.2 - 10Gbs (0,9A) USB-C 3.2 - 10Gbs (1,5A) USB-C 3.2 PD - 100W - port wejścia do ładowania laptopa w przelocie (-15W dla działania samego huba) HDMI - 4K 60Hz (DP-Alt Mode) HDMI - 4K 30Hz (SM) VGA - 1080P Ethernet 2,5 Gbs Audio 3.5mm jack INOUT combo (TRSS) dla słuchawek z wbudowanym mikrofonem Belkin INC014 może być używany bez zewnętrznego zasilacza, ale z ograniczoną funkcjonalnością. Hub pobierze minimum potrzebnego zasilania z portu USB-C komputera. Korzystając ze stacji dokującej w ten sposób, utracisz możliwość ładowania urządzeń z portów USB-C i możesz nie mieć możliwości jednoczesnego korzystania z wielu wyświetlaczy. Rzeczywista wydajność zależy od zapotrzebowania laptopa na energię. 3 monitory jednocześnie Zwiększ możliwości swojego stanowiska o dodatkowe monitory. Stacja obsługuje nawet 3 wyświetlacze jednocześnie z maksymalnymi rozdzielczościami zależnymi od podpiętego laptopa hostującego (rzeczywiste wyjście wyświetlacza może się różnić w zależności od specyfikacji urządzenia hosta). SM768 - stacja wykorzystuje technologię Silicon Motion, co umożliwia komputerowi obsługę wielu wyświetlaczy zewnętrznych Kompatybilny z MacBook M1 i M2 dla trybu dual extended display UWAGA! Należy pamiętać, że: Liczba monitorów, której można użyć z laptopem zależy od mocy komputera i możliwości jego karty graficznej. Nie wszystkie komputery mają możliwości graficzne do obsługi wielu monitorów i mogą wystąpić problemy z wyświetlaniem podczas próby użycia wielu wyświetlaczy. Obsługiwane maksymalne rozdzielczości monitora zależą od liczby monitorów podłączonych i używanych w tym samym czasie oraz od mocy komputera. Maksymalna liczba wyświetlaczy obsługiwanych przez stację dokującą różni się od maksymalnej liczby wyświetlaczy obsługiwanych przez dany komputer. Chociaż stacja dokująca może obsługiwać rozdzielczości i częstotliwości odświeżania podane w specyfikacji, komputer może ich nie obsługiwać. Skontaktuj się z producentem swojego komputera, aby uzyskać informacje na temat możliwości obsługiwania wyświetlaczy. Wygodnie i stylowo Niezależnie od tego, czy pracujesz, przesyłasz strumieniowo, czy grasz, będziesz cieszyć się prostą i solidną łącznością. Stacja charakteryzuje się minimalistyczną, lecz stylową budową o wysokiej jakości wykonania, która świetnie będzie się prezentować w każdej przestrzeni. Wymiary: 25,9 x 8,89 x 2,28 cm Waga: 404 g Testowana kompatybilność iPad Pro M1MacBook Pro M2MacBook Pro M1MacBook Pro IntelDell XPS 9310HP Spectre 360HP EliteBook 745 G6Lenovo X1Microsoft Surface Book 3 PixelBook GoDell S2722QCDell U2720QDell UP3218KHP P32u G5HP N240HLenovo ThinkVision T27h-20LG 43UD79Acer XV282K Wiele zalet w jednym urządzeniu Podłączaj, zasilaj, przesyłaj dane i wyświetlaj wideo w tym samym czasie za pomocą jednego połączenia kablowego dzięki stacji Belkin. 10 Gbs transferów danych Zgodność z Thunderbolt 3 i 4 Zgodność z USB-C Kompatybilność z Kensington security lock Technologia Silicon Motion zwiększa moc i produktywność Twojej konfiguracji sprzętowej Obsługa 3 monitorów jednocześnie Obsługa sieci Ethernet aż do 2,5Gbs Hub z funkcją podstawki pod laptopa Dzięki niej Twoje stanowisko robocze zyska większą funkcjonalność jak i lepszą wygodę w użytkowaniu.','','stacja-hub-belkin-connect-usb-c-11-in-1-pro-dock-100w-srebrna','','','','Stacja, hub Belkin Connect USB-C 11-in-1 Pro Dock 100W, srebrna','','','',''),(61925,1,1,'Tech-Protect L05S Wireless Selfie Stick 