tooth','','uchwyt-kijek-statyw-tech-protect-l05s-wireless-selfie-stick-tripod-bluetooth-led-light-czarny','','','','Uchwyt, kijek, statyw Tech-Protect L05S  Wireless Selfie Stick Tripod Bluetooth & Led Light, czarny','','','',''),(61988,1,1,'Tech-Protect L03S Wireless Selfie Stick Tripod Bluetooth Dla smartfonów z Bluetooth Dla perfekcyjnych ujęć Tech-Protect L03S to innowacyjny selfie stick, który spełni oczekiwania nawet najbardziej wymagających fotografów i vlogerów. Jego niezwykła kombinacja wytrzymałości, stabilności i wszechstronności zapewnia niezawodne ujęcia w każdej sytuacji. Teraz możesz zabrać go ze sobą wszędzie, wystarczy jedno przekręcenie, a już możesz zaczynać swoją sesję selfie. Ale to nie wszystko! Tech-Protect L03S to także przenośny statyw, który daje Ci pełną swobodę kreatywności. Maksymalna szerokość ramion uchwytu: 93mm Kolor producenta: White (biały) Regulowana wysokość Dzięki teleskopowej konstrukcji, wysokość selfie sticka Tech-Protect L03S możesz swobodnie dostosować do swoich potrzeb - nawet do imponujących 148 cm! Po złożeniu jest niewielki i poręczny, zajmując zaledwie 30 cm. Niezależnie od tego, czy preferujesz pozycję pionową czy poziomą, ruchoma głowica o kącie 180 umożliwia precyzyjne ustawienie smartfona. Dodatkowo, obrotowy uchwyt o pełnym zakresie 360 trzyma telefon pewnie i mocno, zapewniając Ci możliwość robienia zdjęć pod dowolnym kątem. A ergonomiczny design sprawia, że selfie stick L03S idealnie leży w Twojej dłoni. Coś dla vlogerów Dzięki pilotowi Bluetooth, który jest częścią tego zestawu, możesz zdalnie sterować swoim smartfonem z odległości do 12 metrów. Nie musisz się martwić o zamieszanie z przewodami czy trudnością w uchwyceniu idealnego kadru. Teraz możesz zająć idealną pozycję, ustawić się w odpowiedniej odległości i wykorzystać pilot Bluetooth do zdalnego robienia zdjęć. Dodatkowo pilot Bluetooth pozwala na zdalne uruchamianie i zatrzymywanie nagrywania wideo, co czyni go idealnym narzędziem dla vlogerów. Teraz możesz skupić się na swoim wystąpieniu lub aktywności, a jednocześnie mieć pełną kontrolę nad rejestrowanym materiałem. Uchwyt posiada wbudowane miejsce na pilot Bluetooth. Niezawodny partner na każdą okazję Tech-Protect L03S wyróżnia się nie tylko swoją wytrzymałością, ale także lekkością dzięki aluminiowej konstrukcji. Łapy uchwytu i nóżki są wyposażone w antypoślizgowe silikonowe podkładki, które gwarantują pewne trzymanie na każdej powierzchni. Teraz możesz robić zdjęcia bez obaw, niezależnie od tego, gdzie się znajdujesz. ZESTAW ZAWIERA: Selfie Stick Tech-Protect L03S Pilot Bluetooth - Praktyczne sterowanie z odległości do 12 metrów. Torba transportowa','','uchwyt-kijek-statyw-tech-protect-l03s-wireless-selfie-stick-tripod-bluetooth-bialy','','','','Uchwyt, kijek, statyw Tech-Protect L03S Wireless Selfie Stick Tripod Bluetooth, biały','','','',''),(62003,1,1,'Belkin BoostCharge Pro Dual USB-C Wall Charger with PPS 60W Uniwersalna 2x USB-C Wygodna i elegancka ładowarka sieciowa Oryginalna, kompaktowa ładowarka sieciowa marki Belkin z serii BoostCharge Pro przeznaczona dla wszelkich urządzeń posiadających kabel ze złączem USB typu C. Ładowarkę charakteryzuje elegancki, nowoczesny, i szczególnie smukły design, dzięki któremu doskonale wpasowuje się między inne wtyczki na listwie zasilającej. Dwa porty USB-C Power Delivery 3.1 PPS zostały wyposażone w technologię, która wykrywa możliwie maksymalne natężenie prądu dla danego urządzenia, co znacznie skraca czas ładowania względem standardowych ładowarek, zapewniając ładowanym urządzeniom optymalną ilość energii z każdego portu. *Przedmiotem sprzedaży jest sama ładowarka, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jej funkcjonalności. Kolor producenta: White (biała) Szybsze ładowanie 2x 30W Naładuje Twój smartfon, tablet, laptop, czy inne urządzenie z optymalną, możliwie najszybsza prędkością. Nowoczesna konstrukcja zapewnia łatwe i wygodne użytkowanie. Wyjścia: USB-C PD 3.1: do 30W max podczas obciążenia jednego lub obu portów(5V 3A), (9V 3A), (12V 2.5), (15V 2A), (20V 1.5A) USB-C PD 3.1: do 30W max podczas obciążenia jednego lub obu portów(5V 3A), (9V 3A), (12V 2.5), (15V 2A), (20V 1.5A) Ponadto ładowarka wyposażona została w technologię dynamicznego ładowania PPS, która wykrywa podłączone urządzenie i negocjuje odpowiednią ilość energii wymaganą do wydajnego ładowania. Parametry PPS: 3,3-11V 2,7A 60W max 3,3-16V 1,8A 60W max *Do wykorzystania potencjału ładowarki wymagane jest posiadanie kabli z obsługą Power Delivery 3.1 i przepustowością odpowiadającą jej parametrom. Nowoczesny design Nowoczesny design ładowarki prezentuje się smukło i stylowo. Doskonale sprawdzi się w ciasnym szeregu gniazdek na listwach zasilających, a ponadto równie łatwo zmieścisz ją w torebce czy plecaku, by mieć ją zawsze pod ręką będąc poza domem. Gwarancja bezpieczeństwa Ładowarki firmy Belkin są tak skonstruowane, aby zapewnić najlepsze zabezpieczenie urządzenia podczas ładowania. Inteligentny układ mierzy napięcie i automatycznie dostosowuje odpowiednio maksymalną moc ładowania. Belkin zapewnia gwarancję bezpieczeństwa podłączonego sprzętu o wartości do 2,000 Euro. Jeśli sprzęt zostanie uszkodzony przez ładunek elektryczny podczas prawidłowego podłączenia do ładowarki, Belkin naprawi lub wymieni urządzenie na nowe.','','ladowarka-sieciowa-2x-usb-c-pd-31-pps-60w-belkin-boost-pro-wall-dual-biala','','','','Ładowarka sieciowa 2x USB-C PD 3.1 PPS, 60W, Belkin Boost Pro Wall Dual, biała','','','',''),(62045,1,1,'Podstawka pod monitor laptopa Nillkin HighDesk Stand dla laptopów monitorów Ekskluzywny design, lekkość aluminium Wyjątkowa podstawka HighDesk Monitor Stand to w 100 aluminium! To niezwykłe połączenie trwałości z ekskluzywnym stylem, który podkreśla prestiż Twojego stanowiska pracy i dba o Twoją prawidłową pozycję przy biurku. Wykonany z anodowanego aluminium nie tylko prezentuje się bosko, ale także skutecznie odprowadza ciepło, dzięki czemu Twój laptop czy monitor pr