a budowa Stylowa podstawka z serii ProDesk bezpiecznie utrzyma Twoje urządzenie, pozwalając na jego wygodną obsługę. wytrzymała budowa z anodowanego aluminium łatwe dostosowywanie odpowiedniego kąta widzenia antypoślizgowe nóżki oraz stabilizatory pozycji laptopa elegancki srebrny kolor Prosta obsługa Dzięki przemyślanej konstrukcji na bazie litery Zpodstawka jest niezwykle mobilna, co daje większą elastyczność w użytkowaniu. Całość jest niesamowicie lekka, przez co podstawkę można bez problemu spakować do plecaka lub torby. Silikonowe podładki antypoślizogwe znajdują się zarówno na podstawie stojaka, zapobiegając jego przesuwaniu się po blacie biurka czy stołu, jak i na podstawce zwiększając stabilność dla samego urządzenia. Wygoda użytkowania Podstawka ProDesk Laptop Stand zapewnia dużą swobodę użytkowania i jest niezwykle funkcjonalna, a jej ergonomiczna budowa i stylowy wygląd sprawiają, że całość świetnie się prezentuje, co jest dowodem na to, że gadżety dodające wygody mogą jednocześnie cieszyć oko swoim wykonaniem. Szeroka kompatybilność Podstawka świetnie nada się dla większości laptopów. Ponadto jej szeroki rozstaw oraz powierzchnia wzmocniona poprzez anodowanie zapewnia doskonałe odprowadzanie ciepła na spodzie urządzenia. Składana konstrukcja Uchwyt możesz mieć zawsze przy sobie, jego składana konstrukcja oferuje możliwość złożenia go do kompaktowego, płaskiego rozmiaru, który z łatwością zmieścisz w torbie od laptopa czy plecaku, mając większą wygodę w jego przenoszeniu.','','uchwyt-podstawka-nillkin-prodesk-laptop-stand-szary','','','','Uchwyt, podstawka Nillkin Prodesk Laptop Stand, szary','','','',''),(62107,1,1,'Belkin Connect USB-C to 4-Port USB-C Hub USB-C do 4x USB-C Kompaktowy Hub USB-C 3.2 Gen2 Oryginalna i uniwersalna stacja czteroportowa marki Belkin przeznaczona dla laptopów ze złączem USB-C. Jej główną zaletą jest możliwość rozdzielenia jednego portu USB-C na aż 4 porty USB-C, co oferuje wygodę podłączenia większej ilości urządzeń peryferyjnych z kablem USB typu C, takich jak np. aparaty, kamery, kamery internetowe, klawiatury, myszy, interfejsy audio, zewnętrzne dyski twarde SSD PCIE, itp. Dodatkowym atutem tej stacji są jej niewielkie rozmiary, co czyni ją wygodnym hubem podróżnym, a dzięki obsłudze PlugPlay jest gotowa do użytku od razu po podłączeniu. Wymiary: ok. 7,5 x 4,2 x 1,40 cm Zapewnia przepustowość do 10Gbs między podłączonymi urządzeniami peryferyjnymi a laptopem. Dodatkowym atutem tej stacji jest wyposażenie jej w port USB-C PD pozwalający na dostarczanie mocy w przelocie max do 100W - minus ok. 15W na zasilenie samej stacji. W opakowaniu: stacja Belkin AVC018 zintegrowany kabel USB-C o długości ok. 22cm pozostałe przedmioty i akcesoria widoczne na zdjęciach przedstawiają jedynie funkcjonalność produktu Kolor producenta: Black (czarny) Podłączenie 4 urządzeń na USB-C Minimalistyczna stacja Belkin AVC018 pozwala na podłączenie aż 4 urządzeń na USB-C pod jeden port USB-C w Twoim laptopie. Przydatna w domu, w biurze, a dzięki kompaktowej i niewielkiej budowie świetnie sprawdzi się także w podróży. Jej szeroka kompatybilność pozwala na współpracę z wieloma zgodnymi urządzeniami. Dzięki niej zbudujesz potężną stację roboczą do płynnego przesyłania strumieniowego i grania oraz błyskawicznego pobierania i wysyłania danych. Dostępne porty: 4x USB-C 3.2 Gen2 z czego jeden port USB-C PD jest zarówno wejściem jak i wyjściem, oferując dostarczanie zasilania na poziomie 100W w przelocie (-15W dla działania samego huba) Szybko, wygodnie i stylowo - 10 Gbs Stacja charakteryzuje się minimalistyczną, lecz stylową budową o wysokiej jakości wykonania, która świetnie będzie się prezentować w każdej przestrzeni. Zintegrowany krótki kabel jest wystarczający by nie zabierać za wiele miejsca, a jednocześnie umożliwić wygodne podpięcie huba do komputera. Szybki transfer danych wynoszący maks. 10 Gbs zapewnia świetne i niezawodne połącznie, gdy edytujesz filmy czy zdjęcia lub próbujesz przejść na wyższy poziom w grze. Niezależnie od tego, czy pracujesz w biurze, tworzysz treści, grasz w domu, czy konfigurujesz stację roboczą do użytku zdalnego, ten 4-portowy koncentrator zapewni Ci pełną kontrolę i swobodę w użytkowaniu swojego stanowiska.','','stacja-hub-belkin-connect-usb-c-to-4-port-usb-c-usb-c-do-4x-usb-c-czarna','','','','Stacja, hub Belkin Connect USB-C to 4-Port USB-C, USB-C do 4x USB-C, czarna','','','',''),(62157,1,1,'Belkin Connect USB-C Core GaN Power Adapter 100W (INC016) Uniwersalna kompatybilność z USB-C PD Zasilacz sieciowy do laptopa z USB-C PD 100W Oryginalny zasilacz sieciowy marki Belkin z serii Connect wyposażony został w końcówkę z wtykiem USB-C PD co czyli go uniwersalnym zasilaczem do wielu laptopów jak MacBook, laptopów z systemem Windows, Chromebook, a nawet do przenośnych konsol typu Nintendo Switch czy SteamDeck. Zasilacz wykonano w technologii GaN, czyli z podzespołów wykonanych z azotku galu o mniejszym generowaniu ciepła niż standardowe krzemowe komponenty. To sprawia, że obudowa jest mniejsza niż w przypadku standardowych zasilaczy, a jednocześnie zwiększa wydajność i bezpieczeństwo dla podpiętych urządzeń. Do tego 6-cio punktowy system zabezpieczeń wraz z inteligentnym udostępnianiem mocy w trybie Power Delivery optymalizuje sygnał wyjściowy przesyłany do urządzenia zapewniając bezpieczne i wydajne ładowanie o dużej mocy, które nie powoduje przegrzania ani nadmiernego ładowania. Całkowita długość: 2,5m Długość kabla od wtyczki EU do zasilacza: 1m Długość kabla od zasilacza do wtyku USB-C: 1,5m *Przedmiotem sprzedaży jest sam zasilacz z kablem USB-C, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Black (czarny) Szeroka i uniwersalna kompatybilność Zapewnij ciągłą gotowość swojego laptopa i urządzeń do gier, dostarczając im moc nawet do 100W. Dzięki zastosowaniu technologii GaN (azotku galu), ten zasilacz charakteryzuje się mniejszymi wymiarami w porównaniu do tradycyjnych ładowarek, jednocześnie zapewniając wyższą wydajność i bezpieczeństwo dla Twoich urządzeń. Wyposażony w uniwersalny wtyk USB-C z obsługą Power Delivery do 100W oferuje szeroką kompatybilność z laptopami jak i przenośnymi konsolami posiadającymi takie wejście: do laptopów jak MacBook, laptopów z systemem Windows, Chromebook do przenośnych konsol typu Nintendo Switch czy SteamDeck do wielu innych urządzeń zgodnych z tym wtykiem i standardem Kabel USB-C jest odpinany od zasilacza, co pozwala łatwiej spakować go do torby. Całość ma 2,5m długości, a dołączony pasek do zarządzania długością kabla zapewnia porządek w miejscu użytkowania. Nowoczesny design z technologią GaN Zastosowanie tranzystorów z azotku galu (GaN - gallium nitride) zamiast tradycyjnego krzemu zaowocowało jeszcze mniejszym wytwarzaniem ciepła, co pozwoliło na bliższe usytuowanie wewnętrznych komponentów względem siebie, a tym samym zachowanie kompaktowej budowy zasilacza. Dzięki takiemu rozwiązaniu otrzymujesz znacznie mniejszy zasilacz z dużą mocą, która wymagałaby standardowo większej obudowy. Kompaktowe wymiary Potrzebujesz zasilacza do swojego laptopa z USB-C PD? Belkin Core GaN doskonale zastąpi Twój stary lub uszkodzony zasilacz, zapewniając ciągłość dostarczania mocy dla Twojego urządzenia. Jego minimalistyczny design prezentuje się smukło i spójnie w każdej przestrzeni. Zaprojektowany do użytku w pomieszczeniach: Zalecana temperatura pracy: od 0C do 40C przy wilgotności względnej (RH) od 10 do 90 Zalecana temperatura przechowywania: od -30C do 70C przy wilgotności względnej od 40 do 85 Posiada certyfikację USB-IF Posiada certyfikację WWCB - Works with ChromeBook Gwarancja bezpieczeństwa Ładowarki firmy Belkin są tak skonstruowane, aby zapewnić najlepsze zabezpieczenie urządzenia podczas ładowania. Inteligentny układ mierzy napięcie i automatycznie dostosowuje odpowiednio maksymalną moc ładowania. Belkin zapewnia gwarancję bezpieczeństwa podłączonego sprzętu o wartości do 2,000 Euro. Jeśli sprzęt zostanie uszkodzony przez ładunek elektryczny podczas prawidłowego podłączenia do ładowarki, Belkin naprawi lub wymieni urządzenie na nowe.','','zasilacz-sieciowy-do-laptopa-belkin-connect-usb-c-pd-core-gan-pa-100w-czarny','','','','Zasilacz sieciowy do laptopa Belkin Connect USB-C PD Core Gan PA 100W, czarny','','','',''),(62633,1,1,'Torba do laptopa Ugreen LP187 Do laptopów 14-14.9 Zadbaj o bezpieczeństwo swojego laptopa! Spraw by Twoje urządzenie było zawsze w nienagannym stanie, i bezpieczne. Dzięki torbie na laptopa od Ugreen możesz mieć pewność, że Twój laptop przetrwa każdą podróż i przygodę bezpiecznie! Producent zadbał również o to, by Twoje urządzenie nie było narażone na warunki atmosferyczne, dlatego pokrowiec jest wodoodporny. *Przedmiotem sprzedaży jest sama torba, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jej funkcjonalności. Wymiary torby: 35 x 25,5 x 2,5 cm Kolor producenta: Grey (szary) Podróż nie jedno ma imię Torba na laptopa Ugreen o przekątnej 14-14.9 idealnie sprawdzi się na co dzień, do szkoły, na studia jak i w pracy. Zaprojektowana została z myślą, by zajmować niewiele miejsca, dzięki czemu Twój laptop zmieścisz nawet do plecaka czy bagażu. Wodoodporna budowa Dzięki zastosowaniu skóry ekologicznej oraz wodoodpornego poliestru możesz być pewien, że Twoje urządzenie pozostanie w nienaruszonym stanie nawet w przypadku deszczu. Przemyślane materiały Producent poza użyciem ekologicznej skóry i poliestru do budowy pokrowca, wykorzystał również miękką tkaninę w środku. Dzięki czemu nie tylko ten pokrowiec jest mocny i bezpieczny, oraz nie porysuje Ci obudowy urządzenia. Teraz możesz swobodnie zabierać urządzenie w dowolne miejsce bez obaw o uszkodzenie!','','torba-na-laptopa-14-149-ugreen-lp187-szara','','','','Torba na laptopa 14\" - 14.9\"  Ugreen LP187, szara','','','',''),(62638,1,1,'Składana podstawka Ugreen pod laptopa z regulacją Uniwersalny urządzenia od 8 do 17,3 Idealny dodatek do laptopa Pracujesz hybrydowo? A może po prostu chcesz wygodnie pracować lub uczyć się? Podstawka pod laptopa Ugreen LP451 to niezbędne wyposażenie dla każdego, kto spędza dużo czasu przed ekranem. Dzięki niej możesz cieszyć się wygodnym korzystaniem z internetu, czytaniem i pracą, bez obaw o bóle pleców i karku. Podstawka przytrzyma laptopy, tablety i książki, zapewniając stabilność i bezpieczeństwo. Wyposażona w regulację wysokości oraz kąta nachylenia. *Przedmiotem sprzedaży jest sama podstawka, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jej funkcjonalności. Kolor producenta: Silver (srebrny) Wygodne korzystanie i stabilność Stojak Ugreen to wybór nie tylko wygodny, ale i praktyczny. Kompatybilna z urządzeniami przenośnymi o różnych wymiarach, od 8 do 17,3 cala, przytrzyma Twojego iPada, MacBooka Pro czy ciężki laptop. Ergonomiczna konstrukcja dodatkowo wpływa na efektywne chłodzenie Twojego laptopa, co przekłada się na jego wydajność. Podróżuj z wygodą Nie tylko w domu czy pracy, ale również w podróży, podstawka Ugreen LP451 jest niesamowicie wygodna. Składana, lekka konstrukcja i kompaktowe rozmiary sprawiają, że możesz zabrać ją ze sobą dosłownie wszędzie. Dzięki dołączonej torbie, bezpiecznie schowasz złożoną podstawkę i unikniesz uszkodzeń w transporcie. Pracuj wygodnie i skutecznie podczas wyjazdów służbowych lub w domu. Bezpieczeństwo i jakość wykonania Ugreen LP451 to nie tylko wygoda, ale i bezpieczeństwo Twoich urządzeń. Antypoślizgowe stopki i zaokrąglone brzegi zapobiegają ślizganiu się podstawki po blacie, co minimalizuje ryzyko uszkodzenia laptopa. Wykonana z aluminium powierzchnia nie rysuje się i nie odkształca, co pozwala na długotrwałe użytkowanie. To produkt, na który zawsze możesz liczyć! Kompatybilność: z laptopami od 8 do 17,3 Dopasowanie wysokości: 46,5-136,5 mm Materiał: aluminium silikon Wymiary po rozłożeniu: 270 x 235,6 x 136,5 mm Wymiary przed złożeniem: 270 x 55 x 136,5 mm W zestawie: torba do przechowania Waga: ok. 235 g','','skladana-podstawka-ugreen-pod-laptopa-z-regulacja-srebrna','','','','Składana podstawka Ugreen pod laptopa z regulacją, srebrna','','','',''),(62645,1,1,'Ugreen LP247 Phone Stand for Desk Dla smartfonów tabletów o przekątnej 4 - 7.9 cala Rozkładaj, dostosuj, ciesz się! Podstawka Ugreen LP247 to niezastąpione narzędzie dla osób, które doceniają ergonomiczne podejście do korzystania z urządzeń mobilnych. Możliwość precyzyjnego dostosowania wysokości oraz kąta nachylenia zapewnia optymalne ustawienie dla Twojego telefonu czy tabletu. Rozkłada się pod kątem 90 stopni. Niezależnie od tego, czy pracujesz, czy odpoczywasz, możesz swobodnie korzystać z urządzenia bez nadmiernego obciążenia dla oczu i szyi. Rozmiary podstawki: 11 x 8,5 x 3 cm (po złożeniu), wys. 9,5 - 12,5 cm Przedmiotem sprzedaży jest sama podstawka, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu funkcjonalności produktu. Kolor producenta: Black (czarny) Antypoślizgowe zabezpieczenie! Antypoślizgowe nakładki na podstawie i uchwycie zapewniają stabilne trzymanie urządzenia, co eliminuje ryzyko przypadkowego przesunięcia się podczas korzystania z niego. To oznacza, że możesz być pewny, że Twoje urządzenia będą bezpiecznie umieszczone na podstawce, nawet gdy pracujesz lub oglądasz treści w internecie przez długie godziny. Ładuj podczas używania! Nie musisz już rezygnować z korzystania z urządzenia, gdy bateria jest na wyczerpaniu. Stojak ma specjalny otwór pozwalający na jednoczesne korzystanie z urządzenia i ładowanie go. To praktyczne rozwiązanie, które sprawia, że możesz być zawsze gotowy do działania, bez konieczności przerywania pracy czy rozrywki. Mała, lekka, wszechstronna! Sprawdza się doskonale nie tylko w podróży, ale również w biurze czy w domu. Kompaktowy design sprawia, że łatwo zmieści się w każdym plecaku, torebce czy walizce, co czyni ją idealnym rozwiązaniem dla osób aktywnych i mobilnych.','','uchwyt-podstawka-stojak-biurkowy-ugreen-lp247-na-telefon-tablet-czarny','','','','Uchwyt, podstawka, stojak biurkowy Ugreen LP247 na telefon / tablet, czarny','','','',''),(62667,1,1,'Kieszeń na dysk twardy Ugreen kabel 0,5 m Obudowa dysku twardego 2,5 HDD SSD USB-C 3.0 (5 GBs) Praktyczne rozwiązanie! Obudowa zewnętrzna Ugreen dla dysków SATA 2,5 jest doskonałym połączeniem praktyczności oraz wydajności transferu. Kieszeń została starannie zaprojektowana i skupia się na zapewnieniu ochrony cennych informacji przechowywanych na dysku, jednocześnie umożliwiając błyskawiczny przesył danych, dzięki prędkości do 5Gbps. Dodatkowo producent umieścił diodę LED, dzięki której będziesz mógł mieć pewność, że dysk pracuje. Obsługuje interfejs: SATA I, SATA II, SATA III W zestawie znajdziesz też kabel USB-C 3.0 o długości 0,5 m. Kolor producenta: Black (czarny) *Przedmiotem sprzedaży jest sama kieszeń na dysk, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jej funkcjonalności. Zawsze pod ręką! Często podróżujesz? A może lubisz zmieniać komputery jak przysłowiowe rękawiczki? To rozwiązanie jest dla Ciebie! Zapomnij o problemie, jakim jest przenoszenie plików pomiędzy komputerami, od teraz Twój dysk może stać się zewnętrznym rozwiązaniem i być przepinanym pomiędzy wieloma urządzeniami! Dodatkowym atutem jest opcja bezpośredniego podłączenia dysku do telewizora, o ile ten posiada wbudowaną obsługę pamięci zewnętrznych. Możesz także wykorzystać go jako zewnętrzny dysk dla konsoli, co daje dodatkową elastyczność w przechowywaniu i zarządzaniu swoimi ulubionymi treściami multimedialnymi oraz grami. To nic skomplikowanego! Ugreen zadbał o to, by kieszeń była łatwa w instalacji! Wystarczy, że otworzysz pokrywkę, włożysz dysk i zamkniesz obudowę! Voilà! Od teraz możesz korzystać z dysku HDD SSD jako rozwiązania zewnętrznego, do wielu urządzeń! Model: US221 Chipset: VL711F0 Wsparcie protokołu: UASP Wymiary: 128.5 x 82 x 14 mm Port wejściowy: USB-C (żeński) Interfejs dysku: SATA I, SATA II, SATA II Prędkość przesyłania danych: do 5Gbps Rozmiar dysku: 2,5 HDD, SSD Grubość dysku: 7.5 9,5 mm Maksymalna pojemność dysku: do 6TB Kompatybilność: systemy Windows 2000 XP 7 8 8.1 10 Mac OS 8.0 i nowsze Linux','','kieszen-obudowa-na-dysk-ssd-hdd-ugreen-25-usb-c-30-5-gb-s-kabel-05-m-czarna','','','','Kieszeń, obudowa na dysk SSD / HDD  Ugreen  2,5\'\' USB-C 3.0 (5 GB/s) + kabel  0,5 m, czarna','','','',''),(62788,1,1,'Ładowarka sieciowa Forcell F-Energy GaN Charger 33W Uniwersalna USB-A USB-C Wielka moc w wersji kompaktowej Malutka ładowarka F-Energy GaN Charger od Forcellz wykorzystaniem najnowszej technologii ładowania GaN zapewnia bezpieczne ładowanie dwóch urządzeń jednocześnie o mocy aż do 33W. Wykonana z wysokiej jakości tworzywa sztucznego jest odporna na uszkodzenia mechaniczne, dlatego świetnie sprawdzi się nie tylko w domu, ale i w podróży. Port 1x USB-A Port 1x USB-C Bez kabla w zestawie Kolor producenta: Grafitowa Szerokie zastosowanie Ładowarka, dedykowana zarówno smartfonom, jak i tabletom, wyposażona jest w dwa porty - USB-C oraz USB-A. Dzięki temu użytkownik ma możliwość ładowania urządzeń posiadających różne typy złączy. Obecność dwóch wejść umożliwia jednoczesne zasilanie kilku urządzeń jednocześnie zaoszczędzając trochę cennego czasu. Naładuj baterię do 100 nawet w ciągu 1 godziny. Ładowarka obsługuje szybkie ładowanie. Jest kompatybilna z Power Delivery (PD3.0) oraz Quick Charge (QC4.0) a także PPS. Parametry godne uwagi Parametry wyjściowe: Wyjście USB-C: 5 V3 A 9 V3 A 12 V2.5 A15 V2 A 20 V1.5 A (33 W) Wyjście USB-A: 5 V3 A 9 V2 A 12 V1.5 A (18 W) Wyjście USB-C USB-A: 5 V3 A (15 W) Więcej za mniej Ładowarki wykonane z azotku galu (GaN) oferują znacznie mniejsze rozmiary oraz wyższą efektywność i oszczędność energetyczną w porównaniu z tradycyjnymi zasilaczami. Dzięki swojej konstrukcji radzą sobie także lepiej z wyższym napięciem i temperaturą niż tradycyjne materiały, takie jak krzem, co minimalizuje ryzyko awarii i uszkodzeń do minimum. Dla bezpiecznego ładowania, polecamy korzystanie z ładowarek marki Forcell, które gwarantują nie tylko efektywne ładowanie, ale także bezpieczeństwo użytkowania.. Ładowarkę zmieścisz bez problemu w kieszeni plecaka, torebce, czy nawet kieszeni.','','ladowarka-sieciowa-gan-usb-c-pd-usb-a-qc-33w-forcell-f-energy-grafitowa','','','','Ładowarka sieciowa GaN USB-C PD, USB-A QC, 33W, Forcell F-Energy, grafitowa','','','',''),(62803,1,1,'Uchwyt magnetyczny z ładowaniem bezprzewodowym ESR Halolock Magnetic MagSafe Vent Car Mount Wireless Charger Do kratki wentylacyjnej w samochodzie lub na kokpit Do smartfonów Apple z MagSafe Wyjątkowa wygoda podróżowania Prawdziwa rewolucja w podróżowaniu! ESR Halolock QI2 to więcej niż tylko uchwyt samochodowy - to bezkompromisowe połączenie wygody podróżowania i szybkiego ładowania bezprzewodowego. Dzięki technologii MagSafe, zapewnia szybkie i bezpieczne ładowanie telefonu nawet podczas intensywnej jazdy w każdych warunkach. Uchwyt jest kompatybilny z MagSafe. Możliwość montażu na kratkę wentylacyjną. *Funkcja magnetyczna MagSafe działa tylko i wyłącznie bezpośrednio do urządzenia lub do etui z wbudowanym oczkiem magnetycznym o zastosowaniu MagSafe bądź z uniwersalnym pierścieniem magnetycznym MagSafe. Kolor producenta: Black (czarny) Bezpieczne mocowanie telefonu Zapomnij o drżącym ekranie i niepewnym montażu! Uchwyt zbudowany jest z mocnych magnesów, które utrzymają telefon nawet podczas jazdy po nierównych drogach, co w Polsce zdarza się dość często ). Teraz możesz swobodnie korzystać z funkcji smartfona, wiedząc, że jest on bezpiecznie zamocowany. Dzięki solidnym magnesom, bez problemu ustawisz telefon zarówno w pozycji pionowej, jak i poziomej. Magnesy są w stanie utrzymać smartfona do 1600g. Łatwy montaż Elastyczność to klucz do komfortowej podróży. ESR Halolock QI2 oferuje możliwość montażu zarówno w kratce wentylacyjnej, jak i na desce rozdzielczej samochodu. Dzięki temu możesz dostosować uchwyt do swoich preferencji i potrzeb, zapewniając sobie pełną funkcjonalność podczas jazdy. Gotowy do drogi z zestawem ESR W zestawie znajdziesz wszystko, czego potrzebujesz do natychmiastowego rozpoczęcia podróży z ESR Halolock QI2. Oryginalne opakowanie, solidny uchwyt, końcówka do montażu na kokpicie oraz kabel USB-CUSB-C zapewnią, że Twój telefon zawsze będzie gotowy do użycia. Specyfikacja: Napięcie wejściowe: 9V2.2A Moc wyjściowa: 15W Montaż do kratki wentylacyjnej oraz na kokpicie Kompatybilność z systemem MagSafe Rzuć okiem Zobacz jak produkt sprawdza się w praktyce.','','uchwyt-magnetyczny-z-ladowaniem-qi2-esr-halolock-magnetic-magsafe-vent-car-mount-15w-czarny','','','','Uchwyt magnetyczny z ładowaniem Qi2 ESR Halolock Magnetic MagSafe Vent Car Mount 15W, czarny','','','',''),(62889,1,1,'FORCELL F-GRIP S150XL Bluetooth Selfie Stick Tripod Dla smartfonów z Bluetooth Twórz nagrania pod swoje wymagania! Forcell tworząc F-GRIP S150XL, zaprojektował go z myślą o wygodzie użytkownika! Jesteś profesjonalistą? A może chcesz uwiecznić mile spędzone wakacje z rodziną? Bez względu, jakie postawisz zadanie przed tym tripodem, zawsze możesz mieć pewność, że ten statyw podoła mu! Dla zwiększenia wygody użytkowania, w zestawie został umieszczony pilot, z którym możesz połączyć się poprzez bluetooth. Dzięki głowicy, która ma zakres rotacji 360 stopni, możesz go obracać w pionie i poziomie, by uzyskać jak najlepszy kadr! Kolor producenta: Black (czarny) Przedmiotem sprzedaży jest sam statyw z pilotem bluetooth, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu funkcjonalności produktu. Wymiar rozłożonego statywu: 150 cm Zimna stopka! Masz za słabe oświetlenie? A może chciałbyś podpiąć zewnętrzny mikrofon, by podnieść jakość swoich nagrań? Nie musisz się już tym martwić! Producent zadbał o to, byś mógł rozszerzyć możliwości swojego selfie sticka! Dlatego obok miejsca mocowania telefonu znajduje się tak zwana zimna stopka, która umożliwia montaż dodatkowego oświetlenia czy mikrofonu! 360 stopni możliwości! Głowica selfie sticka została wyposażona w możliwość obrotu o 360 stopni! Dzięki temu rozwiązaniu, żaden piękny kadr czy widok Ci nie ucieknie! Również dzięki nowym perspektywom będziesz mógł jeszcze lepiej tworzyć unikalne filmy, i zachwycać swoją publiczność! Bezprzewodowa moc! F-GRIP S150XL został wyposażony w pilocik na bluetooth, który umożliwia robienie zdjęć w odległości do 10m od statywu! Dzięki temu rozwiązaniu możesz spokojnie ustawić jak najlepszy kadr, zająć pozycję, i dopiero rozpocząć nagrywanie! A jak skończysz potrzebować pilota, możesz go spokojnie schować w rączce statywu, dzięki czemu będziesz mieć pewność, że nigdzie się nie zgubi! Troszkę specyfikacji! Wymiar złożonego statywu: 30,5 cm Wymiar rozłożonego statywu: 150 cm Waga: 382 g Materiał: ABSPCAluminum Bluetooth: 5.1 Zasięg Bluetooth: 10 m Zestaw zawiera: Selfie Stick FORCELL F-GRIP S150XL, Pilot Bluetooth','','uchwyt-kijek-statyw-forcell-f-grip-s150xl-bluetooth-selfie-stick-tripod-czarny','','','','Uchwyt, kijek, statyw Forcell F-GRIP S150XL Bluetooth Selfie Stick, Tripod, czarny','','','',''),(62895,1,1,'FORCELL F-GRIP S70M Bluetooth Selfie Stick Tripod Dla smartfonów z Bluetooth Twórz nagrania pod swoje wymagania! Forcell stworzył F-GRIP S70M z myślą o wygodzie użytkowania, idealnie pasując do torebki czy plecaka. Dostępny pilot Bluetooth oraz głowica o pełnym zakresie rotacji 360 stopni zapewniają wygodę i wszechstronność podczas ujęć! Bez względu na poziom zaawansowania, ten statyw sprosta każdemu Twojemu zadaniu fotograficznemu czy filmowemu. Doskonały zarówno dla profesjonalistów, jak i osób chcących uwiecznić chwile z rodziną. F-GRIP S70M to niezawodne wsparcie, gwarantujące stabilność i doskonałe kadry w każdej sytuacji. Kolor producenta: Black (czarny) Przedmiotem sprzedaży jest sam statyw z pilotem bluetooth, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu funkcjonalności produktu. Wymiar rozłożonego statywu: 70 cm 360 stopni! Dzięki możliwości obrotu o 360 stopni głowica selfie sticka zapewnia pełną swobodę w uchwyceniu każdego pięknego kadru czy widoku. Otwierają się nowe perspektywy, umożliwiające tworzenie wyjątkowych filmów i zachwycających Twoją publiczność. Nie przegapisz żadnej ważnej chwili, mając pewność, że uchwycisz każdy szczegół w doskonałej jakości. Bezprzewodowy pilocik! F-GRIP S70M jest wyposażony w pilot Bluetooth, umożliwiający wykonywanie zdjęć z odległości do 10 metrów od statywu. Dzięki temu możesz łatwo ustawić idealny kadr, zająć pozycję i rozpocząć nagrywanie bez zbędnych przeszkód. Gdy już nie potrzebujesz pilota, możesz go bezpiecznie schować w rączce statywu, zapewniając sobie pewność, że zawsze będzie pod ręką. Troszkę specyfikacji! Wymiar złożonego statywu: 30,5 cm Wymiar rozłożonego statywu: 70 cm Waga: 154 g Materiał: ABSPCAluminum Bluetooth: 5.1 Zasięg Bluetooth: 10 m Zestaw zawiera: Selfie Stick FORCELL F-GRIP S70M, Pilot Bluetooth','','uchwyt-kijek-statyw-forcell-f-grip-s70m-bluetooth-selfie-stick-tripod-czarny','','','','Uchwyt, kijek, statyw Forcell F-GRIP S70M Bluetooth Selfie Stick, Tripod, czarny','','','',''),(62945,1,1,'Poduszka na zagłówek Baseus ComfortRide Series Car Cooling Headrest Uniwersalna Niezrównane wsparcie dla zdrowia i komfortu Dzięki poduszce na zagłówek Baseus możesz cieszyć się bardziej komfortową i ergonomiczną pozycją podczas jazdy samochodem. To inwestycja w Twoje zdrowie i wygodę na drodze, która z pewnością przyniesie korzyści przez wiele podróży. Ta poduszka doskonale sprawdzi się nie tylko za kierownicą, ale również w biurze lub domu. Gwarantuje ona optymalne ułożenie karku oraz skuteczne odciążenie mięśni, dbając o ich właściwe wsparcie. Wybierz ComfortRide i poczuj różnicę już teraz. Wymiary: 273 x 200 x 113 mm Waga: ok. 450g Kolor producenta: Cluster Black (czarny) Poduszka na lata! Ma unikalny kształt motyla oraz wykonana jest z pianki zapamiętującej kształt i oddychającej tkaniny Sharkskin, która nie tylko jest miękka, ale także nie poddaje się ścieraniu i zapewnia łatwe odparowywanie wilgoci, dzięki czemu pozostaje w doskonałym stanie przez długi czas. Dodatkowo jest odporna na zmienne temperatury nawet od -10 do 60C, co oznacza, że możesz jej używać w różnych warunkach bez obaw o jej trwałość, miękkość czy elastyczność. Poduszka ta posiada również wbudowaną wkładkę z polimerowego żelu chłodzącego, którego zadaniem jest pochłanianie ciepła. Czysty luksus! Dodatkową zaletą poduszki jest jej łatwość czyszczenia, dzięki zastosowaniu zdejmowanego pokrycia. To rozwiązanie sprawia, że utrzymanie poduszki w nieskazitelnej czystości jest wyjątkowo proste i wygodne. Aby oczyścić pokrowiec, wystarczy go rozpiąć i delikatnie zdjąć. To szybki i bezproblemowy proces, który pozwoli Ci na dokładne usunięcie wszelkich zabrudzeń czy plam. Po wyczyszczeniu pokrowca wystarczy go z powrotem wsunąć na piankę, co zajmuje tylko chwilę. Dzięki temu możesz cieszyć się podparciem, które jest nie tylko wygodne, ale także zawsze czyste i świeże.','','poduszka-na-zaglowek-do-samochodu-biura-baseus-comfortride-czarna','','','','Poduszka na zagłówek do samochodu/biura, Baseus ComfortRide, czarna','','','',''),(62958,1,1,'Karta sieciowa Baseus FastJoy Series BS-OH170 USB-A Linux Windows Odkryj szybkość i stabilność połączenia Rozwiń swoje możliwości internetowe dzięki karcie sieciowej USB Baseus BS-OH170! Z prędkością transmisji sięgającą nawet 650 Mbs, możesz cieszyć się błyskawicznym transferem danych. Technologia CCA zapewnia niezawodną stabilność, na którą zawsze możesz polegać. Kolor producenta: Black (czarny) Świetlne sygnały, wyraźne połączenie Wbudowana dioda nie pozwoli Ci na zamartwianie się o szybkość swojego połączenia WiFi. Dzięki szybkiej i intuicyjnej jakości sygnału, świtało stanie się Twoim przewodnikiem - szybkie miganie oznacza silne połączenie, a wolniejsze, że sygnał wymaga wzmocnienia. Uniwersalność i Kompatybilność Niech twoja karta sieciowa dopasuje się do twoich potrzeb. Działaj na paśmie 2,4 GHz lub 5 GHz, korzystając zarówno z standardów 802.11 bgn, jak i 802.11 aac. Bez względu na system operacyjny - Windows czy Linux - karta jest gotowa do działania. Specyfikacja: Wyjście: USB-A 2.0 Kompatybilność: Linux, Windows Obsługiwane częstotliwości sygnału: 2,4 GHz, 5 GHz Standardy WiFi: IEEE 802.11 bgn, IEEE 802.11 aac Tryby kodowania: WPA-PSK, WPA2-PSK, WPAWPA2-PSK, 64128 WEP Moc transmisji: 20 dBm Rodzaj anteny: wbudowana Tryb pracy: NIC i hotspot Wszechstronność w małym formacie Zaprojektowana z myślą o praktyczności, karta Baseus jest lekka i kompaktowa. Włóż ją do torby, plecaka czy nawet kieszeni - zawsze będziesz miał ją pod ręką. Teraz możesz cieszyć się wygodą połączenia bez konieczności martwienia się o miejsce na jej przechowywanie.','','karta-sieciowa-usb-a-baseus-fastjoy-series-bs-oh170-650mb-s-5ghz-czarna','','','','Karta sieciowa USB-A Baseus FastJoy Series BS-OH170 650Mb/s 5GHz, czarna','','','',''),(63084,1,1,'Etui Burga Almond Latte Tough Apple MacBook Air 13,6 M4 2025 (A3240)Apple MacBook Air 13,6 M3 2024 (A3113)Apple MacBook Air 13,6 M2 2022 (A2681) Francja elegancja Futerał Almond Latte od firmy Burga to znacznie więcej niż zwykła obudowa na laptopa. Oryginalny kremowy kolor pełni rolę eleganckiego tła dla wyjątkowego wzoru asymetrycznych, czarnych plamek, co sprawia, że jest to niezwykle wyraziste etui. To nie tylko kwestia stylu - ten produkt to połączenie estetyki i funkcjonalności, które z pewnością Cię zachwyci. Kolor producenta: Almond Latte (beżowy z czarnymi kropkami) Przedmiotem sprzedaży jest samo etui dwuczęściowe, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Ochrona bez kompromisów Burga zaprojektowała case z myślą o Twoim spokoju ducha. Dzięki dwuczęściowej konstrukcji twoje urządzenie będzie ochronione zarówno od spodu, jak i od góry! Etui obejmuje cały spód laptopa, co gwarantuje, że nie musisz martwić się o rysy czy uszkodzenia. Smukły profil etui zapewnia wygodny chwyt, a jakość materiału sprawia, że jest przyjemne w użytkowaniu. Szczegóły, które robi