arzędziem dla vlogerów. Teraz możesz skupić się na swoim wystąpieniu lub aktywności, a jednocześnie mieć pełną kontrolę nad rejestrowanym materiałem. Uchwyt posiada wbudowane miejsce na pilot Bluetooth. Praktycznie na wyciągnięcie ręki Tech-Protect L08S to więcej niż zwykły kijek do selfie - to narzędzie, które rewolucjonizuje twoje zdjęcia i vlogi. Dzięki niezwykłej wytrzymałości i stabilności, możesz bez obaw robić zdjęcia z dowolnego miejsca, a ruchoma głowica zapewnia idealne ustawienie zarówno w poziomie, jak i pionie. Zasięg pracy pilota: 15m Wymiar złożonego: 32cm Wymiar rozłożonego minimalny: 51cm Wymiar rozłożonego maksymalny: 141cm Szerokość szczęki od 4cm do 8.8cm Pojemność baterii: 150mAh Waga: 410g Kompatybilny z iOS, Android','','uchwyt-kijek-statyw-tech-protect-l08s-wireless-selfie-stick-tripod-bluetooth-czarny','','','','Uchwyt, kijek, statyw Tech-Protect L08S Wireless Selfie Stick Tripod Bluetooth, czarny','','','',''),(63132,1,1,'Uchwyt samochodowy na telefon na deskę rozdzielcząszybę Joyroom JR-ZS259 Dla telefonów w rozmiarze 4,7-6,7 Przejdź do specyfikacji Niezawodny kompan podróży Zawsze chcesz być pewien, że masz wszystko pod kontrolą w trakcie podróży, zwłaszcza korzystając z nawigacji? Joyroom JR-ZS259 to uchwyt samochodowy, który nie tylko gwarantuje bezpieczne utrzymanie Twojego telefonu, ale także dodaje stylu do wnętrza Twojego samochodu. Ten uchwyt został stworzony z myślą o wygodzie i trwałości. Wykonany z najwyższej jakości materiałów, uchwyt od Joyroom to pewność, że Twój telefon będzie bezpiecznie trzymany w każdych warunkach. Kompatybilny z telefonami w rozmiarze od 4,7 do 6,7 cala *Przedmiotem sprzedaży jest sam uchwyt, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Kolor producenta: Black (czarny) Elegancki i funkcjonalny Jego prosty, klasyczny design doskonale komponuje się z większością wnętrz samochodowych, dodając elegancji. Kompatybilność z różnymi modelami telefonów sprawia, że n