i swojego stanowiska o dodatkowy 1 monitor. Ciesz się obrazem w rozdzielczości 4K przy odświeżaniu 60Hz (3840x2160p). *Należy pamiętać, że nie wszystkie porty USB-C w laptopach obsługują pełną funkcjonalność standardu USB-C, w tym przesyłu wideo, dlatego zaleca się zapoznać ze specyfikacją i funkcjonalnością swojego laptopa. Technologia GaN Zastosowanie tranzystorów z azotku galu (GaN - gallium nitride) zamiast tradycyjnego krzemu zaowocowało jeszcze mniejszym wytwarzaniem ciepła, co pozwoliło na bliższe usytuowanie wewnętrznych komponentów względem siebie, a tym samym zachowanie kompaktowej budowy wewnętrznego zasilacza. Dzięki takiemu rozwiązaniu otrzymujesz znacznie mniejszą stację dokującą z dużą mocą, która wymagałaby standardowo większej obudowy. Stacja z powodzeniem przeszła szereg wewnętrznych testów, dzięki czemu może wyróżnić się 5-punktowym systemem zabezpieczeń, pod kątem ochrony przed: przetężeniem, przegrzaniem, przeciążeniami, zwarciem oraz pożarem. Ważne informacje Podłączaj, zasilaj i wyświetlaj wideo w tym samym czasie za pomocą jednego połączenia kablowego dzięki stacji Belkin. 5 Gbs dla szybkich transferów danych Zgodność z USB-C 5-punktowy system zabezpieczeń Dopuszczalny zakres temperatury pracy: od 0C do 25C przy wilgotności względnej (RH) od 20 do 80 Dopuszczalny zakres temperatury przechowywania: od -10C do 55C przy wilgotności względnej od 5 do 90 Dzięki niej Twoje stanowisko robocze zyska większą funkcjonalność jak i lepszą wygodę w użytkowaniu. Wygodnie i stylowo Niezależnie od tego, czy pracujesz, przesyłasz strumieniowo, czy grasz, będziesz cieszyć się prostą i solidną łącznością. Stacja charakteryzuje się minimalistyczną, lecz stylową budową o wysokiej jakości wykonania, która świetnie będzie się prezentować w każdej przestrzeni. Wymiary: 8 x 8 x 4,8 cm Na urządzeniu znajduje się dioda informująca o statusie zasilania. Prezentacja producenta o produkcie Zapoznaj się z poniższą prezentacją producenta o produkcie, i zobacz w jaki sposób 