pewne, że każde ujęcie będzie perfekcyjne, a Twój smartfon bezpieczny. To idealny partner dla fotografów, influencerów i podróżników, którzy cenią sobie jakość i wygodę Kolor producenta: Black (czarny) W zestawie: Hardy MagSelfie Stick Silikonowa nakładka do mocowania Pilot Bluetooth Pokrowiec Instrukcja obsługi Przedmiotem sprzedaży jest sam uchwyt, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu funkcjonalności produktu. Stabilność dzięki MagSafe Fotografuj bez obaw o sprzęt z 3mk HARDY MagSelfie Stick! Dzięki pełnej kompatybilności z technologią MagSafe, wystarczy przyłożyć smartfona i już jesteś gotów do działania. Potężne magnesy utrzymują urządzenie stabilnie w jednej pozycji, nawet w trudnych warunkach terenowych. To gwarancja, że każde zdjęcie i film wyjdą fantastycznie, a Twój smartfon będzie bezpiecznie zamocowany. Zapomnij o przypadkowych spotkaniach Twojego telefonu z betonem i skup się na tworzeniu niezapomnianych kadrów! Pracuj z każdym smartfonem Masz smartfon bez MagSafe? Żaden problem! Ten selfie stick jest wyposażony w specjalną silikonową nakładkę, która pozwala na zamocowanie dowolnego telefonu. To wszechstronne narzędzie współpracuje z modelami o rozmiarze od 6,1 cala i systemach iOS lub Android. Niezależnie od tego, jaki masz telefon, MagSelfie Stick zawsze sprosta Twoim oczekiwaniom, zapewniając stabilność i komfort użytkowania. Doświadcz prawdziwej wolności Z tym uchwytem możesz cieszyć się pełną swobodą tworzenia! Pilot Bluetooth o zasięgu 10 metrów pozwala na zdalne robienie zdjęć i nagrywanie filmów. Regulowane ramię teleskopowe, które rozciąga się do 72 cm, umożliwia eksperymentowanie z różnymi ujęciami. Niezależnie od wysokości, Twój smartfon pozostanie stabilnie zamocowany, a obrotowa głowica pozwala na robienie zdjęć w pionie lub poziomie dokładnie tak, jak chcesz. Używaj jako mobilnego statywu 3mk Hardy MagSelfie Stick to nie tylko kijek do selfie to również przenośny statyw, idealny do biura i w podróży. Kilka prostych ruchów i kompaktowa konstrukcja zmienia się w stabilny statyw o trójnożnej podstawie. Korzystaj z obu funkcji według potrzeb, nie martwiąc się o uszkodzenia. Wykonany z trwałych materiałów, takich jak ABS, PC i aluminium, MagSelfie Stick to gwarancja jakości premium od marki 3mk Hardy. Specyfikacja: Materiał: ABS PC aluminium Łączność Bluetooth: do 10m Bateria do pilota: CR1632 Długość: maks. 72cm Kompatybilność: iOS i Android','','uchwyt-kijek-statyw-3mk-hardy-magselfie-stick-pilot-bluetooth-czarny','','','','Uchwyt, kijek, statyw 3mk Hardy MagSelfie Stick + pilot Bluetooth, czarny','','','',''),(65165,1,1,'Spigen Tesla Under Screen Storage Organizer Tesla Model 3 (2021-2023)Tesla Model Y (2021-2024) Porządek w Twoim samochodzie Czy kiedykolwiek marzyłeś o dodatkowej przestrzeni w swojej Tesli, która wygląda tak dobrze, jakby zaprojektował ją sam Elon Musk? No cóż, teraz masz to w zasięgu ręki. Przedstawiamy wyjątkowy organizer samochodowy Spigen Tesla Under Screen Storage Organizer do Tesla Model 3 i Y rozwiązanie, które połączy elegancję, funkcjonalność i nutę kosmicznej technologii. *Przedmiotem sprzedaży jest sam organizer wraz z magnetyczną blaszką, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Wymiary: 319.7 x 198.5 x 200.4mm Waga: 822g Kolor producenta: Black (czarny) *niekompatybilny z Tesla Model 3 Highland (2024) Nieziemska funkcjonalność Organizer montowany jest za pomocą magnesów pod głównym wyświetlaczem Twojej Tesli, a dodatkowa półka umieszczona za wyświetlaczem, opierająca się o deskę rozdzielczą, zapewnia jeszcze więcej miejsca. Wykonany z wysokiej jakości termopoliuretanu oraz poliwęglanu, z miękkim silikonowym wykończeniem, stabilizuje umieszczone przedmioty i redukuje hałas podczas jazdy cisza jak w próżni. Fabryczny look Subtelny design tego schowka idealnie komponuje się z wnętrzem Twojej Tesli, sprawiając wrażenie, że jest to fabryczne rozwiązanie prosto od Elona. Wytrzyma wiele Maksymalna nośność tego organizera to 1 kg, co oznacza, że możesz umieścić w nim swoje najpotrzebniejsze rzeczy od okularów, telefonu, portfela, po słuchawki i wiele więcej, nie martwiąc się o przestrzeń. Kosmiczna estetyka Dzięki zastosowanemu silikonowi, organizer jest nie tylko łatwy w czyszczeniu, ale także zabezpiecza wnętrze Twojego pojazdu przed zniszczeniami. Podkładki ochronne zapobiegają uszkodzeniom, dbając o każdy detal Twojego wnętrza. A dodatkowa magnetyczna blaszka w zestawie pozwala na stabilne przechowywanie wybranych przedmiotów, nawet przy szybkich manewrach.','','organizer-samochodowy-pod-wyswietlacz-spigen-under-screen-storage-do-tesla-model-3-2021-23-y-2021-czarny','','','','Organizer samochodowy pod wyświetlacz Spigen Under Screen Storage do Tesla Model 3 (2021-23) / Y (2021-), czarny','','','',''),(65251,1,1,'Podstawka chłodząca pod laptopa XTrike ME FN-811 Uniwersalny urządzenia od 9 do 17 Pożegnaj przegrzewanie raz na zawsze! Czy Twój laptop przypomina czasem grzejnik? Dzięki podkładce z sześcioma potężnymi wiatrakami możesz zapomnieć o problemach z przegrzewaniem. Nawet podczas intensywnej pracy Twój sprzęt pozostanie chłodny i gotowy do działania. Idealne rozwiązanie na każdy upalny dzień! W zestawie znajduje się: podkładka chłodząca, kabel USB-A USB-A 50 cm *Przedmiotem sprzedaży jest sama podkładka chłodząca i kabel, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jej funkcjonalności. Kolor producenta: Black (czarno-czerwona, z czerwonym podświetleniem wentylatorów) Perfekcyjnie dopasowana do Twoich potrzeb Marzysz o wygodnej pracy przy laptopie? Regulowany kąt nachylenia podkładki zapewnia ergonomiczną pozycję, redukując zmęczenie podczas długich sesji. Z dodatkowym portem USB, podłączenie kolejnego urządzenia nigdy nie było prostsze. Komfort i funkcjonalność w jednym! Podaruj swojemu laptopowi niezawodne chłodzenie Zapewnij swojemu laptopowi optymalne warunki pracy nawet w najbardziej gorące dni. Oddzielne pokrętło do kontrolowania prędkości wentylatorów pozwala dostosować chłodzenie do aktualnych potrzeb. Cichy i wydajny idealny towarzysz Twojego laptopa! Szeroki wachlarz możliwości Podkładka kompatybilna jest z laptopami o przekątnej do 17 cali, co czyni ją wszechstronnym rozwiązaniem dla wielu urządzeń. Z kabelkiem o długości 50 cm i napięciem 5V DC, ta podkładka jest gotowa na wszystko. Dzięki sześciu wiatrakom o prędkości 2400 RPM Twój laptop zyska na wydajności i żywotności. Specyfikacja: Kompatybilność: laptopy o przekątnej ekranu od 9 do 17. Budowa: stalowa siatka, plastik Porty: 2x USB 5V DC Regulowana podstawa Wentylatory: 6 sztuk (60 x 60 x 15 mm), 2400 10 RPM Wymiary podstawki: 368x273x28 mm','','podstawka-chlodzaca-xtrike-me-fn-811-do-laptopa-z-regulacja-czarno-czerwona','','','','Podstawka chłodząca XTrike ME FN-811 do laptopa z regulacją, czarno-czerwona','','','',''),(65777,1,1,'Belkin BoostCharge Pro 4-Port USB-C GaN Charger 200W Uniwersalna 4x USB-C Wygodna i elegancka ładowarka biurkowa Oryginalna, 4-portowa ładowarka sieciowa marki Belkin z serii BoostCharge Pro z tranzystorami wykonanymi z azotku galu (GaN) o mniejszym generowaniu ciepła niż standardowe krzemowe komponenty. Można używać jej z wszelkimi urządzeniami posiadającymi kabel ze złączem USB typu C. Ładowarka posiada elegancki i nowoczesny design, a antypoślizgowa podstawa stabilnie utrzymują ją na blacie biurka. Zasilający kabel o długości 1,5m pozwala na swobodne ułożenie ładowarki w dogodnym miejscu na stoliku czy biurku. Ładowarka ze wsparciem Power Delivery 3.1 (EPR) i PPS została wyposażona w technologię, która wykrywa możliwie maksymalne natężenie prądu do 5A dla danego urządzenia na portach USB-C, co znacznie skraca czas ładowania względem standardowych ładowarek, a inteligentne rozdzielanie mocy zapewni ładowanym urządzeniom możliwie odpowiednią ilość energii z każdego portu. 4 porty ładujące o łącznej mocy 200W oferują możliwość ładowania 4 urządzeń jednocześnie, a wysokie osiągi pozwalają na ładowanie nie tylko mniejszych urządzeń mobilnych jak tablety czy smartfony, ale także laptopy, notebooki, itp. W zestawie przewód zasilający z wtyczką EU o długości 1,5m *Przedmiotem sprzedaży jest sama ładowarka z kablem zasilającym, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jej funkcjonalności. Kolor producenta: White (biała) Szybkie ładowanie do 140W max na najmocniejszym porcie Naładuje Twój smartfon, tablet, laptop inne urządzenie znacznie szybciej niż standardowa 5-watowa ładowarka. Nowoczesna konstrukcja zapewnia łatwe i wygodne użytkowanie. Antypoślizgowa podstawa ładowarki stabilnie utrzymuje ją na płaskiej powierzchni. Wyjścia i ich parametry podczas obciążenia tylko 1 portu na raz: USB-C1 140W max: 5V3A, 9V3A, 15V3A, 20V5A, 28V5A USB-C2 140W max: 5V3A, 9V3A, 15V3A, 20V5A, 28V5A USB-C3 60W max: 5V3A, 9V3A, 15V3A, 20V3A USB-C4 60W max: 5V3A, 9V3A, 15V3A, 20V3A Ładowarka posiada w zestawie przewód zasilający z wtyczką EU o długości 1,5m, co daje duży i swobodny zakres umieszczenia ładowarki od źródła zasilania. Inteligentne rozdzielanie mocy Funkcja inteligentnego rozdzielania mocy ładowania pomiędzy poszczególne podłączone urządzenia zadba o jak najwydajniejsze ładowanie. Zapewnia to optymalny przesył mocy w przypadku ładowania kilku urządzeń jednocześnie. Moc wyjściowa poszczególnych portów USB-C podczas ładowania kilku urządzeń jednocześnie: USB-C1C2: współdzielone 140W czyli po 70W max na każdy z tych dwóch portów USB-C3C4: współdzielone 60W czyli po 30W max na każdy z tych dwóch portów Maksymalne obciążenie: USB-C1C2C3C4: łącznie 200W max Szeroka kompatybilność Ze względu na sporą moc i obsługiwane technologie ładowania ładowarka ta charakteryzuje się szeroką kompatybilnością i z powodzeniem naładuje nie tylko smartfony, tablety, słuchawki, przenośne konsole do gier, ale także bardziej wymagające sprzęty jak laptopy czy notebooki, itp. A do tego wieloportowa konstrukcja pozwoli na ładowanie aż 4 urządzeń jednocześnie. Temperatura pracy: 0C do 25C (10 do 90 wilgotności względnej) Temperatura przechowywania: -20C do 70C (wilgotność względna od 5 do 95) Nowoczesny design z technologią GaN Zastosowanie tranzystorów z azotku galu (GaN - gallium nitride) zamiast tradycyjnego krzemu zaowocowało jeszcze mniejszym wytwarzaniem ciepła, co pozwoliło na bliższe usytuowanie wewnętrznych komponentów względem siebie, a tym samym zachowanie kompaktowej budowy ładowarki. Dzięki takiemu rozwiązaniu otrzymujesz znacznie mniejszą ładowarkę z dużą mocą, która wymagałaby standardowo większej obudowy. Nowoczesny design ładowarki prezentuje się smukło i stylowo. Smukła wtyczka EU doskonale sprawdzi się w ciasnym szeregu gniazdek na listwach zasilających. Wymiary: Długość: 11,9 cm Szerokość: 9,2 cm Wysokość: 3,6 cm Gwarancja bezpieczeństwa Ładowarki firmy Belkin są tak skonstruowane, aby zapewnić najlepsze zabezpieczenie urządzenia podczas ładowania. Inteligentny układ mierzy napięcie i automatycznie dostosowuje odpowiednio maksymalną moc ładowania. Belkin zapewnia gwarancję bezpieczeństwa podłączonego sprzętu o wartości do 2,000 Euro. Jeśli sprzęt zostanie uszkodzony przez ładunek elektryczny podczas prawidłowego podłączenia do ładowarki, Belkin naprawi lub wymieni urządzenie na nowe.','','ladowarka-sieciowa-gan-4x-usb-c-200w-belkin-boost-pro-4-port-charger-biala','','','','Ładowarka sieciowa GaN 4x USB-C, 200W, Belkin Boost Pro 4-Port Charger, biała','','','',''),(66075,1,1,'ℹ Ponieważ folia Grizz wycinana jest specjalnie na zamówienie, przy zakupie folii termin realizacji całego zamówienia może wynosić do 3 dni.Folia ceramiczna CarDisplay Protection GrizzTesla Model X (2016-2021)Komfort w trasie!Folia ceramiczna Grizz jest tutaj, aby uratować dzień! Wykonana z materiału o wysokiej twardości, zapewnia skuteczną ochronę przed zarysowaniami. Twój ekran będzie bezpieczny nawet w starciu z kluczami, monetami czy innymi ostrymi przedmiotami, które przypadkiem znajdą się w Twoim samochodzie. Pierwsze zdjęcie prezentuje autentyczny produkt, a kolejne to inspirujące wizualizacje, które pomogą Ci wyobrazić, jak folia odmieni wygląd Twojego pojazdu. Wybierając folię Grizz, stawiasz na nowoczesny design, ochronę i wyjątkowy styl!Krystaliczna przejrzystość!Martwisz się, że folia wpłynie na jakość wyświetlanego obrazu? Nic z tych rzeczy! Folia ceramiczna Grizz jest przezroczysta i nie zmienia jakości barw. Każdy detal, każda ikona i każda mapa nawigacyjna będą wyraźne i czytelne, jakby folii w ogóle nie było. Ciesz się nieskazitelnym obrazem bez kompromisów!Wrażliwa na dotyk!Dotyk to kluczowy element nowoczesnych wyświetlaczy, a folia ceramiczna Grizz nie zaburza tej funkcji. Dzięki zachowaniu 100 wrażliwości dotykowej, Twoje gesty i komendy będą natychmiastowo i precyzyjnie rejestrowane. Zapomnij o opóźnieniach czy problemach z responsywnością Twój ekran będzie działać jak marzenie!Idealnie dopasowanie i łatwy montaż!Dzięki precyzyjnej technologii laserowej, folia ceramiczna Grizz jest idealnie wycięta na ekran Twojego Tesla Model X (2016-2021). Dopasowanie jest tak perfekcyjne, że folia staje się niemal niewidoczna, bez zapowietrzeń na krawędziach. A co najlepsze? Montaż jest dziecinnie prosty! Bez konieczności odwiedzania serwisu, możesz samodzielnie zamontować folię, ciesząc się jej ochroną od razu po aplikacji. Bezpieczeństwo i łatwość użytkowania gwarantowane!Zainwestuj w folię ceramiczną Grizz i spraw, by wyświetlacz był zawsze w doskonałej kondycji bez zarysowań i z pełną wrażliwością dotykową!','','folia-ceramiczna-2w1-grizz-protector-do-tesla-model-x-2016-2021','','','','Folia ceramiczna 2w1 Grizz Protector do Tesla Model X (2016-2021)','','','',''),(66742,1,1,'ℹ Ponieważ folia Grizz wycinana jest specjalnie na zamówienie, przy zakupie folii termin realizacji całego zamówienia może wynosić do 3 dni.Folia ceramiczna CarDisplay Protection GrizzTesla Model S 12,3 (2013-2021)Komfort w trasie!Folia ceramiczna Grizz jest tutaj, aby uratować dzień! Wykonana z materiału o wysok