a chwil!','','folia-matowa-z-ramka-do-montazu-grizz-mate-screen-do-apple-macbook-pro-14-2023','','','','Folia matowa z ramką do montażu Grizz Mate Screen do Apple Macbook Pro 14\" 2023','','','',''),(69524,1,1,'Spigen Essential Wall Charger EE301EU 30W Dla urządzeń mobilnych USB-C Większa moc w krótszym czasie Kompaktowa i funkcjonalna ładowarka sieciowa posiadająca najnowsze technologie szybkiego ładowania i bezpieczeństwa marki Spigen. Pozwala na ładowanie urządzeń mobilnych mniejszych i większych, takich jak np. smartfony, tablety, głośniki czy słuchawki bezprzewodowe, jak i przenośne konsole do gier typu Nintendo Switch, itp. Posiada port USB-C o maksymalnej mocy 30W dla PD3.0 (Power Delivery) oraz max. 25W dla PPS (Programmable Power Supply), jak i QC3.0 (Quick Charge). *Przedmiotem sprzedaży jest sama ładowarka sieciowa, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jej funkcjonalności. Kolor producenta: Black (czarny z pomarańczowym akcentem) Quantum Boost - ekskluzywna technologia ładowania do 30W Zabierz ją wszędzie tam, gdzie chcesz uzyskać optymalne ładowanie. Wykonana z wysokiej jakości poliwęglanu - niezwykle wytrzymała. Quantum Boost - obsługuje funkcję szybkiego ładowania zapewniając maksymalną możliwą moc ładowania dla danego urządzenia. Ładowarka potrafi dostarczyć dużą dawkę energii w możliwie najkrótszym czasie. Wspiera technologie szybkiego ładowania Fast Charging dla iPhone i Super Fast Charging dla Galaxy. Obsługa: PD3.0, PPS, QC3.0, QC2.0, AFC, FCP, SCP, Apple 2.4A, DCP Parametry wyjściowe: USB-C PD 30W Max: 5V3A, 9V3A, 12V2.5A, 15V2A, 20V1.5A PPS: 5-11V2.75A Intelligent Safety - bezpieczna i funkcjonalna Ładowarka automatycznie identyfikuje urządzenie obsługujące standard szybkiego ładowania. Dzięki Intelligent Safety posiada szereg zabezpieczeń przeciw przepięciu, przegrzaniu, zwarciu, czy przeładowaniu. Inteligentny chip automatycznie identyfikuje podłączone urządzenie dostosowując maksymalną możliwą moc ładowania, zapewniając tym samym optymalny przesył prądu z zachowaniem bezpieczeństwa ładowanego urządzenia. Kompaktowy rozmiar Ładowarka sieciowa Spigen ArcStation to minimalistyczny i jednocześnie nowoczesny design. Kompaktowe rozmiary stanowią zdecydowaną zaletę w podróży. Bez problemu zmieścisz ją na listwie zasilającej między innymi wtyczkami, a także wygodnie spakujesz ją do torby czy plecaka. Wymiary kostki (bez wtyczki): 32 x 32 x 39 mm Waga: 55g Świetnie nada się do ładowania różnych mobilnych urządzeń, takich jak np. smartfony, tablety, słuchawki, głośniki, itp.','','ladowarka-sieciowa-usb-c-pd-30-pps-qc-30-30w-spigen-essential-ee301eu-czarna','','','','Ładowarka sieciowa USB-C PD 3.0, PPS, QC 3.0, 30W, Spigen Essential EE301EU, czarna','','','',''),(69541,1,1,'Szkło hybrydowe prywatyzujące Grizz SecretGlass EasyApple MacBook Air 13,6 M2 2022 (A2681)Prywatyzujące szkło hybrydowe na ekranGrizz SecretGlass Easy to matowe szkło prywatyzujące z aplikatorem, stworzone dla tych, którzy cenią sobie prywatność i bezpieczeństwo danych w każdej sytuacji. Dzięki przyciemnionej powłoce nikt nie dopatrzy się Twoich wiadomości, nawet siedząc obok, co zapewnia komfortowe korzystanie z urządzenia w miejscach publicznych. Unikalne połączenie hybrydowego szkła i folii ceramicznej o twardości 6H wzmacnia ekran o 250 i zabezpiecza go przed codziennymi zagrożeniami. Produkt wyróżnia się dyskretnym wyglądem, który pozostaje praktycznie niewidoczny na wyświetlaczu.W opakowaniu znajdują się:szkło prywatyzujące Grizz SecretGlassramka montażowa z ekologicznego materiałusucha i mokra ściereczkaDustStixinstrukcja montażuWymiary szkłaPodstawowym akcesorium do ochrony urządzenia mobilnego oprócz szkła jest etui. Aby upewnić się, że szkło będzie zgodne z pokrowcem, należy pamiętać, że:wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowcafuterał nie może nachodzić na szybkęWymiary szkła: 29,94 x 19,80 cm(długość - szerokość)Zdjęcie poglądoweMocna ochronna szybka na ekranSolidna powłoka o twardości 6H marki Grizz chroni ekran przed zarysowaniami i delikatnymi uderzeniami sprawiając, że jest on wytrzymalszy o 250. Przyciemniony efekt utrudnia niepożądane podglądanie, co oznacza swobodę korzystania z urządzenia w zatłoczonych przestrzeniach. Szkło hybrydowe nie pęka ani nie kruszy się, dzięki czemu zachowuje nienaganny stan nawet przy intensywnym użytkowaniu. Naturalny wygląd obrazu pozostaje nienaruszony, co przekłada się na komfort codziennego użytkowania.Zdjęcie poglądoweProsta instalacja z aplikatoremMontaż szkła dobrze dopasowanego do urządzenia przebiega płynnie i bez zbędnego stresu dzięki precyzyjnemu aplikatorowi, który pomaga poprawnie nałożyć szkło na urządzenie. Wystarczy jedno wyrównanie szkła i delikatne dociśnięcie, aby idealnie przylegało bez pęcherzyków powietrza. Usuń folię ochronną i ciesz się gładką powierzchnią ekranu w kilka chwil bez dodatkowych narzędzi. Efektywna aplikacja nie wymaga pomocy ani specjalistycznych akcesoriów.Zdjęcie poglądoweSzyba z ochroną prywatnościZastosowanie szkła prywatyzującego praktycznie niewidocznego na urządzeniu, dzięki grubości 0,25 mm zapewnia dyskrecję podczas poufnych rozmów i pracy w przestrzeni publicznej. Matowe wykończenie redukuje odbicia światła i odciski palców, co ułatwia czytanie treści nawet w silnym oświetleniu. Produkt wspiera ochronę prywatności fizycznego dostępu do danych zgodnie z wytycznymi ochrony informacji. Dzięki subtelnej konstrukcji wyświetlacz zachowuje pełną funkcjonalność, co zwiększa wygodę użytkowania każdego dnia.Zdjęcie poglądoweŁatwy montażMontaż szkła hybrydowego jest banalnie prosty! Wystarczy kierować się instrukcją dołączoną do opakowania, albo krokami poniżej:Wyczyść dokładnie ekran za pomocą dołączonych ściereczek, a pozostały kurz usuń za pomocą DustStix.Zdejmij warstwę zabezpieczającą START i obróć ramkę montażową tak, aby strzałka na naklejce wskazywała na lewy górny róg urządzenia.Wypozycjonuj szkło do powierzchni ekranu sugerując się strzałkami i nałóż ramkę równolegle do ekranu urządzenia.Przesuń palcem od lewego górnego do prawego dolnego rogu z odpowiednim dociśnięciem folii pod naklejką, trzymaj przez 30 sekund i usuń naklejkę.Dociśnij folię do wyświetlacza i równolegle zdejmij ramkę z urządzenia, a następnie usuń warstwę zabezpieczającą, pociągając listek z napisem FINISH jak najbardziej płasko w stosunku do folii.Wykorzystaj trójkątny element w celu usunięcia powstałych bąbelków powietrza, kierując się do najbliższej krawędzi urządzenia, a wszelkie ślady powietrza wchłoną się w ciągu 48h.','','szklo-hybrydowe-prywatyzujace-na-ekran-grizz-secretglass-easy-do-macbook-air-13-m2-2022-z-aplikatorem-matowe','','','','Szkło hybrydowe, prywatyzujące na ekran Grizz SecretGlass Easy do MacBook Air 13\" M2 2022 z aplikatorem, matowe','','','',''),(69548,1,1,'Szkło hybrydowe prywatyzujące Grizz SecretGlass EasyApple MacBook Air 13,6 M3 2024 (A3113)Prywatyzujące szkło hybrydowe na ekranGrizz SecretGlass Easy to matowe szkło prywatyzujące z aplikatorem, stworzone dla tych, którzy cenią sobie prywatność i bezpieczeństwo danych w każdej sytuacji. Dzięki przyciemnionej powłoce nikt nie dopatrzy się Twoich wiadomości, nawet siedząc obok, co zapewnia komfortowe korzystanie z urządzenia w miejscach publicznych. Unikalne połączenie hybrydowego szkła i folii ceramicznej o twardości 6H wzmacnia ekran o 250 i zabezpiecza go przed codziennymi zagrożeniami. Produkt wyróżnia się dyskretnym wyglądem, który pozostaje praktycznie niewidoczny na wyświetlaczu.W opakowaniu znajdują się:szkło prywatyzujące Grizz SecretGlassramka montażowa z ekologicznego materiałusucha i mokra ściereczkaDustStixinstrukcja montażuWymiary szkłaPodstawowym akcesorium do ochrony urządzenia mobilnego oprócz szkła jest etui. Aby upewnić się, że szkło będzie zgodne z pokrowcem, należy pamiętać, że:wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowcafuterał nie może nachodzić na szybkęWymiary szkła: 29,94 x 19,80 cm(długość - szerokość)Zdjęcie poglądo