ego, szybkiego ładowania urządzeń Samsung. Specyfikacja Moc wyjściowa: 25W Napięcie wyjściowe: 5V3A, 9V2.2A Napięcie wejściowe: 110-240V Wejściowa częstotliwość prądu przemiennego: 50-60Hz, 0.5A Średnia sprawność podczas pracy: 85.46 Sprawność przy niskim obciążeniu (10): 75,46 Zużycie energii w stanie bez obciążenia: 0.1W Wspierane technologie: PD (Power Delivery), QC 4.0 (Quick Charge), AFC (Funkcja adaptacyjnego ładowania urządzeń Samsung) W zestawie nie dołączono kabla. Do pełnego wykorzystania mocy ładowarki zaleca się używanie kabla, który pozwala na przesyłanie prądu o natężeniu 5A. Aby w pełni cieszyć się możliwościami ładowarki, upewnij się, czy Twoje urządzenie wspiera technologie PD, QC 4.0 lub AFC.','','ladowarka-sieciowa-usb-c-pd-qc-40-25w-forcell-wall-charger-biala','','','','Ładowarka sieciowa USB-C PD, QC 4.0, 25W, Forcell Wall Charger, biała','','','',''),(69786,1,1,'Etui ze szkłem do smartwatcha Bizon Case Glass Set Apple Watch 11 (46mm)Apple Watch 10 (46mm) Podwójna ochrona dla Apple Watch 11 10 (46mm) Nie trać czasu! Etui ze szkłem na zegarek od marki Bizon z serii Case Glass Watch to wszystko, czego potrzebujesz, aby zapewnić ochronę Twojemu smartwatchowi. Osłona z wbudowanym szkłem obroni Twojego smartwatcha przed codziennymi przeciwnościami losu, takimi jak zabrudzenia od lecących w stronę ekranu kropki kawy czy zarysowania spowodowane przez przypadkowe uderzenia o kant stołu. Kolor producenta: Black (czarny) Wykonanie: Poliwęglan, szkło hartowane Grubość szkła: 0,33 mm Idealne dopasowanie do zegarka Doskonałe zabezpieczenie przed zarysowaniami Lekki i wytrzymały case Płynność w działaniu wyświetlacza Przedmiotem sprzedaży jest samo etui ze szkłem, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Innowacyjna konstrukcja Boisz się, że po założeniu osłony smartwatch poczuje się klaustrofobicznie i zacznie Cię oszukiwać, która jest godzina, a Twój palec zostanie dodany do bazy osób nieupoważnionych do k