rey (szary) Specyfikacja techniczna Za szybkie ładowanie Twoich urządzeń odpowiadają najnowsze technologie, takie jak: Power Delivery, Quick Charge 4.0, Super Fast Charging 2.0 oraz PPS. Poniżej krótkie wyjaśnienie, za co odpowiadają: Power Delivery 3.1 i Quick Charge 4.0 zapewniają uniwersalność, ładowanie smartfonów, laptopów czy tabletów różnych marek z maksymalną wydajnością. Dzięki PPS (Programmable Power Supply), ładowarka inteligentnie dostosowuje moc do wymagań urządzenia, chroniąc baterię przed przegrzaniem. Super Fast Charging 2.0 odpowiada za jeszcze szybsze ładowanie smartfonów i tabletów marki Samsung. Dzięki niej urządzenia te mogą naładować się do pełna w znacznie krótszym czasie, wykorzystując wyższą moc ładowania, nawet do 45W. Ponadto ładowarka wyposażona jest w technologię AVS (Automatic Voltage Selection) - to funkcja automatycznego wyboru napięcia. Dzięki niej ładowarka może dostosować napięcie wyjściowe do wymagań podłączonego urządzenia, co zapewnia optymalne i bezpieczne ładowanie. AVS chroni także urządzenia przed przeładowaniem, przeciążeniem oraz uszkodzeniem wskutek nieprawidłowego napięcia. Parametry techniczne: USB-C1 C2 (140W max.): 5V3A (15W), 9V3A (27W), 12V3A (36W), 15V3A (45W), 20V5A (100W), 28V5A (140W max.) PPS: 3.3V - 21V 5A AVS: 15V - 28V 5A USB-C3 (30W max.): 5V3A (15W), 9V3A (27W), 12V2.5A (30W), 15V2A (30W), 20V1.5A (30W max.) PPS1: 3.3V - 11V 3A PPS2: 3.3V - 16V 2A USB-A1 (30W max.): 5V3A (15W), 9V3A (27W), 12V2.5A (30W), 20V1.5A (30W max.) USB-A2 (30W max.): 5V3A (15W), 9V3A (27W), 12V2.5A (30W), 20V1.5A (30W max.) Ważne: W momencie ładowania kilku urządzeń jednocześnie moc ładowania może być dzielona pomiędzy kilka portów. Stacja ładująca z superszybkim ładowaniem Forcell F-Energy VT-51 oferuje dwa porty USB-C o mocy 140W, co czyni ją idealnym wyborem do ładowania laptopów, a dodatkowe porty USB-C i USB-A zapewniają moc do 30W, świetnie sprawdzając się przy smartfonach, tabletach i innych akcesoriach. Zaawansowana technologia GaN Ładowarka została wykonana w nowoczesnej technologii GaN (azotek galu) III generacji, co oznacza jeszcze mniejsze rozmiary, większą wydajność i oszczędność energii. Mimo kompaktowych wymiarów ładowarka zapewnia potężną moc, która poradzi sobie z wymaganiami nawet najbardziej zaawansowanych urządzeń. Kompaktowy design Elegancki wygląd i kompaktowy rozmiar tej ładowarki sprawiają, że doskonale prezentuje się na biurku, a cztery antypoślizgowe podkładki i podstawka zapewniają stabilność. Sam zdecydujesz, czy chcesz, aby stała na biurku, czy leżała dyskretnie pod monitorem. Bezpieczeństwo na najwyższym poziomie Zgodność z normami CE, LVD i RoHS oraz specjalny system zabezpieczeń chronią Twoje urządzenia przed przegrzaniem i skokami napięcia. Możesz mieć pewność, że Twoje urządzenia są zawsze w pełni bezpieczne.','','stacja-ladujaca-biurkowa-gan-3x-usb-c-pd-2x-usb-a-qc-40-200w-forcell-f-energy-vt-51-szara','','','','Stacja ładująca, biurkowa GaN 3x USB-C PD, 2x USB-A QC 4.0, 200W, Forcell F-Energy VT-51, szara','','','',''),(70640,1,1,'Szkło prywatyzujące Bizon Glass Tab Clear Shadow Duo Apple iPad Pro 13 M5 2025 (A3360, A3361, A3362) Apple iPad Pro 13 M4 7 gen. 2024 Duo to nowy standard wygody - jedna decyzja, ochrona na dwa razy dłużej. To ta sama sprawdzona jakość, teraz w zestawie 2w1. Jedna sztuka na teraz, druga na później - bo w życiu dobrze mieć plan B. Wybierz Duo i nie daj się zaskoczyć. Ochrona prywatności i ekranu dla iPad Pro 13 2025 2024 Siedzisz w autobusie i znowu przyciemniasz ekran, żeby sąsiad z siedzenia obok nie czytał Twoich notatek? Prywatyzujące szkło hartowane marki Bizon z serii Tab Clear Shadow Duo to idealne rozwiązanie dla osób, którym zależy na kompleksowej ochronie wyświetlacza przy jednoczesnym zachowaniu prywatności. Osłona obroni ekran Twojego tabletu przed zabrudzeniami oraz zarysowaniami, a Ciebie przed wścibskimi spojrzeniami. Kolor: przyciemniany Twardość szkła: 9H Grubość: 0,30 mm Filtr prywatyzujący Kąt widzenia: 30 Powłok