perełka z technologią MagSafe oferuje kompleksowe rozwiązanie do ładowania telefonu, słuchawek i zegarków. Gadżet jest kompatybilny z funkcją MagSafe. wymiary (złożony): 73 x 73 x 26 mmwymiary (rozłożony): 130 x 73 x 90 mm Waga: 237g Kolor producenta: Grey (szara) W zestawie: Ładowarka indukcyjna 3w1 MagSafe, kabel USB-C do USB-C, instrukcja obsługi w języku polskim Wielozadaniowość i nieskończone możliwości MagFlex wyróżnia się wszechstronnym designem, który umożliwia korzystanie z niej zarówno jako tradycyjnej podkładki do ładowania, jak i funkcjonalnej podstawki. Ładowarkę można szybko złożyć do kompaktowych rozmiarów, co ułatwia transport. W trybie rozłożonym oferuje dedykowaną strefę ładowania obsługującą MagSafe, dzięki której iPhonea naładujesz z mocą do 7,5 W. Jest również kompatybilna z innymi urządzeniami z funkcją ładowania bezprzewodowego Qi, obsługując je z mocą do 5 W. Bez kabli - bez problemu Druga powierzchnia ładowarki, wyposażona w dedykowany moduł dla Apple Watcha, pozwala na wygodne ładowanie zegarka, dzięki czemu jest on zawsze gotowy do użytku. Trzecia strefa ładowania została przeznaczona do bezprzewodowego zasilania słuchawek, co umożliwia jednoczesne ładowanie kilku urządzeń. Dzięki MagPowerstation codzienne ładowanie staje się prostsze i bardziej intuicyjne. Ładowarka posiada złącze wejściowe USB-C, do pełnej wydajności musi być zasilana przez standardową przejściówkę ładującą PD o mocy 25W. Dzięki temu, możesz cieszyć się szybkim i wydajnym ładowaniem. Wejście: 5 V3 A, 9 V2,22 A, maks. 12 V3 A. Moc wyjściowa głównej powierzchni: 5 W, 7,5 W, 10 W, 15 W maks. (7,5 W dla iOS) Moc wyjściowa drugiej powierzchni: 5 W maks. Moc wyjściowa dla Apple Watch: 5 W maks. Zalecany zasilacz: PD min. 25 W Stylowa mocna ochrona MagPowerstation Round wyróżnia się solidną, metalową obudową w stylowym kolorze, która zapewnia wyjątkową trwałość i estetykę. Silikonowe powierzchnie precyzyjnie osłaniają urządzenia, skutecznie chroniąc je przed zarysowaniami i stabilnie utrzymują urządzenia na miejscu, dzięki czemu Twoje sprzęty zachowują idealny stan. Dodatkowo, subtelna dioda LED informuje o statusie ładowania.','','ladowarka-indukcyjna-3w1-fixed-magpowerstation-round-qi-magsafe-15w-5w-szara','','','','Ładowarka indukcyjna 3w1 Fixed MagPowerstation Round, Qi, MagSafe, 15W 5W szara','','','',''),(70960,1,1,'Etui ze szkłem do smartwatcha Bizon Case Glass Set Huawei Watch GT 5 41 mm Podwójna ochrona dla Huawei Watch GT 5 41 mm Nie trać czasu! Etui ze szkłem na zegarek od marki Bizon z serii Case Glass Watch to wszystko, czego potrzebujesz, aby zapewnić ochronę Twojemu smartwatchowi. Osłona z wbudowanym szkłem obroni Twojego smartwatcha przed codziennymi przeciwnościami losu, takimi jak zabrudzenia od lecących w stronę ekranu kropki kawy czy zarysowania spowodowane przez przypadkowe uderzenia o kant stołu. Kolor producenta: Satin Silver (satynowo srebrny) Wykonanie: Poliwęglan, szkło hartowane Grubość szkła: 0,33 mm Idealne dopasowanie do zegarka Doskonałe zabezpieczenie przed zarysowaniami Lekki i wytrzymały case Płynność w działaniu wyświetlacza Przedmiotem sprzedaży jest samo etui ze szkłem, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności. Innowacyjna konstrukcja Boisz się, że po założeniu osłony smartwatch poczuje się klaustrofobicznie i zacznie Cię oszukiwać, która jest godzina, a Twój palec zostanie dodany do bazy osób nieupoważnionych do korzystania z zegarka? Tak jest tylko w bajkach. A Bizon Case Glass Watch, oprócz idealnie dopasowanej, wytrzymałej konstrukcji z poliwęglanu, zachowuje pełną czułość dotyku! Smukły kształt obudowy nie zaburzy oryginalnego wyglądu urządzenia, a dzięki zastosowaniu lekkiego niczym piórko materiału, Twój nadgarstek pod ciężarem nakładki nie będzie miał problemów z uniesieniem dłoni. Prostota w funkcjonalności Zachowaj możliwość swobodnego korzystania z zegarka! Ramka w żaden sposób nie zakłóca jego funkcjonalności, a jeśli Twój smartwatch potraf