onany jest z wytrzymałych materiałów ochronnych, które gwarantują skuteczną ochronę urządzenia przed codziennymi zagrożeniami. Wysłana pianką warstwa oraz miękka polarowa podszewka skutecznie amortyzują wstrząsy i zapobiegają zarysowaniom, dzięki czemu możesz być spokojny o bezpieczeństwo swojego laptopa, niezależnie od sytuacji. Towarzysz w pracy i w podróży Futerał Sleevy to niezawodny wybór na każdy dzień zarówno do biura, jak i w podróży. Jego lekka konstrukcja i funkcjonalność sprawiają, że jest praktycznym towarzyszem, który nie obciąża bagażu, a jednocześnie zapewnia doskonałą ochronę. To połączenie stylu i bezpieczeństwa, na które możesz liczyć każdego dnia.','','etui-tech-protect-sleevy-do-laptopow-15-16-ciemnozielone','','','','Etui Tech-Protect Sleevy do laptopów 15\" / 16\", ciemnozielone','','','',''),(71941,1,1,'Fixed MagFlex Alu Wireless Charging Stand 3in1 Urządzenia obsługujące ładowanie bezprzewodowe Apple iPhone (seria 12 i nowsze) Apple Watch AirPods Wszechstronność w ładowaniu FIXED MagFlex Alu to składana, bezprzewodowa ładowarka, która umożliwia jednoczesne ładowanie telefonu, słuchawek i zegarka wszystko w jednym miejscu. Dzięki technologii MagSafe, wystarczy położyć iPhonea serii 12 lub nowszej, a magnesy automatycznie zainicjują ładowanie o mocy 7,5W. Co więcej, inne modele telefonów mogą być ładowane bezprzewodowo mocą aż do 15W. To nowoczesne, minimalistyczne rozwiązanie dla użytkowników, którzy cenią sobie komfort, styl oraz efektywność. Gadżet jest kompatybilny z funkcją MagSafe. wymiary (złożony): 7,6 7,6 1,9 cmwymiary (rozłożony): 20 7,6 cm Waga: 112g Kolor producenta: Grey (szara) W zestawie: Ładowarka indukcyjna 3w1 MagSafe, kabel USB-C do USB-C, instrukcja obsługi w języku polskim *Do prawidłowego działania ładowarki indukcyjnej wymagany jest zasilacz USB-C (sprzedawany oddzielnie) o mocy min. 40W, zgodny z technologią Power Delivery. Innowacyjna konstrukcja podstawka lub mata Dzięki przemyślanej, składanej konstrukcji FIXED MagFlex Alu oferuje pełną elastyczność. Można ją ustawić w formie podstawki, idealnej do śledzenia powiadomień czy korzystania z wideorozmów podczas ładowania. Zintegrowana nóżka stojaka z możliwością regulacji kąta pozwala na dostosowanie urządzenia do idealnej pozycji widoczności. W trybie rozłożonym ładowarka zmienia się w elegancką matę, zapewniając stabilne ładowanie wszystkich trzech urządzeń. Niezależnie od sytuacji, MagFlex Alu dostosowuje się do Twojego stylu i rytmu dnia. Bez kabli - bez problemu Korpus ładowarki wykonano z odpornego na uszkodzenia aluminium oraz utwardzanego tworzywa sztucznego, co nie tylko zapewnia długowieczność, ale też elegancki wygląd. Elementy soft-touch chronią urządzenia przed zarysowaniami, a wytrzymała, syntetyczna skóra na powierzchni przeznaczonej do ładowania słuchawek dodaje jej elegancji. Dzięki temu FIXED MagFlex Alu doskonale wpisuje się w każde wnętrze i świetnie wygląda na biurku, w sypialni czy nawet w podróży. Specyfikacja Ładowarka jest wyposażona w port USB-C, co pozwala na wygodne podłączenie do różnych źródeł zasilania, a kabel USB-CUSB-C dołączony do zestawu daje swobodę w każdej sytuacji. Wymagając zasilania o mocy minimum 40W (PD), ładowarka jest gotowa zapewnić pełną wydajność. Wejście: 9V12V 3A Max Wyjście główne: 5W, 7,5W, 10W, 15W Max (iOS max. 7,5W) Moc wyjściowa wtórna: maks. 3,5 W Moc wyjściowa dla zegarków: maks. 2,5 W Częstotliwość: 110 kHz-205 kHz Port zasilania USB-C Zalecany zasilacz: min. 30W PD Materiał: stop aluminium, PC, ABS, skóra PU Wymiary (po złożeniu): 7,6 cm, 7,6 cm, 1,9 cm Waga: 112 g','','ladowarka-indukcyjna-3w1-fixed-magflex-alu-qi-magsafe-szara','','','','Ładowarka indukcyjna 3w1 Fixed MagFlex Alu, Qi, MagSafe, szara','','','',''),(71960,1,1,'Tech-Protect KLR100 Pouch Keyless RFID Signal Blocker dla kluczyków samochodowych typu Keyless z blokadą skanowania RFID Etui z funkcją klatki Faradaya Zadbaj o bezpieczeństwo swoich kluczyków samochodowych i chroń je przed zagrożeniami nowoczesnych 