 smart zegarów Apple Watch - z możliwością rozłożenia do pozycji Stand Zatem pozwala ona ładować aż 3 urządzenia z ekosystemu Apple jednocześnie. Tym sposobem uzupełnisz zapas energii na kolejny dzień w swoich kluczowych urządzeniach mobilnych. Wystarczy przyłożyć iPhone z MagSafe w wyznaczonym miejscu aby zadokować telefon i rozpocząć ładowanie. Można to zrobić w dowolnej orientacji: pionowej lub poziomej. To też świetny sposób na kontynuowanie dostarczania energii dla telefonu bez przerywania rozpoczętych czynności - dzięki tej ładowarce kurczący się pasek stanu baterii w ważnych momentach nie będzie już problemem. Belkin zapewnia gwarancję bezpieczeństwa podłączonego sprzętu o wartości do 2,000. Jeśli Twój sprzęt zostanie uszkodzony z winy tego produktu podczas prawidłowego podłączenia i użytkowania, Belkin naprawi lub wymieni urządzenie na nowe. Kompatybilna z MagSafe Ładowarka Belkin jest kompatybilna ze smartfonami iPhone zgodnymi z MagSafe, dzięki czemu zachowuje ich pełną funkcjonalność i swobodę użytkowania. Pozwala to zapewnić optymalne ładowanie poprzez właściwe przyleganie w odpowiednim miejscu względem cewki Qi. Ruchomy moduł 0 - 90 w pionie Wspiera funkcjonalność StandBy. W module ładowania dla iPhone istnieje możliwość regulacji jego nachylenia pionie w zakresie 0 - 90 co oznacza, że możesz ładować telefon zarówno płasko jak i w nachyleniu co pozwala zachować wygodny wgląd na ekran smartfona podczas jego ładowania. Moduł ładowania Apple Watch również wyposażony jest w zawias, pozwalający ładować zegarek w trybie NightStand. Nowoczesny, składany design Wykonana z wysokiej jakości materiałów tworzy elegancką całość i jest przyjemna w dotyku. Małe rozmiary i nowoczesna budowa doskonale komponują się w każdym wnętrzu. Wymiary: 16 x 14,5 x 1,9 cm Waga: 373 g Całość wykonana została w dość kompaktowym i przemyślanym rozmiarze, świetnie prezentując się na nocnym stoliku czy biurku. Łatwo ją rozłożyć do wygodnych widoków Stand, oraz równie łatwo złożyć by wygodnie schować ją w bagażu. Apple Fast Charge 15W Qi2 Ładowarka jest dobrze zoptymalizowana, pozwala na wydajne ładowanie zgodnych urządzeń i wykorzystanie w pełni możliwości ładowarki automatycznie dostosowując odpowiednią moc ładowania. Wyposażona w technologię ładowania Apple Fast Charge Qi2 dla iPhone oraz szybkie ładowanie dla Apple Watch 7 i nowszych. Kompatybilna z pokrowcami MagSafe o grubości do 3mm Mocowanie MagSafe dla iPhone Moduł ładowania dla iPhone w standardzie Qi2 15W max Wsparcie funkcji StandBy Ładowanie 3 urządzeń jednocześnie Zalecana temperatura pracy: 0C do 40C przy wilgotności względnej od 10 do 90 (w pomieszczeniu) Zalecana temperatura przechowywania: -30C do 70C przy wilgotności względnej od 40 do 85 (w pomieszczeniu) Posiada certyfikat Made for Apple Watch co daje gwarancję kompatybilności z urządzeniami Apple W zestawie dołączono kompatybilny kabel USB-C i ładowarkę sieciową z USB-C PD o mocy 36W 5V3A15W, 9V3A27W, 12V3A36W, 15V2.4A36W. Bądź gotowy na każdy dzień Zapoznaj się z prezentacją producenta na temat oferowanego produktu i poznaj jego zalety i właściwości:','','ladowarka-indukcyjna-belkin-boost-foldable-3w1-qi2-15w-wiz029-dla-iphone-z-magsafe-apple-watch-airpods-biala','','','','Ładowarka indukcyjna Belkin Boost Foldable 3w1 Qi2 15W WIZ029 dla iPhone z MagSafe / Apple Watch / AirPods, biała','','','',''),(72375,1,1,'Metalowa podstawka pod laptopa Tech-Protect ULS100 Uniwersalny Urządzenia do 16 Solidne, lekkie, wygodne Solidna podstawka do laptopa Tech-Protect Universal Laptop Stand 100 to idealne połączenie funkcjonalności i stylu. Lekka, aluminiowa konstrukcja pozwala na indywidualną regulację pod kątem wielkości laptopa, co pozwala na szeroką kompatybilność tej podstawki! Możliwość regulacji szerokości podstawki: od 180 do 270mm Podstawka posiada stały kąt nachylenia 17. *Przedmiotem sprzedaży jest sama podstawka, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jej funkcjonalności. Kolor producenta: Grey (