gotowy na każdą przygodę! Wymiary plecaka (wysokość x szerokość): 52x39cm Kolor producenta: Black (czarny) Przedmiotem sprzedaży jest sam plecak Tech-Protect Defender S40, pozostałe akcesoria widoczne na zdjęciach służą jedynie przedstawieniu jego funkcjonalności produktu. Zorganizuj się w mgnieniu oka Komora główna? Przestronna. Przegrody? Na każdą drobnostkę. Kosmetyczka, kable, tablet czy powerbank wszystko znajdzie swoje miejsce. Dzięki dodatkowym kieszeniom zewnętrznym masz pod ręką butelkę wody, parasol i najważniejsze dokumenty. Chaos w plecaku? Nie z tym modelem! Lekkość i komfort noszenia Defender S40 to plecak, który nie zamienia Twojej podróży w maraton siłowy. Lekka konstrukcja i wyprofilowane plecy dbają o Twój komfort. A kiedy trzeba, uchwyt na walizkę pozwala zamocować plecak na bagażu. Wygoda ponad wszystko! Stylowy w każdej sytuacji W drodze do biura czy na weekendowy wypad ten plecak pasuje do każdej okazji. Minimalistyczny design robi wrażenie, a odporne na zabrudzenia materiały sprawiają, że wygląda świetnie przez długi czas. Wyróżnij się stylem, nie plamami! Twoje rzeczy zawsze bezpieczne Zabezpieczone kieszenie na zamek to gwarancja, że ważne dokumenty, klucze i portfel są poza zasięgiem ciekawskich rąk. Plecak odporny na uszkodzenia mechaniczne dba o Twój sprzęt podczas każdej podróży. Nie martw się Defender S40 to Twój strażnik bezpieczeństwa.','','plecak-podrozny-z-miejscem-na-laptopa-40l-tech-protect-defender-s40-czarny','','','','Plecak podróżny z miejscem na laptopa, 40L, Tech-Protect Defender S40, czarny','','','',''),(79669,1,1,'Spigen Tesla Card Holder Case 2-Pack do kluczakarty dostępu wszystkich samochodów Tesla Stylowa ochrona dla karty do Twojej Tesli Spigen Card Holder Case 2-Pack to więcej niż zwykłe etui na karty do Tesli. Wysokiej jakości, trwałe tworzywo odporne na zarysowania chroni Twoje kluczyki przed uszkodzeniami, zachowując ich elegancki wygląd na dłużej. Sportowy wzór imitujący karbon dodaje stylu, a wycięcie odkrywające logo Tesli podkreśla ekskluzywność Twojego samochodu. Kolor producenta: Black (czarny) Twój klucz do Tesli zawsze pod ręką Solidny karabińczyk w zestawie pozwala przypiąć etui do paska, torby lub kluczy, aby Twoje karty zawsze były w zasięgu ręki. Koniec z nerwowym szukaniem kluczyków w kieszeni czy torebce teraz masz je zawsze tam, gdzie potrzebujesz. Funkcjonalne etui na kartę Dzięki kompatybilności z wszystkimi modelami Tesli oraz precyzyjnemu dopasowaniu, etui nie ogranicza funkcjonalności karty-kluczyka. Dwuczęściowa konstrukcja umożliwia łatwe nakładanie i zdejmowanie, a kompaktowy rozmiar sprawia, że doskonale mieści się w każdej kieszeni czy przegródce. Podwójna ochrona, podwójna wygoda Dzięki zestawowi dwóch etui możesz chronić zarówno główny, jak i zapasowy kluczyk lub podzielić się drugim etui z innym użytkownikiem Tesli. Co więcej, dodatkowe 4 sztuki folii ochronnych dołączone do zestawu zapewniają jeszcze większe bezpieczeństwo kart, chroniąc je przed zarysowaniami i zużyciem. Dlaczego warto? Ochrona kluczyków przed uszkodzeniami i utratą. Stylowy wygląd pasujący do luksusu Tesli. Wygoda dzięki możliwości przypięcia i łatwemu użyciu. Uniwersalność kompatybilne z każdą kartą Tesli. Dodatkowe folie ochronne w zestawie dla maksymalnej trwałości.','','etui-na-klucz-karte-do-tesli-spigen-card-holder-case-2-pack-czarne','','','','Etui na klucz/kartę do Tesli, Spigen Card Holder Case 2-Pack, czarne','','','',''),(79683,1,1,'Torba na laptopa Tech-Protect Pocket Bag do laptopów o przekątnej 13 14o wymiarach mniejszych niż: 34 x 25 cm (szer. x głęb.) Wygoda w każdej podróży! Jeśli szukasz idealnego rozwiązania na co dzień, do pracy czy podróży torba Tech-Protect Pocket Bag spełni Twoje oczekiwania. Dzięki solidnemu wykonaniu i designowi zapewnia pełną ochronę 360 dla laptopów 13-14 cali, chroniąc je przed uderzeniami, zarysowaniami i innymi uszkodzeniami mechanicznymi. Niezależnie od tego, czy pracujesz w biurze, czy jesteś w drodze, możesz mieć pewność, że Twój sprzęt jest bezpieczny, a Ty zyskujesz wygodę i elegancję w jednym. Kolor producenta: Black (czarny) Wymiary wewnętrzne: 34 x 25 x 3 cm Wymiary zewnętrzne: 37,5 x 27 x 3,3 cm Długość paska: 135 cm Zanim kupisz, zmierz swój laptop Rozmiar matrycy to tylko orientacyjna wskazówka laptopy o tej samej przekątnej mogą różnić się wymiarami zewnętrznymi. Aby mieć pewność, że etui będzie pasować, przed zakupem sprawdź wymiary wewnętrzne etui podane w opisie i porównaj je z wymiarami swojego urządzenia. X szerokość Y głębokość Perfekcyjna organizacja! Główna komora wyposażona w specjalną wyściółkę zapewnia pełne bezpieczeństwo Twojego sprzętu. Z przodu znajduje się kieszeń na zamek, idealna na drobne przedmioty takie jak ładowarki, kable czy klucze. Dodatkowe wewnętrzne przegrody pozwalają na perfekcyjną organizację, dzięki czemu dokumenty, smartfon i inne akcesoria będą uporządkowane i łatwo dostępne. Wybierz torbę, która dba o Twój komfort i porządek idealna do biura, na uczelnię czy w codziennej podróży! Noś, jak chcesz! Z tą torbą zyskujesz pełną swobodę. Dzięki regulowanemu paskowi możesz przekształcić ją w klasyczną torbę na ramię, dopasowaną do Twoich potrzeb, lub wygodnie uchwycić ją w ręku za pomocą uchwytów.Ale to nie wszystko tylny pasek umożliwia łatwe zamocowanie torby na uchwycie walizki, co czyni ją niezastąpionym kompanem podczas podróży służbowych i prywatnych. Wodoodporna ochrona! Jest wykonana z wodoodpornego materiału, który skutecznie chroni Twoje rzeczy przed wilgocią i zabrudzeniami, zachowując nieskazitelną ochronę przez lata. Jej kolorystyka sprawia, że doskonale komponuje się zarówno z eleganckimi, jak i casualowymi stylizacjami dodając szyku.','','torba-na-laptopa-13-14-na-ramie-tech-protect-pocket-bag-czarna','','','','Torba na laptopa 13-14\" na ramię, Tech-Protect Pocket Bag, czarna','','','',''),(79818,1,1,'Ładowarka 3w1 Tech-Protect QI15W-A45 Dla urządzeń kompatybilnych z ładowaniem Qi i MagSafe Ładuj trzy urządzenia jednocześnie Tech-Protect QI15W-A45 to elegancka ładowarka indukcyjna, która umożliwia jednoczesne ładowanie smartfona z MagSafe, AirPods, Apple Watch lub niektórych zegarków z serii Samsung Galaxy Watch. Silne magnesy i antypoślizgowe gumy zapewniają stabilność i bezpieczeństwo podczas ładowania. Zaawansowany system ochrony chroni Twoje urządzenia przed przegrzaniem i przepięciem, utrzymując niską temperaturę nawet podczas długotrwałego użytkowania. Postaw na praktyczność, bezpieczeństwo i styl wybierz tę ładowarkę i ciesz się bezproblemowym ładowaniem każdego dnia! Dla najlepszego efektu ładowania wszystkich urządzeń zalecamy użycie ładowarki o mocy co najmniej 40W, wspierającej technologię Power Delivery. Kolor producenta: Czarny (Black) Zestaw zawiera: Ładowarka indukcyjna 3w1, kabel USB-C do USB-C 100cm, instrukcja w języku angielskim. Elegancki design pasujący do każdego wnętrza Matowe wykończenie i nowoczesny wygląd sprawiają, że ładowarka idealnie komponuje się z wystrojem Twojego biura czy salonu. Nie musisz już chować kabli teraz staną się one stylowym dodatkiem. Dzięki kompaktowym rozmiarom, urządzenie nie zajmuje dużo miejsca na biurku. Prosta forma i funkcjonalność idą tu w parze, tworząc harmonijną całość. To nie tylko ładowarka, ale i ozdoba Twojego miejsca pracy. Z Tech-Protect QI15W-A45 technologia spotyka się z estetyką. Bezpieczeństwo i niezawodność na co dzień Zaawansowany system ochrony dba o Twoje urządzenia, chroniąc je przed przegrzaniem i przepięciem. Możesz spać spokojnie, wiedząc, że Twoje gadżety są w dobrych rękach. Nawet podczas wielogodzinnego ładowania, temperatura pozostaje na bezpiecznym poziomie. Solidne materiały zapewniają długowieczność produktu. To jak posiadanie osobistego ochroniarza dla Twojej elektroniki. Ładuj urządzenia jak chcesz! Dzięki możliwości ładowania w dowolnej konfiguracji, dostosujesz urządzenie do swoich potrzeb. Ładuj jedno, dwa lub trzy urządzenia jednocześnie wybór należy do Ciebie. Silny magnes utrzymuje wszystko na miejscu, nawet gdy kot postanowi sprawdzić, co to za nowy gadżet na biurku. Antypoślizgowe gumy zapewniają dodatkową stabilność, chroniąc przed przypadkowym przesunięciem. To elastyczność i funkcjonalność w jednym eleganckim urządzeniu. Specyfikacja: Moc wyjściowa (smartfon): 5W7.5W10W15W Moc wyjściowa (zegarek): do 3W Moc wyjściowa (słuchawki): do 5W (AirPods 2W) Wspierane zegarki Samsung Galaxy Watch: 4-7, Classic 3-5, Active 1-2 Wspierane zegarki Apple Watch: 1-10, SE, Ultra 12 Wejście USB-C (PD, QC 3.0): 9V3A, 12V2.5A (zalecamy użyć ładowarki sieciowej o minimalnej mocy 40W ze wsparciem technologii PD)','','ladowarka-indukcyjna-3w1-tech-protect-a45-magnetic-stand-qi-15w-do-magsafe-czarna','','','','Ładowarka indukcyjna 3w1, Tech-Protect A45 Magnetic Stand Qi 15W do MagSafe, czarna','','','',''),(79825,1,1,'Tech-Protect A42 3in1 Magnetic Stand Wireless Charger Qi MagSafe Dla urządzeń kompatybilnych z ładowaniem Qi i MagSafe wbudowany moduł do ładowania Apple Watch Bezprzewodowa ładowarka 3 w 1 Ładowarka indukcyjna 3 w 1 Tech-Protect Qi15W-A42 stworzona do jednoczesnego lub oddzielnego zasilania aż do trzech urządzeń. Jej kompaktowa i składana budowa w połączeniu z eleganckim wykonaniem sprawiają, że znajdzie swoje miejsce w każdym biurze lub sypialni. System ochronny ładowarki zabezpiecza ją przed przegrzaniem, przeciążeniem i przepięciem, a silne magnesy dbają o stabilne łączenie z urządzeniami kompatybilnymi z technologią MagSafe. Do ładowarki został dołączony kabel USB-C o długości 1 m. Ładowarka służy do bezprzewodowego ładowania smartfona (do 15W), słuchawek (do 5W) i zegarka (2.5W). Kolor producenta: Desert Gold (złoty) *Do prawidłowego działania ładowarki indukcyjnej wymagany jest zasilacz USB (sprzedawany oddzielnie) o mocy min. 35W, zgodny z technologią Quick Charge 3.0 lub Power Delivery. * Funkcja magnetyczna MagSafe działa tylko i wyłącznie bezpośrednio do telefonu lub do etui z wbudowanym oczkiem magnetycznym o zastosowaniu MagSafe. Szybkie ładowanie urządzeń! Ładowarka indukcyjna, która pozwala ładować do trzech urządzeń razem lub osobno. Zintegrowana dioda LED zmienia kolory w zależności od aktualnego stanu ładowania urządzeń. System ochronny ładowania Ładowarka dba o bezpieczeństwo urządzeń chroniąc je przed przegrzaniem, zwarciem i przepięciem. Jejkonstrukcja z wytrzymałych materiałów ABS, PC i aluminium wraz z możliwością złożenia i eleganckim designem to połączenie funkcjonalności z trwałością. Mocne magnesy zapewniają pewne łączenie z urządzeniami z technologią MagSafe. Ładowarka indukcyjna do MagSafe, Qi, Apple Watch Materiał: ABS, PC, Aluminium Prąd wejściowy USB-C: 9V3A, 5V3A Moc wyjściowa (smartfon): 5W7.5W10W15W (max) Moc wyjściowa (słuchawki): 5W (max) Moc wyjściowa (zegarek): 2.5W Funkcja ładowania urządzeń jednocześnie lub oddzielnie Modularna, składana konstrukcja Wbudowany moduł do ładowania Apple Watch Magnetyczne, silne łączenie z urządzeniami do MagSafe Obsługa protokołów Quick Charge oraz Power Delivery System ochronny przed przegrzaniem, przeciążeniem i przepięciem Dioda LED zmieniająca kolor podczas ładowania urządzeń Dołączony kabel USB-C o długości 1 m','','ladowarka-indukcyjna-tech-protect-qi15w-a42-3w1-magnetic-stand-and-wireless-charger-do-magsafe-qi-zlota','','','','Ładowarka indukcyjna Tech-Protect Qi15W A42 3w1 Magnetic Stand and Wireless Charger do MagSafe, Qi, złota','','','',''),(79826,1,1,'Ładowarka 3w1 Tech-Protect QI15W-A45 Dla urządzeń kompatybilnych z ładowaniem Qi i MagSafe Ładuj trzy urządzenia jednocześnie Tech-Protect QI15W-A45 to elegancka ładowarka indukcyjna, która umożliwia jednoczesne ładowanie smartfona z MagSafe, AirPods, Apple Watch lub niektórych zegarków z serii Samsung Galaxy Watch. Silne magnesy i antypoślizgowe gumy zapewniają stabilność i bezpieczeństwo podczas ładowania. Zaawansowany system ochrony chroni Twoje urządzenia przed przegrzaniem i przepięciem, utrzymując niską temperaturę nawet podczas długotrwałego użytkowania. Postaw na praktyczność, bezpieczeństwo i sty