honeów, Androidów, laptopów, powerbanków, słuchawek Bluetooth, a nawet konsol Nintendo Switch. Lekka i wydajna Nowoczesne materiały półprzewodnikowe na bazie azotku galu (GaN) sprawiają, że ładowarka jest nie tylko mocna, ale także lżejsza i bardziej kompaktowa niż tradycyjne modele. W porównaniu do wcześniejszych generacji oferuje o 20 więcej mocy, będąc jednocześnie o 13 mniejsza i 40 g lżejsza idealna do zabrania w podróż. Kompaktowa i lekka (145 g) konstrukcja sprawia, że idealnie nadaje się do zabrania w podróż zmieści się nawet w małej kieszeni. Luksusowy design, który zachwyca Obudowa ładowarki została wykończona materiałem przypominającym skórę, a subtelne przeszycia oraz laserowe grawerowanie dodają jej wyjątkowego charakteru. Kompaktowa, przenośna i stylowa idealna zarówno do biura, jak i w podróż. Bezpieczeństwo na najwyższym poziomie Dzięki systemowi podwójnej kontroli temperatury NTC i rygorystycznym testom jakości masz pewność, że Twoje urządzenia są w pełni chronione. Inteligentny układ E-marker automatycznie dostosowuje napięcie i natężenie, zapobiegając przegrzewaniu i przeciążeniom. Ogniotrwała powłoka gwarantuje, że Twoje ładowanie jest bezpieczne w każdych warunkach. A dzięki pracy w zakresie napięcia od 100 do 240V, możesz z niej korzystać na całym świecie.','','ladowarka-sieciowa-gan-usb-c-usb-a-120w-oneplus-supervooc-dual-charger-kabel-usb-c-biala','','','','Ładowarka sieciowa GaN USB-C, USB-A, 120W, OnePlus SuperVOOC Dual Charger, kabel USB-C, biała','','','',''),(85270,1,1,'Torba Tech-Protect Basic Bag do laptopów o przekątnej 13 14o wymiarach mniejszych niż: 33 x 23 cm (szer. x głęb.) Wytrzymała torba do laptopa Tech-Protect Basic Bag, miękki pokrowiec z rączką oraz dodatkowymi kieszeniami na akcesoria. Idealnie dopasowana torbado wymiarów laptopa. Ten pokrowiec chroni urządzenia przed codziennym zużyciem, niewielkimi wstrząsami i zarysowaniami. Kolor producenta: Black (czarny) Wymiary wewnętrzne: 33 x 23 x 3 cm Wymiary zewnętrzne: 35 x 25,