dowarka to zapewnienie trwałości i niezawodności. Solidna obudowa zapobiega uszkodzeniom mechanicznym, dzięki czemu produkt posłuży przez długi czas. Niezależnie od tego, czy ładowarka leży w plecaku, torbie czy na biurku pozostaje w świetnej kondycji. Złącze USB-C pasuje do większości standardowych ładowarek sieciowych, co zapewnia szeroką kompatybilność. Pewne i stabilne połączenie to klucz do szybkiego i bezpiecznego ładowania. Ładowanie bez ograniczeń Z Fixed Charging Cable naładujesz swój smartwatch szybko i wygodnie. Dzięki wyjściu 3W Twój zegarek będzie zawsze gotowy na nowe wyzwania. Wystarczy podłączyć przewód do dowolnego adaptera USB-C i rozpocząć ładowanie. Konstrukcja zapewnia pełną zgodność z europejskimi normami bezpieczeństwa, dzięki czemu możesz mieć pewność, że Twój sprzęt jest chroniony. Teraz już nigdy nie zabraknie Ci energii w kluczowym momencie. Specyfikacja: Wejście: DC 5V Wyjście: 5V1A (maks. 3W) Wbudowany kabel z portem USB-C Kompatybilność: Huawei Watch GT 2 Pro Huawei Watch GT 3 Huawei Watch GT 3 Pro Huawei Watch GT 4 Huawei Watch GT 4 Pro Huawei Watch GT 5 Huawei Watch GT 5 Pro Huawei Watch GT Runner Huawei Watch GT 2022 Huawei Watch D Huawei Watch GT Cyber Huawei Watch Buds Huawei Watch 3 Huawei Watch 3 Pro Huawei Watch 4 Huawei Watch 4 Pro Huawei Watch Ultimate','','ladowarka-indukcyjna-fixed-charging-cable-do-zegarkow-huawei-watch-gt-5-5-pro-4-4-pro-3-3-pro-2-pro-usb-c-czarna','','','','Ładowarka indukcyjna Fixed Charging Cable do zegarków Huawei Watch GT 5/5 Pro/4/ 4 Pro/3/3 Pro/2 Pro, USB-C, czarna','','','',''),(85321,1,1,'Ładowarka do zegarków Fixed Charging Cable Huawei Watch GT 5 Pro54 Pro43 Pro32 ProHuawei Watch GT RunnerGT 2022GT CyberHuawei Watch 4 Pro43 Pro3UltimateBudsD Pełna kompatybilność Z ładowarką Fixed Charging Cable Twój Huawei Watch zawsze będzie gotowy do działania. Produkt doskonale współpracuje z szeroką gamą modeli, w GT 5 Pro, Ultimate czy GT Runner i wieloma innymi. Bez względu na to, który zegarek Huawei posi