ba z rączką Tech-Protect Carrying Bag to pokrowiec na laptopa z uchwytami na rękę z ekoskóry oraz dodatkową kieszenią na akcesoria. Stworzony z wodoodpornego materiału i miękkiej pianki chroni urządzenia przed uszkodzeniami, a nowoczesny wygląd sprawia, że nadaje się do użytku domowego i firmowego. Kolor producenta: Black (czarny) Wymiary wewnętrzne: 33 x 24 x 3 cm Wymiary zewnętrzne: 36 x 26 x 4,5 cm Zanim kupisz, zmierz swój laptop Rozmiar matrycy to tylko orientacyjna wskazówka laptopy o tej samej przekątnej mogą różnić się wymiarami zewnętrznymi. Aby mieć pewność, że etui będzie pasować, przed zakupem sprawdź wymiary wewnętrzne etui podane w opisie i porównaj je z wymiarami swojego urządzenia. X szerokość Y głębokość Pokrowiec z miękką pianką wewnątrz Miękki i delikatny w środku pokrowiec ochronny, z wytrzymałą rączką z ekoskóry. To nierozłączny towarzysz podróży, którego zawsze możesz wziąć ze sobą! Stylowy design pokrowca z dwoma osobnymi kieszeniami sprawdzi się w każdych warunkach. Torba z rączką i kieszeniami Praktyczna i elegancka torba na co dzień oraz do pracy z uchwytem na rękę i kieszeniami na laptopa i najpotrzebniejsze akcesoria. Bez obaw! Pokrowiec ochroni Twoje urządzenia niezależnie od pogody. Większy komfort użytkowania zapewniają użyte materiały jak wytrzymała ekoskóra w przypadku rączki i przyjemna w dotyku miękka pianka wewnątrz, wodoodporny materiał chroniący urządzenia przed wilgocią i zachlapaniami. Dopasowana torba do laptopa Precyzyjnie wykonana torba posiada odpowiednie wymiary do ochrony laptopa. Torba odporna na zewnętrzne uszkodzenia, którą możesz nosić tak jak lubisz, tradycyjnie lub powiesić na uchwyt od walizki podróżnej.','','torba-na-laptopa-13-14-tech-protect-carrying-bag-czarna','','','','Torba na laptopa 13\" / 14\", Tech-Protect Carrying Bag, czarna','','','',''),(85402,1,1,'Torba Tech-Protect Carrying Bag do laptopów o przekątnej 13 14o wymiarach mniejszych niż: 33 x 24 cm (szer. x głęb.) Mocna torba z rączką Tech-Protect Ca