w opisie i porównaj je z wymiarami swojego urządzenia. X szerokość Y głębokość Wszystko pod ręką! Solidny zamek błyskawiczny umieszczony na górze etui zapewnia szybki i łatwy dostęp do laptopa bez zbędnego szarpania czy zacinania. A co z dodatkowymi akcesoriami? Przestronna przednia kieszeń pomieści wszystko, czego potrzebujesz na co dzień mysz, słuchawki, ładowarkę czy nawet notatnik. Koniec z szukaniem drobiazgów w plecaku! Bez zbędnego ciężaru! Jego smukła, lekka konstrukcja sprawia, że nie dodaje zbędnej wagi i nie zajmuje zbyt dużo miejsca w torbie czy plecaku. Teraz możesz zabrać swoje urządzenie wszędzie do pracy, na uczelnię, czy w podróż bez obciążania swojego bagażu.','','uniwersalne-etui-na-laptopa-15-16-tech-protect-defender-czarne','','','','Uniwersalne etui na laptopa 15\"-16\" Tech-Protect Defender, czarne','','','',''),(85617,1,1,'Podstawka chłodząca pod laptopa AQIRYS Pluto Uniwersalny laptopy do 17 Gamingowa podstawka chłodząca do laptopa Nie pozwól, by przegrzewanie się laptopa odebrało Ci przewagę w grze! Aqirys Pluto to potężna podstawka chłodząca, która zapewnia maksymalne chłodzenie Twojego sprzętu dzięki dwóm wydajnym wentylatorom 125 mm. Każdy z nich osiąga prędkość 1100 RPM, generując przepływ powietrza na poziomie 82 CFM. Dzięki temu Twój laptop pozostanie chłodny nawet podczas intensywnych maratonów gamingowych i wymagających sesji pracy. W zestawie: podstawka chłodząca, kabel USB-A USB-A 70 cm Kolor producenta: Black (czarny) Pełna kontrola nad chłodzeniem Nie każdy moment wymaga pełnej mocy wentylatorów. Dlatego Aqirys Pluto oferuje 6-stopniową regulację prędkości, którą możesz wygodnie dostosować za pomocą wbudowanego panelu sterowania z wyświetlaczem LED. Wybierz optymalne ustawienia chłodzenia i ciesz się stabilną wydajnością laptopa w każdych warunkach. Efektowne podświetlenie RGB Gaming to nie tylko wydajność, ale też wygląd Twojego stanowiska. Aqirys Pluto wyposażony jest w dynamiczne podświetlenie RGB z 7 unikalnymi efektami świetlnymi. Możesz je dowolnie zmieniać lub całkowicie wyłączyć za pomocą dedykowanego przycisku. Stwórz niepowtarzalny klimat i wyróżnij się na tle innych graczy! Ergonomia na mistrzowskim poziomie Długie godziny przy komputerze? Dzięki 5-stopniowej regulacji kąta nachylenia Aqirys Pluto pozwala Ci dostosować pozycję laptopa do Twoich potrzeb, poprawiając komfort i zmniejszając obciążenie nadgarstków. Stabilna konstrukcja i antypoślizgowe zabezpieczenia utrzymują laptop na miejscu, nawet podczas najbardziej emocjonujących momentów w grze. Wszechstronna kompatybilność Aqirys Pluto to nie tylko wydajne chłodzenie, ale też pełna funkcjonalność. Podstawka obsługuje laptopy o przekątnej do 17 cali, a dzięki dołączonemu kablowi USB-A USB-A (70 cm) możesz łatwo podłączyć ją do swojego urządzenia. Co więcej, wbudowany uchwyt na smartfon sprawia, że masz swoje powiadomienia zawsze pod ręką, bez odrywania się od rozgrywki. Specyfikacja Aqirys Pluto to niezbędne akcesorium dla każdego gracza i profesjonalisty. Dzięki potężnemu chłodzeniu, stylowemu podświetleniu RGB, ergonomicznemu designowi i dodatkowym funkcjom, zapewni Twojemu laptopowi dłuższą żywotność i stabilną wydajność. Maksymalna przekątna: do 17 cali Liczba wentylatorów: 2 Prędkość obrotowa: 1100 10 obr.min Przepływ powietrza: 82 CFM Wymiary wentylatora: 2x 125 mm Podświetlenie: Tak, kolor LED: RGB Typ zasilania: USB 2.0 Wymiary: 461 x 294 x 52 mm Waga: 1200 g Dodatkowe funkcje: Zintegrowany panel sterowania z ekranem LED, regulowany kąt nachylenia (5 poziomów), stojak na smartfon','','podstawka-chlodzaca-pod-laptopa-do-17-aqirys-pluto-rgb-z-uchwytem-na-telefon-czarna','','','','Podstawka chłodząca pod laptopa do 17\", AQIRYS Pluto RGB z uchwytem na telefon, czarna','','','',''),(85643,1,1,'Podstawka chłodząca pod laptopa AQIRYS Spider Uniwersalny laptopy do 17 Gamingowa podstawka chłodząca do laptopa Nie pozwól, by przegrzewanie się laptopa odebrało Ci przewagę w grze! Aqirys Spider to potężna podstawka chłodząca, któ