ny montaż na ekran multimedialny Zapomnij o kleju, przyssawkach i śrubach! Ten uchwyt montuje się zaciskowo na ekranie multimedialnym o grubości od 7,5 mm do 14 mm. Prosty mechanizm instalacji oznacza, że uchwyt można zamontować w kilka sekund bez narzędzi. Antypoślizgowa powłoka z płynnego silikonu zapewnia miękkie, ale stabilne mocowanie, nie pozostawiając śladów ani zarysowań na ekranie. To czysta wygoda i ochrona dla Twojego samochodu. Bezpieczny uchwyt do nawigacji Dzięki HUD-Inspired Design telefon znajduje się na wysokości wzroku, co pozwala korzystać z nawigacji bez odrywania oczu od drogi. To rozwiązanie zwiększa bezpieczeństwo, zapewniając wygodę i lepszą kontrolę podczas jazdy. Konstrukcja uchwytu pozwala na szybki dostęp do telefonu bez konieczności szukania go np. w uchwytach na kratkach nawiewu. Idealny wybór dla kierowców ceniących ergonomię i komfort użytkowania. Lekka i kompaktowa konstrukcja Uchwyt samochodowy Baseus został zaprojektowany z myślą o minimalistycznym wyglądzie, który doskonale komponuje się z nowoczesnymi wnętrzami samochodów. Kompaktowa forma nie zasłania ekranu multimedialnego ani nie ogranicza widoczności. Dzięki wykonaniu z aluminium, PC i ABS, uchwyt jest lekki, ale niezwykle trwały. To eleganckie i praktyczne rozwiązanie dla każdego kierowcy ceniącego estetykę i funkcjonalność. Specyfikacja Model: MaxView BS-CM045 Magnetic Car Mount for In-Vehicle Infotainment Screen Materiał: Aluminium,ABS, PC Waga: ok. 111,6 g Wymiary: 127,5 x 117 x 41,8 mm (wys. x szer. x głęb.) Kompatybilny z ekranami o grubości: 7,5mm - 14mm Kompatybilność: iPhone z MagSafe oraz inne urządzenia i etui bez MagSafe (z blaszką) Miejsce montażu: ekran multimedialny (infotainment) Rodzaj trzymania uchwytu: do MagSafe Regulacja kąta: regulacja 270 oraz obrót 360 (kulowy przegub) W zestawie: Uchwyt samochodowy MagView, metalowy ring dla telefonów bez MagSafe, ściereczka do czyszczenia powierzchni','','uchwyt-samochodowy-magnetyczny-na-ekran-multimedialny-baseus-m