ane technologie Rysik 3mk Wonder Pen wyposażono w funkcję pochylenia, która naśladuje zachowanie prawdziwego ołówka. W zależności od kąta nachylenia, możesz uzyskać różne efekty graficzne - od delikatnych linii po mocne kreski. Technologia Palm Rejection (odrzucenie dłoni) pozwala swobodnie opierać dłoń na ekranie podczas pracy, eliminując przypadkowe dotknięcia i zapewniając naturalny komfort podczas tworzenia. Ładuj jak chcesz 3mk Wonder Pen oferuje dwa sposoby ładowania: Ładowanie bezprzewodowe (magnetyczne) - pełne naładowanie w zaledwie 90 minut Ładowanie przewodowe przez USB-C - błyskawiczne uzupełnienie energii w 25 minut Wbudowana bateria litowo-polimerowa 125 mAh zapewnia do 9 godzin nieprzerwanej pracy. Dioda LED informuje o stanie naładowania: zielona podczas pracy, czerwona podczas ładowania, migająca przy niskim poziomie baterii. Inteligentne połączenie z iPadem Dzięki wbudowanemu modułowi Bluetooth 5.0, rysik automatycznie łączy się z Twoim iPadem, umożliwiając: Bieżący podgląd poziomu naładowania baterii Wykonywanie zrzutów ekranu jednym kliknięciem przycisku Cofanie ostatnich akcji podwójnym kliknięciem Aby uruchomić lub wyłączyć rysik wystarczy dwa razy nacisnąć przycisk na górze rysika. Rysik wyłącza się automatycznie po 30 minutach nieużywania. Wymienne końcówki W zestawie otrzymujesz dwie zapasowe końcówki, które wydłużają żywotność rysika. Wymiana jest niezwykle prosta - wystarczy odkręcić zużytą końcówkę i zastąpić ją nową. To rozwiązanie gwarantuje długotrwałe korzystanie z rysika bez utraty jakości i precyzji.','','rysik-aktywny-3mk-wonder-pen-do-ipad-pro-air-mini-2018-i-nowszych-bialy','','','','Rysik aktywny 3mk Wonder Pen do iPad / Pro / Air / Mini 2018 i nowszych, biały','','','',''),(90276,1,1,'Kabel Belkin High Speed HDMI Cable with Ethernet HDMI do HDMI Kabel HDMI 4K z obsługą Ethernet 10,2 Gbs Oryginalny kabel marki Belkin pozwalający na podłączenie urządzeń ze złączem HDMI do monitora lub telewizora z portem HDMI. Obsługuje rozdzielc