 podróż bez obciążania swojego bagażu.','','uniwersalne-etui-na-laptopa-11-13-tech-protect-defender-czarne','','','','Uniwersalne etui na laptopa 11\"-13\" Tech-Protect Defender, czarne','','','',''),(90365,1,1,'Belkin BoostCharge 3-in-1 Magnetic Foldable Charger with MagSafe Qi2 15W - WIZ029 Dla serii Apple iPhone 12 i nowszych z MagSafe i z ładowaniem Qi2 oraz QiDla serii Apple Watch 4 i nowszych dla serii AirPods Składana ładowarka indukcyjna z MagSafe Składana, magnetyczna ładowarka bezprzewodowa z serii BoostCharge marki Belkin o mocy 15W, kompatybilna ze smartfonami Apple iPhone obsługującymi standard ładowania bezprzewodowego Qi z mocowaniem MagSafe oraz z serią smartwatchy Apple Watch i słuchawek AirPods. Wyposażona w nowoczesny moduł ładowania obsługujący standard Qi2, co oznacza, że ładowanie jest jeszcze bardziej zoptymalizowane i wydajniejsze. To smukły projekt o płaskiej konstrukcji, zachowujący minimalistyczny i stylowy wygląd. Dzięki ruchomemu modułowi ładowania smartfona w zakresie 0 do 90 oraz ruchomemu modułowi ładowania smartwatcha do pozycji Stand będziesz mieć wygodny wgląd na wyświetlacze obu tych urządzeń podczas ich ładowania, by nie przegapić żadnych powiadomień - wsparcie dla funkcji StandBy. W opakowaniu dołączono kabel USB-CUSB-C o długości 1,5m oraz zgodną ładowarkę sieciową 36W z portem USB-C PD Parametry wejściowe: 100240V 5060 Hz 0.7A Parametry wyjściowe (PDO): 5V3A15W, 9V3A27W, 12V3A36W, 15V2.4A36W Obudowa produktu (z wyłączeniem kabla i ładowarki zasilającej) została wykonana w co najmniej 75 z tworzywa sztucznego pochodzącego z recyklingu poużytkowego, a opakowanie produktu jest w 100 wolne od plastiku. Kolor producenta: Black (czarny) Ładowanie 3 urządzeń jednocześnie Ładowarka zapewnia bezpieczeństwo ładowanych urządzeń oraz komfort użytkowania. Posiada ona 3 moduły ładowania: główny przeznaczony dla smartfonów iPhone z MagSafe z QiQi2 15W max, na którym można też ładować słuchawki AirPods (AirPods 3.gen z obudową MagSafe lub AirPods Pro 2.gen) - z możliwością rozłożenia do pozycji Stand drugi 5W max do ładowania słuchawek na płasko oraz trzeci moduł 5W max przeznaczony dla smart zegarów Apple Watch - z możliwością rozłożenia do pozycji Stand Zatem pozwala ona ładować aż 3 urządzenia z ekosystemu Apple jednocześnie. Tym sposobem uzupełnisz zapas energii na kolejny dzień w swoich kluczowych urządzeniach mobilnych. Wystarczy przyłożyć iPhone z MagSafe w wyznaczonym miejscu aby zadokować telefon i rozpocząć ładowanie. Można to zrobić w dowolnej orientacji: pionowej lub poziomej. To też świetny sposób na kontynuowanie dostarczania energii dla telefonu bez przerywania rozpoczętych czynności - dzięki tej ładowarce kurczący się pasek stanu baterii w ważnych momentach nie będzie już problemem. Belkin zapewnia gwarancję bezpieczeństwa podłączonego sprzętu o wartości do 2,000. Jeśli Twój sprzęt zostanie uszkodzony z winy tego produktu podczas prawidłowego podłączenia i użytkowania, Belkin naprawi lub wymieni urządzenie na nowe. Kompatybilna z MagSafe Ładowarka Belkin jest kompatybilna ze smartfonami iPhone zgodnymi z MagSafe, dzięki czemu zachowuje ich pełną funkcjonalność i swobodę użytkowania. Pozwala to zapewnić optymalne ładowanie poprzez właściwe przyleganie w odpowiednim miejscu względem cewki Qi. Ruchomy moduł 0 - 90 w pionie Wspiera funkcjonalność StandBy. W module ładowania dla iPhone istnieje możliwość regulacji jego nachylenia pionie w zakresie 0 - 90 co oznacza, że możesz ładować telefon zarówno płasko jak i w nachyleniu co pozwala zachować wygodny wgląd na ekran smartfona podczas jego ładowania. Moduł ładowania Apple Watch również wyposażony jest w zawias, pozwalający ładować zegarek w trybie NightStand. Nowoczesny, składany design Wykonana z wysokiej jakości materiałów tworzy elegancką całość i jest przyjemna w dotyku. Małe rozmiary i nowoczesna budowa doskonale komponują się w każdym wnętrzu. Wymiary: 16 x 14,5 x 1,9 cm Waga: 373 g Całość wykonana została w dość kompaktowym i przemyślanym rozmiarze, świetnie prezentując się na nocnym stoliku czy biurku. Łatwo ją rozłożyć do wygodnych widoków Stand, oraz równie łatwo złożyć by wygodnie schować ją w bagażu. Apple Fast Charge 15W Qi2 Ładowarka jest dobrze zoptymalizowana, pozwala na wydajne ładowanie zgodnych urządzeń i wykorzystanie w pełni możliwości ładowarki automatycznie dostosowując odpowiednią moc ładowania. Wyposażona w technologię ładowania Apple Fast Charge Qi2 dla iPhone oraz szybkie ładowanie dla Apple Watch 7 i nowszych. Kompatybilna z pokrowcami MagSafe o grubości do 3mm Mocowanie MagSafe dla iPhone Moduł ładowania dla iPhone w standardzie Qi2 15W max Wsparcie funkcji StandBy Ładowanie 3 urządzeń jednocześnie Zalecana temperatura pracy: 0C do 40C przy wilgotności względnej od 10 do 90 (w pomieszczeniu) Zalecana temperatura przechowywania: -30C do 70C przy wilgotności względnej od 40 do 85 (w pomieszczeniu) Posiada certyfikat Made for Apple Watch co daje gwarancję kompatybilności z urządzeniami Apple W zestawie dołączono kompatybilny kabel USB-C i ładowarkę sieciową z USB-C PD o mocy 36W 5V3A15W, 9V3A27W, 12V3A36W, 15V2.4A36W. Bądź gotowy na każdy dzień Zapoznaj się z prezentacją producenta na temat oferowanego produktu i poznaj jego zalety i właściwości:','','ladowarka-indukcyjna-belkin-boost-foldable-3w1-qi2-15w-wiz029-dla-iphone-z-magsafe-apple-watch-airpods-czarna','','','','Ładowarka indukcyjna Belkin Boost Foldable 3w1 Qi2 15W WIZ029 dla iPhone z MagSafe / Apple Watch / AirPods, czarna','','','',''),(90611,1,1,'Folia prywatyzująca Spigen SafeView Privacy Filter 1-Pack Apple MacBook Air 13,6 M4 2025 (A3240)Apple MacBook Air 13,6 M3 2024 (A3113)Apple MacBook Air 13,6 M2 2022 (A2681) Zadbaj o swoją prywatność Znasz to uczucie, gdy chcesz popracować na swoim laptopie w miejscu publicznym, ale obawiasz się ciekawskich spojrzeń? Z folią prywatyzującą Spigen SafeView Privacy Filter możesz w pełni skupić się na swojej pracy, a dotychczasowe obawy puścić w zapomnienie. Ten wyjątkowy dodatek zapewni Ci spokój i bezpieczeństwo, niezależnie od tego, gdzie się znajdujesz. Filtr przyciemniający działa pod każdym kątem, a jakość wyświetlanego obrazu pozostaje na wysokim poziomie. Instalacja folii na urządzeniu jest banalnie prosta i nie wymaga klejenia. Posiada specjalne wycięcie, więc nie musisz się martwić o zaburzenie pracy czujników, czy kamerki internetowej. Czarna ramka dookoła folii świetnie komponuje się z samym urządzeniem. Kolor: Czarna ramka Wymiary: 29,98 x 19,83 cm Instrukcja aplikacji Dzięki innowacyjnemu systemowi montażu na bazie magnesów, folia Spigen SafeView jest niezwykle łatwa w instalacji. Po prostu przyłóż ją do ekranu swojego MacBooka, a filtr sam się zamocuje, nie pozostawiając żadnych śladów ani kleju na ekranie. Wszystko pod Twoją kontrolą Spigen SafeView Privacy Filter został wykonany z najwyższej jakości materiałów, co gwarantuje trwałość i długotrwałą ochronę Twojej prywatności. Folia ta posiada filtr prywatności, który ukazuje treść pojawiającą się na ekranie jedynie osobie patrzącej na wprost komputera. Dla osób patrzących pod kątem są one niewidoczne. Pozwala to na swobodne korzystanie z urządzenia w miejscach publicznych, chroniąc wyświetlane informacje przed osobami postronnymi. Nie musisz więc martwić się o ciekawskich obserwatorów - teraz to Ty masz kontrolę nad swoimi danymi. Idealne dopasowanie Folia jest idealnie dostosowana do ekranu MacBooka i posiada precyzyjne wycięcia wokół kamery internetowej, tak abyś nadal mógł korzystać z niej w pełni funkcjonalny sposób. Nie ma potrzeby martwić się o utratę funkcjonalności urządzenia. Ekologiczny design Firma Spigen wspiera zrównoważone podejście do projektowania swojego filtra, dbając jednocześnie o Twoją prywatność i naszą planetę. Dlatego folię SafeView można używać wielokrotnie, a proces regeneracji warstwy klejącej jest prosty - wystarczy przemyć ją wodą i dokładnie osuszyć przed ponownym zamontowaniem. To oznacza, że nie tylko możesz cieszyć się długotrwałą ochroną pr