yświetlacza.Wymiary szkłaSzkła z serii Ultra-Wide Fit są przyjazne dla większości etui, mimo to warto się najpierw upewnić, że produkty będą do siebie pasować. Aby to sprawdzić, należy pamiętać, że:wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowcaetui nie może nachodzić na szybkęWymiary szkła:24,47 x 17,25 cm(długość - szerokość )Mocna szybka z powłoką oleofobowąBoisz się, że po aplikacji szkło przejmie kontrolę nad Twoim urządzeniem, dotyk zacznie szwankować, a telefon zapomni, jak wyglądał Twój palec? Nic z tych rzeczy, Ultra-Wide Fit, oprócz ochrony o mocy złota, zachowuje pełną wrażliwość na dotyk, a dzięki powłoce oleofobowej, która zapobiega powstawaniu smug i pozostawianiu odcisków palców, dzięki czemu nie ma potrzeby wycierania ekranu co 10 minut. Co w środku?W zestawie SAFE by PanzerGlass Ultra-Wide Fit, oprócz 1 sztuki szkła hartowanego, znajduje się też mokra ściereczka, sucha ściereczka z mikrofibry i naklejka antykurzowa.Opakowanie jest certyfikowane FSC, czyli można je poddać recyklingowi! W przypadku jakichkolwiek problemów, na opakowaniu znajduje się kod QR przekierowujący do filmu objaśniającego cały montaż!','','szklo-hartowane-safe-by-panzerglass-ultra-wide-fit-do-ipad-pro-11-2025-2024','','','','Szkło hartowane SAFE by PanzerGlass Ultra-Wide Fit do iPad Pro 11\" 2025 / 2024','','','',''),(91088,1,1,'Ładowarka sieciowa Forcell F-Energy Mini GaN III 35W USB-C Power DeliveryUSB-A Quick Charge 4.0 Mini rozmiar, wielka moc ładowania 35W Ładowarka sieciowa Forcell F-Energy Mini GaN III to kompaktowy sprzymierzeniec codziennych wyzwań. Dzięki technologii Power Delivery oraz Quick Charge 4.0 zapewnia sprawne i stabilne ładowanie smartfonów i tabletów. Porty USB-C i USB-A pozwalają wygodnie zasilać dwa urządzenia równocześnie. Jej kompaktowe wymiary (7,5 cm x 3 cm) sprawiają, że bez problemu zmieści się w plecaku czy torebce. Bezpieczna praca i kompatybilność z nowoczesnymi protokołami ładowania to codzienna wygoda bez kompromisów. Kolor producenta: Biały (White) W zestawie znajduje się: Ładowarka sieciowa Forcell F-Energy Mini GaN III Instrukcja obsługi Ładowanie stabilne i bezpieczne Obsługa Quick Charge 4.0 pozwala na wyraźne przyspieszenie procesu ładowania w porównaniu do tradycyjnych ładowarek. Forcell Mini GaN III inteligentnie dostosowuje napięcie do potrzeb urządzenia. Dzięki temu ogranicza ryzyko przegrzania, a bateria ładuje się bardziej optymalnie. Porty USB-C i USB-A umożliwiają wygodne zasilanie dwóch sprzętów jednocześnie. Idealna opcja dla tych, którzy cenią płynność i bezpieczeństwo podczas codziennego użytkowania. Nowoczesna technologia w kompaktowej formie W ładowarce zastosowano III generację technologii GaN, która pozwala zmniejszyć urządzenie bez straty na jego wydajności. Mimo niewielkich rozmiarów, sprzęt skutecznie radzi sobie nawet z wymagającymi urządzeniami. Efektywne zarządzanie energią zmniejsza straty cieplne, co sprzyja dłuższej żywotności zarówno ładowarki, jak i ładowanego sprzętu. Wyższa sprawność oznacza mniej ciepła i większą stabilność działania. Jeśli liczy się dla Ciebie wydajność zamknięta w minimalistycznej obudowie to trafiony wybór. Co to jest GaN? To nowoczesny materiał azotek galu który zastępuje tradycyjny krzem w elektronice. Dzięki niemu ładowarki mogą być mniejsze, pracować wydajniej, generować mniej ciepła i zużywać mniej energii przy zachowaniu tej samej mocy. Uniwersalność i ochrona sprzętu Forcell Mini GaN III sprawdzi się zarówno do ładowania smartfonów, tabletów, jak i mniejszych akcesoriów elektronicznych. Certyfikaty CE i RoHS potwierdzają zgodność z europejskimi normami bezpieczeństwa. Wbudowane systemy ochronne zapobiegają przegrzaniu, przeciążeniu oraz nagłym skokom napięcia. Kompatybilność z szerokim zakresem napięcia wejściowego sprawia, że ładowarka jest gotowa na pracę na różnych kontynentach. Solidne wykonanie i wysoka sprawność to zapewnienie spokojnego użytkowania na co dzień i w podróży. Specyfikacja: Model: VT-35C Wejście: 100240V 5060Hz, 1.0A (maks.) Wyjście USB-C: 5V3A, 9V3A, 12V2.5A, 15V2.33A, 20V1.75A Wyjście USB-A: 5V3A, 9V2A, 12V1.5A Wyjście USB-C USB-A: 5V3A (współdzielone) Łączna moc wyjściowa: 35W (maks.)','','ladowarka-sieciowa-gan-usb-c-pd-usb-a-qc-40-35w-forcell-f-energy-mini-vt-35c-biala','','','','Ładowarka sieciowa GaN USB-C PD, USB-A QC 4.0, 35W, Forcell F-Energy Mini VT-35C, biała','','','',''),(91089,1,1,'Ładowarka sieciowa Forcell F-Energy Mini GaN III 30W USB-C Power DeliveryUSB-A Quick Charge 4.0 Mini rozmiar, wielka moc ładowania Ładowarka sieciowa Forcell F-Energy Mini GaN III to kompaktowy sprzymierzeniec codziennych wyzwań. Dzięki technologii Power Delivery oraz Quick Charge 4.0 zapewnia sprawne i stabilne ładowanie smartfonów i tabletów. Porty USB-C i USB-A pozwalają wygodnie zasilać dwa urządzenia równocześnie. Jej kompaktowe wymiary (7,5 cm x 3 cm) sprawiają, że bez problemu zmieści się w plecaku czy torebce. Bezpieczna praca i kompatybilność z nowoczesnymi protokołami ładowania to codzienna wygoda bez kompromisów. Kolor producenta: Biały (White) W zestawie znajduje się: Ładowarka sieciowa Forcell F-Energy Mini GaN III Instrukcja obsługi Ładowanie stabilne i bezpieczne Obsługa Quick Charge 4.0 pozwala na wyraźne przyspieszenie procesu ładowania w porównaniu do tradycyjnych ładowarek. Forcell Mini GaN III inteligentnie dostosowuje napięcie do potrzeb urządzenia. Dzięki temu ogranicza ryzyko przegrzania, a bateria ładuje się bardziej optymalnie. Porty USB-C i USB-A umożliwiają wygodne zasilanie dwóch sprzętów jednocześnie. Idealna opcja dla tych, którzy cenią płynność i bezpieczeństwo podczas codziennego użytkowania. Nowoczesna technologia w kompaktowej formie W ładowarce zastosowano III generację technologii GaN, która pozwala zmniejszyć urządzenie bez straty na jego wydajności. Mimo niewielkich rozmiarów, sprzęt skutecznie radzi sobie nawet z wymagającymi urządzeniami. Efektywne zarządzanie energią zmniejsza straty cieplne, co sprzyja dłuższej żywotności zarówno ł