or producenta: Czarny (Black) W zestawie znajduje się: Ładowarka samochodowa z wbudowanym transmiterem FM Instrukcja Ładowanie dwóch urządzeń naraz Baseus Enjoy wyposażono w dwa gniazda USB o łącznej mocy 3,4A, co umożliwia jednoczesne ładowanie dwóch urządzeń. Smartfony, tablety czy GPS szybko odzyskają energię w trasie. Dzięki zasilaniu z gniazda zapalniczki masz dostęp do energii bez przerywania jazdy. USB-A oferuje moc 5W, a USB-A 12W. Teraz bateria w Twoim urządzeniu nie stanie się problemem nawet podczas długiej podróży. Intuicyjna obsługa i duży wyświetlacz Transmiter Baseus Enjoy posiada wygodne przyciski funkcyjne, które umożliwiają szybką obsługę bez odrywania wzroku od drogi. Duży i czytelny wyświetlacz ułatwia zmianę ustawień jednym spojrzeniem. Kolorowe podświetlenie LED zapewnia widoczność nawet w nocy. Dzięki prostemu układowi przycisków, zmiana utworu lub regulacja głośności to kwestia jednego kliknięcia. Obsługa staje się naturalna jak zmiana biegów w samochodzie. Wszechstronność i kompaktowy rozmiar Baseus Enjoy bez trudu mieści się w każdym schowku samochodowym, a jego montaż w gnieździe zapalniczki jest błyskawiczny. Pasuje do wszystkich pojazdów z napięciem 12-24 V. Kompatybilny z każdym urządzeniem obsługującym Bluetooth. Szeroki zakres częstotliwości FM (87,5108,0 MHz) zapewnia łatwe znalezienie czystego sygnału. W każdej podróży masz do dyspozycji przenośne centrum rozrywki i ładowania w jednym. Specyfikacja: Liczba gniazd USB: 2 Napięcie wejściowe: 12-24 V Całkowita moc wyjściowa USB: 5 V3,4 A Znamionowa moc wyjściowa: 17 W (maks., 5 V3,4 A) USB1: 5 V1 A (5W) USB2: 5 V2,4 A (12W) Wejście Minijack 3.5mm Wejście na kartę MicroSD Obsługiwana wersja Bluetooth: 5.0 Częstotliwość FM: 87,5108,0 MHz','','transmiter-fm-bluetooth-ladowarka-samochodowa-baseus-enjoyer-17w-2x-usb-a-35mm-minijack-microsd-czarna','','','','Transmiter FM Bluetooth / Ładowarka samochodowa Baseus Enjoyer 17W,  2x USB-A / 3.5mm Minijack / MicroSD, czarna','','','',''),(91159,1,1,'Ładowarka samochodowa Tech-Protect CC01 Car Charger 45W 1x port USB-C 1x USB-A Kompaktowa, szybka, samochodowa! Tech-Protect CC01 to mała, ale wydajna ładowarka samochodowa, która została zaprojektowana z myślą o szybkim, bezpiecznym i niezawodnym ładowaniu Twoich urządzeń gdziekolwiek jesteś. Wykonana została z aluminium i PC. Wyposażona w dwa porty: 1x USB-A i 1x USB-C, wspiera technologie Power Delivery (PD) oraz Quick Charge 3.0, dzięki czemu Twój smartfon czy inne gadżety zyskają pełną moc podczas podróży. W zestawie: ładowarka samochodowa Tech-Protect (brak kabla w komplecie). Kolor producenta: Black (czarny) Bezpieczne ładowanie! To ładowarka, która dba o Twoje urządzenia na każdym etapie ładowania. Dzięki inteligentnemu systemowi zarządzania energią automatycznie dopasowuje napięcie do potrzeb podłączonego sprzętu, gwarantując bezpieczne i efektywne ładowanie. Mała, ale niezawodna! Jej małe wymiary sprawiają, że pasuje do każdego gniazda zapalniczki, a odporna na wysokie temperatury obudowa zapewnia długie użytkowanie nawet w trudnych warunkach. Idealna dla osób, które cenią ładowanie w podróży. Zawsze będzie pod ręką, gotowa do działania, gdy tylko tego potrzebujesz. Specyfikacja! Materiał: PC, aluminium Wejście: DC 12-24W Wyjście USB2-C (45W): 5V3A, 4.5V5A, 5V4.5A, 9V3A, 12V3A, 15V3A, 20V2.25A Wyjście: USB1-A (45W): 5V3A, 4.5V5A, 5V4.5A, 9V3A, 12V3A, 15V3A, 20V2.25A','','ladowarka-samochodowa-tech-protect-cc01-pd-45w-1x-usb-a-1x-usb-c-qc30-czarna','','','','Ładowarka samochodowa Tech-Protect CC01, PD 45W 1x USB-A,  1x USB-C, QC3.0, czarna','','','',''),(91168,1,1,'Młotek bezpieczeństwa Baseus Sharp Tool Safety Hammer Uniwersalny do samochodów szyb pasów Na ratunek - bezpieczeństwo w każdej sytuacji Młotek ratunkowy Baseus to niezastąpione urządzenie w krytycznych momentach. Pozwala błyskawicznie przeciąć pas bezpieczeństwa oraz rozbić szybę samochodową, gdy liczą się sekundy na przykład podczas pożaru auta lub wpadnięcia do wody. To kompaktowe akcesorium może uratować Twoje życie i życie Twoich bliskich, zapewniając szybką i skuteczną ewakuację z pojazdu. Wymiary: 9 x 2 cm Kolor producenta: Graphite (grafitowy) Solidne wykonanie gwarancją bezpieczeństwa Solidna stal wolframowa o twardości HRC 55 gwarantuje natychmiastowe rozbicie szyby. Ukryte, ostre ostrze umożliwia szybkie przecięcie nawet zablokowanych pasów bezpieczeństwa, jednocześnie chroniąc użytkownika przed przypadkowym skaleczeniem. Wbudowana sprężyna wzmacnia siłę uderzenia na tyle, że młotek obsłuży nawet dziecko, bez potrzeby użycia dużej siły. Stylowy i łatwy w przechowywaniu Dzięki niewielkim rozmiarom i dołączonemu uchwytowi, młotek Baseus można zamontować praktycznie w każdym miejscu w samochodzie na drzwiach, desce rozdzielczej czy pod siedzeniem. Matowy kolor i elegancki kształt sprawiają, że akcesorium świetnie komponuje się z wnętrzem każdego auta, zapewniając nie tylko bezpieczeństwo, ale i styl.','','mlotek-zbijak-ratunkowy-samochodowy-baseus-sharp-tool-safety-hammer-grafitowy','','','','Młotek / Zbijak ratunkowy samochodowy Baseus Sharp Tool Safety Hammer,  grafitowy','','','',''),(91260,1,1,'Belkin Connect Universal USB-C 8-in-1 Dual Display Core Hub USB-C do USB-A USB-C GB Ethernet HDMIuniwersalna dla laptopów i tabletów z USB-C MacBook Windows Chromebook iPads i wiele innych Podłączenie wielu urządzeń do laptopa Oryginalna stacja wieloportowa marki Belkin przeznaczona dla laptopów ze złączem USB-C z obsługą video. Hub umożliwia podpięcie do stanowiska roboczego aż do 2 monitorów w zależności od specyfikacji samego laptopa. Do tego dostępność i różnorodność portów oferuje wygodę podłączenia dowolnego urządzenia na USB-A lub USB-C czy Internetu. Zapewnia przepustowość do 10Gbs między podłączonymi urządzeniami peryferyjnymi a laptopem. Dodatkowym atutem tej stacji jest wyposażenie jej w port USB-C 3.2 PD pozwalający na dostarczanie mocy w przelocie max do 100W - minus 15W na zasilenie samej stacji. To świetne rozwiązanie do przesyłania vid