e przestronną główną na laptopa oraz mniejszą, idealną na niezbędne akcesoria, dokumenty czy drobiazgi, które chcesz mieć zawsze pod ręką. Całość dopełnia stylowe, metalowe zapięcie oraz logo Tech-Protect, które nadają mu nowoczesny, minimalistyczny charakter. Smukłość i lekkość! Zachwyca smukłą i lekką konstrukcją, która nie powiększa objętości Twojego laptopa. Dzięki temu etui z łatwością zmieścisz w plecaku, torbie czy aktówce, nie rezygnując z wygody i mobilności. Przyda się zarówno podczas codziennych obowiązków, jak i biznesowych podróży.','','uniwersalne-etui-na-laptopa-13-14-tech-protect-fluffy-ciemnozielone','','','','Uniwersalne etui na laptopa 13\"-14\", Tech-Protect Fluffy, ciemnozielone','','','',''),(93013,1,1,'Etui Tech-Protect Fluffy do laptopów o przekątnej 13 - 14o wymiarach mniejszych niż: 34,7 cm 25,5 cm (szer. x głęb.) Miękkie etui na laptop! Budzik dzwoni zbyt wcześnie, kawa w biegu. Plecak wypchany po brzegi dokumenty, książki, ładowarka, a między nimi Twój laptop. Każdego dnia wystawiany na próbę ścisk w autobusie, tłum w metrze, deszcz na przystanku i szybki marsz przez miasto. Ale tym razem jest inaczej, bo Twój sprzęt chroni etui Tech-Protect Fluffy. Dzięki miękkiej, pluszowej wyściółce oraz amortyzującej piance, Twoje urządzenie będzie bezpieczne od uderzeń, wstrząsów i zarysowań. Kolor producenta: Black (czarny) Wymiary wewnętrzne: 34,7 cm 25,5 cm 3,0 cm Wymiary zewnętrzne: 37,0 cm 27,3 cm 2,6 cm W zestawie: etui Zanim kupisz, zmierz swój laptop Rozmiar matrycy to tylko orientacyjna wskazówka laptopy o tej samej przekątnej mogą różnić się wymiarami zewnętrznymi. Aby mieć pewność, że etui będzie pasować, przed zakupem sprawdź wymiary wewnętrzne etui podane w opisie i porównaj je z wymiarami swojego urządzenia. X szerokość Y głębokość Pokrowiec z kieszeniami! Posiada dwie praktyczne kieszenie przestronną główną na laptopa oraz mniejszą, idealną na niezbędne akcesoria, dokumenty czy drobiazgi, które chcesz mieć zawsze pod ręką. Całość dopeł