-C (Thunderbolt 43) MacBook Windows Chromebook XPS i wiele innych Podłącz dodatkowe urządzenia i monitory do laptopa - z ładowaniem GaN Oryginalna stacja wieloportowa marki Belkin przeznaczona dla laptopów ze złączem USB-C z obsługą video. Jej główną zaletą jest duża liczba dostępnych portów, dzięki czemu jest to rewelacyjne rozwiązanie dla osób, chcących poszerzyć użyteczność swojego laptopa o dodatkowe akcesoria. Hub umożliwia podpięcie do stanowiska roboczego aż do 3 monitorów w zależności od specyfikacji samego laptopa. Do tego dostępność i różnorodność portów oferuje wygodę podłączenia dowolnego urządzenia na USB, Internetu, słuchawek z mikrofonem, kart SD czy MicroSD. Zapewnia przepustowość do 10Gbs między podłączonymi urządzeniami peryferyjnymi a laptopem. Dodatkowym atutem tej stacji jest możliwość ładowania laptopa w przelocie max do 96W - plus 50W na zasilenie podłączonych peryferii, za pośrednictwem wbudowanego zasilacza wykonanego w technologii GaN. To świetne rozwiązanie do przesyłania video do monitorów, projektorów, obsługi kart SD, czy też do zapewnienia sprawnego połączenia z siecią internetową. Dzięki niemu bez problemu zwiększysz komfort i wygodę swojej pracy, w łatwy sposób powiększając stanowisko robocze o dodatkowe komponenty. Hub posiada wbudowany zasilacz GaN o mocy 146W, aby zapewnić do 96W ładowania hosta w przelocie oraz 50W dla peryferiów podczas korzystania z pozostałych urządzeń podpiętych do huba. Rzeczywista wydajność może się różnić w zależności od specyfikacji i wymagań danego laptopa, do którego hub zostanie podłączony. Obudowa produktu (z wyłączeniem kabla) została wykonana w co najmniej 75 z tworzywa sztucznego pochodzącego z recyklingu poużytkowego, a opakowanie produktu jest w 100 wolne od plastiku. W opakowaniu: stacja Belkin INC020 z kablem połączeniowym USB-C o długości ok. 1m oraz kablem zasilającym 2m (EU i UK) instrukcja dokumentacja Kolor producenta: Space Grey (szary czarny) Technologia GaN Zastosowanie tranzystorów z azotku galu (GaN - gallium nitride) zamiast tradycyjnego krzemu zaowocowało jeszcze mniejszym wytwarzaniem ciepła, co pozwoliło na bliższe usytuowanie wewnętrznych komponentów względem siebie, a tym samym zachowanie kompaktowej budowy wewnętrznego zasilacza. Dzięki takiemu rozwiązaniu otrzymujesz znacznie mniejszą stację dokującą z dużą mocą, która wymagałaby standardowo większej obudowy. Stacja z powodzeniem przeszła szereg wewnętrznych testów, dzięki czemu może wyróżnić się 6-punktowym systemem zabezpieczeń, pod kątem ochrony przed: przepięciem, przetężeniem, przegrzaniem, przeciążeniami, zwarciem oraz pożarem. Duży wybór portów Multimedialna stacja Belkin INC020 pozwala na podłączenie większej ilości sprzętu użytkowego, jak również z powodzeniem nada się do udostępniania ekranu laptopa innym osobom. Przydatna w domu, w biurze, czy na spotkaniach prezentacyjnych, itp. Przejściówka może obsługiwać trzy wyświetlacze jednocześnie. Można ją podłączyć do wielu laptopów Mac, Windows czy Chromebook, wyposażonych w złącze USB-C (lub Thunderbolt 43). Dostępne porty: USB-A - 10Gbs (5V1.5A7.5W) USB-C 3.2 - 10Gbs (5V1.5A7.5W) USB-C 3.2 - 5Gbs (5V3A15W), (9V2.22A20W), (12V1.67A20W) Audio 3.5mm jack INOUT combo (TRSS) dla słuchawek z wbudowanym mikrofonem SD 3.0 - czytnik kart MicroSD 3.0 - czytnik kart USB-C PD3.0 96W - port wejścia do ładowania laptopa w przelocie USB-C DisplayPort (Alt Mode) - 10Gbs (5V3A15W), 8K30Hz, 4K120Hz HDMI 2.0 - 4K60Hz HDMI 2.0 - 4K60Hz Ethernet 1Gbs Port zasilania AC Belkin INC020 wyposażony jest we własny wbudowany zasilacz GaN o łącznej mocy 146W. 3 monitory jednocześnie Zwiększ możliwości swojego stanowiska o dodatkowe monitory. Stacja obsługuje nawet 3 wyświetlacze jednocześnie z maksymalnymi rozdzielczościami zależnymi od podpiętego laptopa hostującego (rzeczywiste wyjście wyświetlacza może się różnić w zależności od specyfikacji urządzenia hosta). UWAGA! Należy pamiętać, że: Liczba monitorów, której można użyć z laptopem zależy od mocy komputera i możliwości jego karty graficznej. Nie wszystkie komputery mają możliwości graficzne do obsługi wielu monitorów i mogą wystąpić problemy z wyświetlaniem podczas próby użycia wielu wyświetlaczy. Obsługiwane maksymalne rozdzielczości monitora zależą od liczby monitorów podłączonych i używanych w tym samym czasie oraz od mocy komputera. Maksymalna liczba wyświetlaczy obsługiwanych przez stację dokującą różni się od maksymalnej liczby wyświetlaczy obsługiwanych przez dany komputer. Chociaż stacja dokująca może obsługiwać rozdzielczości i częstotliwości odświeżania podane w specyfikacji, komputer może ich nie obsługiwać. Skontaktuj się z producentem swojego komputera, aby uzyskać informacje na temat możliwości obsługiwania wyświetlaczy. USB-C DP-Alt Port Windows* MacOS Chrome Singlemonitor 8K30Hz 4K120Hz 4K120Hz 4K60Hz Dualmonitor 4K60Hz 4K60Hz (mirrored) 4K60Hz Triplemonitor 4K60Hz4K30Hz4K30Hz 4K60Hz (mirrored) --- HDMI 1 Windows* MacOS Chrome Singlemonitor 4K60Hz 4K60Hz 4K60Hz Dualmonitor 4K60Hz 4K60Hz (mirrored) 4K60Hz Triplemonitor 4K30Hz4K60Hz4K30Hz 4K60Hz (mirrored) --- HDMI 2 Windows* MacOS Chrome Singlemonitor 4K60Hz 4K60Hz 4K60Hz Dualmonitor 4K60Hz 4K60Hz (mirrored) 4K60Hz Triplemonitor 4K30Hz4K30Hz4K60Hz 4K60Hz (mirrored) --- *Do obsługi maksymalnej rozdzielczości wymagane jest Źródło sygnału DP1.4. Rzeczywista wydajność wyjścia różni się w zależności od specyfikacji urządzenia hosta: Windows i Chrome obsługują MST (Multi-Stream Transport), oferując korzystanie z wielu monitorów (extended displays). Chrome obsługuje do dwóch monitorów w zależności od specyfikacji laptopa. macOS obsługuje SST (Single-Stream Transport), aby oferować tylko rozszerzone wyświetlacze w trybie lustrzanym (mirroring). Wygodnie i stylowo Niezależnie od tego, czy pracujesz, przesyłasz strumieniowo, czy grasz, będziesz cieszyć się prostą i solidną łącznością. Stacja charakteryzuje się minimalistyczną, lecz stylową budową o wysokiej jakości wykonania, która świetnie będzie się prezentować w każdej przestrzeni. Wymiary: 9,1 x 5,425 x 13,2 cm Waga: 885 g Wiele zalet w jednym urządzeniu Podłączaj, zasilaj, przesyłaj dane i wyświetlaj wideo w tym samym czasie za pomocą jednego połączenia kablowego dzięki stacji Belkin. 10 Gbs transferów danych Zgodność z Thunderbolt 3 i 4 Zgodność z USB-C Obsługa 3 monitorów jednocześnie Obsługa sieci Ethernet do 1Gbs Dzięki niej Twoje stanowisko robocze zyska większą funkcjonalność jak i lepszą wygodę w użytkowaniu. Zapoznaj się z poniższą prezentacją producenta o produkcie, i zobacz w jaki sposób i jak łatwo możesz wykorzystać urządzenie w swojej przestrzeni:','','stacja-hub-belkin-connect-usb-c-11-in-1-pro-gan-dock-150w-szara','','','','Stacja, hub Belkin Connect USB-C 11-in-1 Pro GaN Dock 150W, szara','','','',''),(93119,1,1,'Magnetyczny uchwyt samochodowy Allity ACH-300 z ładowaniem bezprzewodowym 15W do kratki nawiewu dla urządzeń i akcesoriów kompatybilnych z MagSafe Qi Rewolucja w podróży Uchwyt samochodowy i ładowarka indukcyjna 2 w 1, a do tego kompatybilność z MagSafe. Kompaktowa budowa, minimalistyczny design i parametry na miarę wymagającego użytkownika. Telefon masz zawsze w zasięgu wzroku, dobrze przylegający do magnetycznego uchwytu i z uzupełnioną baterią. Nowoczesny wygląd i doskonała jakość, to znak rozpoznawczy Allity. Dzięki temu uchwyt świetnie prezentuje się we wnętrzu każdego pojazdu, podkreślając jego nowoczesny styl. W zestawie: Uchwyt, kabel zasilający USB-A - USB-C o długości 0.7 m, instrukcja obsługi Kolor producenta: Black (czarny) Pobierz instrukcję obsługi Sprawdź kompatybilność przed zakupem! Nie wszystkie uchwyty samochodowe pasują do każdego typu kratki nawiewu. Przed złożeniem zamówienia upewnij się, że kratka w Twoim aucie jest zgodna z konstrukcją uchwytu. Na załączonym zdjęciu prezentujemy rodzaje nawiewów, które są obsługiwane. Zobacz produkt w akcji Bezpiecznie w trasie Łatwa obsługa jedną ręką i automatyczne uruchomienie ładowania indukcyjnego przekłada się na to, że uchwyt jest niemal bezobsługowy. Wystarczy przyłożyć smartfona do uchwytu, a on dobrze przylega i zaczyna się ładować. Szybka ładowarka indukcyjna samochodowa Allity do iPhone może błyskawicznie uzupełniać baterię dzięki mocy 15 W. Przy użyciu adapterów do magnesu (sprzedawane oddzielnie) uchwyt sprawdzi się też do ładowania innych telefonów z ładowaniem indukcyjnym w standardzie Qi. Zabezpieczenie przeciw przeładowaniu baterii, powoduje zakończenie ładowania po osiągnięciu 100 naładowania. Moc kompatybilności MagSafe Uchwyt został zaprojektowany tak, aby dobrze trzymał telefon, bez zaciskowych ramion. Jest to możliwe dzięki kompatybilności z MagSafe. Mocny magnes zastosowany w naszym uchwycie na telefon do auta sprawdza się nawet na bardziej wyboistych drogach. Ustawiony GPS pozostaje zawsze w zasięgu wzroku, a Ty masz pewność, że telefon jest na swoim miejscu. Łatwość montażu Łatwy montaż, z którym poradzi sobie każdy. Uchwyt wystarczy wsunąć w kratkę wentylacji i dokręcić mechanizm zaciskowy. Tyle wystarczy, aby zyskać stabilność mocowania. Pokrycie kluczowych elementów gumą chroni kokpit przed zarysowaniami. Uchwyt umieszczony jest na obrotowej głowicy, dzięki czemu dostosujesz ustawienie telefonu do swoich preferencji.','','uchwyt-samochodowy-do-kratki-nawiewu-allity-ach-300-z-ladowaniem-magsafe-qi-15w-czarny','','','','Uchwyt samochodowy do kratki nawiewu, Allity ACH-300 z ładowaniem MagSafe / Qi 15W, czarny','','','',''),(93534,1,1,'Etui Bizon Case Salpa 2 szt. folii na ekran Bizon Glass HydrogelOppo Find X8 ProPełna ochrona dla Oppo Find X8 ProMówi się, że szczęścia chodzą parami. A w przypadku Clear Pack tercetami.Zestaw ochronny od marki Bizon z serii Clear Pack ochroni Twojego smartfona i przyjmie na klatę (oraz plecy) codzienne przeciwności losu, takie jak niespodziewane zarysowania spowodowane przez walkę kluczy z telefonem w plecaku czy niezdarne zachlapania porannymi kropelkami kawy, kiedy jeszcze nie zdążyłeś się do końca obudzić.W skład zestawu wchodzą w pełni kompatybilne ze sobą produkty:1 sztuka etui Bizon Case Salpa2 sztuki folii ochronnej na wyświetlacz Bizon Glass Hydrogel FrontCzystość i wysoka odporność na uszkodzeniaNie chcesz zasłaniać oryginalnego wyglądu smartfona oraz jego koloru, który tak długo i namiętnie wybierałeś w sklepie?Bizon Case Salpa to przezroczysta, elastyczna obudowa z TPU, która dzięki wzmocnionym narożnikom i delikatnie wysuniętym nad ekran krawędziom stanowi doskonałą ochronę przed zarysowaniami i zabrudzeniami. Kropkowana struktura etui zapobiega efektowi mokrej plamy, czyli przyklejaniu się smartfona do obudowy.Kolor producenta: Clear (przezroczysty)Czułość dotyku ułatwiająca użytkowanieBoisz się, że po aplikacji folii, smartfon zacznie sam wysyłać nieprzyzwoite SMS-y do szefa, a Twój palec zostanie dodany do bazy osób nieupoważnionych do korzystania z telefonu?Tak jest tylko na filmach. A Bizon Glass Hydrogel Front, oprócz ultracienkiej grubości 0,15 mm, zachowuje pełną czułość dotyku! Za sprawą powłoki oleofobowej, która redukuje ilość pozostawianych smug i odcisków palców, nie będziesz musiał maniakalnie wycierać co chwilę ekranu, a dzięki wysokiej przejrzystości folii nie umknie Ci żaden szczegół na zdjęciu, nawet taki, którego być może nie chcesz widzieć...Wisienką na torcie jest magiczna powłoka Self-Heal, która sama naprawi drobne rysy czy powstałe po instalacji pęcherzyki powietrza.Z dbałością o środowiskoBizon Case Clear Pack, oprócz 1 sztuki etui i 2 sztuk folii hydrożelowej na wyświetlacz, zawiera również 1 mokrą ściereczkę, 1 suchą ściereczkę z mikrofibry, Dust Absorbera i 3 naklejki pozycjonujące.Bizon dba o łosie, jelenie, sarny, dziki, lisy, borsuki, kuny, jenoty, wilki, rysie, a z ptaków kuropatwy, bażanty, dzikie kaczki, gęsi, łyski, bekasy i cietrzewie, dlatego zestaw przybędzie do Ciebie w ekologicznym opakowaniu, w którym zastosowano jedynie śladowe ilości plastiku!Pakujemy w ekologiczne opakowania!','','elastyczne-etui-2x-folia-na-ekran-bizon-case-clear-pack-do-oppo-find-x8-pro','','','','Elastyczne etui + 2x folia na ekran Bizon Case Clear Pack do Oppo Find X8 Pro','','','',''),(93538,1,1,'Szkło hartowane Bizon Glass Edge 2 PackOppo Find X8 ProZestaw szkieł hartowanych dla Oppo Find X8 ProJeżeli do tej pory świat był dla Ciebie nieco zamglony, teraz nadszedł czas na krystaliczną przejrzystość!Zestaw ochronny od producenta Bizon z serii Edge 2 Pack stanie na straży wyświetlacza oraz obiektywu Twojego telefonu i zawalczy z codziennymi przeciwnościami losu, takimi jak niespodziewane zarysowania spowodowane przez walkę kluczy z telefonem w plecaku czy potencjalne pęknięcia od nieudanych rzutów telefonem na łóżko.W skład zestawu wchodzą:2 sztuki szkła hartowanego na wyświetlacz Bizon Glass Edge 21 sztuka nakładki na aparat Bizon Glass Lenszestaw aplikacyjny Wymiary szkłaPodstawowym akcesorium do ochrony urządzenia mobilnego oprócz szkła jest etui. Aby upewnić się, że szkło będzie zgodne z etui należy pamiętać, że:wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowcafuterał nie może nachodzić na szybkęWymiary szkła: 15,82 x 7,31 cm(długość szerokość)* Szkło pokrywa niemal całą część wyświetlacza wraz z ramkami i w zależności od zaokrągleń danego modelu telefonu bardziej lub mniej na nie nachodzi, dlatego może nie być kompatybilne ze wszystkimi pokrowcami. Przejrzystość bez smugBoisz się, że po aplikacji szkła, smartfon zacznie sam wysyłać nieprzyzwoite SMS-y do szefa, a Twój palec zostanie dodany do bazy osób nieupoważnionych do korzystania z telefonu?Tak jest tylko w bajkach. A Bizon Glass Edge 2, oprócz wytrzymałej konstrukcji i twardości na poziomie 9H, zachowuje pełną czułość dotyku! Za sprawą powłoki oleofobowej, która redukuje ilość pozostawianych smug i odcisków palców, nie będziesz musiał maniakalnie wycierać co chwilę ekranu, a dzięki wysokiej przejrzystości szkła nie umknie Ci żaden szczegół na zdjęciu, nawet taki, którego być może nie chcesz widzieć...Czym właściwie różni się ta wersja od poprzednika? Seria Edge 2 charakteryzuje się większą przejrzystością i gładszą powierzchnią szkła, a co za tym idzie jeszcze płynniejszym dotykiem. Łatwa i szybka aplikacjaAplikacja szkła nie sprawi Ci większych problemów, a głęboki wdech i pozytywne nastawienie sprawią, że proces będzie jeszcze prostszy.Postaraj się, aby Twoje stanowisko nie znajdowało się w ciemni oraz było wolne od kurzu i resztek jedzenia.Sprawdź, czy szkło na pewno pasuje do Twojego modelu telefonu.Za pomocą najpierw mokrej, a potem suchej ściereczki, oczyść powierzchnię wyświetlacza. Ewentualne pyłki usuń za pomocą Dust Absorbera lub naklejek pozycjonujących.Odklej warstwę ochronną ze szkła.Przyłóż szkło do ekranu i delikatnie dociśnij, aby rozprowadzić klej.Wypchnij pęcherzyki powietrza, przesuwając je ściereczką z mikrofibry w kierunku najbliższej krawędzi.Jeśli pod szkłem znalazła się drobinka kurzu, możesz podważyć szkło i pozbyć się jej za pomocą Dust Absorbera lub naklejek pozycjonujących.Nie wystrasz się! Po instalacji szkła wokół ekranu może pojawić się aureola powietrzna. Efekt nie jest spowodowany wadami fabrycznymi, a jedynie naturalnym procesem mogącym się pojawić w zależności od zakrzywień w danym modelu telefonu. Zdjęcie poglądowe, produkt może się różnić w zależności od modelu urządzeniaBez zarysowań bez problemu!Roztrzaskanym obiektywem można co najwyżej porobić eksperymentalne fotki przypominające widok z kalejdoskopu, a nawet mała ryska to gwarancja trwałej blizny na każdym zdjęciu. Jak zadbać o soczewki?Bizon Glass Lens cechuje się wytrzymałą konstrukcją oraz nie wpływa znacząco na jakość i jasność wykonywanych zdjęć! Za sprawą powłoki oleofobowej, która redukuje ilość pozostawianych smug i odcisków palców, nie będziesz musiał maniakalnie wycierać co chwilę soczewek, a dzięki mocnej warstwie klejącej, osłona będzie solidnie przylegać do urządzenia.Szkło pokrywa cały obiektyw wraz z soczewkami. Przed zakupem zwróć uwagę, czy posiadane etui pokrywa wyspę aparatu. Jeśli tak, szkło na aparat z serii Glass Lens może nie być kompatybilne z pokrowcem.Żeby nie było plastiku - ekologicznie opakowanieBizon Glass Edge 2 Pack, oprócz 2 sztuk szkła hartowanego na wyświetlacz i 1 sztuki nakładki na aparat, zawiera:4 mokre ściereczki2 suche ściereczki z mikrofibry2 Dust Absorbery (do wybierania drobin kurzu)6 naklejek pozycjonującychBizon dba o łosie, jelenie, sarny, dziki, lisy, borsuki, kuny, jenoty, wilki, rysie, a z ptaków kuropatwy, bażanty, dzikie kaczki, gęsi, łyski, bekasy i cietrzewie, dlatego zestaw przybędzie do Ciebie w ekologicznym opakowaniu, w którym zastosowano jedynie śladowe ilości plastiku!','','2x-szklo-szybka-na-aparat-bizon-edge-2-pack-do-oppo-find-x8-pro','','','','2x Szkło + szybka na aparat Bizon Edge 2 Pack do Oppo Find X8 Pro','','','',''),(93540,1,1,'Szkło hartowane Bizon Glass Edge 2 PackXiaomi POCO X7 ProZestaw szkieł hartowanych dla POCO X7 ProJeżeli do tej pory świat był dla Ciebie nieco zamglony, teraz nadszedł czas na krystaliczną przejrzystość!Zestaw ochronny od producenta Bizon z serii Edge 2 Pack stanie na straży wyświetlacza oraz obiektywu Twojego telefonu i zawalczy z codziennymi przeciwnościami losu, takimi jak niespodziewane zarysowania spowodowane przez walkę kluczy z telefonem w plecaku czy potencjalne pęknięcia od nieudanych rzutów telefonem na łóżko.W skład zestawu wchodzą:2 sztuki szkła hartowanego na wyświetlacz Bizon Glass Edge 21 sztuka nakładki na aparat Bizon Glass Lenszestaw aplikacyjny Wymiary szkłaPodstawowym akcesorium do ochrony urządzenia mobilnego oprócz szkła jest etui. Aby upewnić się, że szkło będzie zgodne z etui należy pamiętać, że:wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowcafuterał nie może nachodzić na szybkęWymiary szkła: 15,66 x 7,06 cm(długość szerokość)* Szkło pokrywa niemal całą część wyświetlacza wraz z ramkami i w zależności od zaokrągleń danego modelu telefonu bardziej lub mniej na nie nachodzi, dlatego może nie być kompatybilne ze wszystkimi pokrowcami. Przejrzystość bez smu