a i mniejszymi gabarytami ładowarki Quantum Boost - autorska technologia marki Spigen, która maksymalizuje wydajność ładowania. Umożliwia dostarczenie maksymalnej mocy ładowania w krótkim czasie, co jest szczególnie przydatne dla nowoczesnych urządzeń. Quantum Boost zapewnia szybsze ładowanie bez ryzyka przegrzania. Wspiera technologie szybkiego ładowania PD3.0, PPS, QC3.0, AFC, FCP, SCP Pozwala na ładowanie do 3 urządzeń jednocześnie Parametry wyjściowe najmocniejszego portu: USB-C PD3.0: 67W Max Rozkład mocy na poszczególne porty Rozkład mocy podczas używania portów w różnych konfiguracjach: Wariant 1: Tylko USB-C(1): 67W Tylko USB-C(2): 67W Tylko USB-A: 22,5W Wariant 2: USB-C(1) USB-A: 45W 18W USB-C(1) USB-C(2): 45W 20W USB-C(2) USB-A: 18W do automatycznego podziału pomiędzy oba porty Wariant 3: USB-C(1) USB-C(2) USB-A: 45W dla C1 18W do automatycznego podziału pomiędzy porty C2 i A Intelligent Safety - bezpieczna i funkcjonalna Ładowarka automatycznie identyfikuje urządzenie obsługujące standard szybkiego ładowania. Dzięki m. in. Intelligent Safety czy Overheat Protection posiada szereg zabezpieczeń na wielu poziomach, w tym przeciw przepięciu, przegrzaniu, zwarciu, czy przeładowaniu. Inteligentny chip automatycznie identyfikuje podłączone urządzenie dostosowując maksymalną możliwą moc ładowania, zapewniając tym samym optymalny przesył prądu z zachowaniem bezpieczeństwa ładowanego urządzenia. Kompaktowy rozmiar Ładowarka sieciowa Spigen to minimalistyczny i jednocześnie nowoczesny design. Kompaktowe rozmiary stanowią zdecydowaną zaletę w podróży. Bez problemu zmieścisz ją na listwie zasilającej między innymi wtyczkami, a także wygodnie spakujesz ją do torby czy plecaka. Wymiary kostki (bez wtyczki): 32 x 37,1 x 58,5 mm Waga: 140g Świetnie nada się do ładowania różnych mobilnych urządzeń, takich jak np. smartfony, słuchawki, smartwatche, tablety, laptopy, itp. Technologia GaN Zastosowanie tranzystorów z azotku galu (GaN - gallium nitride) zamiast tradycyjnego krz