ę, lecz również wyższą efektywność energetyczną. Dzięki niższej emisji ciepła zyskujesz pewność, że Twoje urządzenia są bezpieczne, nawet podczas długiego ładowania. Zaawansowana technologia sprawia, że ładowanie przebiega szybciej, co oznacza realne oszczędności czasu idealne dla zabieganych osób. Dzięki wsparciu dla Quick Charge 3.0 oraz Power Delivery możesz ładować nowoczesne smartfony, tablety i laptopy, mając pewność, że otrzymują optymalną moc. Zainwestuj w ładowarkę, która zawsze dostosuje się do Twoich potrzeb i zapewni maksymalne bezpieczeństwo Twojej elektroniki. Ładowanie bez kompromisów dwa urządzenia jednocześnie Podwójny port USB-C oraz USB-A pozwala łatwo i szybko ładować dwa urządzenia w tym samym czasie, eliminując potrzebę korzystania z dodatkowych akcesoriów i wydłużając komfort użytkowania. Dzięki maksymalnej mocy 33 W możesz w pełni korzystać z szybkiego ładowania nawet wtedy, gdy zasilasz dwa urządzenia jednocześnie. To wygoda, która ułatwia codzienność bez kolejek do gniazdka czy rozładowanego telefonu. Pełna uniwersalność ładowarki sprawia, że sprawdzi się zarówno w domu, w pracy, jak i podczas podróży. To Ty decydujesz, co ładujesz i kiedy, nie rezygnując z wygody. Bezpieczne ładowanie to pewność, że Twoje urządzenia otrzymują dokładnie tyle energii, ile potrzebują. Wytrzymały, silikonowy kabel trwałość i swoboda W zestawie znajdziesz elastyczny kabel silikonowy USB-C o długości 100 cm, umożliwiający wygodne ładowanie bez ograniczeń. Przewód jest odporny na skręcanie oraz uszkodzenia mechaniczne, co czyni go niezawodnym towarzyszem zarówno w domu, jak i w podróży. Obsługa ładowania do 60 W gwarantuje szybkie i stabilne uzupełnianie energii nie tylko smartfona, ale także tabletu czy laptopa. Wysoka trwałość materiału zapewni Ci spokój na długo nie musisz martwić się codziennym użytkowaniem. To detal, który zwiększa komfort i wydłuża żywotność Twoich urządzeń każdego dnia. Specyfikacja techniczna: Wejście: 100-240V, 0.8A maks., 50-60Hz Wyjście USB-C: 5V3A, 9V3A, 12V2.5A, 15V2A, 20V1.5A PPS: 3.3-11V3A, 3.3-16V2A (maks. 33W) Wyjście USB-A: 5V3A, 9V3A, 12V2.5A, 20V1.5A (maks. 30W) Wyjście USB-C USB-A: 5V4A (20W)','','ladowarka-sieciowa-gan3-usb-c-pd-usb-a-qc-40-33w-forcell-wall-charger-kabel-usb-c-jasnozielona','','','','Ładowarka sieciowa GaN3 USB-C PD, USB-A QC 4.0, 33W, Forcell Wall Charger, kabel USB-C, jasnozielona','','','',''),(94031,1,1,'Ładowarka sieciowa Forcell F-Energy Wall Charger GaN3 33W USB-C 33W Power DelievryUSB-A 30W Quick Charge 4.0 Kompaktowa moc i bezpieczeństwo ładowania Ładowarka sieciowa Forcell F-Energy Wall Charger GaN3 33W to doskonały wybór dla wymagających użytkowników ceniących wygodę i szybkość działania. Dzięki dwóm portom USB-A oraz USB-C zyskujesz swobodę ładowania praktycznie każdego urządzenia, kiedy i gdzie tego potrzebujesz. Kompaktowy rozmiar sprawia, że ładowarka bez trudu zmieści się w torbie lub kieszeni, oszczędzając miejsce i zwiększając mobilność. Inteligentne systemy zabezpieczeń chronią Twój sprzęt przed przegrzaniem, przepięciami oraz przepięciami, dzięki czemu możesz ładować nawet podczas nocnych podróży czy w biurze bez obaw. To nowoczesne rozwiązanie, które pozwala ładować dwa urządzenia jednocześnie, pozwalając oszczędzić Twój czas. Kolor producenta: Blue (niebieski) W opakowaniu znajduje się: 1x Ładowarka sieciowa Forcell F-Energy Wall Charger GaN3 33W 1x Kabel USB-C 100 cm, 60W Instrukcja Zaawansowana technologia GaN3 oszczędność i wydajność Ładowarka opiera się na trzeciej generacji technologii GaN3, która zapewnia nie tylko mniejsze rozmiary i bardziej elegancką formę, lecz również wyższą efektywność energetyczną. Dzięki niższej emisji ciepła zyskujesz pewność, że Twoje urządzenia są bezpieczne, nawet podczas długiego ładowania. Zaawansowana technologia sprawia, że ładowanie przebiega szybciej, co oznacza realne oszczędności czasu idealne dla zabieganych osób. Dzięki wsparciu dla Quick Charge 3.0 oraz Power Delivery możesz ładować nowoczesne smartfon