 komfortowego ładowania podczas podróży. Kontrola i ochrona podczas ładowania Pełna ochrona i stały monitoring parametrów Wyświetlacz na obudowie ładowarki informuje na bieżąco o natężeniu prądu, co pozwala na szybką reakcję w razie jakichkolwiek nieprawidłowości. Sześć poziomów zabezpieczeń dba o Twoje urządzenia przed przegrzewaniem, przepięciem, zwarciem i przeciążeniem, gwarantując spokojną głowę podczas jazdy. Solidne wykonanie z ogniotrwałych materiałów zabezpiecza nie tylko elektronikę, ale i wnętrze Twojego auta. Antypoślizgowe wypustki zapewniają idealny chwyt nawet na wyboistej drodze nie grozi Ci wypadnięcie z gniazdka. Bezpieczne, niezawodne ładowanie w każdym miejscu i w każdych warunkach to nowy standard produktów Baseus. Specyfikacja: Materiał: PC, ABS Prąd wejściowy: DC 12V-24V Prąd wyjściowy: USB-C PD: 5V 3A, 9V 3A, 12V 3A, 15V 3A, 20V 2.25A (maks. 45W) USB-A QC: 4.5V 5A, 5V 4.5A, 9V 3A, 12V 3A, 20V 2.25A (maks. 45W) USB-C PD USB-A QC: 5V 5A (współdzielone 25W) Wspierane technologie: Power Delivery 3.0 (PD), Quck Charge 4 (QC, ze wsteczną kompatybilnością), PPS, SCP, FCP, PE Wymiary: 6,5 x 3 x 3 cm Wbudowany wyświetlacz pokazujący natężenie na żywo','','ladowarka-samochodowa-baseus-magic-series-45w-usb-c-usb-a-pd-30-qc-40-pps-rozowo-niebieska','','','','Ładowarka samochodowa Baseus  Magic Series 45W USB-C, USB-A, PD 3.0, QC 4.0, PPS, różowo-niebieska','','','',''),(94374,1,1,'Etui Tech-Protect Defender do laptopów o przekątnej 13 - 14o wymiarach mniejszych niż: 32 x 24 cm (szer. x głęb.) Zabezpiecz swój laptop! Poranek w biegu pakujesz laptopa, chwytasz klucze i wychodzisz z domu. Na ulicy tłok, w metrze ciasno, a w torbie obok książek i dokumentów Twój laptop narażony na każdy wstrząs i przypadkowe uderzenie. Ale nie tym razem! Dzięki trójwarstwowej konstrukcji wytrzymałej powłoce z poliestru, amortyzującej piance i miękkiej wyściółce z mikrofibry Twój laptop 13-14 będzie doskonale zabezpieczony przed wstrząsami, zarysowaniami i codziennym zużyciem. Teraz z Tech-Protect Defender Twój sprzęt zawsze pozostanie w idealnym stanie! Kolor producenta: Navy Blue (granatowy) Wymiary wewnętrzne: 32 24 3 cm Wymiary zewnętrzne: 34,5 25,5 3 cm Zanim kupisz, zmierz swój laptop Rozmiar matrycy to tylko orientacyjna wskazówka laptopy o tej samej przekątnej mogą różnić się wymiarami zewnętrznymi. Aby mieć pewność, że etui będzie pasować, przed zakupem sprawdź wymiary wewnętrzne etui podane w opisie i porównaj je z wymiarami swojego urządzenia. X szerokość Y głębokość Wszystko pod ręką! Solidny zamek błyskawiczny umieszczony na górze etui zapewnia szybki i łatwy dostęp do laptopa bez zbędnego szarpania czy zacinania. A co z dodatkowymi akcesoriami? Przestronna przednia kieszeń pomieści wszystko, czego potrzebujesz na co dzień mysz, słuchawki, ładowarkę czy nawet notatnik. Koniec z szukaniem drobiazgów w plecaku! Bez zbędnego ciężaru! Jego smukła, lekka konstrukcja sprawia, że nie dodaje zbędnej wagi i nie zajmuje zbyt dużo miejsca w torbie czy plecaku. Teraz możesz zabrać swoje urządzenie wszędzie do pracy, na uczelnię, czy w podróż bez obciążania swojego bagażu.','','uniwersalne-etui-na-laptopa-13-14-tech-protect-defender-granatowe','','','','Uniwersalne etui na laptopa 13\"-14\" Tech-Protect Defender, granatowe','','','',''),(94389,1,1,'Etui Tech-Protect Defender do laptopów o przekątnej 15 - 16o wymiarach mniejszych niż: 37 x 26 cm (szer. x głęb.) Zabezpiecz swój laptop! Poranek w biegu pakujesz laptopa, chwytasz klucze i wychodzisz z domu. Na ulicy tłok, w metrze ciasno, a w torbie obok książek i dokumentów Twój laptop narażony na każdy wstrząs i przypadkowe uderzenie. Ale nie tym razem! Dzięki trójwarstwowej konstrukcji wytrzymałej powłoce z poliestru, amortyzującej piance i miękkiej wyściółce z mikrofibry Twój laptop będzie doskonale zabezpieczony przed wstrząsami, zarysowaniami i codziennym zużyciem. Teraz z Tech-Protect Defender Twój sprzęt zawsze pozostanie w idealnym stanie! Kolor producenta: Navy Blue (granatowy) Wy