W, a USB-A QC 3.0 oferuje szybkie ładowanie z mocą 18W. To oznacza, że Twój smartfon lub tablet będzie gotowy do działania, zanim zdążysz dojechać na miejsce.Pełna kontrola nad zasilaniemBezpieczeństwo i wygoda idą tu w parze. Każde gniazdo zapalniczki ma własny wyłącznik, dzięki czemu możesz decydować, które urządzenia mają być aktywne. Dodatkowo główny wyłącznik pozwala odciąć zasilanie całkowicie jednym kliknięciem.Wyświetlacz LED z woltomierzemDzięki wbudowanemu woltomierzowi na wyświetlaczu LED zawsze wiesz, jaki jest stan napięcia w Twoim akumulatorze. Unikaj rozładowania i niespodzianek w trasie monitoruj stan instalacji elektrycznej.Bezpieczeństwo i wygodaBezpieczeństwo Twoich urządzeń to priorytet. Wymienny bezpiecznik 15A z łatwym dostępem zapobiega przeciążeniom. A jeśli zdarzy się awaria zapasowy bezpiecznik w zestawie gwarantuje ciągłość działania.A jeśli nie lubisz, gdy urządzenia przesuwają się po kokpicie, to w zestawie znajdziesz rzep montażowy, dzięki któremu bez problemu umieścisz rozgałęźnik tam, gdzie chcesz. Kabel o długości 1 metra daje elastyczność montażu nawet dla pasażerów tylnej kanapy.Specyfikacja techniczna Napięcie wejściowe: DC 12V 24VPrąd wejściowy: 3 - 6APrąd wyjściowy: 10AMoc wyjściowa: 120W12V, 240W24VTyp złącz: 3x USB-A, 1x USB-C, 3x gniazdo zapalniczkiTechnologie szybkiego ładowania: Power Delivery, PPS i Quick Charge 3.0Możliwość ładowania aż 7 urządzeń jednocześnieKompatybilność: z większością smartfonów, tabletów i innych urządzeń zasilanych poprzez porty USB i gniazdo zapalniczki samochodowejNapięcie wyjściowe: USB-C1: 5V3A, 9V3A, 12V2.5A PPS: 3.3 - 11V 3A (PD 30W)USB-A1: 5V3A, 9V2A, 12V1.5A (QC 18W)USB-C1 USB-A1: 5V3.4AUSB-A2 USB-A3: 5V3.4AGniazda zapalniczki: 80W przy 12V, 200W przy 24VDługość przewodu: 1 mDodatkowe informacje: Wyświetlacz LED z woltomierzem, Osobne wyłączniki i wyłącznik główny, Wymienny bezpiecznik Pobierz instrukcję obsługi','','ladowarka-samochodowa-z-rozgaleznikiem-3mk-car-power-splitter-120w-1x-usb-c-pd-3x-usb-a-3x-gniazdo-12-24v-czarna','','','','Ładowarka samochodowa z rozgałęźnikiem 3mk Car Power Splitter 120W, 1x USB-C PD / 3x USB-A / 3x gniazdo 12-24V, czarna','','','',''),(94838,1,1,'Poduszka lędzwiowa samochodowa Baseus ComfortRide Series Car Lumbar Pillow Uniwersalna Komfort i nowoczesna technologia Poduszka samochodowa Baseus ComfortRide zapewnia wyjątkowy poziom wygody dzięki innowacyjnej piance memory foam, która dopasowuje się do naturalnych krzywizn kręgosłupa. Każdy dłuższy odcinek drogi staje się mniej męczący, ponieważ poduszka równomiernie rozkłada nacisk i redukuje uczucie napięcia. Wbudowana technologia chłodzenia gwarantuje przyjemne uczucie świeżości nawet podczas upalnych dni, chroniąc przed przegrzaniem. Lekka konstrukcja i kompaktowe wymiary dopasowują się do potrzeb oraz ułatwia przenoszenie między pojazdami. Eleganckie wykończenie doskonale komponuje się z wnętrzem w domu jak i samochodzie. Poduszka lędźwiowa sprawdzi się również w biurze lub w domu np. podczas pracy przy komputerze, idealnie dopasuje się do Twoich pleców, dbając o prawidłową postawę. Kolor producenta: Szary (Grey) Innowacyjna pianka i technologia chłodzenia Poduszka została wykonana z pianki memory foam, która reaguje na temperaturę ciała, dzięki czemu idealnie dopasowuje sie do kształtu postawy. W jej wnętrzu znajduje się warstwa żelu chłodzącego, utrzymującego optymalną temperaturę nawet w ekstremalnie wysokich upałach. Zakres pracy pianki od -10C do 60C sprawia, że produkt zachowuje swoje właściwości termiczne w różnych warunkach klimatycznych. Optymalne wymiary 395 x 263 x 115 mm pozwalają na łatwe dopasowanie do większości foteli samochodowych jak i fotela czy krzesła podczas pracy przy komputerze. Waga około 780g gwarantuje stabilność. Trwały materiał Sharkskin Zewnętrzna powłoka z materiału Sharkskin wyróżnia się dużą odpornością na przetarcia i rozdarcia, co przekłada się na długotrwałe użytkowanie. Gładka struktura tkaniny ułatwia utrzymanie czystości wystarczy przetrzeć powierzchnię wilgotną szmatką, aby usunąć zabrudzenia. Dodatkowa warstwa ochronna zabezpiecza piankę przed wnikaniem wilgoci, co zapobiega powstawaniu nieprzyjemnych zapachów. Kolor materiału jest odporny na blaknięcie i zachowuje intensywny odcień nawet po długim czasie użytkowania. To połączenie stylu i funkcjonalności, które zwiększa komfort podróży i pracy. Ergonomiczne wsparcie dla wszystkich Dzięki ergonomicznemu kształtowi poduszka precyzyjnie dopasowuje się do postawy i odciąża kręgosłup, co zmniejsza zmęczenie nawet podczas wielogodzinnej jazdy lub pracy przy komputerze. Specjalne wyprofilowanie bocznych części zapewnia stabilne dopasowanie, co minimalizuje ryzyko urazów przy gwałtownych manewrach lub nierównościach drogi. Produkt sprawdza się doskonale zarówno dla kierowców i pasażerów, oferując uniwersalne rozwiązanie dla całej rodziny jak i osób spędzających długi czas przy pracy przy komputerze.','','poduszka-ledzwiowa-do-samochodu-biura-baseus-comfortride-szara','','','','Poduszka lędzwiowa do samochodu/biura Baseus ComfortRide, szara','','','',''),(94844,1,1,'Ładowarka samochodowa z przedłużaczem 3mk Double Car Charger 135W do pojazdów z gniazdem zapalniczki 12V 24V2x USB-A QC 3.0 4x USB-C PD Maksimum mocy, pełna kontrola Zadbaj o energię dla całej załogi niezależnie od tego, czy jedziesz sam, z rodziną czy współpracownikami. 3mk Double Car Charger 135W to samochodowa ładowarka z przedłużaczem, która zasila do 6 urządzeń jednocześnie zarówno z przodu, jak i z tyłu auta. Z taką mocą każda podróż staje się bardziej komfortowa, a każde urządzenie zawsze gotowe do działania. Obie części ładowarki przednia i tylna posiadają po trzy porty ładowania: 2x USB-C z technologią Power Delivery (PD) Przednie siedzenia mają do dyspozycji moc 65W i 20W, natomiast tylne 30W i 20W. 1x USB-A z obsługą Quick Charge 3.0 (QC 3.0) i maksymalną mocą 18W idealny dla urządzeń starszego typu. Ładowarka dostarcza łączną moc do 135W, zapewniając szybkie i stabilne ładowanie nawet dla najbardziej wymagających urządzeń elektronicznych. W zestawie: 3mk Double Car Charger, instrukcja obsługi Kolor producenta: Black (czarny) Samochodowa ładowarka z podwójną mocą To nie jest zwykła ładowarka. Double Car Charger 135W to zaawansowany system ładowania z dwoma niezależnymi modułami jeden dla kierowcy i pasażera z przodu, drugi dla pasażerów z tyłu (na kablu o długości 1,5 m z klipsem mocującym). 6 portów ładowania (4x USB-C 2x USB-A) rozmieszczonych w pojeździe eliminuje konflikt o dostęp do gniazda każdy pasażer ma swoje zasilanie pod ręką. Ekstremalna szybkość ładowania od smartfona po laptopa Masz laptopa, który wymaga dużo mocy? Żaden problem. Jeden z portów USB-C PD (dla osób z przodu samochodu) zapewnia moc do 65W (wymagany kabel 5A nie dołączony do zestawu). Do tego: Porty USB-C o mocy 20W i 30W PD idealne dla smartfonów i tabletów. Porty USB-A z technologią Quick Charge 3.0 18W szybkie ładowanie starszych urządzeń. Efekt? Sześć urządzeń może być ładowanych jednocześnie, bez utraty szybkości czy stabilności. Idealna ładowarka do podróży Bez względu na to, czy jedziesz na spotkanie służbowe, w rodzinną podróż czy długą trasę ciężarówką ładowarka 3mk działa zarówno w samochodach osobowych (12V), jak i ciężarowych (24V). Dzięki niej: dzieci na tylnym siedzeniu mogą ładować tablety i konsole, pasażerowie z przodu podładują swoje telefony, Ty możesz zasilić laptopa i telefon jednocześnie. Ładowarka, którą znajdziesz nawet w nocy Wbudowane subtelne podświetlenie LED pozwala bez problemu zlokalizować porty nawet po zmroku. Moduł na tył auta wyposażony jest w praktyczny klips, który umożliwia stabilne przymocowanie do kieszeni fotela koniec z plączącymi się kablami. Specyfikacja techniczna Napięcie wejściowe: DC 12V 24V Prąd wyjściowy: do 10A Moc wyjściowa: 135W Typ złącz: 2x USB-A, 4x USB-C Technologie szybkiego ładowania: Power Delivery, PPS i Quick Charge 3.0 Możliwość ładowania aż 6 urządzeń jednocześnie Kompatybilność: z większością 