 regulowanemu nachyleniu o 35 zwiększającemu komfort nawet podczas wielogodzinnego pisania. Tryby magnetyczny i odłączany zapewniają elastyczność dopasowania do różnych scenariuszy, od wygodnego pisania przy biurku po pracę na kolanach w podróży. Inteligentne rozwiązania minimalizują bałagan i pozwalają skupić się wyłącznie na zadaniach. Dzięki temu urządzenie sprawdza się zarówno w domu, w biurze, jak i na pokładzie samolotu. Cicha klawiatura, precyzyjne pisanie Ciche klawisze z mechanizmem nożycowym zapewniają sprężyste i precyzyjne naciśnięcia, co przekłada się na szybsze pisanie bez zbędnego hałasu. Podświetlenie w 7 kolorach z trzema poziomami jasności pozwala dostosować atmosferę pracy do własnych upodobań, niezależnie od warunków oświetleniowych. Wbudowany moduł Bluetooth 5.0 dba o natychmiastowe parowanie i stabilne połączenie bez opóźnień. To wszystko sprawia, że każda wiadomość, notatka czy tekst wychodzą perfekcyjnie za pierwszym razem. Energia, efektywność i akcesoria zawsze pod ręką Wbudowany slot na rysik umożliwia ładowanie i przechowywanie pióra, dzięki czemu nigdy nie zgubisz niezbędnego akcesorium. Duży touchpad zapewnia precyzyjną kontrolę kursora i sprawia, że nawigacja po ekranie staje się intuicyjna. Potężna bateria z szybkim ładowaniem USB-C pozwala na 6 godzin pracy z włączonym podświetleniem oraz ponad 120 godzin w trybie oszczędzania energii. CK Pro Series stanowi wsparcie dla kreatywności, niezawodności i efektywności w eleganckim etui klawiaturowym. Specyfikacja: Sposób łączności: Bluetooth 5.0 Pojemność baterii: 700mAh Czas pracy: 120 godzin bez włączonego podświetlenia, do 6 godzin pracy z włączonym podświetleniem Podświetlenie: 7 kolorów, 3 poziomy jasności','','klawiatura-magnetyczna-bluetooth-dux-ducis-ck-series-do-microsoft-surface-pro-11-10-9-8-x-czarna-z-jasnoniebieskimi-klawiszami','','','','Klawiatura magnetyczna Bluetooth Dux Ducis (CK Series) do Microsoft Surface Pro 11 / 10 / 9 / 8 / X, czarna z jasnoniebieskimi k','','','','