r, Stabilność, Wygoda Kieszeń wspiera dyski o pojemności do 2 TB, a dzięki interfejsowi USB-C 3.2 Gen 2 oferuje prędkość transmisji aż do 10 Gbps. Idealna do backupu danych, rozszerzenia pamięci komputera czy jako przenośna biblioteka multimediów. W zestawie znajdziesz kabel USB Typ C, który gwarantuje nie tylko szybkość, ale także stabilność transmisji. Prosta instalacja bez narzędzi Odkryj, jak prosta może być instalacja. Dzięki kieszeni Ugreen nie potrzebujesz żadnych narzędzi. Instalacja dysku w kieszeni Ugreen jest bajecznie prosta: Naciśnij przycisk, aby otworzyć kieszeń Wysuń kieszeń i umieść w niej dysk SSD M.2 Zablokuj dysk przez włożenie klipsa zabezpieczającego Zamknij kieszeń Kieszeń Ugreen to nie tylko funkcjonalność, ale także styl. Wykonana z solidnego aluminium, przyjemnie leży w dłoni i skutecznie odprowadza ciepło. Dioda LED wbudowana w obudowę daje znać, kiedy dysk pracuje. Dzięki tej kieszeni, ochrona i wydajność Twojego dysku idą w parze z elegancją i komfortem. Port: USB 3.2 - Tranfer do 10GpbsInterfejs dysku: NVMEPCIE, NGFFSATA (MB, M)Rozmiar dysku: 2230, 2242, 2260, 2280Prędkość przesyłania danych: do 10GbpsPojemność: do 2TBW zestawie: kabel USB-C - USB-C oraz kabel USB-A - USB-C o długości 0,5 mMateriał: aluminiumWymiary: 119 x 37 x 12 mm','','kieszen-na-dysk-ugreen-obudowa-dysku-twardego-cm400-90264-na-dysk-ssd-m2-z-portem-usb-c-32-szara','','','','Kieszeń na dysk Ugreen / obudowa dysku twardego CM400 90264 na dysk SSD M.2 z portem USB-C 3.2, szara','','','',''),(99032,1,1,'Stacja dokująca Satechi Thunderbolt 4 Slim Hub Pro dla urządzeń ze złączem Thunderbolt 4 3, USB4 lub USB 3.2 Gen2 (z obsługą DP Alt Mode) oraz systemem Windows 8 lub nowszym macOS 11 lub nowszym iOSiPadOS 10.2 lub nowszym ChromeOS Pełna moc w kompaktowym wydaniu Potrzebujesz czegoś więcej niż zwykłego huba USB-C? Satechi Thunderbolt 4 Slim Hub Pro to profesjonalne centrum dowodzenia stworzone z myślą o tych, którzy nie godzą się na kompromisy. Superszybkie przesyłanie danych, obsługa wymagających ekranów i błyskawiczne ładowanie to wszystko zamknięte w wyjątkowo smukłej i eleganckiej konstrukcji. Masz wiele urządzeń i potrzebujesz, by wszystko działało razem? Ten hub to prawdziwa potęga technologiczna, która pozwala: ładować laptopa z mocą 96 W, przesyłać dane z prędkością do 40 Gbps, podłączyć dwa ekrany 4K 60Hz lub jeden 8K 30Hz, korzystać z 3 portów Thunderbolt 4, podłączyć dodatkowe akcesoria przez port USB-A 10 Gbps, podtrzymać działanie wszystkich podłączonych urządzeń jednym kablem. Dzięki 96W Power Delivery Twój laptop jest zawsze naładowany i gotowy do pracy, bez konieczności podłączania dodatkowych ładowarek. Jeden kabel łączy wszystko od zasilania, przez dane, po obraz w najwyższej jakości. Mniej kabli. Więcej możliwości. Kolor producenta: Gray (szary) W zestawie: stacja Satechi Thunderbolt 4 Slim Hub Pro, przewód Thunderbolt 4 do hosta, zasilacz sieciowy i przewód zasilający typu C5, instrukcja obsługi Zobacz produkt w akcji! Obsługa najbardziej wymagających ekranów i peryferii Chcesz pracować na kilku ekranach jednocześnie? Thunderbolt 4 Slim Hub Pro umożliwia podłączenie: dwóch monitorów 4K 60Hz, lub jednego monitora 8K 30Hz, lub jednego ekranu 6K na Macu. Idealne rozwiązanie do pracy w Adobe Premiere, Final Cut, DaVinci Resolve czy projektowania graficznego, gdzie każdy piksel ma znaczenie. Chcesz pracować na zewnętrznym dysku SSD, podłączyć tablet graficzny, korzystać z interfejsu audio lub karty przechwytywania wideo? Dzięki portom 10 Gbps i Thunderbolt 4 podłączasz wszystko bez spowolnień i bez utraty jakości. Duże pliki kopiujesz błyskawicznie, materiały z kamer trafiają od razu na timeline, a peryferia działają płynnie, niezależnie ile urządzeń podłączysz. Potrzebujesz więcej sprzętu? Dzięki technologii Daisy Chain możesz podłączyć do sześciu urządzeń jednocześnie, bez utraty jakości sygnału czy prędkości przesyłu danych. To idealne rozwiązanie dla twórców treści, streamerów i profesjonalistów, którzy pracują na wielu urządzeniach jednocześnie. Kompaktowy design, który pasuje wszędzie Wszystko to zamknięte w smukłej i wytrzymałej obudowie z aluminium klasy lotniczej, z eleganckimi, fazowanymi krawędziami. Dzięki minimalistycznej konstrukcji i nowoczesnemu wykończeniu, hub nie tylko świetnie wygląda, ale też nie zajmuje cennego miejsca na biurku. To rozwiązanie, które organizuje Twoją przestrzeń, zamiast ją zagracać. Przykładowa kompatybilność MacBook MacBook Pro 16 (2019 i nowsze) MacBook Pro 14 (2021 i nowsze) MacBook Pro 13 (2016 i nowsze) MacBook Pro 15 (2016 i nowsze) MacBook Air 15 (2022 i nowsze) MacBook Air 13 (2018 i nowsze) MaciMac iMac 24 (2021 i nowsze) iMac 21,5 (2017 i nowsze) iMac 27 (2017 i nowsze) iMac Pro (2017) Mac mini (2018 i nowsze) Mac Studio (2022 i nowsze) iPad iPad Pro 12,9 (od 3. generacji do M4) iPad Pro 11 (od 1. generacji do M4) iPad Air (4. generacja i nowsze) iPad (10. generacja i nowsze) iPad mini (7. generacja i nowsze) iPhone iPhone 16 Pro Max i nowsze iPhone 15 Pro Max i nowsze Windows Microsoft Surface Pro 789 Microsoft Surface Laptop Studio Lenovo ThinkPad X13 Gen 2 Lenovo X1 Gen 1 Carbon Lenovo Yoga 720-13IKB Lenovo Legion S7 15ACH6 Dell XPS 13 9315 Warto wiedzieć: Obsługa monitora 5K60Hz wymaga bezpośredniego połączenia USB-C - DisplayPort. Podstawowe modele MacBooków z procesorem M1M2 obsługują tylko jeden zewnętrzny ekran. Podstawowe modele MacBook Air i Pro z procesorem M3 obsługują dwa ekrany (4K60Hz) tylko w trybie zamkniętej pokrywy (Clamshell Mode). MacBooki z procesorem M4 obsługują dwa zewnętrzne ekrany. Hub nie obsługuje 4K przy 144Hz maksymalna obsługiwana częstotliwość odświeżania to 60Hz. Wymagania systemowe dla komputerów z Windows: wymagane złącza Thunderbolt 4, Thunderbolt 3, USB4 lub USB 3.2 Gen2 z DP Alt Mode (USB-C) dla optymalnego działania. W niektórych przypadkach wyświetlacze 5K są ograniczane do 4K przez hub, np. gdy: Użyty jest kabel inny niż USB-C - DisplayPort, Monitor nie obsługuje DisplayPort przez USB-C, 