t zawsze pod ręką! Zdalny pilot i stabilność nawet pod chmurką Wbudowany statyw z antypoślizgowymi silikonowymi podkładkami zapewnia stabilność nawet na nierównym terenie, co docenisz podczas rodzinnych spotkań w plenerze. Pilot Bluetooth umożliwia zdalne sterowanie migawką bez sięgania do telefonu, więc wystarczy jedno naciśnięcie, by zatrzymać wspomnienie. Nie przegap chwili i twórz łatwo wspomnienia! Przygotuj się na spontaniczne sesje z Spigen Selfie Stick Tripod, bo z pilotem Bluetooth i stabilnym statywem każdy kadr staje się profesjonalny! Nie czekaj, bo każda sekunda bez takiej wygody to stracone zdjęcie do rodzinnego albumu! Specyfikacja: Minimalna wysokość: 27.8 cm Maksymalna wysokość: 168.5 cm Wspierana wersja Bluetooth przez pilota: Bluetooth 4.2 Odległość łączenia pilota: do 10 metrów Czas ładowania pilota: 1 godzina Cas pracy pilota: do 20 godzin (65 mAh) Dodatkowe funkcje: ring magnetyczny dla urządzeń i etui bez wsparcia funkcji MagSafe, MagSafe z dwóch stron do dodatkowego przyczepienia akcesoriów, silikonowe wykończenie chroniące przed rysami','','uchwyt-kijek-statyw-spigen-s581w-bluetooth-selfie-stick-tripod-z-pilotem-bluetooth-czarny','','','','Uchwyt, kijek, statyw Spigen S581W Bluetooth Selfie Stick Tripod z pilotem Bluetooth, czarny','','','',''),(99249,1,1,'Uchwyt, kijek Spigen S581W Selfie Stick Tripod UniwersalneDla urządzeń etui z wbudowanym MagSafeRing magnetyczny do przyklejenia w zestawie Magnetyczne selfie na wyciągnięcie ręki Selfie Stick Tripod MagSafe marki Spigen pozwala uchwycić każdy moment poza zasięgiem ręki z precyzją i lekkością. Intuicyjny system MagSafe bez dodatkowych kabli sprawia, że użytkowanie statywu jest równie szybkie, co przyklejenie magnesu. Skończą się ryzykowne prośby o pomoc w zdjęciu, bo statyw i MagSafe zrobią robotę za każdego ochotnika. Kolor producenta: Dune Beige (beżowy) W opakowaniu znajduje się: Statyw do telefonu Spigen Selfie Stick Tripod z paskiem na nadgarstek Pilot Bluetooth USB-C 4.2 Ring magnety