 Przesiądź się na nową jakość zasilania i pozwól tej ładowarce indukcyjnej 3w1 od Spigena możesz rozwiązać problem pustej baterii, oraz plątaniny kabli. Postaw na elegancję i funkcjonalność, zanim Twój telefon obudzi Cię z pustą baterią po północy! Specyfikacja: Wejście: 9V3A, 12V2.5A Wyjście 1 (ładowanie smartfona): 15W Qi2 Wyjście 2 (ładowanie słuchawek AirPods): 5W Wyjście 3 (ładowanie zegarków Apple Watch): 2.5W Wymiary: 70.3 x 70.3 x 122.6 mm Waga: 415g','','ladowarka-indukcyjna-3w1-spigen-essential-3-in-1-wireless-charger-qi2-do-magsafe-225w-czarna','','','','Ładowarka indukcyjna 3w1 Spigen Essential 3 in 1 Wireless Charger, Qi2 do MagSafe, 22.5W, czarna','','','',''),(99422,1,1,'Pokrowiec na laptopa Tech-Protect Sleevedo laptopów o przekątnej 13 - 14o wymiarach mniejszych niż: 34 x 24,5 cm (szer. x głęb.)Wygodna ochrona laptopa w każdej podróżyCzy Twój laptop zasługuje na VIP-owską ochronę podczas drogowych podróży? Tech-Protect Sleeve został stworzony po to, by zamienić chaos w bezpieczne schronienie dla Twojego sprzętu, minimalizując ryzyko uszkodzeń w codziennych sytuacjach. Ten praktyczny pokrowiec łączy lekkość i wytrzymałość, zapewniając komfort użytkowania przy każdym wyjściu z domu.W opakowaniu znajduje się:pokrowiec na laptopa Tech-Protect SleeveKolor producenta: Navy Blue (granatowy)Zawsze wszystkie akcesoria pod rękąPrzemyślana kieszeń frontowa pomieści zasilacz, przewody i myszkę bezprzewodową, zapewniając porządek i szybki dostęp do wszystkich akcesoriów. Wytrzymały materiał tekstylny zabezpiecza przed wilgocią i ścieraniem, wydłużając żywotność pokrowca i podnosząc poziom bezpieczeństwa laptopa. Dzięki Tech-Protect Sleeve transport laptopa staje się prostszy, a Ty zyskujesz pewność, że sprzęt jest chroniony niezależnie od okoliczności.Twoje urządzenie nie boi się przypadkówKiedy laptop wyskoczy niespodziewanie z plecaka, pokrowiec przejmie całą brutalną lekcję fizyki na klatę. Miękka wyściółka chroni krawędzie i ekran przed zarysowaniami, a soli