 FCP, SCP Pozwala na ładowanie do 2 urządzeń jednocześnie Parametry wyjściowe najmocniejszego portu: USB-C PD3.0: 47W Max Rozkład mocy na poszczególne porty Rozkład mocy podczas używania portów w różnych konfiguracjach: Wariant 1: Tylko USB-C(1): 47W Wariant 2: USB-C(1) USB-C(2): 27W 20W Intelligent Safety - bezpieczna i funkcjonalna Ładowarka automatycznie identyfikuje urządzenie obsługujące standard szybkiego ładowania. Dzięki m. in. Intelligent Safety czy Overheat Protection posiada szereg zabezpieczeń na wielu poziomach, w tym przeciw przepięciu, przegrzaniu, zwarciu, czy przeładowaniu. Inteligentny chip automatycznie identyfikuje podłączone urządzenie dostosowując maksymalną możliwą moc ładowania, zapewniając tym samym optymalny przesył prądu z zachowaniem bezpieczeństwa ładowanego urządzenia. Kompaktowy rozmiar Ładowarka sieciowa Spigen to minimalistyczny i jednocześnie nowoczesny design. Kompaktowe rozmiary stanowią zdecydowaną zaletę w podróży. Bez problemu zmieścisz ją na listwie zasilającej między innymi wtyczkami, a także wygodnie spakujesz ją do torby czy plecaka. Wymiary kostki (bez wtyczki): 31 x 41 x 44,5 mm Waga: 105g Świetnie nada się do ładowania różnych mobilnych urządzeń, takich jak np. smartfony, słuchawki, smartwatche, tablety, itp. Technologia GaN Zastosowanie tranzystorów z azotku galu (GaN - gallium nitride) zamiast tradycyjnego krzemu zaowocowało jeszcze mniejszym wytwarzaniem ciepła, co pozwoliło na bliższe usytuowanie wewnętrznych komponentów względem siebie, a tym samym zachowanie kompaktowej budowy ładowarki. Dzięki takiemu rozwiązaniu otrzymujesz znacznie mniejszą ładowarkę z dużą mocą, która wymagałaby standardowo większej obudowy.','','ladowarka-sieciowa-gan-2x-usb-c-47w-spigen-essential-ee472eu-czarna','','','','Ładowarka sieciowa GaN 2x USB-C, 47W, Spigen Essential EE472EU, czarna','','','',''),(99452,1,1,'Spigen Essential Wall Charger EE673EU 67W Dla urządzeń mobilnych USB-A, 2x USB-C Większa moc w krótszym czasie Kompaktowa i fun