B-C 150 cm Uniwersalna kompatybilność ładowarki bezprzewodowej Z uniwersalną kompatybilnością z urządzeniami Apple, Samsung czy innymi obsługującymi Qi ładowanie staje się dziecinnie proste, a cały proces przebiega błyskawicznie i komfortowo. Pionowy design pozwala ładować smartfon, słuchawki i zegarek na raz, oszczędzając miejsce na blacie biurka lub nocnej szafce. Komfort użytkowania podnosi elastyczność rozmieszczenia dzięki długiemu kablowi USB-C, który łatwo dopasujesz do każdej przestrzeni. Aluminium robi robotę i wygląda świetnie Konstrukcja z aluminium przekłada się na codzienną trwałość, co pozwala bez obaw korzystać z ładowarki w każdej sytuacji od poranka przed wyjściem do pracy aż po wieczorne ładowanie gadżetów. Nowoczesne wykończenie sprawia, że urządzenie idealnie komponuje się ze stylem mieszkania czy biura i przyciąga oko swoim subtelnym designem. Wreszcie możesz pochwalić się ładowarką, która dumnie prezentuje Twoje podejście do technologii funkcjonalnie i z humorem. Czterostopniowe system zabezpieczeń Zaawansowany czterostopniowy system ochrony zabezpiecza Twoje urządzenia przed przegrzaniem, przepięciami, przeciążeniem i zwarciem, oferując spokój każdego dnia. Wybierasz bezpieczeństwo i wygodę w jednym, jednocześnie eliminując typowe ładowarkowe frustracje. Już dziś zrób pierwszy krok ku technologicznemu porządkowi i ciesz się, że ładowanie może być szybkie, łatwe i bezproblemowe! Specyfikacja: Wejście: 9V2A Wyjście (ładowanie telefonu): 5W 7.5W 10W 15W Wyjście (ładowanie słuchawek): 2W Wyjście (ładowanie zegarka): 2W Maksymalna moc wyjściowa: 15W','','ladowarka-indukcyjna-3w1-forcell-f-energy-simply-charge-qi-do-magsafe-15w-szara','','','','Ładowarka indukcyjna 3w1 Forcell F-Energy Simply Charge, Qi do MagSafe, 15W, szara','','','',''),(105129,1,1,'Etui Guess Fixed Glitter Big 4G Metal Frame Apple iPhone 17 Pro Wyjątkowa kolekcja z klasycznym wzornictwem Amerykańska firma Guess od wielu lat jest utożsamiania z bardzo dobrą jakością i oryginalnym wzornictwem. Etui z kolekcji Fixed Glitter Big 4G Metal Frame wyprodukowane przez firmę CG Mobile na oficjalnej licencji marki Guess jest pozycją dla osób ceniących sobie klasykę i styl. Zaprojektowane z wyjątkową starannością o szczegóły. Wykonane z połączenia przyjemnego w dotyku i twardego poliwęglanu na pleckach oraz elastycznego termopoliuretanu, z którego wykonana została ramka. Pokryte błyszczącym brokatem. Etui zapakowane jest w przyjazne środowisku opakowanie. Kolor producenta: Gold (złoty z brokatem) Etui kompatybilne ze szkłami o wymiarach mniejszych niż (dług.szer.): 14,76 x 6,98 cm Ochrona tyłu i boków Dobrze dopasowane etui, zachowuje opływowe kształty smartfona. Plecki i boki telefonu są skutecznie zabezpieczone przed zarysowaniami, zabrudzeniem oraz wstrząsami. Wciąż tak samo funkcjonalne Precyzyjne wycięcia zapewniają pełen dostęp do interfejsów i portów, bezpiecznie leżąc w dłoni. Staranne wykończenie oraz zintegrowane osłony przycisków utrzymują nowoczesny i minimalistyczny design. Case pewnie leży w dłoni oraz łatwo się zakłada. *Kliencie! Ze względu na wystające logo Guess, funkcja ładowania bezprzewodowego w tym etui jest ograniczona. Przyjemne dla oka dodatki Ta wyjątkowa kolekcja przyciąga wzrok dzięki subtelnej warstwie migoczącego brokatu, która dodaje efektownego blasku. Złote metalowe logo Guess utrzymane w stylu vintage stanowi nie tylko ozdobę, lecz także hołd dla klasyki marki. Posiada ramkę wokół aparatu oraz złote przyciski, które podkreślają jego elegancki wygląd. Te drobne, lecz znaczące detale sprawiają, że kolekcja emanuje wyrafinowanym urokiem i przyciąga uwagę wielbicieli mody.','','etui-guess-fixed-glitter-big-4g-metal-frame-do-iphone-17-pro-zloto-brokatowe','','','','Etui Guess Fixed Glitter Big 4G Metal Frame do iPhone 17 Pro, złoto-brokatowe','','','',''),(105149,1,1,'Etui ochronne Guess 4G Case Cardslot Apple iPhone 17 Pro Etui z portfelem ogarnie codzienny chaos Nigdy więcej dylematów z portfelem wypchanym kartami i telefonem w drugiej kieszeni Guess 4G Case Cardslot to etui, które rozwiązuje oba problemy na raz! Marka Guess słynie z projektowania akcesoriów, które nie tylko chronią, lecz także podnoszą styl na wyższy poziom, a ten model łączy w sobie wyjątkowo elegancką obudowę z praktycznym portfelem na karty, idealnym na szybkie wyjście z domu. To propozycja dla tych, którzy cenią modny design, ochronę urządzenia oraz wygodę w jednym bo przecież codzienność bywa wystarczająco skomplikowana bez gonienia za zgubionymi kartami. W opakowaniu znajduje się: etui na telefon Guess 4G Case magnetyczny portfel na karty Kolor producenta: Brown (brązowy) Etui kompatybilne ze szkłami o wymiarach mniejszych niż (długość x szerokość): 14,74 x 6,93 cm Obudowa z klasą powstrzyma taniec telefonu Obudowa 4G Case Cardslot to mocna, wytrzymała konstrukcja, stworzona z myślą o bezpiecznym użytkowaniu urządzenia, niezależnie od natężenia dnia. Skóra ekologiczna ozdobiona kultowym monogramem w połączeniu ze złotymi akcentami i logo Guess sprawia, że każde spojrzenie na Twoje urządzenie wywołuje przyjemny uśmiech z nutką luksusu. Boki etui są elastyczne, a delikatnie podniesione krawędzie skutecznie chronią ekran i optykę, więc nawet szybki taniec telefonu na podłodze nie kończy się katastrofą. Case ładuje się i trzyma jak trzeba Magnetyczny pierścień kompatybilny z MagSafe pozwala na bezproblemowe ładowanie bez zdejmowania ochrony bo po co tracić czas na niepotrzebne czynności, kiedy liczy się wygoda i płynność działania? Dzięki precyzyjnemu dopasowaniu, obudowa zapewnia swobodny dostęp do przycisków i portów, a mocno przylegające magnesy dbają, by urządzenie nie zjechało z ładowarki dokładnie wtedy, gdy wychodzisz z domu. Ta praktyczna funkcjonalność sprawia, że urządzenie i karty są zawsze tam, gdzie powinny być, a Ty możesz robić wrażenie stylem i zapanować nad codziennym chaosem. Ochrona kart i styl w kieszeni W zestawie znajdziesz magnetyczny portfel pokryty wzorem monogramu Guess, który nie tylko bezpiecznie przechowa karty i gotówkę, ale stanie się także subtelnym modowym akcentem. Metalowe logo 4G i elegancki napis GUESS podkreślają wyjątkowość dodatku, więc nawet płacąc za kawę na mieście, możesz czuć się jak gwiazda pierwszego planu. Nowoczesny portfel z czterema slotami świetnie sprawdzi się w każdej sytuacji, dbając o porządek i minimalizm w Twojej kieszeni bo nie ma nic lepszego, niż mieć wszystko pod ręką!','','etui-portfel-na-karty-guess-4g-magsafe-do-iphone-17-pro-brazowe','','','','Etui + portfel na karty Guess 4G MagSafe do iPhone 17 Pro, brązowe','','','',''),(105175,1,1,'Szkło hartowane Bizon Glass Edge PackSamsung Galaxy A17 5GZestaw szkieł hartowanych dla Galaxy A17 5GJeżeli do tej pory świat był dla Ciebie nieco zamglony, teraz nadszedł czas na krystaliczną przejrzystość!Zestaw ochronny od producenta Bizon z serii Edge Pack stanie na straży wyświetlacza oraz obiektywu Twojego telefonu i zawalczy z codziennymi przeciwnościami losu, takimi jak niespodziewane zarysowania spowodowane przez walkę kluczy z telefonem w plecaku czy potencjalne pęknięcia od nieudanych rzutów telefonem na łóżko.W skład zestawu wchodzą:2 sztuki szkła hartowanego na wyświetlacz Bizon Glass Edge1 sztuka nakładki na aparat Bizon Glass Lenszestaw aplikacyjny Wymiary szkłaPodstawowym akcesorium do ochrony urządzenia mobilnego oprócz szkła jest etui. Aby upewnić się, że szkło będzie zgodne z etui należy pamiętać, że:wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowcafuterał nie może nachodzić na szybkęWymiary szkła: 16,00 x 7,34 cm(długość szerokość)* Szkło pokrywa niemal całą część wyświetlacza wraz z ramkami i w zależności od zaokrągleń danego modelu telefonu bardziej lub mniej na nie nachodzi, dlatego może nie być kompatybilne ze wszystkimi pokrowcami. Przejrzystość bez smugBoisz się, że po aplikacji szkła, smartfon zacznie sam wysyłać nieprzyzwoite SMS-y do szefa, a Twój palec zostanie dodany do bazy osób nieupoważnionych do korzystania z telefonu?Tak jest tylko w bajkach. A Bizon Glass Edge, oprócz wytrzymałej konstrukcji i twardości na poziomie 9H, zachowuje pełną czułość dotyku! Za sprawą powłoki oleofobowej, która redukuje ilość pozostawianych smug i odcisków palców, nie będziesz musiał maniakalnie wycierać co chwilę ekranu, a dzięki wysokiej przejrzystości szkła nie umknie Ci żaden szczegół na zdjęciu, nawet taki, którego być może nie chcesz widzieć... Łatwa i szybka aplikacjaAplikacja szkła nie sprawi Ci większych problemów, a głęboki wdech i pozytywne nastawienie sprawią, że proces będzie jeszcze prostszy.Postaraj się, aby Twoje stanowisko nie znajdowało się w ciemni oraz było wolne od kurzu i resztek jedzenia.Sprawdź, czy szkło na pewno pasuje do Twojego modelu telefonu.Za pomocą najpierw mokrej, a potem suchej ściereczki, oczyść powierzchnię wyświetlacza. Ewentualne pyłki usuń za pomocą Dust Absorbera lub naklejek pozycjonujących.Odklej warstwę ochronną ze szkła.Przyłóż szkło do ekranu i delikatnie dociśnij, aby rozprowadzić klej.Wypchnij pęcherzyki powietrza, przesuwając je ściereczką z mikrofibry w kierunku najbliższej krawędzi.Jeśli pod szkłem znalazła się drobinka kurzu, możesz podważyć szkło i pozbyć się jej za pomocą Dust Absorbera lub naklejek pozycjonujących.Nie wystrasz się! Po instalacji szkła wokół ekranu może pojawić się aureola powietrzna. Efekt nie jest spowodowany wadami fabrycznymi, a jedynie naturalnym procesem mogącym się pojawić w zależności od zakrzywień w danym modelu telefonu. Zdjęcie poglądowe, produkt może się różnić w zależności od modelu urządzeniaBez zarysowań bez problemu!Roztrzaskanym obiektywem można co najwyżej porobić eksperymentalne fotki przypominające widok z kalejdoskopu, a nawet mała ryska to gwarancja trwałej blizny na każdym zdjęciu. Jak zadbać o soczewki?Bizon Glass Lens cechuje się wytrzymałą konstrukcją oraz nie wpływa znacząco na jakość i jasność wykonywanych zdjęć! Za sprawą powłoki oleofobowej, która redukuje ilość pozostawianych smug i odcisków palców, nie będziesz musiał maniakalnie wycierać co chwilę soczewek, a dzięki mocnej warstwie klejącej, osłona będzie solidnie przylegać do urządzenia.Szkło pokrywa cały obiektyw wraz z soczewkami. Przed zakupem zwróć uwagę, czy posiadane etui pokrywa wyspę aparatu. Jeśli tak, szkło na aparat z serii Glass Lens może nie być kompatybilne z pokrowcem.Żeby nie było plastiku - ekologicznie opakowanieBizon Glass Edge Pack, oprócz 2 sztuk szkła hartowanego na wyświetlacz i 1 sztuki nakładki na aparat, zawiera:4 mokre ściereczki2 suche ściereczki z mikrofibry2 Dust Absorbery (do wybierania drobin kurzu)6 naklejek pozycjonującychBizon dba o łosie, jelenie, sarny, dziki, lisy, borsuki, kuny, jenoty, wilki, rysie, a z ptaków kuropatwy, bażanty, dzikie kaczki, gęsi, łyski, bekasy i cietrzewie, dlatego zestaw przybędzie do Ciebie w ekologicznym opakowaniu, w którym zastosowano jedynie śladowe ilości plastiku!','','2x-szklo-szybka-na-aparat-bizon-edge-pack-do-galaxy-a17-5g','','','','2x Szkło + szybka na aparat Bizon Edge Pack do Galaxy A17 5G','','','',''),(105557,1,1,'Plecak podróżny Tech-Protect Defender S40 Travel Laptop Cabin Backpack 20L Uniwersalny o wymiarach 40 x 20 x 25 cm Spokojnie wchodzi do Ryanaira i Wizzaira Nie musisz już kręcić się w kółko na lotnisku, bo Tech-Protect Defender S40 Travel Laptop Cabin Backpack 20L to Twój nowy sprzymierzeniec na każdą podróż i codzienne dojazdy. Zmieścisz w nim wszystko, czego naprawdę potrzebujesz elektronika, ubrania i małe drobiazgi odnajdują swoje miejsce dzięki przemyślanej pojemności 20 l oraz ergonomicznej organizacji wnętrza. Najważniejsze? Jego rozmiar pozwala spokojnie wnosić plecak jako bagaż podręczny do Ryanaira czy Wizzair, więc nie musisz płacić ani złotówki więcej i masz wszystko pod ręką. Kolor producenta: Black (czarny) Laptop tablet i dokumenty mają swoje miejsce W środku znajdziesz dedykowaną kieszeń na laptopa, dodatkową przegródkę na tablet i sekcję na dokumenty, więc żaden ważny sprzęt ani bilet nie zginie w czeluściach plecaka. Sprytne rozmieszczenie kieszeni oraz elastyczna boczna kieszonka sprawiają, że butelka na wodę albo parasolka w końcu nie walczą z portfelem o miejsce. Nie zabrakło też zamykanej kieszeni na zamek, która zapewnia poczucie bezpieczeństwa dla kluczy, kart czy portfela bo każdemu może się zdarzyć zapomnieć, gdzie je schował. Plecy i szelki niosą bez narzekania Materiał odporny na wilgoć, zanieczyszczenia i codzienne przetarcia gwarantuje, że plecak zniesie niejedną podróż, nawet jeśli twoje przygody mają w zwyczaju zaskakiwać pogodą. Zawsze czujesz, jakby miał więcej miejsca niż w rzeczywistości, a przy tym całość pozostaje lekka, poręczna i gotowa, by pędzić tuż obok Ciebie przez ulice i lotniskowe terminale. Świetnie wyprofilowane plecy i szelki sprawiają, że nawet najdłuższe spacery nie kończą się narzekaniem na bolące ramiona. Kable ujarzmione a przesiadka bez zadyszki Wbudowana kieszeń organizacyjna pomaga ujarzmić kable, powerbank, długopisy oraz inne technologie żyjące na dnie przeciętnego plecaka tutaj wszystko ma swoje miejsce, więc już nie usłyszysz gdzie położyłeś ładowarkę?. Praktyczny, dyskretny pasek umożliwia wygodne zamocowanie plecaka na walizce podczas podróży, co daje chwilę odprężenia podczas biegu na przesiadkę. Podróż lżejsza a rzeczy zawsze pod kontrolą Tech-Protect Defender S40 Travel Laptop Cabin Backpack 20L to must-have dla tych, którzy lubią być gotowi na wszystko od konferencji po ekspresowe wypady do innego miasta. Z tym plecakiem każda podróż nabiera lekkości, a twoje rzeczy są zawsze pod kontrolą i bezpieczne. Jeśli jeszcze się wahasz, pamiętaj lepiej zorganizować swój bagaż z uśmiechem, niż potem szukać ładowarki w czeluściach zwykłej torby, ryzykując spóźnienie na samolot! Zmieścisz się w limitach i w planie Wielofunkcyjność i dopracowany design sprawiają, że Defender S40 szybko stanie się twoim najlepszym, podróżnym kompanem gotowym sprostać zarówno lotniskowym kontrolom, jak i codziennym wyzwaniom. Zaufaj praktyczności i oszczędności, jakie oferuje odpowiedni rozmiar i inteligentny podział wnętrza już nigdy nie będziesz się zastanawiać, czy wszystko zmieścisz albo, czy na pewno zmieścisz się w limicie linii lotniczych. Ten plecak jest gotowy podróżować razem z tobą przez długie lata pełne przygód i niespodzianek!','','plecak-podrozny-z-miejscem-na-laptopa-20l-40x20x25-cm-tech-protect-defender-s40-czarny','','','','Plecak podróżny z miejscem na laptopa, 20L 40x20x25 cm, Tech-Protect Defender S40, czarny','','','',''),(105560,1,1,'Selfie stick tripod Bluetooth Tech-Protect L09S Wireless Szerokość szczęki od 4 cm do 9,5 cm Rób szerokie ujęcia z pilotem Bluetooth Selfie Stick Tripod Tech-Protect L09S to wygodny sposób na uchwycenie ważnych chwil bez angażowania wszystkich rąk idealny podczas wycieczek, spotkań z przyjaciółmi czy vlogowania. Teleskopowy wysięgnik rozkłada się do 146 cm, co zapewnia naprawdę szerokie kadry oraz komfort nawet w tłumie, a solidna budowa z aluminium i tworzywa ABS dba o bezpieczeństwo Twojego smartfona. Wyjątkową zaletą L09S jest odłączany pilot Bluetooth, pozwalający robić zdjęcia wygodnie na odległość bez biegu na miejsce, zanim upłynie czas na samowyzwalaczu! W opakowaniu znajduje się: selfie stick pilot Bluetooth Kolor producenta: Beige (beżowy) Zrób z parapetu studio i nadaj live Nikt nie lubi ostrożnego balansowania telefonu na niestabilnych powierzchniach, dlatego Tech-Protect L09S wyposażono w składany statyw, który z każdego stołu czy parapetu robi profesjonalne studio. Antypoślizgowe wykończenie uchwytu chroni urządzenie przed upadkiem i zarysowaniami, dzięki czemu bez stresu możesz skupić się na kreatywności podczas nagrywania czy transmisji live. Uniwersalność kompatybilności z systemami iOS i Android sprawia, że sprawdzi się niemal z każdym smartfonem, więc nie musisz martwić się wymianą sprzętu. Zmieści się wszędzie i trzyma pewnie kadr L09S docenisz również za kompaktowe wymiary po złożeniu ma tylko 29 cm długości i waży zaledwie 289 g, więc bez problemu zmieścisz go do plecaka lub torebki razem z innymi akcesoriami. Długość szczęki uchwytu pozwala zamocować telefony o szerokości od 4 cm do 9,5 cm, co daje swobodę wyboru i gwarancję stabilności nawet podczas dynamicznych ujęć. Decydując się na ten selfie stick, możesz już zapomnieć o rozmazanych zdjęciach z przypadkowych podpórek i nieudanych grupowych kadrach przekonaj się, że technologia naprawdę ułatwia codzienne rejestrowanie wspomnień.','','uchwyt-kijek-statyw-tech-protect-l09s-wireless-selfie-stick-tripod-bluetooth-bezowy','','','','Uchwyt, kijek, statyw Tech-Protect L09S Wireless Selfie Stick Tripod Bluetooth, beżowy','','','',''),(105575,1,1,'Selfie stick tripod Bluetooth Tech-Protect L09S Wireless Szerokość szczęki od 4 cm do 9,5 cm Rób szerokie ujęcia z pilotem Bluetooth Selfie Stick Tripod Tech-Protect L09S to wygodny sposób na uchwycenie ważnych chwil bez angażowania wszystkich rąk idealny podczas wycieczek, spotkań z przyjaciółmi czy vlogowania. Teleskopowy wysięgnik rozkłada się do 146 cm, co zapewnia naprawdę szerokie kadry oraz komfort nawet w tłumie, a solidna budowa z aluminium i tworzywa ABS dba o bezpieczeństwo Twojego smartfona. Wyjątkową zaletą L09S jest odłączany pilot Bluetooth, pozwalający robić zdjęcia wygodnie na odległość bez biegu na miejsce, zanim upłynie czas na samowyzwalaczu! W opakowaniu znajduje się: selfie stick pilot Bluetooth Kolor producenta: Black (czarny) Zrób z parapetu studio i nadaj live Nikt nie lubi ostrożnego balansowania telefonu na niestabilnych powierzchniach, dlatego Tech-Protect L09S wyposażono w składany statyw, który z każdego stołu czy parapetu robi profesjonalne studio. Antypoślizgowe wykończenie uchwytu chroni urządzenie przed upadkiem i zarysowaniami, dzięki czemu bez stresu możesz skupić się na kreatywności podczas nagrywania czy transmisji live. Uniwersalność kompatybilności z systemami iOS i Android sprawia, że sprawdzi się niemal z każdym smartfonem, więc nie musisz martwić się wymianą sprzętu. Zmie