 12V2.5A Wyjście USB-C: DC 5V3A, 9V3A, 12V2.5A Napięcie wejściowe: 12V - 24V DC','','ladowarka-samochodowa-baseus-mini-tiny-star-pd-30w-1x-usb-a-1x-usb-c-czarna','','','','Ładowarka samochodowa Baseus Mini Tiny Star PD 30W, 1x USB-A, 1x USB-C, czarna','','','',''),(106176,1,1,'Hub USB Orico Mini 3in1 USB Hub Kompatybilne z urządzeniami wyposażonymi w USB-A Zyskaj porty i transfer 5 Gbps Masz już dość żonglowania przejściówkami przy każdym nowym gadżecie na biurku? Mini 3in1 USB Hub Orico to narzędzie, które błyskawicznie rozwiąże problem braku portów i pozwoli na transfer danych z prędkością aż do 5Gbps, dzięki szybkiemu portowi USB 3.0. Taki kompaktowy pomocnik sprawdzi się wszędzie tam, gdzie liczy się miejsce, porządek i wygodny dostęp do kilku urządzeń naraz. Materiał: ABS (tworzywo sztuczne) Kolor producenta: Black (czarny) W opakowaniu znajduje się: Orico Mini 3in1 USB Hub Podłącz i działaj stabilnie gdziekolwiek jesteś Niewielkie gabaryty huba Orico gwarantują, że dopasuje się do każdego stanowiska pracy, a trwała obudowa z tworzywa ABS sprawia, że nie straszne mu nawet codzienne podróże. Obsługa jest wyjątkowo intuicyjna: wystarczy podłączyć do komputera i już możesz korzystać z pełnej mocy portów bez zbędnych formalności czy dodatkowych sterowników. Zyskujesz stabilność i funkcjonalność niezależnie czy podłączasz mysz, klawiaturę czy inne urządzenia USB. USB 3.0 i USB 2.0 porządkują biurko Dwa porty USB 2.0 wraz z ultraszybkim USB 3.0 pozwalają za jednym ruchem zebrać wszystkie ważne odbiorniki i pamięci w jednym miejscu, oferując porządek i wygodę na każdym biurku. Praca staje się płynniejsza dzięki możliwości równoczesnego podpięcia wielu urządzeń, co docenią zarówno użytkownicy laptopów, jak i komputerów stacjonarnych. Kompatybilność z szeroką gamą systemów operacyjnych pozwala korzystać z huba praktycznie w każdych warunkach. Niezwykły lekki HUB USB Mikroskopijna waga, wynosząca jedynie 47g, sprawia, że możesz zabrać urządzenie nawet do najmniejszej torby lub plecaka i zupełnie o nim zapomnieć, dopóki nie będzie potrzebne. Solidność i wytrzymałość konstrukcji gwarantują długotrwałą pracę, niezależnie od liczby codziennych transportów. Wszystkie Twoje urządzenia będą mieć zawsze dostęp do ładowania i wymiany danych bez zbędnych strat czasu na podpinanie i odpinanie kabli osobno. Specyfikacja: Wejście: USB-A 3.0 (męski) Wyjście: 1x USB-A 3.0 (5 Gbps), 2x USB-A 2.0 (480Mbps) Wymiary: 55x25x20 mm','','hub-adapter-orico-mini-3in1-usb-hub-1x-usb-a-30-2x-usb-a-20-czarny','','','','HUB, adapter Orico Mini 3in1 USB HUB, 1x USB-A 3.0, 2x USB-A 2.0, czarny','','','',''),(106177,1,1,'Hub USB Orico Mini 3in1 USB Hub Kompatybilne z urządzeniami wyposażonymi w USB-A Zyskaj porty i transfer 5 Gbps Masz już dość żonglowania przejściówkami przy każdym nowym gadżecie na biurku? Mini 3in1 USB Hub Orico to narzędzie, które błyskawicznie rozwiąże problem braku portów i pozwoli na transfer danych z prędkością aż do 5Gbps, dzięki szybkiemu portowi USB 3.0. Taki kompaktowy pomocnik sprawdzi się wszędzie tam, gdzie liczy się miejsce, porządek i wygodny dostęp do kilku urządzeń naraz. Materiał: Aluminium Kolor producenta: Black (czarny) W opakowaniu znajduje się: Orico Mini 3in1 USB Hub Podłącz i działaj stabilnie gdziekolwiek jesteś Niewielkie gabaryty huba Orico gwarantują, że dopasuje się do każdego stanowiska pracy, a trwała obudowa z aluminium sprawia, że nie straszne mu nawet codzienne podróże. Obsługa jest wyjątkowo intuicyjna: wystarczy podłączyć do komputera i już możesz korzystać z pełnej mocy portów bez zbędnych formalności czy dodatkowych sterowników. Zyskujesz stabilność i funkcjonalność niezależnie czy podłączasz mysz, klawiaturę czy inne urządzenia USB. USB 3.0 i USB 2.0 porządkują biurko Dwa porty USB 2.0 wraz z ultraszybkim USB 3.0 pozwalają za jednym ruchem zebrać wszystkie ważne odbiorniki i pamięci w jednym miejscu, oferując porządek i wygodę na każdym biurku. Praca staje się płynniejsza dzięki możliwości równoczesnego p