rawą powłoki oleofobowej, która redukuje ilość pozostawianych smug i odcisków palców, nie będziesz musiał maniakalnie wycierać co chwilę soczewek, a dzięki mocnej warstwie klejącej, osłona będzie solidnie przylegać do urządzenia.Szkło pokrywa cały obiektyw wraz z soczewkami. Przed zakupem zwróć uwagę, czy posiadane etui pokrywa wyspę aparatu. Jeśli tak, szkło na aparat z serii Glass Lens może nie być kompatybilne z pokrowcem.Żeby nie było plastiku - ekologicznie opakowanieBizon Glass Edge Pack, oprócz 2 sztuk szkła hartowanego na wyświetlacz i 1 sztuki nakładki na aparat, zawiera:3 mokre ściereczki2 suche ściereczki z mikrofibry2 Dust Absorbery (do wybierania drobin kurzu)6 naklejek pozycjonującychBizon dba o łosie, jelenie, sarny, dziki, lisy, borsuki, kuny, jenoty, wilki, rysie, a z ptaków kuropatwy, bażanty, dzikie kaczki, gęsi, łyski, bekasy i cietrzewie, dlatego zestaw przybędzie do Ciebie w ekologicznym opakowaniu, w którym zastosowano jedynie śladowe ilości plastiku!','','2x-szklo-szybka-na-aparat-bizon-edge-pack-do-galaxy-s25-fe','','','','2x Szkło + szybka na aparat Bizon Edge Pack do Galaxy S25 FE','','','',''),(111101,1,1,'Szkło hartowane Bizon Glass Edge PackXiaomi 15TZestaw szkieł hartowanych dla Xiaomi 15TJeżeli do tej pory świat był dla Ciebie nieco zamglony, teraz nadszedł czas na krystaliczną przejrzystość!Zestaw ochronny od producenta Bizon z serii Edge Pack stanie na straży wyświetlacza oraz obiektywu Twojego telefonu i zawalczy z codziennymi przeciwnościami losu, takimi jak niespodziewane zarysowania spowodowane przez walkę kluczy z telefonem w plecaku czy potencjalne pęknięcia od nieudanych rzutów telefonem na łóżko.W skład zestawu wchodzą:2 sztuki szkła hartowanego na wyświetlacz Bizon Glass Edge1 sztuka nakładki na aparat Bizon Glass Lenszestaw aplikacyjny Wymiary szkłaPodstawowym akcesorium do ochrony urządzenia mobilnego oprócz szkła jest etui. Aby upewnić się, że szkło będzie zgodne z etui należy pamiętać, że:wymiary szkła muszą być mniejsz