 dopasowanie Niemarudząca, nieodstająca i idealnie przylegająca do urządzenia folia została wykonana z elastycznego TPU, a dzięki magicznej powłoce Self-Heal, potrafi sama naprawić drobne rysy czy powstałe po instalacji pęcherzyki powietrza! Jak zamontować folię na zegarek? Prosto! Zanim przystąpisz do montażu, sprawdź, czy folia jest przeznaczona dla Twojego modelu zegarka to pierwszy krok do sukcesu i gwarancja idealnego dopasowania. Znajdź dobrze oświetlone, czyste miejsce , weź głęboki wdech i ruszaj do dzieła! Oczyść ekran wilgotną ściereczkąUsuń tłuste plamy, smugi i większe zabrudzenia, przecierając ekran mokrą ściereczką Wytrzyj ekran mikrofibrąDokładnie przetrzyj ekran suchą ściereczką z mikrofibry, tak aby powierzchnia była idealnie sucha i gładka. Usuń kurz i pyłkiChwyć okrągłą naklejkę (Dust Absorber) i przyklejaj ją punktowo w miejscach, gdzie pojawiły się pyłki. Usuń naklejkęChwyć za naklejkę i usuń część folii z napisem REMOVE ME. Wypozycjonuj folięObróć folię o 180* i odpowiednio ułóż ją na ekranie, a następnie przyklej część pozycjonującą do ekranu, aby zapobiec przesuwaniu się folii podczas dalszego montażu. Przyklej krótszą częśćPodnieś i delikatnie zegnij krótszą dolną część z napisem Bizon, tak aby odkleiła się od folii. Za pomocą karty, jednym, płynnym i stabilnym ruchem przejedź w stronę dolnej krawędzi ekranu tak, by folia się przykleiła. Przyklej dłuższą częśćTaką samą czynność wykonaj w przypadku drugiej, dłuższej części folii. Następnie przesuń kartą po ekranie, aby usunąć ewentualne, pozostałe bąbelki powietrza. Chwyć za wystającą końcówkę i zdejmij pozostałą warstwę ochronną. Gotowe! Nadal widzisz drobne bąbelki? Bez obaw, znikną same w ciągu 24 godzin! Zestaw w ekologicznym opakowaniu Bizon Glass Watch Hydrogel, oprócz 1 sztuki folii hydrożelowej, zawiera również: 1 mokrą ściereczkę 1 suchą ściereczkę z mikrofibry 1 Dust Absorber (do wybierania drobin kurzu) 3 naklejki pozycjonujące Kartę do eliminacji pęcherzyków powietrza Bizon dba o 