 pompka automatycznie ustawia odpowiednie ciśnienie. Dodatkowo dostępny jest tryb manualny, w którym można samodzielnie ustawić żądaną wartość idealny do mniej standardowych zastosowań. Dzięki precyzyjnemu chipowi pomiarowemu urządzenie może pełnić funkcję manometru, zapewniając dokładny odczyt aktualnego ciśnienia w oponach. Obsługiwane jednostki PSI BAR KPA KGCM² pozwalają dopasować sposób pomiaru do rodzaju pojazdu i preferencji użytkownika. Mobilna konstrukcja i funkcja powerbanku VA0410 została zaprojektowana tak, aby była maksymalnie mobilna i zawsze gotowa do użytku. Obudowa wykonana z trwałego tworzywa ABS i poliwęglanu jest odporna na uderzenia i wysokie temperatury, co sprawia, że urządzenie świetnie sprawdza się zarówno w trasie, jak i podczas codziennego użytkowania. Wbudowana lampka LED pozwala wygodnie pompować opony nawet po zmroku, a dwuliniowy wyświetlacz zapewnia stały wgląd w parametry pracy. Funkcja powerbanku 8000 mAh umożliwia ładowanie smartfonów, urządzeń sportowych oraz drobnej elektroniki nawet wtedy, gdy pompka nie jest używana do pompowania. Dzięki portowi USB-C ładowanie jest szybkie i wygodne zarówno z gniazda sieciowego, jak i samochodowego. Wysoka wydajność i komfort użytkowania Dzięki swojej konstrukcji pompka Vayox VA0410 może z łatwością obsłużyć różne rodzaje pojazdów i akcesoriów. Na jednym ładowaniu urządzenie potrafi napompować nawet 4 opony samochodowe, 13 opon motocyklowych, około 30 opon rowerowych lub aż 88 piłek. System automatycznego wyłączania po 10 minutach chroni przed przegrzaniem, a szybkie ładowanie USB-C (5V2A) pozwala uzupełnić energię w ok. 3,5 godziny. Lekka, ergonomiczna konstrukcja sprawia, że urządzenie pewnie leży w dłoni, a jego mobilność sprawia, że doskonale sprawdzi się w samochodzie, garażu, na biwaku czy podczas rodzinnych wyjazdów. Dodatkowe akcesoria i końcówki, będące częścią zestawu, umożliwiają korzystanie z pompki praktycznie w każdej sytuacji. Kompletny zestaw końcówek do każdego zastosowania W zestawie z pompką znajduje się pełny komplet akcesoriów, które znacząco zwiększają możliwości urządzenia. 4 końcówki: adapter Presta do rowerów szosowych i MTB, końcówkę Schrader do opon samochodowych i motocyklowych, igłę do pompowania piłek sportowych oraz końcówkę do materacy i dmuchanych akcesoriów. Wężyk ciśnieniowy, który umożliwia łatwe dotarcie do zaworów w trudno dostępnych miejscach, np. pod błotnikami czy w głębokich felgach. Kabel USB-C do ładowania pompki Praktyczne etui ochronne, dzięki któremu urządzenie można wygodnie przechowywać i transportować. Specyfikacja Ciśnienie maksymalne (BAR): 10,3 Pojemność akumulatora (mAh): 8000 Średnica cylindra (mm): 19 Przepływ powietrza (lmin): 20 Ochrona przed przegrzaniem: automatyczne wyłączenie po 10 minutach pracy Port ładowania: USB-C Czas ładowania (h): 3,5 Materiał obudowy: ABS PC (trudnopalny) Funkcje dodatkowe: Powerbank, Latarka Niezawodność w każdych warunkach od -20C do 55C','','pompka-akumulatorowa-vayox-va0410-z-kompresorem-i-powerbank-8000mah-czarna','','','','Pompka akumulatorowa Vayox VA0410 z kompresorem i powerbank 8000mAh, czarna','','','',''),(111755,1,1,'Pompka akumulatorowa Vayox VA0409 z kompresorem i powerbankiem Do samochodów motocykli rowerów piłek Mobilny kompresor Pompka akumulatorowa Vayox VA0409 to kompaktowy i niezwykle praktyczny kompresor stworzony z myślą o użytkownikach ceniących wygodę, mobilność oraz niezawodność. Dzięki maksymalnemu ciśnieniu 150 PSI 10,3 BAR i przepływowi powietrza 20 lmin urządzenie z łatwością pompuje opony samochodowe, motocyklowe, rowerowe, hulajnogi elektryczne, piłki sportowe czy akcesoria dmuchane. Model ten wyposażony jest w akumulator 4000 mAh i potrafi napompować oponę 20555R16 od 0 do 2,5 bara w zaledwie 7 minut i 35 sekund, co stawia go w czołówce kompaktowych kompresorów. Pobierz instrukcję obsługi (w języku polskim) Automatyczne tryby pracy i precyzyjny pomiar ciśnienia Model ten oferuje aż 5 trybów pracy, z czego cztery są w pełni automatyczne: do samochodu, roweru, motocykla oraz piłki. Po wybraniu jednego z nich pompka samodzielnie proponuje ciśnienie i kończy pompowanie, gdy osiągnie zaprogramowaną wartość. Tryb manualny daje możliwość precyzyjnego ustawienia parametrów według indywidualnych potrzeb. Za dokładność pomiaru odpowiada cyfrowy chip, dzięki czemu pompka pełni również funkcję manometru, sprawdzając ciśnienie w oponach w czasie rzeczywistym. Obsługa jednostek PSI, BAR, KPA oraz KGCM² ułatwia dopasowanie urządzenia do różnych standardów i typów pojazdów. Wielozadaniowa i wydajna konstrukcja Pomimo kompaktowych rozmiarów pompka oferuje imponującą wydajność. Na jednym ładowaniu potrafi napompować nawet 2 opony samochodowe, 7 motocyklowych, 15 rowerowych lub około 44 piłki. Obudowa wykonana z trwałego tworzywa ABS i poliwęglanu gwarantuje odporność na uszkodzenia, wstrząsy oraz wysokie temperatury. Urządzenie działa w szerokim zakresie temperatur od 20C do 55C, dzięki czemu idealnie nadaje się do użytku w różnych warunkach. System automatycznego wyłączania po 10 minutach chroni przed przegrzaniem, a szybkie ładowanie USB-C (5V2A) pozwala uzupełnić energię w ok. 2,5 godziny. Praktyczna w podróży i codziennym użytkowaniu Pompka akumulatorowa została stworzona z myślą o wygodzie i wszechstronności. Jej lekka konstrukcja sprawia, że można zabrać ją dosłownie wszędzie do auta, na wycieczkę rowerową, biwak czy do torby podróżnej. Wbudowana lampka LED zapewnia komfort pracy po zmroku, a ergonomiczny kształt ułatwia trzymanie urządzenia w dłoni nawet podczas dłuższego pompowania. Dwuliniowy wyświetlacz LED jednocześnie prezentuje aktualne i docelowe ciśnienie. To idealny wybór dla osób ceniących niezależność oraz gotowość na każdą sytuację zarówno w trasie, jak i na co dzień. Zestaw końcówek do wielu zastosowań Wraz z pompką użytkownik otrzymuje bogaty zestaw praktycznych akcesoriów, które rozszerzają jej możliwości. Adapter Presta do rowerów szosowych, Igła do piłek, Końcówka do materacy i akcesoriów dmuchanych, Standardowa końcówka Schrader stosowana w oponach samochodowych i motocyklowychm Wężyk ciśnieniowy, który ułatwia dostęp do trudno położonych zaworów, Kabel USB-C do ładowania urządzeniam Praktyczne etui ochronne do przechowywania wszystkich elementów w jednym miejscu. Specyfikacja Ciśnienie maksymalne (BAR): 10,3 Pojemność akumulatora (mAh): 4000 Średnica cylindra (mm): 19 Przepływ powietrza (lmin): 20 Ochrona przed przegrzaniem: TAK Port ładowania: USB-C Czas ładowania (h): 2,5 Materiał obudowy: ABS PC (trudnopalny) Funkcje dodatkowe: Latarka','','pompka-akumulatorowa-vayox-va0409-z-kompresorem-i-powerbank-4000mah-czarna','','','','Pompka akumulatorowa Vayox VA0409 z kompresorem i powerbank 4000mAh, czarna','','','',''),(111845,1,1,'Etui Urban Armor Gear Plyo LT Apple iPad Pro 13 M5 2025 (A3360, A3361, A3362)Apple iPad Pro 13 M4 2024 (A2925, A2926, A3007) Pancerne etui na tablet Oryginalne etui z klapką od marki Urban Armor Gear z serii Plyo. Wykonane z połączenia wysokiej jakości wytrzymałych materiałów, takich jak poliwęglan oraz TPU. Wykończone skórą ekologiczną oraz wyściółką z mikrofibry. W pełni funkcjonalne, posiada uchwyt na rysik. Model ten został wydany przez producenta w wersji Bulk (zapakowany w folii ochronnej), a w opakowaniu dodatkowo znajdują się kolorowe gumki (czerwona i niebieska) do wymiany wokół obiektywu. Kolor producenta: Black - Ice (czarny z przezroczystymi pleckami) Etui kompatybilne ze szkłami o wymiarach nieprzekraczających (długość x szerokość): 27,85 x 21,19 cm Pancerne i wytrzymałe Wysoka odporność na uderzenia i wstrząsy. Pokrowiec zabezpieczy Twoje urządzenie od upadków, dzięki wzmocnionym narożnikom oraz solidnym materiałom wykonania zapewniającą doskonałą ochronę podczas upadku. Funkcjonalne Etui posiada uchwyt na rysik, a dzięki przyjemnej w dotyku strukturze, z jakiej zostało wykonane etui, nie musisz się martwić o wyślizgnięcie etui z rąk. Przezroczyste plecki etui świetnie prezentują oryginalny wygląd urządzenia. Wygodne zamykanie w formie klapki umożliwia pozycjonowanie iPada w dogodnej pozycji do przeglądania multimediów, pisania czy wideo rozmów, a także chroni front urządzenia przed zarysowaniami. Logo firmy UAG dodaje oryginalności, a całość przy swojej solidnej budowie prezentuje się bardzo stylowo. Dopasowane do urządzenia Dobrze leży w dłoni, a lekko wystające krawędzie chronią kamerę i ekran przed zarysowaniami na płaskich powierzchniach. Precyzyjne wycięcia na porty i złącza. Cienkie i lekkie Nie pogrubia znacząco urządzenia. Jest maksymalnie cienkie dla tego typu konstrukcji, dzięki czemu zapewnia solidną ochronę, praktyczną lekkość i smukły wygląd.','','etui-pancerne-urban-armor-uag-plyo-lt-do-ipad-pro-13-2025-2024-przezroczysto-czarne','','','','Etui pancerne Urban Armor UAG Plyo LT do iPad Pro 13\" 2025 / 2024, przezroczysto-czarne','','','',''),(111862,1,1,'Szkło hybrydowe Bizon Glass MuleHonor 400 Smart 4GHonor 400 Smart 5GSzkło hybrydowe do Honor 400 SmartMuł najbardziej znana hybryda, do tej pory tylko w środowisku zwierząt, a teraz także wśród akcesoriów GSM!Szkło hybrydowe marki Bizon z serii Mule łączy w sobie wytrzymałość szkła hartowanego z elastycznością folii hydrożelowej. Niczym muł, który zawsze dostarczy ładunek tam, gdzie trzeba, ta hybryda przeniesie Twój wyświetlacz na wyżyny równowagi, zapewniając mu doskonałą ochronę na co dzień, przy jednoczesnym zachowaniu subtelnego wyglądu i bezpieczeństwa, ponieważ nie kruszy się i nie pęka!Materiał: wysokiej jakości PETTyp: szkło hybrydoweTwardość: 9HGrubość: 0,43 mmOdporne na zarysowania i uderzeniaWyposażone w powłokę oleofobową i powłokę antystatycznąIdealnie przejrzyste (94)Zachowuje pełną czułość dotykuMocny klej silikonowyWymiary szkłaPodstawowym akcesorium do ochrony urządzenia mobilnego, oprócz szkła, jest etui. Aby upewnić się, że szkło będzie zgodne z etui, należy pamiętać, że:wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowcafuterał nie może nachodzić na szkłoWymiary szkła: 16,05 x 7,08 cm(długość szerokość) Przejrzystość bez ograniczeńBoisz się, że po aplikacji szkła, smartfon zacznie sam wysyłać nieprzyzwoite SMS-y do szefa, a Twój palec zostanie dodany do bazy osób nieupoważnionych do korzystania z telefonu? Tak jest tylko w bajkach. A Mule, oprócz elastycznej konstrukcji z najwyższej jakości koreańskiego materiału PET i twardości na poziomie 9H, cechuje się ultracienką grubością 0,43 mm, a co za tym idzie zachowaną pełną czułością dotyku! Za sprawą powłoki oleofobowej, która redukuje smugi i odciski palców, nie będziesz musiał maniakalnie wycierać co chwilę ekranu, a dzięki wysokiej przejrzystości szkła nie umknie Ci żaden szczegół na zdjęciu, nawet taki, którego być może nie chcesz widzieć...Zdjęcie poglądowe, obrazujące przezroczystość szkłaJak zamontować szkło? Prosto!Zanim szkło wyląduje na Twoim ekranie, upewnij się, że szkło jest przeznaczone do Twojego modelu telefonu to gwarancja bezproblemowego montażu i pełnej ochrony. Przygotuj czyste, dobrze oświetlone miejsce i do dzieła!Oczyść ekran wilgotną ściereczkąUsuń tłuste plamy, smugi i większe zabrudzenia, przecierając ekran mokrą ściereczką.Wytrzyj ekran mikrofibrąDokładnie przetrzyj ekran suchą ściereczką z mikrofibry, tak aby powierzchnia była idealnie sucha i gładka.Usuń kurz i pyłkiChwyć okrągłą naklejkę (Dust Absorber) i przyklejaj ją punktowo w miejscach, gdzie pojawiły się pyłki.Nałóż szkłoZdejmij folię ochronną oznaczoną numerem 1 i przyłóż szkło do ekranu. Wyrównaj pozycję możesz skorzystać z naklejek ułatwiających pozycjonowanie.Dociśnij szkłoDelikatnie naciśnij na środek szkła, aby szybka mogła się równomiernie przykleić do wyświetlacza.Wygładź powierzchnięUżywając ściereczki z mikrofibry, wypchnij ewentualne pęcherzyki powietrza w kierunku najbliższej krawędzi. Na koniec pociągnij za naklejkę numer 2, aby odkleić górną warstwę ochronną.Misja zakończona szkło na miejscu, ekran w pełni zabezpieczony!Zestaw w ekologicznym opakowaniuBizon Glass Mule, oprócz 1 sztuki szkł