-beetle-ub-macbook-air-136-m4-m3-m2-czarno-przezroczyste','','','','Etui Supcase Unicorn Beetle UB MacBook Air 13.6\" M4 / M3 / M2, czarno-przezroczyste','','','',''),(112231,1,1,'Ładowarka indukcyjna Tech-Protect Qi15W-A37 Kompatybilne z telefonami z Androidem, oraz smartfonami Apple wspierającymi ładowanie QiDla Apple WatchWspiera ładowanie dla AirPods, oraz Galaxy Buds Ładowanie bezprzewodowe 3w1 z Qi 15W Tech-Protect Qi15W-A37 to kompaktowa ładowarka indukcyjna 3w1 stworzona po to, aby w jednym miejscu wygodnie zasilać smartfon, zegarek i słuchawki bezprzewodowe, utrzymując biurko lub stolik nocny w idealnym porządku. Obsługa bezprzewodowego ładowania z mocą do 15W oraz wyraźnie wydzielone strefy dla każdego urządzenia sprawiają, że korzystasz z szybkiego, zorganizowanego i całkowicie bezprzewodowego uzupełniania energii w domu, pracy oraz w podróży. ℹ Kliencie! Aby cieszyć się z pełnej mocy ładowania, należy użyć ładowarki sieciowej o mocy min. 30W ze wsparciem Power Delivery, kompatybilne urządzenia znajdziesz pod tym linkiem. Kolor producenta: Black (czarny) W opakowaniu znajduje się: Ładowarka indukcyjna Tech-Protect Qi15W-A37 Kabel USB-C - USB-C o długości 100 cm Instrukcja obsługi Efektywne ładowanie dzięki USB-C Power Delivery Parametry wejściowe USB-C 5V3A lub 9V2A w połączeniu z osobnymi wyjściami 15W dla smartfona, 3W dla zegarka i 3W dla słuchawek zapewniają efektywne ładowanie dopasowane do wymagań różnych urządzeń. Dzięki temu jedno akcesorium zastępuje kilka klasycznych ładowarek, oszczędzając miejsce, ograniczając plątaninę kabli i pozwalając zawsze mieć najważniejszy sprzęt gotowy do pracy. Bezpieczne zasilanie z ochroną termiczną baterii Zintegrowany system ochrony przed przegrzaniem, przepięciami i przeciążeniem dba o bezpieczne zasilanie nawet podczas wielogodzinnego ładowania kilku urządzeń jednocześnie. Możesz swobodnie odkładać smartfon, zegarek i słuchawki na stację, a następnie zająć się swoimi obowiązkami, mając pewność stabilnej pracy i ochrony baterii. Nowoczesny design z matowym poliwęglanem Obudowa z matowego poliwęglanu nadaje modelowi Tech-Protect Qi15W-A37 nowoczesny, elegancki wygląd, który znakomicie komponuje się z biurkiem, stolikiem nocnym lub profesjonalnym stanowiskiem pracy. Trwała konstrukcja odporna na ślady codziennego użytkowania podkreśla profesjonalny charakter stanowiska, a jednocześnie zapewnia komfortowe i pewne odkładanie urządzeń na odpowiednie strefy ładowania. Specyfikacja: Wejście: DC 12V2A, 9V2A, 5V3A Wyjście dla telefonów: 15W 10W 7.5W 5W Wyjście dla smartwatchy: 3W Wyjście dla słuchawek: 3W','','ladowarka-indukcyjna-tech-protect-qi15w-a37-3w1-qi-dla-telefonow-sluchawek-i-smartwatchy-czarna','','','','Ładowarka indukcyjna Tech-Protect Qi15W A37 3w1, Qi dla telefonów, słuchawek i smartwatchy, czarna','','','',''),(112306,1,1,'Folia matowa Bizon Glass Tab Film Sun Apple iPad Pro 11 M5 2025 (A3357, A3358, A3359) Matowa ochrona ekranu dla iPad Pro 11 M5 2025 Słońce świeci i praży, a Ty nie widzisz, kto do Ciebie napisał? Matowa folia marki Bizon z serii Tab Film Sun zapewni wyświetlaczowi codzienne wakacje w cieniu i stanie się idealnym kompanem dla Twojego tabletu, szczególnie jeśli większą część dnia spędzasz na świeżym powietrzu. Folia nie tylko skutecznie walczy z promieniami padającymi prosto na tablet, ale także, dzięki jej matowemu obliczu, pozwoli Ci zapomnieć o brudnym ekranie, wyglądającym niczym detektywistyczna mapa odcisków palców! Materiał: elastyczny Przejrzystość: 92 Grubość: 0,12 mm Chroni przed zarysowaniami Redukuje odbijanie światła i odciski palców Idealnie dopasowana do urządzenia Zachowuje pełną czułość dotyku 1 sztuka w zestawie Wymiary folii Podstawowym akcesorium do ochrony urządzenia, oprócz folii, jest etui. Aby upewnić się, że folia będzie zgodna z etui, należy pamiętać, że: wymiary folii muszą być mniejsze od wymiarów wewnętrznych pokrowca futerał nie może nachodzić na folię Wymiary folii: 24,70 x 17,44 cm (długość szerokość) Właściwości folii matowej do tabletu Znasz ten moment, gdy patrzysz na ekran i widzisz tylko swoje odciski palców? To zdjęcie mówi wszystko. Po prawej klasyka, którą zna każdy użytkownik tabletu. Po lewej folia matowa, która zmienia zasady gry. Bez smug i odblasków, tylko czysty obraz i satysfakcja z użytkowania. To zmiana, którą łatwo zauważyć i trudno się bez niej obejść. Zdjęcie poglądowe, obrazujące porównanie efektu folii matowej i standardowej Bez odbić i śladów Boisz się, że po aplikacji folii, tablet zacznie sam wysyłać nieprzyzwoite SMS-y do szefa, a Twój palec zostanie dodany do bazy osób nieupoważnionych do korzystania z tabletu? Tak jest tylko w bajkach. A z Tab Film Sun komfort użytkowania jest jasny jak słońce! Folia cechuje się ultracienką grubością 0,12 mm, a co za tym idzie zachowaną pełną czułością dotyku. Za sprawą powłoki oleofobowej, która redukuje wszelkie dowody zbrodni smugi i odciski palców nie będziesz musiał maniakalnie wycierać co chwilę ekranu, a dzięki zaawansowanej redukcji odbić światła, ekran pozostanie czytelny, nawet gdy natura będzie rzucać najjaśniejsze wyzwania. Zdjęcie poglądowe, produkt może się różnić w zależności od modelu urządzenia Jak zamontować folię? Prosto! Zanim folia wyląduje na Twoim ekranie, upewnij się, że folia jest przeznaczona do Twojego modelu tabletu to gwarancja bezproblemowego montażu i pełnej ochrony. Przygotuj czyste, dobrze oświetlone miejsce i do dzieła! Oczyść ekran wilgotną ściereczkąUsuń tłuste plamy, smugi i większe zabrudzenia, przecierając ekran mokrą ściereczką. Wytrzyj ekran mikrofibrąDokładnie przetrzyj ekran suchą ściereczką z mikrofibry, tak aby powierzchnia była idealnie sucha i gładka. Usuń kurz i pyłkiChwyć okrągłą naklejkę (Dust Absorber) i przyklejaj ją punktowo w miejscach, gdzie pojawiły się pyłki. Nałóż folięZdejmij folię ochronną oznaczoną numerem 1 i przyłóż folię do ekranu. Wyrównaj pozycję możesz skorzystać z naklejek ułatwiających pozycjonowanie. Dociśnij folięDelikatnie naciśnij na środek folii, aby szybka mogła się równomiernie przykleić do wyświetlacza. Wygładź powierzchnięUżywając ściereczki z mikrofibry, wypchnij ewentualne pęcherzyki powietrza w kierunku najbliższej krawędzi. Na koniec pociągnij za naklejkę numer 2, aby odkleić górną warstwę ochronną. Misja zakończona folia na miejscu, ekran w pełni zabezpieczony! Zestaw w ekologicznym opakowaniu Bizon Glass Tab Film Sun, oprócz 1 sztuki folii ochronnej, zawiera również: 1 suchą ściereczkę z mikrofibry 1 mokra ściereczka do czyszczenia ekranu 3 naklejki pozycjonujące Dust Absorber (do wybierania drobin) Kartę do eliminacji pęcherzyków powietrza Bizon dba o łosie, jelenie, sarny, dziki, lisy, borsuki, kuny, jenoty, wilki, rysie, a z ptaków kuropatwy, bażanty, dzikie kaczki, gęsi, łyski, bekasy i cietrzewie, dlatego zestaw przybędzie do Ciebie w ekologicznym opakowaniu, w którym zastosowano jedynie śladowe ilości plastiku!','','folia-matowa-bizon-glass-tab-film-sun-do-apple-ipad-pro-11-m5-2025-1-sztuka','','','','Folia matowa Bizon Glass Tab Film Sun do Apple iPad Pro 11\" M5 2025, 1 sztuka','','','',''),(112307,1,1,'Folia matowa Bizon Glass Tab Film Sun Apple iPad Pro 13 M5 2025 (A3360, A3361, A3362) Matowa ochrona ekranu dla iPad Pro 13 M5 2025 Słońce świeci i praży, a Ty nie widzisz, kto do Ciebie napisał? Matowa folia marki Bizon z serii Tab Film Sun zapewni wyświetlaczowi codzienne wakacje w cieniu i stanie się idealnym kompanem dla Twojego tabletu, szczególnie jeśli większą część dnia spędzasz na świeżym powietrzu. Folia nie tylko skutecznie walczy z promieniami padającymi prosto na tablet, ale także, dzięki jej matowemu obliczu, pozwoli Ci zapomnieć o brudnym ekranie, wyglądającym niczym detektywistyczna mapa odcisków palców! Materiał: elastyczny Przejrzystość: 92 Grubość: 0,12 mm Chroni przed zarysowaniami Redukuje odbijanie światła i odciski palców Idealnie dopasowana do urządzenia Zachowuje pełną czułość dotyku 1 sztuka w zestawie Wymiary folii Podstawowym akcesorium do ochrony urządzenia, op