laczy. ℹ Kliencie! Aby cieszyć się z pełnej mocy ładowania, należy użyć ładowarki sieciowej o mocy min. 35W ze wsparciem Power Delivery, kompatybilne urządzenia znajdziesz pod tym linkiem. Kolor producenta: Black (czarny) W opakowaniu znajduje się: Ładowarka indukcyjna Tech-Protect Qi15W-A46 Kabel USB-C do USB-C o długości 1 m Stabilne mocowanie magnetyczne do wideorozmów Silne magnesy w sekcji MagSafe stabilnie przyciągają iPhonea, utrzymując go pewnie również w pozycji pionowej podczas rozmów wideo, wideokonferencji czy korzystania z FaceTime. Możliwość jednoczesnego ładowania trzech urządzeń lub zasilania ich osobno sprawia, że jedna stacja obsługuje cały ekosystem Apple, zwiększając wygodę korzystania ze smartfona, smartwatcha i słuchawek przez cały dzień. Kompaktowy design z podświetleniem Nowoczesna konstrukcja połączona z kompaktową formą pozwala tej ładowarce indukcyjnej 3w1 zajmować niewiele miejsca i pomaga utrzymać idealny porządek na biurku, szafce nocnej czy komodzie. Subtelne podświetlenie z wyborem 6 kolorów tworzy nastrojowy klimat do pracy i relaksu, delikatnie rozjaśniając otoczenie i podkreślając nowoczesny charakter stanowiska z elektroniką. Wytrzymałość ABS PC i szybkie USB-C Wytrzymała obudowa z tworzywa ABSPC oraz port USB-C przekładają się na komfortowe i długotrwałe użytkowanie zarówno z zasilaczem sieciowym, jak i powerbankiem lub komputerem. Dołączony kabel USB-C do USB-C o długości 1 m pozwala szybko podłączyć stację zaraz po wyjęciu z opakowania, dzięki czemu bezprzewodowe ładowanie smartfona, zegarka i słuchawek płynnie wpisuje się w codzienną rutynę. Specyfikacja: Wejście: 9V2A Wyjście dla telefonu: ładowanie do 15W Wyjście dla zegarka: 2.5W Wyjście dla słuchawek: 3W','','ladowarka-indukcyjna-tech-protect-qi15w-a46-3w1-qi-do-magsafe-czarna','','','','Ładowarka indukcyjna Tech-Protect Qi15W A46 3w1, Qi do MagSafe, czarna','','','',''),(112309,1,1,'Ładowarka indukcyjna Tech-Protect Qi15W-A46 Kompatybilne ze smartfonami wspierającymi MagS