óży Składane ramię oraz lekka, modularna konstrukcja sprawiają, że Tech-Protect Qi15W-A47 bez trudu mieści się w torbie lub plecaku, stając się praktyczną bazą ładującą w domu, biurze i w podróży służbowej czy wakacyjnej. Możliwość zasilania trzech urządzeń jednocześnie lub każdego z osobna pozwala elastycznie dopasować sposób korzystania z ładowarki do aktualnych potrzeb, bez konieczności zabierania wielu osobnych akcesoriów. Bezpieczeństwo ładowania dzięki USB-C Zaawansowany system ochrony monitoruje parametry pracy w czasie rzeczywistym, chroniąc podłączone urządzenia przed przegrzaniem, przepięciami i przeciążeniem prądowym nawet podczas wielogodzinnego ładowania nocą. Wejście USB-C 9V3A lub 12V2.4A w połączeniu z mocą wyjściową 15W dla smartfona, 2W dla Apple Watcha i 3W dla słuchawek zapewnia bezpieczne, stabilne i w pełni wykorzystane ładowanie całego zestawu urządzeń. Specyfikacja: Wejście: 9V3A, 12V2.4A Wyjście dla telefonu: 15W Wyjście dla zegarka: 2W Wyjście dla słuchawek: 3W Wymiary: 150 x 75 x 29.6 mm','','ladowarka-indukcyjna-skladana-tech-protect-qi15w-a47-3w1-qi-do-magsafe-czarna','','','','Ładowarka indukcyjna, składana Tech-Protect Qi15W A47 3w1, Qi do MagSafe, czarna','','','',''),(112313,1,1,'Ładowarka indukcyjna 3w1 Tech-Protect Qi15W-A47 Kompatybilne ze smartfonami wspierającymi MagSafe i ładowanie indukcyjne QiDla Apple Watch Apple AirPods Ładowanie urządzeń bezprzewodowo z Qi Tech-Protect Qi15W-A47 to kompaktowa ładowarka indukcyjna 3w1 do MagSafe, stworzona po to, aby w jednym miejscu wygodnie ładować iPhonea, Apple Watcha oraz słuchawki z Qi i raz na zawsze pozbyć się plątaniny przewodów na biurku czy szafce nocnej. Wydajne ładowanie bezprzewodowe z mocą do 15W dla smartfona oraz dedykowane strefy dla zegarka i etui słuchawek pozwalają w pełni wykorzystać potencjał szybkiego zasilania całego ekosystemu Apple przy jednoczesnym zachowaniu porządku. ℹ Kliencie! Aby cieszyć się z pełnej mocy ładowania, należy użyć ładowarki sieciowej o mocy min