m benzynowym do 7 litrów i diesle o napięciu 12V. To oznacza, że nawet większe samochody terenowe czy cięższe pojazdy nie stanowią problemu. Jump starter jest niezawodny w każdej awaryjnej sytuacji od porannego rozruchu w zimowy dzień po uruchamianie pojazdu na odludziu, gdy każda minuta ma znaczenie. To moc i skuteczność, na które zawsze możesz liczyć. Urządzenie jest kompatybilne z szeroką gamą pojazdów 12V zarówno samochodami osobowymi, terenowymi, jak i dieslami. W zestawie znajdziesz wszystkie niezbędne akcesoria: kabel rozruchowy EC8 z klemami kabel USB-C do ładowania instrukcję obsługi Konstrukcja wykonana z wytrzymałego tworzywa PC i ABS w eleganckim kolorze gwarantuje trwałość i odporność na uszkodzenia mechaniczne. Kompaktowy rozmiar pozwala na łatwe przechowywanie w samochodzie, a ponad milion cykli ładowania zapewnia niezawodność na lata. Baseus BS-CH007 to niezbędny element wyposażenia każdego kierowcy, który ceni spokój i pewność w każdej sytuacji drogowej.','','samochodowy-rozrusznik-baseus-car-jump-starter-kable-rozruchowe-usb-a-usb-c-czarny','','','','Samochodowy rozrusznik Baseus Car Jump Starter + kable rozruchowe, USB-A, USB-C, czarny','','','',''),(112730,1,1,'Odkurzacz samochodowy Baseus Powerful Suction A3 Do samochodu Odkurzacz do auta Bezprzewodowy odkurzacz samochodowy Baseus A3 to praktyczne urządzenie stworzone do szybkiego usuwania piasku, kurzu i okruchów z samochodu bez konieczności podłączania przewodu i przenoszenia ciężkiego sprzętu. Mocny silnik 80000 obrmin, siła ssania 15000Pa, moc znamionowa 135W oraz filtr HEPA przekładają się na dokładniejsze sprzątanie, oszczędność czasu i wyraźnie czystsze wnętrze auta. Kolor producenta: Black (czarny) W opakowaniu znajduje się: odkurzacz samochodowy Baseus Powerful Suction A3 Dysza 2w1 Dysza do szczelin kabel USB-A USB-C instrukcja obsługi w języku angielskim Ciche odkurzanie Dzięki czterem wysokowydajnym bateriom o pojemności 2000 mAh odkurzacz umożliwia około 17 minut intensywnego odkurzania oraz do 45 minut pracy w trybie standardowym, co pozwala komfortowo posprzątać całe auto. Cichy tryb pracy na poziomie poniżej 75dB oraz ładowanie przez port USB-C zapewniają wygodę korzystania w domu, biurze i samochodzie. Pojemny pojemnik 70 ml Smukły korpus o średnicy 56,5 mm sprawia, że wygodnie leży w dłoni, mieści się w schowku i może być zawsze pod ręką. Pojemnik na zanieczyszczenia o pojemności 70 ml można opróżnić w kilka sekund, a filtr HEPA usuwa do 99,7 mikrocząsteczek kurzu, pyłków i alergenów, co sprzyja czystszemu i zdrowszemu powietrzu w kabinie oraz pomieszczeniach. Latarka LED w odkurzaczu Inteligentne funkcje, takie jak diody LED informujące o poziomie naładowania baterii, wbudowana latarka do pracy w ciemnych miejscach, prosty panel sterowania z jednym przyciskiem oraz czujnik przepływu powietrza automatycznie zwiększający siłę ssania przy większych zabrudzeniach, czynią sprzątanie szybkim, intuicyjnym i komfortowym. Latarka uruchamiana jest łatwo - wystarczy przytrzymać przycisk zasilania przez 3 sekundy, aby oświetlić trudno dostępne zakamarki i ciemne kąty, co pozwala dokładnie sprzątać nawet w słabo oświetlonych miejscach. Specyfikacja Siła ssania: 15000Pa Wejście: 5V2,1A (maks.) Moc znamionowa: 135W Pojemność baterii: 4x 2000 mAh Moc akumulatora: 28,8 Wh Czas ładowania: 3-5h Czas działania baterii: Duża siła ssania 17 min Standardowa siła ssania 45 min Hałas 75dB Port ładowania: USB typ C','','bezprzewodowy-odkurzacz-samochodowy-z-flirtem-hepa-baseus-a3-135w-15000-pa-czarny','','','','Bezprzewodowy odkurzacz samochodowy z flirtem HEPA Baseus A3, 135W, 15000 Pa, czarny','','','',''),(112802,1,1,'Transmiter FM ładowarka samochodowa Baseus S-09 Uniwersalny (Bluetooth 2x USB-A 1x czytnik kart TF microSD) Transmiter z USB i TF Transmiter FM Baseus S-09 z Bluetooth i ładowarką samochodową 3.4A to praktyczne rozwiązanie dla osób, które chcą szybko dodać do swojego auta bezprzewodowe odtwarzanie muzyki z telefonu na radiu samochodowym i tryb głośnomówiący. W jednym, kompaktowym urządzeniu jest funkcja transmitera FM, ładowarki samochodowej z dwoma portami USB-A oraz czytnika kart TFmicroSD, co znacząco podnosi funkcjonalność codziennej jazdy. Kolor producenta: Black (czarny) Podwójne ładowanie USB Dwa porty USB o łącznej mocy 3.4A umożliwiają jednoczesne ładowanie dwóch urządzeń mobilnych bez zauważalnego spadku prędkości ładowania, dzięki czemu smartfon i tablet zawsze pozostają w gotowości do pracy. Jeden z portów działa również jako odtwarzacz muzyki z pendrivea, pozwalając słuchać ulubionych playlist bezpośrednio przez system audio samochodu bez konieczności korzystania z pamięci telefonu. Odtwarzacz kart TF microSD Czytnik kart TFmicroSD obsługujący nośniki o pojemności do 32 GB pozwala zabrać w trasę rozbudowaną bibliotekę utworów zapisanych na karcie pamięci. Obsługa popularnych formatów audio, takich jak MP3, WAV, FLAC, APE, MWA oraz innych formatów Hi-Fi, przekłada się na czysty, szczegółowy dźwięk, który uprzyjemnia codzienne dojazdy i długie podróże. Zestaw głośnomówiący Bluetooth Wbudowany moduł Bluetooth zamienia urządzenie w wygodny zestaw głośnomówiący i umożliwia jednoczesne podłączenie dwóch telefonów, co szczególnie sprawdza się przy równoczesnym korzystaniu z numeru prywatnego i służbowego. Zaawansowane przetwarzanie dźwięku, zapewnia wyraźne rozmowy pozbawione szumów i echa, a połączenia przychodzące są automatycznie kierowane z aktualnie aktywnego telefonu na ten, który właśnie dzwoni. Obracalne pokrętło i przyciski Gadżet został wyposażony w obrotowe pokrętło oraz intuicyjne przyciski, które pozwalają w prosty sposób: zmieniać częstotliwość FM*, regulować głośność, przełączać utwory, odbierać i kończyć połączenia telefoniczne. Czytelny wyświetlacz LED pokazuje aktualnie ustawioną częstotliwość oraz napięcie samochodu, ułatwiając szybkie dostrojenie radia i bieżącą kontrolę stanu układu elektrycznego pojazdu. * Podłączenie i konfiguracja 1) Znajdź w radiu samochodowym częstotliwość FM, na której nie słychać szumów. 2) Włóż transmiter do gniazda zapalniczki i ustaw jego częstotliwość na tę samą, co w radiu. 3) Po prawidłowym połączeniu radio będzie ciche, bez zakłóceń. W razie szumów zmień częstotliwość. 4) Podłącz dysk z muzyką lub sparuj transmiter z urządzeniem przez Bluetooth, aby odtwarzać muzykę lub prowadzić rozmowy bez użycia rąk. Jak dostosować częstotliwość? 1) Naciśnij pokrętło na 23 sekundy, aby wejść w tryb regulacji częstotliwości. 2) Obracaj pokrętło w prawo lub w lewo, aż wybierzesz odpowiednią częstotliwość. 3) Po odczekaniu 23 sekund ekran zamiga, sygnalizując ustawienie nowej częstotliwości. Precyzyjny odczyt napięcia Zaawansowany chipset automatycznie dopasowuje natężenie prądu do podłączonych urządzeń, zabezpieczając je przed przeładowaniem, przepięciami, przegrzaniem, prądem przetężeniowym, wyładowaniem, zwarciem oraz szkodliwym polem elektromagnetycznym. Funkcja monitorowania napięcia z precyzyjnym odczytem na wyświetlaczu pomaga szybko wychwycić niepokojące spadki poniżej 12V, co umożliwia wczesną reakcję i zmniejsza ryzyko problemów z akumulatorem oraz instalacją elektryczną samochodu. Specyfikacja Materiał obudowy: ABS PC Kompatybilność: uniwersalna (AndroidiOs) zapalniczki 12-24V USB1: 1.0A czytanie plików muzycznych USB2: 2.4A Napięcie robocze: DC12-24V Wyjście: 3.4A każde Częstotliwość nadawania FM: 88,1-107,9 MHz Odległość nadawania FM: 16ft Wersja bluetooth: 4.2 Obsługiwana pojemność dysku flashkarty TF: 32G Odtwarzane formaty audio: MP3, WAV, FLAC, APE. WMA Zasięg radiowybluetooth: 5m10m Zakres częstotliwości Bluetooth: 2402 - 2480 MHz Wbudowany mikrofon: tak Wyświetlacz LED: napięcie akumulatora częstotliwość FM W zestawie: Transmiter FM, instrukcja obsługi','','transmiter-fm-z-bluetooth-ladowarka-samochodowa-baseus-s-09-2x-usb-a-tf-microsd-czarny','','','','Transmiter FM z Bluetooth + ładowarka samochodowa, Baseus S-09, 2x USB-A, TF / microSD, czarny','','','',''),(112803,1,1,'Szkło hybrydowe prywatyzujące Bizon Glass Tab Mule Shadow Apple iPad Pro 11 M5 2025 (A3357, A3358, A3359) Szkło chroniące ekran i prywatność do iPad Pro 11 M5 2025 Kto powiedział, że szkło ochronne nie może być jednocześnie wytrzymałe, elastyczne i niedostępne dla wścibskich oczu? Poznaj Bizon Glass Tab Mule Shadow szkło, które chroni zarówno ekran, jak i Twoją prywatność. Ta elastyczna hybryda ochroni Twój wyświetlacz przed zarysowaniami i zabrudzeniami, a Ciebie przed niepowołanymi spojrzeniami. W dodatku w matowym wydaniu! Specjalna powłoka skutecznie redukuje odblaski, dzięki czemu słońce może świecić i prażyć, a Ty i tak bez problemu zobaczysz, kto do Ciebie napisał. Kolor: lekko przyciemniany Twardość szkła: 6H Grubość: 0,25 mm Odporne na zabrudzenia, zarysowania i podglądaczy Elastyczna konstrukcja nie kruszy się i nie pęka Matowe wykończenie redukujące odblaski Powłoka oleofobowa minimalizująca widoczność odcisków palców Wzmocniony filtr prywatyzujący Kąt widzenia: 28 Przepuszcza tylko 60 światła Wymiary szkła Podstawowym akcesorium do ochrony urządzenia mobilnego, oprócz szkła, jest etui. Aby upewnić się, że szkło będzie zgodne z etui, należy pamiętać, że: wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowca futerał nie może nachodzić na szybkę Wymiary szkła: 24,66 x 17,46 cm (długość szerokość) Prywatność w zasięgu wzroku Siedzisz w pociągu i znowu przyciemniasz ekran, żeby sąsiad z siedzenia obok nie czytał Twoich wiadomości? Z Tab Mule Shadow to przeszłość! Specjalna warstwa prywatyzująca* sprawia, że ekran pozostaje tylko dla Twoich oczu każdy, kto spojrzy z boku**, zobaczy no właśnie, nic. Komfort, dyskrecja i zero stresu w miejscach publicznych bo Twój ekran to Twoja sprawa! * Powłoka częściowo redukuje jasność obrazu nawet podczas patrzenia na wprost. To typowa cecha tej technologii w razie potrzeby zalecamy zwiększenie jasności ekranu. Warstwa prywatyzująca może też zakłócać działanie czytnika linii papilarnych. ** Przyciemnianie działa tylko podczas korzystania z tabletu w poziomie. Zdjęcie poglądowe, obrazujące działanie filtra prywatyzującego Czysty ekran Znasz ten moment, gdy patrzysz na ekran i widzisz tylko swoje odciski palców? To zdjęcie mówi wszystko. Po prawej klasyka, którą zna każdy użytkownik tabletu. Po lewej szkło z powłoką matową oraz oleofobową, które zmienia zasady gry. Bez smug i odblasków, tylko czysty obraz i satysfakcja z użytkowania. To zmiana, którą łatwo zauważyć i trudno się bez niej obejść. Zdjęcie poglądowe, obrazujące porównanie efektu szkła matowego i standardowego Twardziel, który nie pęka Choć Tab Mule Shadow jest ultracienkie tylko 0,25 mm, jego twardość 6H daje prawdziwą ochronę przed zarysowaniami. Elastyczne szkło nie pęka i nie kruszy się, dzięki czemu nawet w przypadku upadku ekran pozostaje bezpieczny. Cienkie, lekkie i wytrzymałe to hybryda, która nie idzie na kompromisy. Zdjęcie poglądowe, obrazujące grubość szkła Perfekcyjne od krawędzi do krawędzi Szkło pokrywa płaską część ekranu, a dzięki idealnemu wycięciu zapewnia pełną i precyzyjną ochronę. Nie odstaje, nie haczy i pozwala na komfortowe korzystanie z niemal każdego etui. Jak zamontować szkło? Prosto! Zanim szkło wyląduje na Twoim ekranie, upewnij się, że szkło jest przeznaczone do Twojego modelu tabletu to gwarancja bezproblemowego montażu i pełnej ochrony. Przygotuj czyste, dobrze oświetlone miejsce i do dzieła! Oczyść ekran wilgotną ściereczkąUsuń tłuste plamy, smugi i większe zabrudzenia, przecierając ekran mokrą ściereczką. Wytrzyj ekran mikrofibrąDokładnie przetrzyj ekran suchą ściereczką z mikrofibry, tak aby powierzchnia była idealnie sucha i gładka. Usuń kurz i pyłkiChwyć okrągłą naklejkę (Dust Absorber) i przyklejaj ją punktowo w miejscach, gdzie pojawiły się pyłki. Nałóż szkłoZdejmij folię ochronną oznaczoną numerem 1 i przyłóż szkło do ekranu. Wyrównaj pozycję możesz skorzystać z naklejek ułatwiających pozycjonowanie. Dociśnij szkłoDelikatnie naciśnij na środek szkła, aby szybka mogła się równomiernie przykleić do wyświetlacza. Wygładź powierzchnięUżywając ściereczki z mikrofibry, wypchnij ewentualne pęcherzyki powietrza w kierunku najbliższej krawędzi. Na koniec pociągnij za naklejkę numer 2, aby odkleić górną warstwę ochronną. Misja zakończona szkło na miejscu, ekran w pełni zabezpieczony! Ekologiczne opakowanie Bizon Glass Tab Mule Shadow, oprócz 1 sztuki szkła hybrydowego, zawiera również: mokrą ściereczkę suchą ściereczkę z mikrofibry okrągłą naklejkę do usuwania drobinek i kurzu (Dust Absorber) 3 naklejki pozycjonujące Bizon dba o łosie, jelenie, sarny, dziki, lisy, borsuki, kuny, jenoty, wilki, rysie, a z ptaków kuropatwy, bażanty, dzikie kaczki, gęsi, łyski, bekasy i cietrzewie, dlatego zestaw przybędzie do Ciebie w ekologicznym opakowaniu, w którym zastosowano jedynie śladowe ilości plastiku!','','prywatyzujace-szklo-hybrydowe-bizon-glass-tab-mule-shadow-do-ipad-pro-11-m5-2025-matowe','','','','Prywatyzujące szkło hybrydowe Bizon Glass Tab Mule Shadow do iPad Pro 11\" M5 2025, matowe','','','',''),(112804,1,1,'Szkło hybrydowe prywatyzujące Bizon Glass Tab Mule Shadow Apple iPad Pro 13 M5 2025 (A3360, A3361, A3362) Szkło chroniące ekran i prywatność do iPad Pro 13 M5 2025 Kto powiedział, że szkło ochronne nie może być jednocześnie wytrzymałe, elastyczne i niedostępne dla wścibskich oczu? Poznaj Bizon Glass Tab Mule Shadow szkło, które chroni zarówno ekran, jak i Twoją prywatność. Ta elastyczna hybryda ochroni Twój wyświetlacz przed zarysowaniami i zabrudzeniami, a Ciebie przed niepowołanymi spojrzeniami. W dodatku w matowym wydaniu! Specjalna powłoka skutecznie redukuje odblaski, dzięki czemu słońce może świecić i prażyć, a Ty i tak bez problemu zobaczysz, kto do Ciebie napisał. Kolor: lekko przyciemniany Twardość szkła: 6H Grubość: 0,25 mm Odporne na zabrudzenia, zarysowania i podglądaczy Elastyczna konstrukcja nie kruszy się i nie pęka Matowe wykończenie redukujące odblaski Powłoka oleofobowa minimalizująca widoczność odcisków palców Wzmocniony filtr prywatyzujący Kąt widzeni