Shadow do iPad Pro 13\" M5 2025, matowe','','','',''),(112808,1,1,'Etui Spigen Liquid Air Folio Apple iPad Pro 13 M5 2025 (A3360, A3361, A3362)Apple iPad Pro 13 M4 2024 (A2925, A2926, A3007) Klasyczna elegancja Smukłe etui z klapką od marki Spigen z serii Liquid Air Folio, wykonane z połączenia wysokiej jakości miękkiego termoplastycznego poliuretanu oraz trwałego poliwęglanu, z imitacją skórzanego wykończenia PU. Wnętrze klapki posiada wyściółkę, która dodatkowo chroni ekran dotykowy przed zarysowaniami. To hybrydowy pokrowiec zapewniający dobry chwyt oraz ochronę w codziennym użytkowaniu. Kolor producenta: Black (czarny) Etui kompatybilne ze szkłami o wymiarach mniejszych niż (długość x szerokość): 28,14 x 21,37 cm Hybrydowe etui z klapką Nowoczesne etui Liquid Air Folio z klapką, zachowujące smukły profil urządzenia. Zapewnia doskonałą ochronę przed zarysowaniami w codziennym użytkowaniu. Futerał został wykończony eleganckim, drobnym wzorkiem imitującym skórzaną fakturę, który dodaje stylowego wyglądu oraz minimalizuje pozostawianie odcisków palców na jego powierzchni. Doskonale dopasowane Dobrze leży w dłoni, a lekko wystające krawędzie chronią kamerę i ekran przed zarysowaniami na płaskich powierzchniach. Funkcjonalna klapka umożliwia wybudzanie i usypianie urządzenia podczas jej otwierania i zamykania. Wnętrze klapki jest miękkie i delikatne, co stanowi dodatkowe zabezpieczenie dla ekranu. Pełna funkcjonalność Spigen Liquid Air Folio zapewnia swobodny dostęp do wszystkich interfejsów urządzenia. Niezwykle funkcjonalne i wygodne w użytkowaniu. Posiada wygodne wycięcia na porty i osłony na przyciski. Futerał jest lekki i cienki, stanowi świetną ochronę przed zabrudzeniami oraz zarysowaniami. posiada także wycięcie w miejscu mocowania magnetycznego na rysik Apple Ustawienie poziome Niezależnie od tego czy czytasz, piszesz lub oglądasz swój ulubiony film - dzięki składanej klapce stanowiącej jednocześnie podpórkę możesz to robić jeszcze lepiej i wygodniej. Dzięki klapce składanej w trzech miejscach posłuży ona jako Stand, pozwalając ustawić tablet pod kątem płaskim dla wygodnego pisania, lub pod kątem bardziej wysokim, doskonałego dla przeglądania multimediów.','','etui-spigen-liquid-air-folio-do-ipad-pro-13-2025-2024-czarne','','','','Etui Spigen Liquid Air Folio do iPad Pro 13 2025/2024, czarne','','','',''),(112834,1,1,'Etui Bizon Case Salpa 2 szt. folii na ekran Bizon Glass HydrogelVivo X300 ProPełna ochrona dla Vivo X300 ProMówi się, że szczęścia chodzą parami. A w przypadku Clear Pack tercetami.Zestaw ochronny od marki Bizon z serii Clear Pack ochroni Twojego smartfona i przyjmie na klatę (oraz plecy) codzienne przeciwności losu, takie jak niespodziewane zarysowania spowodowane przez walkę kluczy z telefonem w plecaku czy niezdarne zachlapania porannymi kropelkami kawy, kiedy jeszcze nie zdążyłeś się do końca obudzić.W skład zestawu wchodzą w pełni kompatybilne ze sobą produkty:1 sztuka etui Bizon Case Salpa2 sztuki folii ochronnej na wyświetlacz Bizon Glass Hydrogel FrontCzystość i wysoka odporność na uszkodzeniaNie chcesz zasłaniać oryginalnego wyglądu smartfona oraz jego koloru, który tak długo i namiętnie wybierałeś w sklepie?Bizon Case Salpa to przezroczysta, elastyczna obudowa z TPU, która dzięki wzmocnionym narożnikom i delikatnie wysuniętym nad ekran krawędziom stanowi doskonałą ochronę przed zarysowaniami i zabrudzeniami. Kropkowana struktura etui zapobiega efektowi mokrej plamy, czyli przyklejaniu się smartfona do obudowy.Kolor producenta: Clear (przezroczysty)Czułość dotyku ułatwiająca użytkowanieBoisz się, że po aplikacji folii, smartfon zacznie sam wysyłać nieprzyzwoite SMS-y do szefa, a Twój palec zostanie dodany do bazy osób nieupoważnionych do korzystania z telefonu?Tak jest tylko na filmach. A Bizon Glass Hydrogel Front, oprócz ultracienkiej grubości 0,15 mm, zachowuje pełną czułość dotyku! Za sprawą powłoki oleofobowej, która redukuje ilość pozostawianych smug i odcisków palców, nie będziesz musiał maniakalnie wycierać co chwilę ekranu, a dzięki wysokiej przejrzystości folii nie umknie Ci żaden szczegół na zdjęciu, nawet taki, którego być może nie chcesz widzieć...Wisienką na torcie jest magiczna powłoka Self-Heal, która sama naprawi drobne rysy czy powstałe po instalacji pęcherzyki powietrza.Z dbałością o środowiskoBizon Case Clear Pack, oprócz 1 sztuki etui i 2 sztuk folii hydrożelowej na wyświetlacz, zawiera również 1 mokrą ściereczkę, 1 suchą ściereczkę z mikrofibry, Dust Absorbera i 3 naklejki pozycjonujące.Bizon dba o łosie, jelenie, sarny, dziki, lisy, borsuki, kuny, jenoty, wilki, rysie, a z ptaków kuropatwy, bażanty, dzikie kaczki, gęsi, łyski, bekasy i cietrzewie, dlatego zestaw przybędzie do Ciebie w ekologicznym opakowaniu, w którym zastosowano jedynie śladowe ilości plastiku!Pakujemy w ekologiczne opakowania!','','elastyczne-etui-2x-folia-na-ekran-bizon-case-clear-pack-do-vivo-x300-pro','','','','Elastyczne etui + 2x folia na ekran Bizon Case Clear Pack do Vivo X300 Pro','','','',''),(112860,1,1,'Uchwyt samochodowy iOttie Easy One Touch 6 Air Vent Flush Do kratki nawiewu i deski rozdzielczej Uniwersalny dla urządzeń o szerokości 58 - 89 mm Regulowany uchwyt na smartfona do auta Uchwyt samochodowy na telefon iOttie Easy One Touch 6 Air Vent Flush umożliwia kierowcy wygodne korzystanie ze smartfona podczas jazdy, zwiększając komfort obsługi nawigacji i połączeń bez odrywania uwagi od drogi. Innowacyjny mechanizm zaciskowy Easy One Touch pozwala zamocować lub zwolnić telefon jednym ruchem, a regulowana dolna stopka stabilizująca i uniwersalna konstrukcja sprawiają, że uchwyt pasuje do większości nowoczesnych smartfonów o szerokości od 5,80 do 8,90 cm. Kolor producenta: Black (czarny) W opakowaniu znajduje się: Uchwyt samochodowy iOttie Easy One Touch 6 Air Vent Flush Adapter samoprzylepny do montażu uchwytu na desce rozdzielczej Stabilność telefonu w pionie i poziomie na każdej trasie Stabilizująca stopka z samopoziomującymi się ramionami utrzymuje urządzenie w stałej pozycji nawet na nierównych trasach, dzięki czemu ekran pozostaje stabilny i czytelny. Cztery poziomy regulacji wysokości dolnej stopki umożliwiają precyzyjne ustawienie telefonu w pionie lub poziomie, zapewniając swobodny dostęp do portów ładowania, bocznych przycisków i funkcji nawigacyjnych. Poznaj zalety uchwytu iOttie Uchwyty marki iOttie to jedne z najlepiej sprzedających się uchwytów na rynku, spełniające oczekiwania wielu osób. Obejrzyj poniższy film i przekonaj się, dlaczego! Uniwersalny montaż uchwytu w kratce nawiewu i na desce rozdzielczej System montażu do kratki nawiewu pozwala solidnie zamocować uchwyt zarówno na poziomych, jak i pionowych kratkach wentylacyjnych, co zwiększa elastyczność instalacji w różnych modelach samochodów. Obrotowe podparcie zapobiega zsuwaniu się mocowania w dół, a możliwość obrotu o 360, pochylenia i ustawienia telefonu w pionie lub poziomie poprawia wygodę korzystania z nawigacji, zestawu głośnomówiącego oraz aplikacji multimedialnych. Dołączony adapter samoprzylepny pozwala zamontować uchwyt także na desce rozdzielczej samochodu. Organizer przewodów i estetyczna konsola Zintegrowany, obrotowy organizer przewodów w uchwycie z elastycznego, gumowego tworzywa umożliwia uporządkowane poprowadzenie kabla o dowolnym rozmiarze lub kształcie do ładowania smartfona, co pomaga zachować estetyczny porządek w aucie. Nowoczesny design i staranne wykończenie sprawiają, że uchwyt iOttie harmonijnie komponuje się z kokpitem samochodu, oferując codzienny komfort obsługi smartfona bez plączących się kabli i przypadkowo przesuwającego się urządzenia.','','uchwyt-samochodowy-do-kratki-nawiewu-deski-rozdzielczej-iottie-easy-one-touch-6-air-vent-flush-czarny','','','','Uchwyt samochodowy do kratki nawiewu / deski rozdzielczej iOttie Easy One Touch 6 Air Vent & Flush, czarny','','','',''),(112962,1,1,'Uchwyt samochodowy iOttie Easy One Touch 6 Dash Windshield Na szybę i deskę rozdzielczą Uniwersalny dla urządzeń o szerokości 58 -