onalności produktu. Stabilność dzięki MagSafe Fotografuj bez obaw o sprzęt z 3mk HARDY MagSelfie Stick! Dzięki pełnej kompatybilności z technologią MagSafe, wystarczy przyłożyć smartfona i już jesteś gotów do działania. Potężne magnesy utrzymują urządzenie stabilnie w jednej pozycji, nawet w trudnych warunkach terenowych. To gwarancja, że każde zdjęcie i film wyjdą fantastycznie, a Twój smartfon będzie bezpiecznie zamocowany. Zapomnij o przypadkowych spotkaniach Twojego telefonu z betonem i skup się na tworzeniu niezapomnianych kadrów! Pracuj z każdym smartfonem Masz smartfon bez MagSafe? Żaden problem! Ten selfie stick jest wyposażony w specjalną silikonową nakładkę, która pozwala na zamocowanie dowolnego telefonu. To wszechstronne narzędzie współpracuje z modelami o rozmiarze od 6,1 cala i systemach iOS lub Android. Niezależnie od tego, jaki masz telefon, MagSelfie Stick zawsze sprosta Twoim oczekiwaniom, zapewniając stabilność i komfort użytkowania. Doświadcz prawdziwej wolności Z tym uchwytem możesz cieszyć się pełną swobodą tworzenia! Pilot Bluetooth o zasięgu 10 metrów pozwala na zdalne robienie zdjęć i nagrywanie filmów. Regulowane ramię teleskopowe, które rozciąga się do 72 cm, umożliwia eksperymentowanie z różnymi ujęciami. Niezależnie od wysokości, Twój smartfon pozostanie stabilnie zamocowany, a obrotowa głowica pozwala na robienie zdjęć w pionie lub poziomie dokładnie tak, jak chcesz. Używaj jako mobilnego statywu 3mk Hardy MagSelfie Stick to nie tylko kijek do selfie to również przenośny statyw, idealny do biura i w podróży. Kilka prostych ruchów i kompaktowa konstrukcja zmienia się w stabilny statyw o trójnożnej podstawie. Korzystaj z obu funkcji według potrzeb, nie martwiąc się o uszkodzenia. Wykonany z trwałych materiałów, takich jak ABS, PC i aluminium, MagSelfie Stick to gwarancja jakości premium od marki 3mk Hardy. Specyfikacja: Materiał: ABS PC aluminium Łączność Bluetooth: do 10m Bateria do pilota: CR1632 Długość: maks. 72cm Kompatybilność: iOS 