enia poliwęglanu i TPU ochrona w prawdziwym stylu. Obroni Twojego MacBooka przed codziennymi przeciwnościami losu, takimi jak straszne ostre klucze i zminimalizuje przykre skutki działania grawitacji. Kolor producenta: Ice (przezroczyste z strukturą w plastry miodu) Królowa etui Niczym yin i yang, obudowa Essential Armor balansuje między subtelnym, a pancernym designem. Półprzezroczyste plecki przywodzące na myśl plaster miodu nie zasłaniają ikonicznego jabłuszka, tworzą mocną skorupę dla Twojego MacBooka. Mimo to etui jest tak lekkie, że prawdopodobnie zapomnisz o tym, że je w ogóle założyłeś na laptopa. Instalacja na klik-klik Założenie obudowy UAG na MacBooka jest równie proste, co założenie koszuli. Wystarczy włożyć urządzenie do konstrukcji i zatrzasnąć. Pokrowiec mocno przylega do laptopa, natomiast o swobodny przepływ powietrza, a nie tropiki w środku etui, dbają otwory wentylacyjne. Zawias łączący dwie strony pokrowca jest elastyczny, dzięki czemu otwieranie i zamykanie odbędzie się bez żadnych trzasków i innych świdrujących dźwięków.','','etui-pancerne-uag-urban-armor-gear-essential-armor-do-macbook-pro-162021-2025-przezroczyste','','','','Etui pancerne UAG Urban Armor Gear Essential Armor do MacBook Pro 16\"(2021-2025) , przezroczyste','','','',''),(117383,1,1,'Jump starter i powerbank Baseus Super Energy Ultra Pojazdy z silnikiem benzynowym diesla o napięciu 12V Pewny rozruch akumulatora nawet zimą Baseus Super Energy Ultra to zaawansowany jump starter z funkcją powerbanku 26800mAh, stworzony po to, aby samodzielnie i bez stresu uruchomić samochód z instalacją 12V nawet w skrajnie niesprzyjających warunkach pogodowych. Natężenie szczytowe 3000A, prąd rozruchowy 1000A oraz zakres pracy od -20C do 60C przekładają się na pewny awaryjny rozruch akumulatora nawet kilkadziesiąt razy po jednym pełnym naładowaniu, co realnie podnosi poziom bezpieczeństwa podczas codziennej jazdy i długich tras. Kolor producenta: Black (czarny) W opakowaniu znajduje się: Jump starter powerbank Baseus Super Energy Ultra Przewody rozruchowe Kabel USB-C Pokrowiec etui Instrukcja Mobilne centrum energii z USB-C 100W Pojemność 26800mAh 99.2Wh oraz sprawność konwersji energii na poziomie co najmniej 75 pozwalają wygodnie wykorzystać urządzenie jako mocny powerbank do zasilania elektroniki w podróży. Port USB-C z obsługą zasilania wejściowego i wyjściowego do 100W, złącza USB-A 5V3A oraz wyjście DC2 12V10A oferują szybkie ładowanie laptopów, lodówek samochodowych i sprzętu turystycznego, dzięki czemu Baseus Super Energy Ultra pełni rolę mobilnego centrum energii na kempingu, parkingu i w trakcie dłuższych wyjazdów. Wielopoziomowa ochrona rozruchu i baterii Inteligentny zacisk z wielopoziomowym systemem ochrony przed odwrotną polaryzacją, przepięciem, przeciążeniem i przegrzaniem dba o stabilne warunki rozruchu pojazdu. Z kolei tryb niskiego zużycia energii, automatyczne wyłączanie po 1 minucie bezczynności oraz możliwość wygodnego doładowywania co 3 miesiące pomagają utrzymać optymalny poziom naładowania baterii, aby urządzenie było zawsze gotowe do użycia w sytuacji awaryjnej. Szerokie zastosowanie i bezpieczeństwo w podróży Kompaktowa obudowa z tworzyw ABS i PC o masie 1,2 kg skrywa dodatkowe funkcje, takie jak wbudowana dioda LED, kompas oraz praktyczna skórzana zawieszka, co znacząco ułatwia korzystanie z jump startera po zmroku i w terenie. Zgodna z międzynarodowymi przepisami lotniczymi pojemność 26800mAh umożliwia zabranie Baseus Super Energy Ultra na pokład samolotu, czyniąc go wszechstronnym i niezawodnym towarzyszem podróży dla kierowców ceniących niezależność oraz pełne przygotowanie na nieprzewidziane zdarzenia.','','samochodowy-rozrusznik-baseus-super-energy-ultra-car-jump-starter-o-natezeniu-szczytowym-3000a-z-powerbankiem-26800-ma-czarny','','','','Samochodowy rozrusznik Baseus Super Energy Ultra Car Jump Starter o natężeniu szczytowym 3000A z powerbankiem 26800 mA, czarny','','','',''),(117387,1,1,'Booster rozruchowy Baseus Power Starter Pojazdy z silnikiem benzynowym diesla o napięciu 12V Przenośny booster zapewnia samodzielny rozruch Jumpstarter Baseus Power Starter to przenośny booster rozruchowy, który pozwala samodzielnie uruchomić samochód z instalacją 12V, gdy akumulator rozładuje się na parkingu, pod domem lub w trasie. Prąd szczytowy 1000A, prąd rozruchowy 500A oraz pojemność 10000mAh dają nawet do 50 prób rozruchu, co zapewnia kierowcy niezależność od pomocy drogowej i szybki powrót na drogę w sytuacjach awaryjnych. Kolor producenta: Black (czarny) W opakowaniu znajduje się: Booster starter samochodowy Baseus Power Starter Kable rozruchowe (krokodylki) Kabel USB-C Instrukcja Duża pojemność gwarantuje zapas energii Pojemność 10000mAh przy napięciu 3,7V i energii 37Wh oznacza solidny zapas energii, który możesz stale trzymać w aucie jako zabezpieczenie na wypadek problemów z akumulatorem. Ogniwa litowo polimerowe zachowują pełną sprawność w zakresie od -20C do 60C, dzięki czemu Baseus Power Starter działa stabilnie zarówno podczas zimowych mrozów, jak i letnich upałów. USB-C łączy funkcje jump startera i powerbanku Wejście 5V2,4A umożliwia sprawne doładowanie urządzenia, a wyjście USB-C 5V2,4A pozwala korzystać z niego jak z praktycznego powerbanku do telefonu, nawigacji czy innych akcesoriów mobilnych. W efekcie jeden kompaktowy jump starter łączy funkcję rozrusznika i magazynu energii, ograniczając liczbę osobnych urządzeń, które trzeba zabierać w podróż. Kompaktowa konstrukcja z antypoślizgową obudową Konstrukcja o masie 470 g i kompaktowych wymiarach bez trudu mieści się w schowku, kieszeni drzwi lub torbie narzędziowej, a antypoślizgowe wykończenie obudowy ułatwia pewne trzymanie podczas podłączania przewodów do akumulatora. Dołączone kable krokodylkowe dopasowane do akumulatorów 12V sprawiają, że przygotowanie do rozruchu jest szybkie i zrozumiałe nawet dla osób, które pierwszy raz sięgają po urządzenie rozruchowe. Zaawansowany system zabezpieczeń chroni urządzenie Rozbudowany, 9