cowanie w podróży Wbudowany długopis wieczny z miękkim, wymiennym wkładem ołówkowym sprawia, że wkrętak HOTO pełni również rolę praktycznego narzędzia do codziennego pisania, szkicowania i sporządzania szybkich notatek. Jedno kompaktowe akcesorium zastępuje osobny wkrętak i długopis, co pozwala ograniczyć liczbę przedmiotów w torbie czy kieszeni i mieć zawsze pod ręką rozwiązanie zarówno do pracy, jak i do spontanicznych napraw. Magnetyczny schowek na bity i trwałość CNC Magnetyczny, ukryty schowek na bity w rękojeści wkrętaka precyzyjnego HOTO ułatwia porządkowanie końcówek i skraca czas potrzebny na ich wymianę, jednocześnie chroniąc je przed przypadkowym zgubieniem. Konstrukcja obrabiana w technologii CNC, stal stopowa S2 o twardości 60HRC i wieloetapowo anodowane aluminium zwiększają odporność na zużycie i rdzę oraz nadają wkrętakowi 5 w 1 nowoczesny charakter, dzięki czemu narzędzie świetnie sprawdza się jako codzienny towarzysz w domu, w pracy i podczas wyjazdów.','','wkretak-precyzyjny-hoto-qwlsd013-kieszonkowy-5-w-1-z-funkcja-dlugopisu-czarny','','','','Wkrętak precyzyjny HOTO QWLSD013, kieszonkowy, 5 w 1 z funkcją długopisu, czarny','','','',''),(117675,1,1,'Wkrętak precyzyjny 5 w 1 HOTO QWLSD013 Uniwersalny Kieszonkowe narzędzie do dokręcania, odkręcania i pisania Wkrętak precyzyjny i długopis wieczny 5 w 1 HOTO QWLSD013 to kompaktowe narzędzie, które pozwala jednocześnie pisać i wykonywać szybkie naprawy, dzięki czemu nie trzeba wybierać między funkcjonalnością a poręcznością. Korpus z aluminium klasy lotniczej, bity ze stali S2 o twardości 60HRC oraz maksymalny ręczny moment obrotowy 1Nm sprawiają, że to kieszonkowe akcesorium typu 5 w 1 staje się niezawodnym wsparciem przy codziennych zadaniach serwisowych i notatkach. Kolor producenta: Silver (srebrny) W opakowaniu znajdują się: 1x Wkrętak precyzyjny HOTO QWLSD013 1x końcówka piórkowa 2x podwójne głowice (PH0, PH00, PH1, SL1.5) Smukły wkrętak z precyzyjnymi końcówkami Kieszonkowe narzędzie HOTO wykorzy