QWLSD013, kieszonkowy, 5 w 1 z funkcją długopisu, pomaranczowy','','','',''),(117702,1,1,'Produkt oficjalnie licencjonowany przez PlayStation Kontroler mobilny Backbone One PlayStation Edition Kompatybilne z telefonami Apple z serii iPhone 14 i starszych, wyposażonych w port Lightning Mobilna konsola dla Twojego iPhone dzięki MFi Backbone One PlayStation Edition to kontroler do telefonów iPhone z portem Lightning, który zamienia smartfon w mobilną konsolę stworzoną do PS Remote Play, grania w chmurze i tytułów z App Store, oferując konsolową precyzję sterowania zawsze pod ręką. Konstrukcja inspirowana kontrolerem PS5 DualSense łączy znajome rozmieszczenie przycisków z komfortowym chwytem, dzięki czemu od pierwszej sekundy można skupić się wyłącznie na rozgrywce, a certyfikat MFi zapewnia pełną kompatybilność z telefonami od Apple. Dedykowana aplikacja Backbone porządkuje gry i usługi streamingowe, tworząc spójne centrum rozrywki. Kolor producenta: White (bialy) W opakowaniu znajduje się: Kontroler do iPhone Backbone One PlayStation Edition Adaptery magnetyczne Instrukcja Niezawodne mocowanie z adapterami magnetycznymi Druga generacja Backbone One wykorzystuje dwa zestawy magnetycznych adapterów, które stabilizują iPhone w uchwycie i eliminują niepożądane luzy nawet przy gwałtownych ruchach. Dzięki temu kontroler pozostaje pewnie zamocowany, a intensywna rozgrywka akcji, wyścigów czy bijatyk przebiega bez rozpraszających przesunięć urządzenia. Kompatybilne z: Grami z App Store Apple Arcade PS Remote Play GeForce NOW Amazon Luna Xbox Game Pass Błyskawiczne reakcje dzięki precyzyjnemu krzyżakowi Przeprojektowany, bardzo responsywny D-pad zwiększa dokładność sterowania w grach wymagających błyskawicznych reakcji, takich jak platformówki, tytuły akcji oraz klasyczne bijatyki. Każde wciśnięcie krzyżaka jest odczytywane z wysoką precyzją, co pozwala lepiej kontrolować ruchy postaci, łączyć kombinacje ciosów i precyzyjnie pokonywać trudne sekcje poziomów. Uniwersalne granie z wieloma platformami Kontroler Backbone One PlayStation Edition współpracuje z usługami GeForce NOW, Xbox Game Pass, Apple Arcade, Amazon Luna, PS Remote Play oraz grami z App Store, tworząc uniwersalną platformę do grania w tytuły z PS4, PS5 i PC na ekranie iPhone. W praktyce wystarczy umieścić smartfon w uchwycie, aby w kilka sekund przejść od zwykłego przeglądania do płynnej rozgrywki w niemal dowolnym miejscu, z wrażeniami zbliżonymi do domowej konsoli. Ładowanie Lightning i port minijack 3,5mm Złącze Lightning z funkcją Pass Through Charging pozwala jednocześnie ładować telefon i grać, co rozwiązuje problem szybkiego spadku poziomu baterii podczas długich sesji w chmurze i korzystania z PS Remote Play. Port 3,5mm na słuchawki z mikrofonem daje możliwość podłączenia ulubionego zestawu przewodowego, zapewniając czysty dźwięk i wyraźną komunikację głosową w grach sieciowych bez konieczności stosowania dodatkowych przejściówek.','','kontroler-do-mobilnego-grania-backbone-one-playstation-edition-lightning-bialy','','','','Kontroler do mobilnego grania Backbone One PlayStation Edition, Lightning, biały','','','',''),(117705,1,1,'Ładowarka samochodowa Allity ACC-100 USB-A USB-C 30W Uniwersalna 1x USB-C PD 1x USB-A QC Ładowarka do nowoczesnych samochodów Ładowarka samochodowa Allity wyróżnia się doskonałymi parametrami i eleganckim designem. Dzięki tej ładowarce nawet w czasie niedługiej przejażdżki możesz uzupełnić poziom energii, aby telefon służył Ci przez dalszą część dnia. Niewielki rozmiar i minimalistyczny design wtapiają się we wnętrze samochodu, stanowiąc dyskretne źródło zasilania. W zestawie: ładowarka, instrukcja obsługi Kolor producenta: Black (czarny) Szybkie ładowanie w aucie Ładowarka samochodowa z Quick Charge i Power Delivery pozwala osiągnąć szybkie ładowanie na większości dostępnych smartfonów. Duża moc 30W sprawdza się również w przypadku większych urządzeń takich jak tablety. Ekspresowe ładowanie w drodze z wydajnością, równą ładowaniu sieciowemu. Dwa porty ładowania Ładowarka samochodowa z USB typu C i USB daje szeroką kompatybilność z ładowanymi urządzeniami. Nie tylko ładujesz nią dwa urządzenia na raz, kiedy masz taką potrzebę, ale też używasz jej do różnego rodzaju sprzętów. Najnowszy smartfon, klasyczny telefon, nawigacja, słuchawki, tablet i wiele innych akcesoriów mobilnych zasilonych z jednej ładowarki do gniazda zapalniczki. Energia i ochrona Systemy zabezpieczeń stosowane w ładowarce przyczyniają się do jej ochrony, ale co najważniejsze chronią ładowane urządzenia. Ochrona przed przegrzaniem, przepięciem, czy zwarciem pozwala zadbać o żywotność baterii i ładowanie bez obaw o jej uszkodzenie. Dane techniczne: Maksymalna moc: 30W Wejście: 12-24V Wyjście USB-A: 5V3A (15W), 9V3A (27W), 12V2,5A (30W) Wyjście USB-C: 5V3A (15W), 9V3A (27W), 12V2,5A (30W) Wyjście USB-A USB-C: 5V3A (15W) Złącza: Gniazdo zapalniczki samochodowej, USB-A (żeński), USB-C (żeński) Standard szybkiego ładowania: PD QC (Power Delivery oraz QuickCharge) Wymiary produktu: 45 x 23 x 25 mm','','ladowarka-samochodowa-allity-acc-100-30wac-1x-usb-c-1x-usb-a-30w-czarna','','','','Ładowarka samochodowa Allity ACC-100-30WAC 1x USB-C / 1x USB-A 30W, czarna','','','',''),(117712,1,1,'Uchwyt samochodowy Allity ACH-200 MS magnetyczny Uniwersalny kompatybilny z MagSafe na szybę - kokpit Pewne mocowanie Uchwyt samochodowy z przyssawką do montażu daje łatwość i bezinwazyjność mocowania. Wystarczy nacisnąć klips do przyssawki, a ta mocno przywiera do powierzchni. Telefon jest stabilnie utrzymany na swoim miejscu, zarówno dzięki mocnej przyssawce, jak i dzięki mocnemu magnesowi odpowiedzialnemu za przyleganie urządzenia. W zestawie: uchwyt samochodowy, zestaw blaszek, instrukcja obsługi Kolor producenta: Black (czarny) Moc kompatybilności z MagSafe Uchwyt jest kompatybilny z MagSafe, co docenią posiadacze telefonów Apple iPhone oraz wybranych Samsungów, które również mają wbudowany magnes. Jednak to nie rozwiązanie dla wybranych, a dla wszystkich. Dodany zestaw blaszek pozwala zaadaptować każdy telefon do zamontowania na naszym uchwycie. Pełnia wszechstronności Uchwyt na telefon do samochodu z magnesem świetnie się sprawdzi dla użytkowników telefonów o nietypowych rozmiarach. Brak ramion - to brak ograniczenia wielkości telefonu. To także swoboda wyboru orientacji ekranu telefonu podczas jazdy. Elastyczny pałąk pozwala idealnie dopasować kąt nachylenia do samochodu i preferencji kierowcy. Maksymalnie elegancki Nowoczesne samochody wyróżniają się minimalistycznym wykończeniem wnętrza. Aby sprostać oczekiwaniom użytkowników nasz uchwyt wpisuje się w te trendy. Prosta forma, dobrej jakości materiały i funkcjonalność na najwyższym poziomie tworzą produkt, który doskonale prezentuje się w każdym aucie. Dane techniczne: Miejsce montażu: Szyba, Kokpit Mocowanie: Przyssawka Kompatybilny: MagSafe Uniwersalny Wymiary produktu: 42 x 72 x 220 mm','','uchwyt-samochodowy-na-szybe-kokpit-allity-ach-200-magsafe-czarny','','','','Uchwyt samochodowy na szybę / kokpit, Allity ACH-200 MagSafe, czarny','','','',''),(117728,1,1,'ℹ Produkt pochodzi z outletu!Na aukcji kupujesz produkt, który nie kwalifikuje się do sprzedaży jako pełnowartościowy z powodu uszkodzonego lub rozpakowanego opakowania, dlatego oferujemy go w obniżonej cenie!Każdy produkt jest sprawdzony i w pełni sprawny, posiada pełną gwarancję producenta oraz wsparcie techniczne sklepu.OUT_2512090019Uchwyt samochodowy FIXED Tab XL Uniwersalny dla urządzeń między 7 - 11 Dla tabletów i telefonów Uniwersalny uchwyt na telefon tablet Tab XL od firmy Fixed, który pozwala na montaż na desce rozdzielczej lub szybie samochodowej za pomocą wielorazowej przyssawki. Obrotowy przegub 360 pozwoli na komfortowe ułożenie uchwytu wraz z urządzeniem. Rodzaj trzymania urządzenia: zakres zacisku 12,5 cm - 20,5 cm, dla urządzeń między 7, a 11 Wymiary: 13 x 9,5 x 16 cm * Jeśli deska rozdzielcza jest powlekana o skórzanej lub nieregularnej powierzchni albo jest zakrzywiona, wtedy zaleca się montaż na szybie. Kolor producenta: Black (czarny) Gumowe wykończenie Gumowe wykończenia znajdujące się w wewnętrznej części uchwytu zmniejszają ryzyko wypadnięcia urządzenia podczas jazdy na wyboistych drogach, a także niwelują możliwość porysowania się czy uszkodzenia boków i plecków urządzenia. Klipy mocujące pozwolą na stabilne i silne trzymanie urządzenia. Rozkładają się w zakresie od 12,5 cm do 20,5 cm i z łatwością utrzymują tablety telefony o przekątnej od 7 do 11 cali. Teleskopowe ramię Uchwyt posiada regulowane, teleskopowe ramię, które może posiadać max. długość do 17 cm i świetnie sprawdzi się w samochodach MPV, vanach i wszystkich samochodach ciężarowych, w których przednia szyba i deska rozdzielcza znajdują się w większej odległości od kierowcy. Ruchoma głowica Ruchoma głowica, na której umieszczony zostaje uchwyt pozawala na swobodny obrót uchwytu o 360 stopni, co sprawia, że w łatwy sposób możesz dostosować do swoich potrzeb zarówno kąt jak i orientację pionową czy poziomą swojego urządzenia, co zwiększa komfort w trakcie korzystania z uchwytu. Boczny otwór Kończy się bateria w Twoim sprzęcie podczas użytkowania w trakcie jazdy? Nic się nie martw, producent również przewidział taką ewentualność i stworzył boczny otwór w uchwycie, który pozwoli Ci podłączyć kabel do urządzenia, bez wyjmowania go z uchwytu.','','outlet-uchwyt-samochodowy-fixed-tab-xl-dla-urzadzen-o-przekatnej-od-7-do-11-czarny','','','','OUTLET: Uchwyt samochodowy FIXED Tab XL dla urządzeń o przekątnej od 7 do 11\", czarny','','','',''),(117761,1,1,'ℹ Produkt pochodzi z outletu!Na aukcji kupujesz produkt, który nie kwalifikuje się do sprzedaży jako pełnowartościowy z powodu uszkodzonego lub rozpakowanego opakowania, dlatego oferujemy go w obniżonej cenie!Każdy produkt jest sprawdzony i w pełni sprawny, posiada pełną gwarancję producenta oraz wsparcie techniczne sklepu.OUT_2512090056Belkin BoostCharge Braided USB-A to USB-C Cable USB-A do USB-C Krótki kabel do Android Auto Wzmocniony oplotem nylonowym kabel ładujący i synchronizujący dane marki Belkin z serii BoostCharge. Przeznaczony dla urządzeń z portem USB-C. Można go używać zarówno do ładowania z ładowarką sieciową, samochodową jak i jako kabel połączeniowy z komputerem, czy stacjami dokującymi. Długość kabla: 15cm Kolor producenta: Black Przesyłanie danych oraz ładowanie Wykonany z wysokiej jakości materiałów kabel Belkin BoostCharge może być używany do ładowania urządzeń jak i do synchronizacji danych. Przeznaczony dla urządzeń z portem USB-C. Kabel posiada niewielkie rozmiary oraz długość 15cm. Jest dość giętki dzięki czemu możesz zawsze mieć go przy sobie. Wystarczy, że podłączysz go do źródła zasilania, by naładować swoje urządzenia czy to w domu, w biurze czy w podróży. Wzmocniony nylonowym oplotem Nylonowy oplot wzmacnia żywotność kabla, przedłużając jego czas użytkowania minimalizując wystąpienie uszkodzeń. Kabel posiada formowany odciążnik naprężeń na obu końcówkach, co zapewnia większą elastyczność przy ewentualnym ruchu kabla i minimalizuje ryzyko pęknięcia lub uszkodzenia, zwiększając jego ogólną trwałość w tym szczególnie narażonym na uszkodzenia miejscu. Pomyślnie przetestowany podczas 10000-krotnego zginania pod kątem 60 stopni. Bezpieczeństwo użytkowania Certyfikat USB-IF zapewnia zgodność z technologią Hi-Speed USB. Oznacza to, że kabel został certyfikowany przez USB-IF w celu spełnienia wszelkich wymaganych standardów elektrycznych, mechanicznych i środowiskowych.','','outlet-kabel-belkin-boost-charge-braided-do-android-auto-usb-a-do-usb-c-15cm-czarny','','','','OUTLET: Kabel Belkin Boost Charge Braided do Android Auto USB-A do USB-C 15cm, czarny','','','',''),(117787,1,1,'Folia matowa Bizon Glass Tab Film Sun Samsung Galaxy Tab A11 Plus 11,0 (SM-X310, SM-X315, SM-X230, SM-X235, SM-X236, SM-X236B) Matowa ochrona ekranu dla Galaxy Tab A11 Plus Słońce świeci i praży, a Ty nie widzisz, kto do Ciebie napisał? Matowa folia marki Bizon z serii Tab Film Sun zapewni wyświetlaczowi codzienne wakacje w cieniu i stanie się idealnym kompanem dla Twojego tabletu, szczególnie jeśli większą część dnia spędzasz na świeżym powietrzu. Folia nie tylko skutecznie walczy z promieniami padającymi prosto na tablet, ale także, dzięki jej matowemu obliczu, pozwoli Ci zapomnieć o brudnym ekranie, wyglądającym niczym detektywistyczna mapa odcisków palców! Materiał: elastyczny Przejrzystość: 92 Grubość: 0,12 mm Chroni przed zarysowaniami Redukuje odbijanie światła i odciski palców Idealnie dopasowana do urządzenia Zachowuje pełną czułość dotyku 1 sztuka w zestawie Wymiary folii Podstawowym akcesorium do ochrony urządzenia, oprócz folii, jest etui. Aby upewnić się, że folia będzie zgodna z etui, należy pamiętać, że: wymiary folii muszą być mniejsze od wymiarów wewnętrznych pokrowca futerał nie może nachodzić na folię Wymiary folii: 25,22 x 16,35 cm (długość szerokość) Właściwości folii matowej do tabletu Znasz ten moment, gdy patrzysz na ekran i widzisz tylko swoje odciski palców? To zdjęcie mówi wszystko. Po prawej klasyka, którą zna każdy użytkownik tabletu. Po lewej folia matowa, która zmienia zasady gry. Bez smug i odblasków, tylko czysty obraz i satysfakcja z użytkowania. To zmiana, którą łatwo zauważyć i trudno się bez niej obejść. Zdjęcie poglądowe, obrazujące porównanie efektu folii matowej i standardowej Bez odbić i śladów Boisz się, że po aplikacji folii, tablet zacznie sam wysyłać nieprzyzwoite SMS-y do szefa, a Twój palec zostanie dodany do bazy osób nieupoważnionych do korzystania z tabletu? Tak jest tylko w bajkach. A z Tab Film Sun komfort użytkowania jest jasny jak słońce! Folia cechuje się ultracienką grubością 0,12 mm, a co za tym idzie zachowaną pełną czułością dotyku. Za sprawą powłoki oleofobowej, która redukuje wszelkie dowody zbrodni smugi i odciski palców nie będziesz musiał maniakalnie wycierać co chwilę ekranu, a dzięki zaawansowanej redukcji odbić światła, ekran pozostanie czytelny, nawet gdy natura będzie rzucać najjaśniejsze wyzwania. Zdjęcie poglądowe, produkt może się różnić w zależności od modelu urządzenia Jak zamontować folię? Prosto! Zanim folia wyląduje na Twoim ekranie, upewnij się, że folia jest przeznaczona do Twojego modelu tabletu to gwarancja bezproblemowego montażu i pełnej ochrony. Przygotuj czyste, dobrze oświetlone miejsce i do dzieła! Oczyść ekran wilgotną ściereczkąUsuń tłuste plamy, smugi i większe zabrudzenia, przecierając ekran mokrą ściereczką. Wytrzyj ekran mikrofibrąDokładnie przetrzyj ekran suchą ściereczką z mikrofibry, tak aby powierzchnia była idealnie sucha i gładka. Usuń kurz i pyłkiChwyć okrągłą naklejkę (Dust Absorber) i przyklejaj ją punktowo w miejscach, gdzie pojawiły się pyłki. Nałóż folięZdejmij folię ochronną oznaczoną numerem 1 i przyłóż folię do ekranu. Wyrównaj pozycję możesz skorzystać z naklejek ułatwiających pozycjonowanie. Dociśnij folięDelikatnie naciśnij na środek folii, aby szybka mogła się równomiernie przykleić do wyświetlacza. Wygładź powierzchnięUżywając ściereczki z mikrofibry, wypchnij ewentualne pęcherzyki powietrza w kierunku najbliższej krawędzi. Na koniec pociągnij za naklejkę numer 2, aby odkleić górną warstwę ochronną. Misja zakończona folia na miejscu, ekran w pełni zabezpieczony! Zestaw w ekologicznym opakowaniu Bizon Glass Tab Film Sun, oprócz 1 sztuki folii ochronnej, zawiera również: 1 suchą ściereczkę z mikrofibry 1 mokra ściereczka do czyszczenia ekranu 3 naklejki pozycjonujące Dust Absorber (do wybierania drobin) Kartę do eliminacji pęcherzyków powietrza Bizon dba o łosie, jelenie, sarny, dziki, lisy, borsuki, kuny, jenoty, wilki, rysie, a z ptaków kuropatwy, bażanty, dzikie kaczki, gęsi, łyski, bekasy i cietrzewie, dlatego zestaw przybędzie do Ciebie w ekologicznym opakowaniu, w którym zastosowano jedynie śladowe ilości plastiku!','','folia-matowa-bizon-glass-tab-film-sun-do-samsung-galaxy-tab-a11-plus-1-sztuka','','','','Folia matowa Bizon Glass Tab Film Sun do Samsung Galaxy Tab A11 Plus, 1 sztuka','','','',''),(117788,1,1,