iesięcy z w pełni naładowany Czas ładowania bezprzewodowo: 1 godzina Magnetyczne mocowanie Kształt i niska waga sprawiają, że korzystanie z rysika jest wygodne i przyjemne. Za sprawą magnetycznej obudowy zawsze jest pod ręką, a ryzyko, że się zgubi - spada niemal do zera. Zaraz po wyjęciu z opakowania jest gotowy do użytku bez konieczności instalowania aplikacji. Łatwe łączenie Diody LED pokazują stan naładowania baterii: dioda LED określa poziom naładowania: niebieska: 100-70, zielona: 70-30, czerwona: poniżej 30, pulsująca czerwona: potrzeba naładowania.','','outlet-rysik-baseus-smooth-writing-2-overseas-z-ladowaniem-indukcyjnym-do-ipad-ipad-pro-ipad-air-mini-2018-2022-bialy','','','','OUTLET: Rysik Baseus Smooth Writing 2 Overseas z ładowaniem indukcyjnym do iPad / iPad Pro / iPad Air / Mini (2018-2022), biały','','','',''),(118076,1,1,'Szkło hybrydowe Bizon Glass MuleOppo A6 Pro 5GSzkło hybrydowe do Oppo A6 Pro 5GMuł najbardziej znana hybryda, do tej pory tylko w środowisku zwierząt, a teraz także wśród akcesoriów GSM!Szkło hybrydowe marki Bizon z serii Mule łączy w sobie wytrzymałość szkła hartowanego z elastycznością folii hydrożelowej. Niczym muł, który zawsze dostarczy ładunek tam, gdzie trzeba, ta hybryda przeniesie Twój wyświetlacz na wyżyny równowagi, zapewniając mu doskonałą ochronę na co dzień, przy jednoczesnym zachowaniu subtelnego wyglądu i bezpieczeństwa, ponieważ nie kruszy się i nie pęka!Materiał: wysokiej jakości PETTyp: szkło hybrydoweTwardość: 9HGrubość: 0,43 mmOdporne na zarysowania i uderzeniaWyposażone w powłokę oleofobową i powłokę antystatycznąIdealnie przejrzyste (94)Zachowuje pełną czułość dotykuMocny klej silikonowyWymiary szkłaPodstawowym akcesorium do ochrony urządzenia mobilnego, oprócz szkła, jest etui. Aby upewnić się, że szkło będzie zgodne z etui, należy pamiętać, że:wymiary szkła muszą być mniejsze od wymiarów wewnętrznych pokrowcafuterał nie może nachodzić na szkłoWymiary szkła: 15,35 x 7,05 cm(długość szerokość) Przejrzystość 