sowanie stopnia przyciemnienia do każdej sceny, więc bez trudu reagujesz na zmieniające się warunki oświetleniowe. Płynna regulacja ekspozycji pomaga zachować naturalne kolory, kontrolowane światła i cienie oraz miękkie rozmycie ruchu i filmowy charakter ujęć, szczególnie przy kreatywnej pracy w plenerze. Dzięki temu filtr ND400 do telefonu staje się narzędziem do świadomego kreowania klimatu ujęć w plenerze i osiągania profesjonalnych efektów bez skomplikowanych ustawień. Uniwersalne mocowanie z zimną stopką Uniwersalne mocowanie z uchwytem typu zimna stopka umożliwia łatwy montaż na większości smartfonów i wygodne wpięcie obiektywu do rozbudowanego mobilnego zestawu akcesoriów. Lekka, a jednocześnie solidna konstrukcja sprawdza się podczas podróży oraz pracy w terenie, zapewniając komfort użytkowania przez cały dzień zdjęciowy. Możliwość wykorzystania również z kamerami zwiększa elastyczność, dlatego jedno kompaktowe akcesorium pozwala swobodnie przełączać się między różnymi urządzeniami i pracować efektywnie w pełnym słońcu.','','obiektyw-soczewka-do-telefonu-z-filtrem-vnd2400-apexel-hd-glass-67mm-nd400-czarny','','','','Obiektyw, soczewka do telefonu z filtrem VND2–400, Apexel HD Glass 67mm ND400, czarny','','','',''),(118116,1,1,'Obiektyw Lupa mikroskopowa Apexel JeweLens 120X Uniwersalne Mikroskopowe zdjęcia 120x dla jubilerów Apexel JeweLens 120X to lupa jubilerska do telefonu, która zamienia smartfon w precyzyjny mikroskop mobilny wszędzie tam, gdzie standardowy aparat nie pokazuje wystarczająco dużo. Maksymalne powiększenie 120X odsłania mikrorysy, ślady napraw i subtelne różnice w strukturze biżuterii, monet, zegarków oraz antyków, co ułatwia wiarygodną wycenę i bezpieczniejszy zakup. Jednocześnie możliwość tworzenia zdjęć mikroskopowych porządkuje dokumentację, przyspiesza porównywanie obiektów w czasie i wspiera profesjonalną archiwizację. ℹ Powiększenie 120 najlepiej sprawdza się przy precyzyjnej inspekcji detali z bardzo bliskiej odległości, gdzie kluczowa jest analiza struktury, a nie pełna ostrość całego obrazu. Kolor producenta: Black (czarny) W opakowaniu znajduje się: Lupa mikroskopowa Apexel JeweLens 120X Woreczek do przechowywania Wkładki EVA Membrana ochronna Ściereczka Uniwersalny uchwyt do smartfona Kabel USB-C Trzy tryby LED i UV do inspekcji Wbudowana lampa LED z 3 trybami światła białym, ciepłym i UV pozwala idealnie dopasować oświetlenie do metalu, kamieni szlachetnych oraz powierzchni o zróżnicowanym połysku. Zastosowanie 36 diod oraz 3-stopniowej regulacji jasności ogranicza cienie, podnosi kontrast i znacząco poprawia czytelność grawerów, krawędzi oraz mikrostruktur podczas inspekcji detali. Światło UV pomaga ujawnić cechy optyczne kamieni, wypełnienia i ukryte defekty, co bywa kluczowe przy ocenie autentyczności oraz jakości wykonania. Lupa 20x z muszlą oczną do podglądu Muszla oczna i kaptur umożliwiają użycie JeweLens 120X jak klasycznej lupy jubilerskiej z powiększeniem 20X, gdy liczy się szybki podgląd bez zakładania uchwytu na telefon. Niewielka masa 98 g oraz kompaktowa konstrukcja sprzyjają pracy mobilnej w terenie, na giełdzie kolekcjonerskiej, w pracowni zegarmistrzowskiej czy punkcie skupu. Dołączony woreczek do przechowywania, wkładki EVA, membrana ochronna i ściereczka pomagają bezpiecznie transportować sprzęt oraz utrzymywać optykę w idealnej czystości przez długi czas. Stabilny uchwyt i ładowanie USB-C w trasie Uniwersalny uchwyt dla smartfonów o szerokości od 7 cm do 10 cm stabilizuje kadr, co przekłada się na ostre zdjęcia makro i płynne nagrania wideo bez poruszeń. Zasilanie przez USB-C ułatwia ładowanie lampy tym samym przewodem co inne urządzenia i pozwala korzystać z energii z powerbanków oraz ładowarek sieciowych zarówno w domu, jak i w trasie. Tak skonfigurowany obiektyw do telefonu wspiera precyzyjną kontrolę jakości, cyfrową archiwizację oraz efektowną prezentację szczegółów, zapewniając powtarzalne, profesjonalne rezultaty pracy z detalami. Specyfikacja: Powiększenie: do 120x Powiększenie samym okiem: do 20x (przy użyciu osłony obiektywu) Oświetlenie: 36 wbudowanych diod LED Tryby oświetlenia: biały, ciepły, UV Poziomy regulacji jasności: niski, średni, wysoki Tryby oświetlenia pierścieniowego: 19 trybów styl półkolisty i kulisty Specjalistyczne światło UV Waga: 98 g','','obiektyw-lupa-jubilerska-do-telefonu-z-powiekszeniem-120x-apexel-jewelens-lampa-led-uv-usb-c-czarny','','','','Obiektyw, lupa jubilerska do telefonu z powiększeniem 120x, Apexel JeweLens, lampa LED / UV, USB-C, czarny','','','',''),(118121,1,1,'Obiektyw z filtrem CPL Apexel HD Glass 67mm Uniwersalne Kontrola odbić i głębia kolorów Apexel HD Glass 67mm CPL to obiektyw do telefonu z filtrem polaryzacyjnym zaprojektowany po to, aby opanować odbicia światła i odzyskać pełną czytelność kadru w ostrym słońcu, nad wodą oraz wśród miejskich przeszkleń. Duża średnica 67 mm w połączeniu ze szkłem optycznym HD sprzyja uzyskaniu maksymalnie ostrych ujęć, a precyzyjna kontrola polaryzacji pomaga wydobyć głębię nieba, intensywność barw i wysoki kontrast bez przepaleń. Dzięki temu smartfon szybciej rejestruje nasycone, szczegółowe zdjęcia krajobrazowe i miejskie, bez konieczności długiej postprodukcji. ℹ Efekt polaryzacji jest najsilniejszy przy fotografowaniu pod kątem około 90 względem słońca, co warto uwzględnić przy komponowaniu kadru. Kolor producenta: Black (czarny) W opakowaniu znajduje się: Obiektyw do smartfona Apexel HD Glass 67mm CPL Uchwyt typu zimna stopka Etui ochronne Ściereczka do czyszczenia optyki Obrotowy pierścień dla idealnej polaryzacji Filtr CPL w tym obiektywie efektywnie redukuje refleksy od szkła, metalu i powierzchni wody, dzięki czemu subtelne detale nie giną pod warstwą rozproszonego światła. Obracając pierścień filtra, można intuicyjnie dopasować poziom polaryzacji do konkretnej sceny i uzyskać naturalne przejścia tonalne w chmurach, roślinności oraz na elewacjach budynków. Takie rozwiązanie pozwala tworzyć bardziej profesjonalne fotografie smartfonowe w południowym słońcu i w wymagającym, mieszanym oświetleniu otoczenia. Zimna stopka i mobilny zestaw filmowy Wbudowany uchwyt typu zimna stopka umożliwia szybki montaż obiektywu na telefonie i ułatwia komfortową pracę z dodatkowymi akcesoriami w mobilnym zestawie filmowym. Lekka, a jednocześnie wytrzymała konstrukcja sprawdza się podczas intensywnego użytkowania w terenie oraz w podróży, zachowując wygodę obsługi. Szeroka kompatybilność z 99 smartfonów oraz możliwość współpracy z kamerami sprawiają, że model APL-67CPL pozwala uzyskać spójny wygląd zdjęć i wideo nagrywanych różnymi urządzeniami.','','obiektyw-soczewka-do-telefonu-z-filtrem-cpl-apexel-hd-glass-67mm-cpl-czarny','','','','Obiektyw, soczewka do telefonu z filtrem CPL, Apexel HD Glass 67mm CPL, czarny','','','',''),(118124,1,1,'Kabel HDMI Ugreen HD104, 4K 30 Hz, 10 m HDMI - HDMI Elastyczny przewód HDMI 1.4 z 4K 30Hz Kabel HDMI Ugreen HD104 ułatwia szybkie połączenie telewizora, monitora lub projektora ze źródłem sygnału i wykorzystanie obrazu 4K 30Hz. Standard HDMI 1.4 z obsługą 3D pozwala budować spójny zestaw do kina domowego, gier i multimediów bez zbędnych ustawień. Otrzymujesz czytelny obraz, zsynchronizowany dźwięk i wygodę jednej, prostej instalacji. Długość przewodu: 10 m Kolor producenta: Black (czarny) Bezkompresyjny i stabilny sygnał Transmisja audio i wideo bez kompresji pomaga zachować naturalne kolory oraz czyste brzmienie, co szczególnie czuć przy głośniejszym odsłuchu i materiałach o wysokiej dynamice. Miedź beztlenowa OFC wspiera stabilny przesył danych, dzięki czemu rozdzielczość 4K pozostaje wyraźna również w bardziej wymagających scenach. Zamiast walczyć z zakłóceniami, skupiasz się na seansie, rozgrywce albo prezentacji. Elastyczna i wytrzymała powłoka PVC Powłoka z PVC zwiększa odporność na przetarcia i ułatwia poprowadzenie przewodu wzdłuż mebli, listew lub za sprzętem RTV. Elastyczna konstrukcja lepiej znosi częste przepinanie urządzeń, ograniczając ryzyko uszkodzeń podczas zmian konfiguracji. Instalacja wygląda schludnie, a kabel zachowuje swoje właściwości w codziennym użytkowaniu. Uniwersalny kabel do przesyłania obrazu i dźwięku Uniwersalne zastosowanie pozwala podłączyć odtwarzacz DVD, Blu Ray, amplituner, dekoder lub komputer do telewizora i projektora bez kombinowania z przejściówkami. Takie połączenie sprawdza się w salonie, pokoju gracza i podczas wyświetlania materiałów szkoleniowych lub firmowych na większym ekranie. Jeśli chcesz uporządkować stanowisko i szybko uruchamiać sprzęt w dowolnym miejscu, przewód od Ugreen będzie praktycznym wyborem. Rodzaj złącza: HDMI Standard HDMI: HDMI 1.4 Obsługiwana rozdzielczość: 4K 30Hz Materiał: PVC','','kabel-hdmi-14-ugreen-hd104-przewod-4k-30hz-10-m-czarny','','','','Kabel HDMI 1.4 Ugreen HD104 przewód, 4K / 30Hz, 10 m, czarny','','','',''),(118132,1,1,'Kabel HDMI 2.0 Ugreen HD101 HDMI - HDMI Stabilny kabel HDMI 2.0 4K 60Hz Kabel HDMI 2.0 Ugreen HD101 pozwala połączyć telewizor, monitor, projektor lub konsolę tak, aby obraz i dźwięk były idealnie zsynchronizowane i gotowe na seans albo dynamiczną rozgrywkę w 4K60Hz. Przepustowość sygnału 18 Gbs oraz technologia TMDS usprawniają transfer, dzięki czemu wideo jest płynne, a reakcje w grach bardziej przewidywalne. To praktyczny wybór, gdy potrzebny jest kabel HDMI do konsoli i telewizora 4K bez irytujących przycięć i spadków jakości. Kolor producenta: Black (czarny) Wyraźniejsze detale dzięki HDR Obsługa statycznego HDR, w tym HDR10 i Dolby Vision, wydobywa więcej szczegółów w jasnych i ciemnych scenach, więc ekran pokazuje obraz bliższy temu, co widział twórca. Efekt wizualny 3D wzmacnia wrażenie głębi przy kompatybilnych treściach, a standard HDMI High Speed ułatwia bezpośrednie streamowanie krystalicznie czystego obrazu i autentycznego audio. W codziennym użyciu taki kabel HDMI 2.0 do 4K oznacza mniej kompromisów w filmach i większą czytelność detali podczas grania. Przewód z pozłacanymi wtyczkami i wielowarstwowym ekranowaniem Wielowarstwowe ekranowanie ogranicza zakłócenia elektromagnetyczne, co przekłada się na stabilną transmisję nawet w otoczeniu pełnym innych przewodów i urządzeń. Pozłacane złącza są odporne na korozję i utlenianie, dlatego wtyk częściej działa pewnie także po wielu podłączeniach. Izolacja z PVC pomaga utrzymać elastyczność, dzięki czemu kabel HDMI Ugreen lepiej znosi typowe użytkowanie w domu i przy biurku. Kabel audio-wideo Kabel wspiera HDCP 2.2 z kompatybilnością wsteczną, więc łatwiej odtwarzać treści chronione i korzystać również ze starszymi urządzeniami. Dla dźwięku dostępne są formaty LPCM, AC-3, DTS oraz DTS-HD Master Audio, a próbkowanie do 24-bit przy 192 kHz pomaga zachować szczegóły brzmienia. Funkcje ARC oraz połączenie 4K60Hz, HDR10, Dolby Vision i synchronizacji audio-wideo w jednym przewodzie sprawiają, że przewód Ugreen porządkuje kino domowe i zachęca, by podłączyć sprzęt od razu tak, jak powinien działać.','','kabel-hdmi-20-ugreen-hd101-przewod-4k-60hz-1-m-czarny','','','','Kabel HDMI 2.0 Ugreen HD101 przewód 4K / 60Hz, 1 m, czarny','','','','');
